(1, 1, 1, 'Szukasz minimalistycznych mebli, które podkreślą loftowy charakter wnętrza? Spodoba Ci się metalowy regał EXETER . Regał EXETER to mebel o nowoczesnym designie, uniwersalny pod kątem użytkowym. Różne rozmieszczenie półek sprzyja ustawieniu na nim nie tylko książek i dokumentów, ale też innych drobiazgów, elementów dekoracyjnych lub kwiatów. Za pomocą regału EXETER możesz stworzyć własną, oryginalną aranżację. Regał EXETER stanowi istotne dopełnienie dla wnętrza pokoju dziennego, młodzieżowego oraz domowego gabinetu. Wykorzystasz go również w kąciku do czytania. WYKOŃCZENIE Na szczególną uwagę zasługuje jego oprawa kolorystyczna regału EXETER . Jasne wybarwienie dębu dzikiego świetnie komponuje się z ciemnym, matowym stelażem. Regał EXETER doskonale prezentuje we wnętrzach industrialnych, rustykalnych, minimalistycznych lub nowoczesnych.', '', 'regal-exeter-szeroki-dab', '', '', '', 'Regał EXETER szeroki, dąb', '', '', '', ''),
(2, 1, 1, 'Komoda MORTIZ 2D3S ułatwi Ci uporządkowanie wszystkich rzeczy, które przydają się w salonie lub jadalni. Mebel w ciepłym kolorze drewna pomoże wprowadzić do wnętrza przytulny, domowy nastrój. Ozdobnym elementem mebla są listewki na froncie mebla . Sam decydujesz, czy chcesz je zamontować. Przydadzą się też, kiedy postanowisz zmienić charakter mebli i nadać wnętrzu więcej surowego klimatu. Opcjonalne okucia zostały wykończone z efektem postarzenia. WNĘTRZE Komoda posiada 4 zamykane wnęki , w których uporządkujesz ubrania, zastawę stołową czy dokumenty. 3 szuflady pomieszczą niewielkie akcesoria. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony laminatem. Wykończenie utrzymane jest w barwie dąb wotan, dzięki któremu wnętrze nabiera domowej i ciepłej atmosfery. Uwagę zwracają ładnie wkomponowane w bryłę uchwyty z efektem postarzenia.', '', 'komoda-mortiz-2d3s', '', '', '', 'Komoda MORTIZ 2D3S', '', '', '', ''),
(3, 1, 1, 'Zwarta bryła komody TORONTO w estetyczny sposób wkomponuje się we współczesny pokój dzienny, oferując sporo miejsca do przechowywania przedmiotów. Jej uniwersalna konstrukcja sprawia, że może pełnić zarówno funkcję bufetu, jak i mebla do przechowywania odzieży. Jej rustykalny charakter został wzbogacony nowoczesnym elementem w postaci dekoru o kontrastowej barwie. Dzięki temu możesz zestawiać ją z elegancką czernią i wkomponować we wnętrza wypełnione chłodnymi szarościami. WNĘTRZA W 3 szufladach łatwiej przechowywać drobne przedmioty i akcesoria. Potrójne drzwi ułatwiają dostęp do wnętrza komody, w którym możesz poukładać książki, albumy ze zdjęciami, ale także tekstylia i elementy zastawy stołowej. WYKOŃCZENIE Korpusy mebli wykończono laminatem , imitującym strukturę drewna o ciepłej barwie dębu wotan (tylna ściana - dąb złoty craft). Fronty pokryto folią PVC . Ciemny dekor współgra z nowoczesnymi elementami wykończenia. Dzięki takiemu wykończeniu, witryna wprowadzą przytulną atmosferę (nawet do wnętrz typu - loft) i świetnie prezentuje się wśród tzw. barw ziemi, otoczona roślinnością lub dekoracjami z modnym motywem „urban jungle” .', '', 'komoda-toronto-3d3s-e', '', '', '', 'Komoda TORONTO 3D3S E', '', '', '', ''),
(4, 1, 1, 'Duża komoda do sypialni RECOVER ułatwi Ci funkcjonalne wyposażenie wnętrza. Oryginalna konstrukcja mebla pozwoli uzyskać wyjątkowy efekt. Połączenie kolorów dąb szlachetny i dąb czarny dodaje stylu. Dzięki szufladom z łatwością uporządkujesz wszystkie niezbędne przedmioty – elementy garderoby czy pościel. Półki pozwalają dowolnie udekorować wnętrze i stworzyć niepowtarzalną atmosferę. Kolekcja Recover wprowadzi do wnętrza klimat luksusu i napełni je elegancją. WNĘTRZE Cztery pojemne szuflady, półka w części zamkniętej oraz półki otwarte ułatwią rozmieszczenie rzeczy. WYKOŃCZENIE Ciemna wstawka na froncie oraz ergonomiczne uchwyty podkreślają charakter mebla.', '', 'komoda-recover-bellevue-blqk351l', '', '', '', 'Komoda RECOVER/BELLEVUE BLQK351L', '', '', '', ''),
(5, 1, 1, 'Komoda ITALIA przyciąga wzrok blaskiem białej powierzchni, która prostej bryle nadaje luksusowego sznytu. Mebel doskonale sprawdza się w przestrzeni sypialnianej, nie przytłaczając wnętrza i odbijając refleksy świetlne. Dzięki prowadnicom z samodomykiem szauflady zamykają się lekko i nie trzaskają. WNĘTRZE Na konstrukcję komody składają się 3 szuflady , wyposażone w prowadnice kulkowe z funkcją cichego domyku . WYKOŃCZENIE Wykonany z płyty mebel został pokryty laminatem oraz folią o wysokim połysku. Funkcję uchwytów pełnią frezowania we frontach . Białe wybarwienie doskonale uzupełni nowoczesne wnętrza, zarówno w stylu minimalistycznym, jak i glamour, w zestawieniu z połyskującymi tkaninami i kryształowymi lampami.', '', 'komoda-bialy-polysk-italia', '', '', '', 'Komoda biały połysk ITALIA', '', '', '', ''),
(6, 1, 1, 'Komoda SIENNA dzięki swojej uniwersalnej formie i kolorystyce może być wkomponowana w każde nowoczesne wnętrze. Przyda się w sypialni, jadalni i pokoju dziecięcym. Biel nigdy nie przestanie być modna. Połyskujące fronty sprawiają, że prezentuje się elegancko. Komoda posiada frezowane uchwyty, a brak nóżek sprawia, że łatwej będzie Ci utrzymać czystość. WNĘTRZE Komoda posiada 4 szuflady - idealne na przechowywanie bielizny lub dokumentów. W zamykanej szafce z2 półkami, które pozwolą Ci uporządkować ubrania, książki, segregatory z dokumentami i inne potrzebne drobiazgi. WYKOŃCZENIE Komoda wykonana jest z płyt meblowych i wykończona folią. Białe, połyskujące fronty sprawią, że pomieszczenie wyda się większe.', '', 'komoda-sienna-4s1d', '', '', '', 'Komoda SIENNA 4S1D', '', '', '', ''),
(7, 1, 1, 'Komoda COLLET to idealne miejsce na przechowywanie galanterii, tekstyliów lub bielizny. Poukładaj odzież w szufladach , a zachowasz idealny porządek na długo. Komoda wraz z pozostałymi meblami z kolekcji tworzy jasną i nowoczesną aranżację sypialni. Zastosowana kolorystyka przywodzi na myśl poranek na słonecznej plaży, sprzyjając wyciszeniu i zachęcając do relaksu. WNĘTRZE Komoda posiada 3 pojemne szuflady wysuwane na prowadnicach kulkowych. Boczną szafkę wyposażono w półkę, dzięki czemu możesz w niej przechowywać prześcieradła lub zestawy kosmetyków. Na blacie możesz ustawić rodzinne zdjęcia lub lustro, tworząc praktyczną toaletkę. WYKOŃCZENIE Połączenie białych frontów z subtelnym wybarwieniem „dębu bianko” optycznie powiększa pomieszczenie. Meble warto łączyć z drewnianymi i białymi dodatkami. Dobrze zaprezentują się zarówno wśród szarych, białych, jak i pastelowych ścian. Folia , jaką pokryto komodę podkreśla nowoczesny charakter mebla i jest łatwa w czyszczeniu.', '', 'komoda-collet', '', '', '', 'Komoda COLLET', '', '', '', ''),
(8, 1, 1, 'Dzięki regałowi MAURO uporządkujesz książki i wprowadzisz ład do swojego kącika do czytania. Regał MAURO to minimalistyczna bryła w białym kolorze. Dzięki kompaktowym wymiarom sprawdzi się nawet w niewielkich wnętrzach lub może być podstawą większej kombinacji, kiedy zmienią się Twoje potrzeby. Regał możesz wykorzystać również jako miejsce do uporządkowania dokumentów i segregatorów w przestrzeni biurowej. Możesz ustawić na nim kwiaty lub stylowe dekoracje, które podkreślą charakter wnętrza. Lekka i uniwersalna konstrukcja pozwala na wiele możliwości wykorzystania bryły. Wnęka ma wymiary: 33x33 cm WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. Regał MAURO MXXR331 występuje w trzech wariantach kolorystycznych: czarnym, białym i szarym.', '', 'regal-mauro-1072x1072-cm-bialy', '', '', '', 'Regał MAURO 107,2x107,2 cm biały', '', '', '', ''),
(9, 1, 1, 'Szafka RTV BOSTON dodaje wnętrzu elegancji. Dzięki zastosowaniu efektu lameli na froncie szafki, kącik wypoczynkowy nabiera nietuzinkowego charakteru. Kolor naturalnego drewna wizualnie ociepla przestrzeń i wprowadza przytulny klimat. Takie połączenie kolorów - dąb charleston z czernią - pasuje do nowoczesnego wnętrza , które nie unika kontrastów. WNĘTRZE W otwartej wnęce zmieści się dekoder lub konsola. Wymiary wnęki otwartej: 49x38x22 cm Szafki i szuflady wykorzystasz do uporządkowania urządzeń elektronicznych i innych akcesoriów. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Szafka RTV BOSTON jest wykonana z płyty meblowej o grubości 18 mm i wykończona laminatem. Rolę nóżek pełnią metalowe profile, które stabilizują mebel. Drzwi otwierają się za pomocą systemu push to open. Kolekcja BOSTON To intrygująca propozycja dla osób pragnących stworzyć oryginalny charakter wnętrza. Meble BOSTON sprawdzą się w zarówno w nowoczesnych, jak i industrialnych mieszkaniach – wszędzie tam, gdzie chcemy wprowadzić nowatorski, strukturalny efekt. Obok tej kolekcji nie można przejść obojętnie!', '', 'szafka-rtv-boston', '', '', '', 'Szafka RTV BOSTON', '', '', '', ''),
(10, 1, 1, 'Książki, tekstylia lub mniejsze akcesoria możesz schować do komody BERGEN 2D2S , która łączy cechy rustykalnego mebla z nowoczesnymi elementami wykończeniowymi. Wraz z pozostałymi meblami z serii tworzy aranżację o sielskim charakterze, wprowadzając do wnętrz przytulny klimat. Ze względu na dużą różnorodność brył, meble te można wkomponować w otwarte, wielofunkcyjne przestrzenie. Tzw. ślizgacze ułatwiają precyzyjne ustawienie mebla oraz jego przesuwanie podczas sprzątania. WNĘTRZE Szafkę wyposażono w cztery wnęki, ułatwiające segregację przedmiotów. Dwie szuflady to dobre miejsce na mniejsze akcesoria, bieliznę lub dokumenty. WYKOŃCZENIE Laminat, imitujący wyraźną strukturę drewna dębowego w kolorze „wotan” ociepla wnętrze i nadaje mu swojskiego charakteru. Metalowe uchwyty i ciemny dekor umożliwiają estetyczne wkomponowanie mebli w nowoczesne wnętrza. Wystrój dopełnią drewniane dekoracje lub dodatki w czarnym kolorze.', '', 'komoda-bergen-2d2s', '', '', '', 'Komoda BERGEN 2D2S', '', '', '', ''),
(11, 1, 1, 'Komoda BOSTON 3D podkreśla nowoczesny charakter pokoju dziennego. Możesz wykorzystać ją również w domowym biurze czy przestronnym przedpokoju. Dzięki zastosowaniu efektu lameli na froncie, wnętrze nabiera nietuzinkowego charakteru. Kolor naturalnego drewna wizualnie ociepla przestrzeń i wprowadza przytulny klimat. Takie połączenie kolorów - dąb charleston z czarną barwą - pasuje do nowoczesnego wnętrza , które nie unika kontrastów. WNĘTRZE Komoda posiada 6 zamykanych wnęk, dzięki którym rozważnie uporządkujesz ubrania, dokumenty lub przydatne drobiazgi. Maksymalne obciążenie półki wynosi 5 kg . Blat możesz wykorzystać na wyeksponowanie pamiątek lub dekoracji. WYKOŃCZENIE Komoda BOSTON została wykonana z płyty meblowej o grubości 18 mm i wykończona laminatem. Rolę nóżek pełnią metalowe profile, które stabilizują mebel. Drzwi otwierają się za pomocą systemu push to open. KOLEKCJA BOSTON To intrygująca propozycja dla osób pragnących stworzyć oryginalny charakter wnętrza. Meble BOSTON sprawdzą się w zarówno w nowoczesnych, jak i industrialnych mieszkaniach – wszędzie tam, gdzie chcemy wprowadzić nowatorski, strukturalny efekt. Obok tej kolekcji nie można przejść obojętnie!', '', 'komoda-boston-3d', '', '', '', 'Komoda BOSTON 3D', '', '', '', ''),
(12, 1, 1, 'Szafka RTV FARGO z gracją wkomponuje się we wnętrze pokoju młodzieżowego utrzymanego w nowoczesnym tonie oraz w pomieszczenia stylizowane na klimat industrialny. Fronty przypominające strukturą beton zostały zestawione z korpusami wykończonymi okleiną w ciepłym dekorze drewna zdobionej dekoracyjnym nadrukiem. Takie połączenie tworzy harmonijny duet podkreślając jednocześnie nieszablonowy charakter mebla. Metalowe uchwyty dopełniają całość. Mnogość brył systemu pozwala na funkcjonalne wyposażenie pokoju nastolatka. WNĘTRZE Szafka posiada półkę w części zamkniętej, szufladę wysuwaną za pomocą prowadnicy kulkowej oraz wnękę o wymiarach: szer.:65 cm, gł.:32 cm, wys.:14,5cm WYKOŃCZENIE Mebel został pokryty laminatem, który charakteryzuje się trwałością oraz jest łatwy w utrzymaniu czystości.', '', 'szafka-rtv-fargo-fg-10', '', '', '', 'Szafka RTV FARGO FG-10', '', '', '', ''),
(13, 1, 1, 'Szafka RTV HUD jest idealnym dopełnieniem dla wnętrza pokoju dziennego, salonu lub jadalni, a jej design oparty jest na prostocie, nowoczesności i funkcjonalności. Oryginalna kolorystyka dębu klepkowego wzbogacona ciemnymi wstawkami betonu jest doskonałym pomysłem na urozmaicenie wnętrza oraz nadania mu surowego, naturalnego piękna. Szafkę można wykorzystać standardowo pod kątem ustawienia na niej sprzętu RTV, jednak doskonale sprawdzi się również dla jako podstawa dla kwiatów, dekoracji lub książek. Szafkę RTV HUD można zestawić z innymi bryłami kolekcji, jednak sprawdza się również jako pojedynczy mebel, który można dopasować do własnej, indywidualnej koncepcji aranżacji pomieszczenia. WNĘTRZE RTV HUD posiada zamykaną szafkę oraz 2 szuflady na prowadnicach kulkowych i 2 otwarte wnęki. Ta ilość schowków w zupełności wystarczy, aby uporządkować w nich kolekcję filmów lub muzyki, piloty do sprzętu RTV, gazety i inne przedmioty codziennego użytku. Wymiary wnęki - szerokość 54 cm (53 cm prawa), głębokość 36 cm, wysokość 15 cm. WYKOŃCZENIE RTV HUD została wykonana z płyty meblowej wykończonej folią. Gustownym dopełnieniem są metalowe uchwyty w czarnym kolorze, które korespondują z profilem spełniającym role nóżek mebla. Do szafki RTV HUD można zamontować za dopłatą 2-punktowe oświetlenie typu Square o ciepłej barwie .', '', 'szafka-rtv-loft-hud', '', '', '', 'Szafka RTV loft HUD', '', '', '', ''),
(14, 1, 1, 'Od wykrochmalonych obrusów przez ozdobne serwety, aż po odświętną zastawę. Za podwójnymi drzwiami albo w jednej z 3 szuflad schowasz to, co warto mieć pod ręką, kiedy odwiedzą Cię goście. Cokolwiek im podasz, na pewno zachwycą się oryginalnym wyglądem komody STREET , która jednocześnie ma w sonie coś surowego i coś minimalistycznego. Połączenie czarnego koloru z rysunkiem dębowego drewna i metalowymi nogami sprawia, że komodę dopasujesz do industrialnych pomieszczeń. Wstaw ją do loftowego pokoju dziennego lub do przytulnej sypialni i uzupełnij pozostałymi meblami z serii STREET. WNĘTRZE W szafce po prawej stronie znajdziesz półkę o udźwigu do 5 kg. Po lewej stronie komody znajdują się 3 pojemne szuflady. WYKOŃCZENIE Komodę z 3 szufladami STREET wykonano z 16 mm płyty meblowej. Mebel wykończono laminatem w kolorze jasnego dębu navarra i w czarnym kolorze. Szuflady zamontowano na prowadnicach kulkowych. Konstrukcję osadzono na grubej płycie z wkomponowanymi nogami. Oryginalne, skośne nogi wykonano z metalu pomalowanego na czarno.', '', 'komoda-loftowa-z-3-szufladami-street', '', '', '', 'Komoda loftowa z 3 szufladami STREET', '', '', '', ''),
(15, 1, 1, 'Niezbędne w przedpokoju akcesoria i buty możesz przechowywać w komodzie UMBRIA . Blat może pełnić funkcję toaletki - możesz skorygować makijaż i fryzurę przed samym wyjściem. WNĘTRZE Szuflada na prowadnicach rolkowych przyda się do przechowywania drobiazgów. W 3 wnękach możesz przechowywać wszystko, co chcesz mieć w przedpokoju pod ręką. Na półkach możesz przechowywać przedmioty o wadze do 5 kg. WYKOŃCZENIE Korpus, półki oraz fronty szafy są wykonane z płyty wiórowej o grubości 16 mm. Melaminowana powierzchnia komody UMBRIA jest bardzo praktyczna i łatwo utrzymać ją w czystości. Modne - czarne nóżki z tworzywa dodają komodzie industrialnego charakteru . Drzwi komody otwierają się łatwo przy pomocy efektywnego uchwytu z tworzywa . ARANŻACJA Komoda charakteryzuje się prostą formą w nowoczesnym stylu. Nie tylko nie zdominuje przestrzeni, ale także pięknie wkomponuje się w większość rozwiązań aranżacyjnych. Klasyczna, jasna barwa szarego dębu doskonale uzupełni wnętrza loftowe, minimalistyczne, inspirowane naturą, ale także modernistyczne.', '', 'komoda-waska-z-szuflada-i-polkami-umbria', '', '', '', 'Komoda wąska z szuflada i półkami UMBRIA', '', '', '', ''),
(16, 1, 1, 'Szafkę UMBRIA zaprojektowao w taki sposób, byś mógł przymierzać buty na siedząco nawet w niewielkim przedpokoju. Wraz z szafką otrzymujesz poduchę na siedzisko pokryt a plecioną tkaniną, która prezentuje się elegancko. Szafka świetnie prezentuje się w zestawie z panelem z wieszakami. Stanowią duet idealny do małego przedpokoju. WNĘTRZE Obuwie możesz przechowywać w 2 wnękach. Dzięki zastosowaniu drzwi klapowych, łatwiej jest wyciągnąć buty od góry, gdy korzystasz z siedziska. WYKOŃCZENIE Szafkę wykonano z płyty wiórowej o grubości 16 mm. Melaminowana powierzchnia jest bardzo praktyczna i łatwo utrzymać ją w czystości. Szafka jest umieszczona na modnych, czarnych nóżkach z tworzywa . Wymiary nóżek: 2x3x10,5 cm. Drzwi szafki otwierają się łatwo przy pomocy efektywnego uchwytu z tworzywa . ARANŻACJA Szafka charakteryzuje się prostą formą w nowoczesnym stylu. Nie tylko nie zdominuje przestrzeni, ale także pięknie wkomponuje się w większość rozwiązań aranżacyjnych. Klasyczna, jasna barwa szarego dębu doskonale uzupełni wnętrza loftowe, minimalistyczne, inspirowane naturą, ale także modernistyczne.', '', 'szafka-na-obuwie-umbria', '', '', '', 'Szafka na obuwie UMBRIA', '', '', '', ''),
(17, 1, 1, 'Komoda CLIF przyciąga wzrok i zaciekawia dzięki oryginalnemu wybarwienia powierzchni i niby prostej, ale wyróżniającej się konstrukcji. Efekt starych, sfatygowanych desek oraz elementy imitujące beton, a także uchwyty, które wyglądają, jakby przetarła się na nich farba, nawiązują do stylu industrialnego. Przytwierdzone do boków szafki listwy, stanowią jednocześnie nóżki komody, podpierając również blat. Prezentowany mebel doskonale uzupełni wnętrze o loftowym charakterze. WNĘTRZE Komoda CLIF jest miejscem, w którym skryjesz bieliznę i ubrania. Cztery szuflady stwarzają okazję, by wreszcie zaprowadzić porządek w skarpetkowych zasobach. Szafka pozwala schować ubrania, takie jak t-shirty czy pidżamy. WYKOŃCZENIE Piękne, niespotykane wykończenie na wzór starych, podniszczonych przez czas desek zestawiono z imitującą beton okleiną bocznych listw, pełniących jednocześnie rolę nóg. Proste, przetarte uchwyty. przytwierdzone do powierzchni frontów pokaźnymi śrubami, podkreślają przemysłowy charakter komody.', '', 'komoda-loft-efekt-starego-drewna-clif', '', '', '', 'Komoda loft efekt starego drewna CLIF', '', '', '', ''),
(18, 1, 1, 'Szafka RTV z kolekcji MARRI to praktyczny i elegancki mebel, który dyskretnie zajmie honorowe miejsce w twoim salonie. Sprawia wrażenie lekkości, dzięki czemu mebel nie przytłoczy nawet niewielkiego pomieszczenia. WNĘTRZE Dwie pojemne, zamykane szafki zmieszczą wszystkie dodatki niezbędne w twoim salonie. Na dwóch półkach znajdujących się w szafce możesz umieścić dekoder, piloty i wszelkie niezbędne akcesoria, które mogą ci być potrzebne. WYKOŃCZENIE Konstrukcja szafki RTV jest wykonana z płyty MDF. Szafka MARRI jest wykończona naturalną okleiną, która ociepli wnętrze dzięki niejednolitej strukturze rysunku drewna. Barwa rustykalnego brązu podkreśli elegancką wytworność twoich wnętrz. Nogi szafki są wykonane z metalu, dzięki czemu zyskasz w swoich przestrzeniach loftowy klimat surowego szyku.', '', 'szafka-rtv-marri-2d-m2610003', '', '', '', 'Szafka RTV MARRI 2D M2610003', '', '', '', ''),
(19, 1, 1, 'Szukasz pomysłu na komodę z szufladami do nowoczesnego salonu lub jadalni ? Komoda SEVILLA stanowi propozycję „na miarę” współczesnego , eleganckiego domu. WNĘTRZE Komody wykończone jest laminatem w kolorze arktyczny szary . Pozwala to dłużej zachować elegancki wygląd komody SEVILLA; 4 wnęki za zamkniętymi frontami o udźwigu 10 kg pozwolą Ci umieścić w jej wnętrzu również cięższe przedmioty; 2 szuflady poruszają się na prowadnicy z hamulcem , która zwalnia podczas zamykania, niwelując hałas; Drzwiczki komody osadzone są na metalowych zawiasach ; WYKOŃCZENIE Lakierowane matowe fronty komody posiadają poziome żłobienia – tworzące geometryczne podziały mebla; Podkreśli to modernistyczny wygląd Twojego wnętrza; Komoda posiada ozdobne pionowe listwy wykonane z okleiny naturalnej w kolorze dębowym ; Ozdobne szkatułki będą „zerkać” zza frontu z ciemnego , hartowanego szkła – znajdującego się w centralnej części komody; Metalowe uchwyty stanowią ozdobę komody, jednocześnie ułatwiając otwarcie drzwi.', '', 'nowoczesna-komoda-z-szufladami-i-szyba-sevilla', '', '', '', 'Nowoczesna komoda z szufladami i szybą SEVILLA', '', '', '', ''),
(20, 1, 1, 'Szafka RTV MAGALE w ciemnej tonacji brązu to mebel, który łączy cechy klasyki i nowoczesności. Usytuowana w salonie lub pokoju dziennym zwraca uwagę funkcjonalnością oraz dyskretną elegancją, którą podkreślają nóżki oraz uchwyty w kolorze anodowanej miedzi. Szafka RTV MAGALE współgra z aranżacjami utrzymanymi w ciepłej kolorystyce, kojarzoną z wygodą i komfortem. WNĘTRZE RTV MAGALE to szafka w sam raz na kolekcję filmów, dokumenty, gazety lub przydatne przedmioty osobiste. Posiada klasyczne dla tego typu mebla rozwiązanie, czyli dwie wnęki pod blatem. Całości dopełniają cztery szuflady wyposażone w funkcję cichego domyku. WYKOŃCZENIE Korpus z płyty MDF o grubości 15 mm został wykończony fornirem z widocznymi słojami drewna. Zabieg ten nadaje wrażenie, że mebel został wykonany z naturalnego drewna o głębokim brązowym odcieniu. Szafka RTV MAGALE wizualnie pasuje zarówno do jasnych, jak i ciemniejszych wnętrz oraz dodatków w szarym kolorze.', '', 'szafka-rtv-magale-m2410001', '', '', '', 'Szafka RTV MAGALE M2410001', '', '', '', ''),
(21, 1, 1, 'Szafka RTV wyglądająca równie imponująco, co Twój 65 calowy telewizor? Tylko szafka RTV do salonu z kolekcji mebli SEVILLA. Jej szerokość wynosząca 216 cm , pozwoli Ci na swobodne ustawienie dekodera , routera lub innej elektroniki. WNĘTRZE Szeroka szuflada poruszająca się dzięki prowadnicy z hamulcem pomieści niezbędne akcesoria, by wieczór kinomana przebiegał bez przeszkód; Za 2 otwieranymi frontami znajdują się 4 wnęki , w których umieścić możesz cięższe przedmioty; Półki z płyty meblowej posiadają udźwig 10 kg ; Wnętrze szafki RTV oraz półki wykończone laminatem ułatwią utrzymanie czystości. Za szklanym , przyciemnianym frontem znajduje się również idealne miejsce dla Twojej kolekcji ozdobnej ceramiki; WYKOŃCZENIE Szafka RTV posiada nieszablonowe wykończenie matowym lakierem w eleganckim, stylowym kolorze arktycznej szarości . Stwórz nowoczesne, pełne modernizmu wnętrze, które urzeknie swoim wyglądem. Fronty z płyty MDF wykończone lakierem ozdabiają metalowe , minimalistyczne uchwyty. Łączą estetykę z komfortem użytkowania; Z zewnątrz korpus wykończony lakierem oraz dekoracyjnymi listwami z naturalnej okleiny tworzy efekt geometrycznej, prostej bryły; Wysokość szafki sprawia, że monitor umieszczony jest na optymalnej wysokości.', '', 'szeroka-szafka-rtv-do-nowoczesnego-salonu-sevilla', '', '', '', 'Szeroka szafka RTV do nowoczesnego salonu SEVILLA', '', '', '', ''),
(22, 1, 1, 'Bufet z kolekcji MARRI to praktyczny i elegancki mebel, który w pełni naturalnie zajmie honorowe miejsce w twoim salonie lub jadalni. Sprawia wrażenie lekkości, dzięki czemu mebel nie przytłoczy nawet niewielkiego pomieszczenia. WNĘTRZE Trzy pojemne szuflady zmieszczą wszystkie potrzebne akcesoria i dodatki a eleganckie, szerokie uchwyty ułatwią ci ich wysuwanie. W dużych szafkach bufetu z łatwością zmieścisz nawet sporą kolekcję porcelany, dodatkowe obrusy i zestaw sztućców. WYKOŃCZENIE Konstrukcja bufetu MARRI jest wykonana z płyty MDF. Bufet jest wykończony naturalną okleiną, która ociepli wnętrze dzięki niejednolitej strukturze rysunku drewna. Barwa rustykalnego brązu podkreśli elegancką wytworność twoich wnętrz. Nogi bufetu są wykonane z metalu, dzięki czemu zyskasz w swoich przestrzeniach loftowy klimat surowego szyku.', '', 'bufet-marri-2d3sz-m2609005', '', '', '', 'Bufet MARRI 2D+3SZ M2609005', '', '', '', ''),
(23, 1, 1, 'Szafka RTV DAMA BIANCA zachwyca blaskiem i starannością wykonania. Elegancki mebel o elitarnym wyglądzie, o lśniącej niczym diament powierzchni, rozjaśni pomieszczenie i doda prestiżu każdej aranżacji. Płyta meblowa, z której została stworzona szafka, pokryta jest lakierem z pomocą najnowocześniejszych technologii, co ma niezaprzeczalny wpływ na jej estetykę. WNĘTRZE Na konstrukcję szafki składają się dwie wnęki ukryte za drzwiczkami otwieranymi za pomocą systemu push to open . Pomiędzy nimi umieszczono dwie otwarte półki, które stanowią doskonałe umiejscowienie dekodera czy kolorowych magazynów. WYKOŃCZENIE Całość bryły mebla wykończono na wysoki połysk. Biała, budząca skojarzenia z luksusem barwa, harmonizuje błyszczącymi elementami w barwie chromu. Lśniąca podstawa podkreśla elegancję i luksusowy charakter szafki.', '', 'szafka-rtv-dama-bianca-141ptv01bi', '', '', '', 'Szafka RTV DAMA BIANCA 141PTV.01BI', '', '', '', ''),
(24, 1, 1, 'Szafka RTV BRUGIA pozwala zorganizować przestrzeń pod telewizorem. Tworzy we wnętrzu atmosferę sprzyjającą integracji podczas wspólnych wieczorów filmowych. Geometryczna bryła i funkcjonalne rozwiązania sprawiają, że BRUGIA łączy w sobie estetykę rodem z filmów science fiction z akcentami, czerpiącymi z aranżacji „loftowych”. Oświetlenie LED podkreśla nowoczesny charakter sprzętu RTV i ułatwia korzystanie z szafki. Mebel wyposażono w specjalne hamulce, które eliminują problem trzaskających drzwi. Ślizgacze ułatwiają przesuwanie mebla. WNĘTRZE Dwie szafki boczne to idealne miejsce na domową płytotekę. Nie zabraknie także miejsca na drobiazgi i piloty, które możesz przechowywać w szufladzie. Wnęka ułatwia dostęp do sprzętu RTV. WYKOŃCZENIE Mebel wykończono folią, która nadaje mu ciekawą strukturę i ułatwia czyszczenie. Połączenie białego połysku na froncie z oświetleniem LED tworzy elegancki klimat, a ciemna listwa w kolorze betonu, przełamując minimalistyczny desing, dodaje mu intrygującego charakteru. Dzięki temu meble z serii BRUGIA świetnie prezentują się zarówno w jasnych, jak i w ciemnych pomieszczeniach.', '', 'szafka-rtv-brugia-bugt131b-z-oswietleniem', '', '', '', 'Szafka RTV BRUGIA BUGT131B z oświetleniem', '', '', '', ''),
(25, 1, 1, 'Szafka RTV CANNE NEW to mebel o nietuzinkowej budowie, wykraczający poza standardy. CANNE NEW to program do współczesnego salonu idealny do wyposażenia niewielkich loftowych przestrzeni. Kolorystyka łączy popularną biel z modnym betonem ciemnoszarym. Frontowe elementy w bieli wykończone zostały w połysku. Szafka cechuje się masywną ramą, która najbardziej zwraca na siebie uwagę. Wydaje się okalać całą bryłę i jeszcze bardziej podkreśla trójwymiarowość. Kolejnym wyróżniającym z tłumu elementem szafkę CANNE NEW są pionowe i długie uchwyty w kolorze aluminium. Zawiasy w drzwiach wyposażone w hamulce nie hałasują w trakcie zamykania. Szufladę wyposażono w system push to open dzięki czemu wystarczy delikatnie nacisnąć front by ją otworzyć lub zamknąć. Bogactwo wyposażenia wieńczy oświetlenie LED dostępne w standardzie. Są to dwie szerokie listwy LEDowe montowane w dwóch miejscach, pod wieńcem i pod cokołem. Sterowanie całym oświetleniem odbywa się za pomocą zamontowanego systemu dotykowego umieszczanego na korpusie. Rozwiązanie to ukrywa okablowanie i włączniki. Dlatego system dotykowy jest niezmiernie wygodny. WNĘTRZE Szafkę zorganizowano standardowo, dwie zamykane szafki, jedna szuflada i wnęka na sprzęt. WYKOŃCZENIE Szafkę wykonano z płyt meblowych pokrytych laminatem i folią, z listwami z płyty MDF pokrytymi folią. Wymiary wnęki: głębokość: 46 cm, wysokość: 21 cm, szerokość: 58 cm.', '', 'szafka-rtv-canne-new-1s2d-cqnt132b-z-oswietleniem', '', '', '', 'Szafka RTV CANNE NEW 1S2D CQNT132B z oświetleniem', '', '', '', ''),
(26, 1, 1, 'Biała komoda BIANCO to mebel, który urzeka lekkością i geometryczną prostotą. Fronty szuflad i szafki nie posiadają uchwytów, a zastąpiono je równie praktycznym podfrezowanym podchwytem . Biel to świetne rozwiązanie do nowocześnie urządzonych wnętrz, nawet jeśli pomieszczenie jest mniej oświetlone to biel rozjaśni je optycznie. Pracę z komodą ułatwiają zamontowane zawiasy z systemem samodomykającym drzwi i prowadnice kulkowe z pełnym wysuwem. W pełni uniwersalna konstrukcja BIANCO pozwoli na stosowanie jej w każdym z pomieszczeń od przedpokoju po salon. WNĘTRZE 3 szuflady i 3 wnęki za drzwiami ułatwiają rozmieszczenie potrzebnych przedmiotów. WYKOŃCZENIE Komodę wykonano z płyty meblowej pokrytej lakierem.', '', 'komoda-bianco-1d3s-typ02', '', '', '', 'Komoda BIANCO 1D3S TYP02', '', '', '', ''),
(27, 1, 1, 'Komoda CANNE NEW to mebel o nietuzinkowej budowie, wykraczający poza standardy. CANNE NEW to program do współczesnego salonu idealny do wyposażenia niewielkich loftowych przestrzeni. Kolorystyka łączy popularną biel z modnym betonem ciemnoszarym. Frontowe elementy w bieli wykończone zostały w połysku. Komoda cechuje się masywną ramą, która najbardziej zwraca na siebie uwagę. Wydaje się okalać całą bryłę i jeszcze bardziej podkreśla trójwymiarowość. Kolejnym wyróżniającym elementem są pionowe i długie uchwyty w kolorze aluminium. Zawiasy w drzwiach wyposażone w hamulce nie hałasują w trakcie zamykania. Szuflady z kolei wyposażono w system push to open dzięki czemu wystarczy delikatnie nacisnąć front by je otworzyć lub zamknąć. Bogactwo wyposażenia komody wieńczy oświetlenie LED. Są to dwie szerokie listwy LEDowe montowane w dwóch miejscach, pod wieńcem i pod cokołem. Sterowanie całym oświetleniem odbywa się za pomocą zamontowanego systemu dotykowego umieszczanego na korpusie. Rozwiązanie to ukrywa okablowanie i włączniki. Dlatego system dotykowy jest niezmiernie wygodny. WNĘTRZE Wnętrze komody z podziałem na półki, zamykane trojgiem drzwi i dwiema szufladami pozwala na szybką kontrolę zawartości. W zewnętrznych drzwiach znajdują się zawiasy z hamulcami, środkowe drzwi i szuflady wyposażono w system push to open. WYKOŃCZENIE Komodę wykonano z płyt meblowych pokrytych laminatem i folią, z listwami z płyty MDF pokrytymi folią.', '', 'komoda-canne-new-2s3d-z-oswietleniem', '', '', '', 'Komoda CANNE NEW 2S3D z oświetleniem', '', '', '', ''),
(28, 1, 1, 'Komoda ATTENTION EXCLUSIVE to pojemny mebel, który może pełnić funkcję biblioteczki, bufetu lub bieliźniarki. Dzięki subtelnemu połączeniu barw i podświetleniu na froncie pozwala zaaranżować przestrzeń, w której można się wyciszyć. Szare wnętrze stanowi ciekawe tło dla przechowywanych przedmiotów. WNĘTRZE Możesz optymalnie rozmieścić swoje rzeczy na ośmiu wnękach. Górny blat to dobre miejsce na wyeksponowanie dekoracji i rodzinnych zdjęć. Specjalne zawiasy zapobiegają trzaskaniu drzwi. WYKOŃCZENIE Meble z kolekcji ATTENTION EXCLUSIVE mają w sobie coś z futuryzmu. Przełamują symetrię przestrzeni, stosując wzornictwo oparte o figury geometryczne. Dobrze prezentują się we wnętrzach wypełnionych odcieniami szarości. Współgrają z pastelowymi dodatkami i komponują się z naturalnymi materiałami wykończeniowymi. Połyskująca powierzchnia frontów rozświetla i powiększa optycznie przestrzeń.', '', 'komoda-attention-exclusive-3d-z-oswietleniem', '', '', '', 'Komoda ATTENTION EXCLUSIVE 3D z oświetleniem', '', '', '', ''),
(29, 1, 1, 'Komoda BRUGIA może pełnić funkcję bieliźniarki, szafki na dokumenty lub bufetu do przechowywania zastawy stołowej. Praktyczny i zarazem elegancki mebel tworzy we wnętrzu atmosferę sprzyjającą relaksowi. Oświetleniu LED ułatwia korzystanie z szuflady . Geometryczna bryła i funkcjonalne rozwiązania podkreślają nowoczesny charakter wnętrza. Komodę wyposażono w specjalne hamulce, które eliminują problem trzaskających drzwi. Korzystanie z mebla jest więc bezpieczne. Mebel wyposażono w tzw. ślizgacze, co ułatwia przesuwanie. WNĘTRZE Obszerne szafki pozwolają optymalnie zorganizować i uporządkować przedmioty. Na czterech półkach możesz zmieścić zastawę stołową i obrusy lub dokumenty czy akcesoria dekoracyjne. Dzięki czterem szufladom wszelkie drobiazgi możesz podzielić tematycznie, co ułatwi sprzątanie i utrzymanie porządku, a także pozwoli zaoszczędzić czas. WYKOŃCZENIE Mebel wykończono folią, która nadaje mu gładką strukturę i ułatwia czyszczenie. Połączenie białego połysku na froncie z oświetleniem LED dodaje elegancji, a ciemna listwa w kolorze betonu, przełamując minimalistyczny desing, intryguje. Kolekcja BRUGIA łączy w sobie kobiecą delikatność, z męskim zdecydowaniem, dzięki czemu dobrze zaprezentuje się zarówno w pastelowych, jak w ciemnych wnętrzach.', '', 'komoda-brugia-bugk231b-z-oswietleniem', '', '', '', 'Komoda BRUGIA BUGK231B z oświetleniem', '', '', '', ''),
(30, 1, 1, 'Komoda DONATELLA z trzema szufladami to mebel produkcji włoskiej. Pochodzi z kilkuelementowego programu do sypialni, jednakże dzięki uniwersalnej kolorystyce można ją zestawić z bryłami, które pasują do innych kolekcji utrzymanych w podobnym stylu. Trzy, pojemne szuflady można wykorzystać do trzymania ubrań, dokumentów lub osobistych drobiazgów. WYKOŃCZENIE Biel w połysku będzie idealna wprost do jasnych przestronnych wnętrz salonu oraz sypialni.', '', 'komoda-biala-z-3-szufladami-donatella', '', '', '', 'Komoda biała z 3 szufladami DONATELLA', '', '', '', ''),
(31, 1, 1, 'Komoda ARISTA to nowoczesny mebel, idealny dla pełnych światła wnętrz utrzymanych w tonacji bieli oraz szarości. Jej przeznaczeniem może być większość pomieszczeń w domu. Komodę ARISTA można ustawić w sypialni, pokoju dziennym lub w jadalni. Można w niej przechowywać wszystko – od ubrań po przybory kuchenne. Połączenie białych frontów oraz korpusu i blatu w kolorystyce ciemnoszarego betonu daje wspaniałe efekty wizualne, które stylistycznie sprawdza się w nowoczesnych aranżacjach. WNĘTRZE Komoda ARISTA została wykonana z płyty meblowej i laminowanej, wykończonej folią. Posiada cztery szuflady i półki, które pozwolą lepiej rozmieścić i zorganizować ubrania, obrusy zastawę lub rzeczy codziennego użytku. WYKOŃCZENIE Dopełnieniem całości są frezowania na froncie i uchwyty w kolorze matowy chrom.', '', 'komoda-arista-2-2d4s-rstk262-c592', '', '', '', 'Komoda ARISTA 2 2D4S RSTK262 C592', '', '', '', ''),
(32, 1, 1, 'Od tekstyliów takich jak obrusy, serwety i pościel, po książki, naczynia albo wszystko, co tylko przyjdzie Ci do głowy. Biała komoda z serii VALENCIA, to uniwersalny mebel, który sprawdzi się w salonie, sypialni, czy przydomowym gabinecie. Dzięki połączeniu białych frontów z blatem i elementami w kolorach jasnego drewna, wpisze się w przestrzenie o skandynawskim lub rustykalnym charakterze. WNĘTRZE za pełnymi drzwiami po dwóch stronach mebla, znajdziesz 4 półki o udźwigu do 5 kg. w centralnej części komody znajdują się 4 szuflady. WYKOŃCZENIE komodę zrobiono z 16 mm płyty meblowej, którą pokryto melaminą w kolorze dębu Artisan. front komody został wykonany z płyty MDF, pokrytej folią PVC w białym kolorze. w drzwiach i szufladach zamontowano plastikowe uchwyty. szuflady umieszczono na prowadnicach rolkowych.', '', 'komoda-2-drzwiowa-biala-valencia', '', '', '', 'Komoda 2 drzwiowa biała VALENCIA', '', '', '', ''),
(33, 1, 1, 'Lubisz łączyć postarzane dodatki z nowoczesnym wystrojem wnętrza? Kolekcja KASTENOS wyróżnia się minimalizmem i powstała z naturalnego drewna z ręcznym zdobieniem w formie jodełki. Ciepły odcień drewna w połączeniu z industrialnymi nóżkami, pozwala Ci stworzyć wyjątkowy klimat w Twoim mieszkaniu. Szafka RTV KASTENOS to idealne rozwiązanie aranżacyjne do Twojego salonu. Elegancko komponuje telewizor i sprzęt RTV w Twoim wnętrzu. 2 PÓŁKI NA SPRZĘT Szafka ma 40 cm głębokości - zmieści się w niewielkim salonie lub wąskim przedpokoju. Umieszczone pośrodku 2 otwarte wnęki pozwalają estetycznie wyeksponować sprzęt RTV. Do dyspozycji masz też 4 zamykane wnęki, w których możesz przechowywać dokumenty lub rzeczy, które chcesz mieć zawsze pod ręką. Zawiasy wyposażono w cichy domyk, dlatego możesz mieć pewność, że żaden hałas nie będzie rozpraszał Twoich bliskich. Najważniejsze cechy: Wykonany w dużej części z drewna Posiada industrialne nóżki Zachwyca minimalistyczną formą Ma stylowe ręczne zdobienie w formie jodełki na froncie RĘCZNIE ZDOBIONE FRONTY Na każdym froncie ręcznie układano drewniane listwy w taki sposób, by powstał nietypowy wzór w jodełkę. Wybierając KASTENOS stawiasz na unikalne rozwiązania. Każdy mebel z kolekcji KASTENOS jest jedyny w swoim rodzaju. MINIMALIZM W ODSŁONIE VINTAGE Meble z kolekcji KASTENOS nawiązują do stylu vintage oraz charakteryzują się minimalizmem. Śmiało zestawiaj je z nowoczesnymi dodatkami, budując unikalny i przytulny klimat w swoim wnętrzu. WYKOŃCZENIE Blat wykonano z naturalnego drewna, które zabezpieczono lakierem UV. Dzięki temu długo będziesz się cieszyć jego oryginalnym urokiem. Jego ciepły odcień i wyrazista struktura z ręcznym zdobieniem na froncie pozwolą Ci stworzyć przytulny klimat w Twoim wnętrzu. Wysokie, industrialne nóżki ułatwią Ci codzienne porządki i dodadzą Twojemu wnętrzu przestronności.', '', 'drewniana-szafka-rtv-z-frontem-w-jodelke-kastenos', '', '', '', 'Drewniana szafka RTV z frontem w jodełkę KASTENOS', '', '', '', ''),
(34, 1, 1, 'Zaaranżuj domowe centrum rozrywki z szafką RTV VALENCIA. We wnękach za pełnymi drzwiami schowasz ulubione winylowe płyty. Na blacie postawisz telewizor lub gramofon. Otwarta półka przyda się na konsolę albo dekoder, a szuflada na zapasowe baterie do pilota i padów. Dzięki białym frontom i elementom w kolorze jasnego drewna, szafka sprawdzi się w pomieszczeniach ze skandynawskim charakterem. Meble z serii VALENCIA pasują też do wnętrz o rustykalnym zabarwieniu. Salon, pokój gościnny, a może jadalnia? Decyzja jak zawsze należy do Ciebie. WNĘTRZE 2 pojemne szafki schowane za pełnymi drzwiami. centralnie umiejscowiona szuflada na mniejsze przedmioty. półka na dekoder lub konsolę. WYKOŃCZENIE szafkę wykonano z 16 mm płyty meblowej, pokrytej melaminą w kolorze dębu Artisan. front mebla zrobiono z płyty MDF i pokryto folią PVC w białym kolorze. półka o udźwigu do 5 kg została zrobiona z płyty meblowej i wykończona melaminą w barwie dębu Artian. szufladę osadzono na prowadnicach rolkowych. uchwyt szuflady i uchwyty drzwi wykonano z tworzywa sztucznego.', '', 'szafka-rtv-biala-valencia', '', '', '', 'Szafka RTV biała VALENCIA', '', '', '', ''),
(35, 1, 1, 'Potrzebujesz dodatkowego mebla do małego salonu w stylu prowansalskim lub rustykalnym? Komoda IRIS jest głęboka na 39 cm więc możesz wkomponować w małą przestrzeń. Wykończono ją folią imitującą jasne, postarzane drewno więc idealnie wpasuje się we wnętrza o dworkowym charakterze. WNĘTRZE W 2 wnękach poukładasz dokumenty, elementy zastawy czy obrusy. 2 szuflady przydadzą się na drobiazgi WYKOŃCZENIE Komodę wykonano z płyty wiórowej i pokryto folią w kolorze bielonej sosny andersen. Widoczne słoje drewna i przetarcia sprawiają, że komoda przypomina postarzany mebel. Blat jest wykonany z płyty wiórowej pokrytej folią w wybarwieniu złotego dębu . Wprowadza przytulność do wnętrza. Uchwyty wyróżniają się elegancką stylistyką i podkreślają prowansalski charakter mebla. Szuflady poruszające się na prowadnicy kulkowej pozwalają na płynne wysuwanie. Kolekcja IRIS Szukasz mebli, które rozjaśnią Twoją przestrzeń? Zestaw komodę z pozostałymi meblami z serii IRIS i ciesz się eleganckim urokiem stylizowanej kolekcji. Meble pasują nawet do małych pomieszczeń, rozjaśniając je i optycznie powiększając.', '', 'komoda-2-drzwiowa-prowansalska-iris', '', '', '', 'Komoda 2-drzwiowa prowansalska IRIS', '', '', '', ''),
(36, 1, 1, 'Komoda IRIS to mebel przeznaczony do salonu lub sypialni. Wyposażona w 4 szuflady - doskonale nadaje się do przechowywania dokumentów, ubrań oraz innych potrzebnych drobiazgów. Wykończono ją folią imitującą jasne, postarzane drewno więc idealnie wpasuje się we wnętrza o dworkowym charakterze. WYKOŃCZENIE Komodę wykonano z płyty meblowej i pokryto folią w kolorze bielonej sosny andersen . Widoczne słoje drewna i przetarcia sprawiają, że komoda przypomina postarzany mebel. Blat jest wykonany z płyty meblowej pokrytej folią w wybarwieniu złotego dębu . Wprowadza przytulność do wnętrza. Uchwyty wyróżniają się elegancką stylistyką i ładnie podkreślają charakter mebla. Szuflady poruszające się na prowadnicy kulkowej pozwalają na płynne wysuwanie. Kolekcja IRIS Szukasz mebli, które rozjaśnią Twoją przestrzeń? Zestaw komodę z pozostałymi meblami z serii IRIS i ciesz się eleganckim urokiem stylizowanej kolekcji. Meble pasują nawet do małych pomieszczeń, rozjaśniając je i optycznie powiększając.', '', 'komoda-z-4-szufladami-prowansalska-iris', '', '', '', 'Komoda z 4 szufladami prowansalska IRIS', '', '', '', ''),
(37, 1, 1, 'D wudrzwiowa komoda z kolekcji Paris charakteryzuje się klasyczną i prostą stylistyką. Efektowna masywna rama i ryflowana drewniana wstawka nadają jej niepowtarzalny wygląd. Ciepła kolorystyka w odcieniu brązu podkreśla przytulność pomieszczenia. Wygodny metalowy uchwyt w kolorze srebrnym to kontrastujący element na froncie, który podkreśla charakter mebla. WNĘTRZE Posiada półki i szuflady, które ułatwią rozmieszczenie poszczególnych części garderoby.', '', 'komoda-ciemny-braz-dwudrzwiowa-paris', '', '', '', 'Komoda ciemny brąz dwudrzwiowa PARIS', '', '', '', ''),
(38, 1, 1, 'Komoda 3-drzwiowa IRIS ułatwi Ci uporządkowanie wszystkich rzeczy, które przydają się w salonie lub jadalni. Za drzwiami znajduje się 6 półek, na których możesz poukładać dokumenty, tekstylia domowe i elementy zastawy. Natomiast w szufladzie przechowasz drobniejsze akcesoria, które chcesz mieć zawsze pod ręką. Szeroka na 137,6 cm - pozwala wyeksponować na blacie ważne dla Ciebie pamiątki lub dekoracje, które ubogacą Twoje wnętrze. Wykończono ją folią imitującą jasne, postarzane drewno więc idealnie wpasuje się we wnętrza o dworkowym charakterze. WYKOŃCZENIE Komodę wykonano z płyty wiórowej w kolorze bielonej sosny andersen . Widoczne słoje drewna i przetarcia sprawiają, że komoda przypomina postarzany mebel. Blat jest wykonany z płyty wiórowej pokrytej folią w wybarwieniu złotego dębu . Wprowadza przytulność do wnętrza. Uchwyty wyróżniają się elegancką stylistyką i ładnie podkreślają charakter mebla. Szuflada poruszająca się na prowadnicy kulkowej pozwalaja na płynne wysuwanie. Kolekcja IRIS Szukasz mebli, które rozjaśnią Twoją przestrzeń? Zestaw witrynę z pozostałymi meblami z serii IRIS i ciesz się eleganckim urokiem stylizowanej kolekcji. Meble pasują nawet do małych pomieszczeń, rozjaśniając je i optycznie powiększając.', '', 'komoda-3-drzwiowa-prowansalska-iris', '', '', '', 'Komoda 3-drzwiowa prowansalska IRIS', '', '', '', ''),
(39, 1, 1, '4 szuflady i pojemna szafka. Nie ograniczaj się i wykorzystaj całe miejsce komody jednodrzwiowej SALGADO. Ten nowoczesny mebel świetnie sprawdzi się w przestronnym salonie, ale też w sypialni czy pokoju gościnnym. Połączenie koloru jasnego dębu artisan z czarnymi elementami podstawy, zachęca do wstawienia mebla do pomieszczeń loftowych. Szafka jest dość wąska 39,5 cm - sprawdzi się w niewielkich pokojach. Zestaw ją z pozostałymi meblami z kolekcji SALGADO i ciesz się wystrojem salonu z asymetrycznym motywem. WNĘTRZE Szafka z półką za pełnymi drzwiami przyda się do przechowywania szklanek lub albumów ze zdjęciami. W 4 szufladach pomieścisz serwety lub drobiazgi. Na półce możesz ustawić przedmioty o wadzedo 5 kg. WYKOŃCZENIE Komodę wykonano z 18 mm płyty meblowej. Konstrukcję pokryto laminatem w kolorach czarnym i jasnego dębu artisan. Szuflady zamontowano na prowadnicach rolkowych. Uchwyty wykonano z tworzywa.', '', 'komoda-do-salonu-z-4-szufladami-salgado', '', '', '', 'Komoda do salonu z 4 szufladami SALGADO', '', '', '', ''),
(40, 1, 1, 'Komoda z kolekcji Paris charakteryzuje się klasyczną i prostą stylistyką. Efektowna masywna rama i drewniana wstawka pokryta ciekawym wzorem nadają jej niepowtarzalny wygląd. Ciepła kolorystyka w odcieniu brązu podkreśli przytulność pomieszczenia. Wygodny metalowy uchwyt w kolorze srebrnym to kontrastujący element na froncie, który podkreśla charakter mebla. WNĘTRZE Komoda posiada cztery szuflady, które ułatwią rozmieszczenie poszczególnych części garderoby.', '', 'komoda-z-szufladami-waska-ciemny-braz-paris', '', '', '', 'Komoda z szufladami wąska ciemny brąz PARIS', '', '', '', ''),
(41, 1, 1, 'SZAFKA RTV PARIS Szafka rtv z kolekcji Paris o wyjątkowo klasycznej stylistyce. Efektowna masywna rama i ryflowana drewniana wstawka nadają szafce niepowtarzalny wygląd. Ciepła kolorystyka w odcieniu brązu podkreśli przytulność pomieszczenia. Wygodny metalowy uchwyt w kolorze srebrnym wprowadza stylowy kontrast. WNĘTRZE Szafka posiada cztery szuflady i długą otwartą półkę przygotowaną na sprzęt audio- wideo.', '', 'szafka-rtv-mala-ciemny-braz-paris', '', '', '', 'Szafka RTV mała ciemny brąz PARIS', '', '', '', ''),
(42, 1, 1, 'Trzydrzwiowa komoda z kolekcji Paris charakteryzuje się klasyczną i prostą stylistyką. Efektowna masywna rama i ryflowana drewniana wstawka nadają jej niepowtarzalny wygląd. Ciepła kolorystyka w odcieniu brązu podkreśli przytulność pomieszczenia. Wygodny metalowy uchwyt w kolorze srebrnym to kontrastujący element na froncie, który podkreśla charakter mebla. WNĘTRZE We wnętrzu znajdują się półki i szuflady , które ułatwią rozmieszczenie poszczególnych części garderoby.', '', 'komoda-ciemny-braz-szeroka-trzydrzwiowa-paris', '', '', '', 'Komoda ciemny brąz szeroka trzydrzwiowa PARIS', '', '', '', ''),
(43, 1, 1, 'SZAFKA RTV PARIS Szafka rtv z kolekcji Paris o wyjątkowo klasycznej stylistyce. Efektowna masywna rama i ryflowana drewniana wstawka nadają szafce niepowtarzalny wygląd. Ciepła kolorystyka w odcieniu brązu podkreśli przytulność pomieszczenia. Wygodny metalowy uchwyt w kolorze srebrnym wprowadza stylowy kontrast. WNĘTRZE Szafka posiada trzy szuflady i długą otwartą półkę, w której pomieścisz niezbędny sprzęt.', '', 'szafka-rtv-szeroka-ciemny-braz-paris', '', '', '', 'Szafka RTV szeroka ciemny brąz PARIS', '', '', '', ''),
(44, 1, 1, 'Biała szafka RTV POOLE to prosty i nowoczesny mebel, który można ustawić w pokoju dziennym oraz salonie. Korpus szafki został wykonany z płyty meblowej oraz położonego na zewnątrz lakierowanego, hartowanego szkła o grubości 4mm. Wnętrze mebla zostało wykończone folią. W podobnej technologii utrzymano blat oraz frontową część mebla, jednak tam grubość szkła wynosi 6mm. RTV POOLE idealnie wpasowuje się w przestrzeń pomieszczenia. Pasuje do minimalistycznych rozwiązań przy wystroju wnętrza oraz aranżacji wzorowanych na stylu skandynawskim. Idealnie wpisuje się we współczesne trendy wystroju wnętrza i doskonale współgra z naturalnym oświetleniem pomieszczenia. WNĘTRZE RTV POOLE pozwala też zorganizować ekspozycję urządzeń RTV. Na blacie można ustawić przedmioty o łącznej wadze do 30kg. Ponadto dzięki zamykanej szafce oraz dwóm szufladom sprawdza się do przechowywania płyt z filmami i muzyką oraz potrzebnych drobiazgów. Drzwi szafki zostały wyposażone w system cichego domyku, a szuflady wzbogacone o zamontowanie prowadnic HAFELE z hamulcem. Dzięki tym udogodnieniom mebel jest trwalszy, a jego obsługa wygodna. WYKOŃCZENIE W szafce RTV POOLE zostały zamontowane metalowe uchwyty oraz nóżki z tworzywa w kolorystyce stali szlachetnej.', '', 'szafka-rtv-poole-l-p-1d2s-enjt121-c605', '', '', '', 'Szafka RTV POOLE L/P 1D2S ENJT121-C605', '', '', '', ''),
(45, 1, 1, 'Szafka RTV z kolekcji LISSE to nowoczesny, minimalistyczny mebel do zastosowania w salonie. Jej mocny, biały kolor z połyskiem rozjaśni i optycznie powiększy przestrzeń. Szafka jest jednym z elementów uniwersalnej kolekcji LISSE ale dzięki swojej białej barwie i ponadczasowej formie sprawdzi się w połączeniu z innymi meblami wykończonymi w bieli lub jasnych odcieniach drewna. Będzie idealną bazą dla aranżacji wnętrza w różnych stylach, w szczególności nowoczesnym, minimalistycznym i skandynawskim. WNĘTRZE Wnętrze szafki składa się z dwóch praktycznych szuflad, w których schowasz niezbędne drobiazgi, piloty, baterie, płyty DVD lub CD. Odkryte wnęki pozwolą na umieszczenie sprzętu RTV. Dzięki prowadnicom z hamulcem zasuwanie szuflad nie powoduje hałasu. Wymiary wnęki: szerokość 67 cm, głębokość 41 cm, wysokość 16,5 cm WYKOŃCZENIE Fronty są wykończone folią w połysku. Uchwyty są wykonane z metalu.', '', 'szafka-rtv-lisse-2s', '', '', '', 'Szafka RTV LISSE 2S', '', '', '', ''),
(46, 1, 1, 'Biała komoda BIANCO to mebel, który urzeka lekkością i geometryczną prostotą. Fronty szuflad i szafki nie posiadają uchwytów, a zastąpiono je równie praktycznym podfrezowanym podchwytem. Biel to świetne rozwiązanie do nowocześnie urządzonych wnętrz, nawet jeśli pomieszczenie jest mniej oświetlone to biel rozjaśni je optycznie. Pracę z komodą ułatwiają zamontowane zawiasy z systemem samodomykającym drzwi i prowadnice kulkowe z pełnym wysuwem. W pełni uniwersalna konstrukcja BIANCO pozwoli na stosowanie jej w każdym z pomieszczeń od przedpokoju po salon. WNĘTRZE 2 szuflady i 4 wnęki za drzwiami pozwalają łatwo ułożyć potrzebne przedmioty. WYKOŃCZENIE Komodę wykonano z płyty meblowej pokrytej lakierem.', '', 'komoda-bianco-2s2d-typ01', '', '', '', 'Komoda BIANCO 2S2D TYP01', '', '', '', ''),
(47, 1, 1, 'Szafka RTV REX to propozycja do salonu lub sypialni. Wykonana w uniwersalnej bieli, wpasuje się w każdą nowoczesną stylistykę wnętrza. Dwie otwierane szafki i szklana półka w środku to rozwiązanie funkcjonalne i eleganckie pod względem wizualnym. Szerokość szafki wynosi 170 cm , co umożliwia umieszczenie na niej nawet dużego telewizora. WNĘTRZE Posiada dwie zamykane szafki oraz półki otwarte w centralnej części mebla. Idealnie sprawdza się zarówno jako mebel eksponujący sprzęt RTV oraz miejsce na kolekcję filmów oraz muzyki. WYKOŃCZENIE Model RTV REX charakteryzuje się starannym wykończeniem i estetycznym wyglądem. Biała kolorystyka mebla rozjaśnia wnętrze. Do całości idealnie pasują uchwyty w szarym kolorze.', '', 'szafka-rtv-rex-2d-11008813', '', '', '', 'Szafka RTV REX 2D 11008813', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(48, 1, 1, 'Minimalistyczne i nowoczesne wnętrza kochają czerń! Dzięki wiszącej szafce RTV VIVIEN Twój salon będzie niezwykle reprezentacyjny i dobrze zaplanowany. Szafka wisząca RTV VIVIEN to stylowa podstawa dla sprzętu, a dzięki połyskującym frontom, nie przytłoczy przestrzeni wypoczynkowej. Ze względu na prostą konstrukcję szafki, możesz wykorzystać ją jako dodatkowy mebel do przechowywania w różnych pomieszczeniach. WNĘTRZE W 2 zamykanych wnękach uporządkujesz niezbędne akcesoria. Dzięki drzwiom klapowym (otwieranym w dół) możesz wygodnie dostać się do swojego sprzętu. Górna krawędź drzwi jest podfrezowana . Możesz umieścić palce we wgłębieniu, by z łatwością otwierać drzwi. Maksymalne obciążenie szafki wynosi 15 kg. WYKOŃCZENIE Szafka została wykonana z płyty meblowej pokrytej laminatem. Fronty wykończone na wysoki połysk odbiją światło i nadadzą wnętrzu elegancki charakter. Brak widocznych uchwytów podkreśla minimalistyczny charakter kolekcji. CZARNE MEBLE DO SALONU Kolekcja VIVIEN to ukłon w stronę minimalistycznego wnętrza. Wiszące meble VIVIEN sprawdzą się zarówno w przestronnych salonach, jak i mniejszych mieszkaniach, w których zależy nam na maksymalnym wykorzystaniu dostępnej przestrzeni. Dzięki zastosowaniu wysokiego połysku na frontach, meble nie przytłoczą pomieszczenia. Czarne meble do salonu to propozycja dla osób, które lubią odważne aranżacje i chcą wprowadzić do wnętrza nowoczesny, luksusowy klimat. Z kolekcją VIVIEN możesz skompletować zestaw , który najlepiej sprawdzi się w Twoim mieszkaniu. System mebli wiszących VIVIEN szczególnie dobrze wypełni minimalistyczne i nowoczesne wnętrza.', '', 'szafka-wiszaca-rtv-vivien-01-czarna', '', '', '', 'Szafka wisząca RTV VIVIEN 01 CZARNA', '', '', '', ''),
(49, 1, 1, 'Dzięki białej, wiszącej szafce RTV VIVIEN wnętrze Twojego salonu będzie niezwykle reprezentacyjne i dobrze zaplanowane. Szafka wisząca RTV VIVIEN to stylowa podstawa dla sprzętu. Dzięki połyskującym frontom nie przytłoczy przestrzeni, a optycznie ją powiększy. Ze względu na prostą konstrukcję szafki, możesz wykorzystać ją jako dodatkowy mebel do przechowywania w różnych pomieszczeniach. WNĘTRZE W 2 zamykanych wnękach uporządkujesz niezbędne akcesoria. Dzięki drzwiom klapowym (otwieranym w dół) możesz wygodnie dostać się do swojego sprzętu. Górna krawędź drzwi jest podfrezowana . Możesz umieścić palce we wgłębieniu, by z łatwością otwierać drzwi. Maksymalne obciążenie szafki wynosi 15 kg. WYKOŃCZENIE Szafka została wykonana z płyty meblowej pokrytej laminatem. Białe fronty wykończone na wysoki połysk odbiją światło i nadadzą wnętrzu elegancki charakter. Brak widocznych uchwytów podkreśla minimalistyczny charakter kolekcji. WISZĄCE MEBLE DO SALONU Kolekcja VIVIEN to ukłon w stronę minimalistycznego wnętrza. Białe meble wiszące świetnie prezentują się w różnych aranżacjach i są ponadczasowe. Zapewniają też dużą swobodę w wyborze dodatków. Wiszące meble VIVIEN sprawdzą się zarówno w przestronnych salonach, jak i mniejszych mieszkaniach, w których zależy nam na maksymalnym wykorzystaniu dostępnej przestrzeni. Dzięki białemu wybarwieniu i zastosowaniu wysokiego połysku na frontach, meble VIVIEN optycznie rozjaśnią i powiększą pomieszczenie. Z kolekcją VIVIEN możesz skompletować zestaw , który najlepiej sprawdzi się w Twoim mieszkaniu. System mebli wiszących VIVIEN szczególnie dobrze wypełni minimalistyczne i nowoczesne wnętrza.', '', 'szafka-wiszaca-rtv-vivien-01-biala', '', '', '', 'Szafka wisząca RTV VIVIEN 01 BIAŁA', '', '', '', ''),
