(51, 1, 1, 'Minimalistyczne i nowoczesne wnętrza kochają czerń! Dzięki wiszącej szafce RTV VIVIEN Twój salon będzie niezwykle reprezentacyjny i dobrze zaplanowany. Szafka wisząca RTV VIVIEN to stylowa podstawa dla sprzętu, a dzięki połyskującym frontom, nie przytłoczy przestrzeni wypoczynkowej. Ze względu na prostą konstrukcję szafki, możesz wykorzystać ją jako dodatkowy mebel do przechowywania w różnych pomieszczeniach. WNĘTRZE W 2 zamykanych wnękach uporządkujesz niezbędne akcesoria. Dzięki drzwiom klapowym możesz wygodnie dostać się do swojego sprzętu. Górna krawędź drzwi jest podfrezowana . Możesz umieścić palce we wgłębieniu, by zręcznie otwierać drzwi. Maksymalne obciążenie szafki wynosi 15 kg. WYKOŃCZENIE Szafka została wykonana z płyty meblowej pokrytej laminatem. Fronty wykończone na wysoki połysk odbiją światło i nadadzą wnętrzu elegancki charakter. Brak widocznych uchwytów podkreśla minimalistyczny charakter kolekcji. CZARNE MEBLE DO SALONU Kolekcja VIVIEN to ukłon w stronę minimalistycznego wnętrza. Wiszące meble VIVIEN sprawdzą się zarówno w przestronnych salonach, jak i mniejszych mieszkaniach, w których zależy nam na maksymalnym wykorzystaniu dostępnej przestrzeni. Dzięki zastosowaniu wysokiego połysku na frontach, meble nie przytłoczą pomieszczenia. Czarne meble do salonu to propozycja dla osób, które lubią odważne aranżacje i chcą wprowadzić do wnętrza nowoczesny, luksusowy klimat. Z kolekcją VIVIEN możesz skompletować zestaw , który najlepiej sprawdzi się w Twoim mieszkaniu. System mebli wiszących VIVIEN szczególnie dobrze wypełni minimalistyczne i nowoczesne wnętrza.', '', 'szafka-rtv-wiszaca-vivien-03-czarna', '', '', '', 'Szafka RTV wisząca VIVIEN 03 CZARNA', '', '', '', ''),
(52, 1, 1, 'Od kompletu talerzy, przez szklanki, aż po obrusy i pościel. Dzięki 4 szufladom i 2 szafkom nie musisz się ograniczać. Komoda z serii SALGADO sprawdzi się w minimalistycznych wnętrzach i loftowych przestrzeniach. Swój nietuzinkowy wygląd zawdzięcza połączeniu czerni, z naturalną barwą jasnego dębu i asymetrycznemu dekorowi. WNĘTRZE Za pełnymi drzwiami umieszczonymi po przeciwnych stronach komody, znajdziesz po 2 półki o udźwigu do 5 kg. W 4 szufladach schowasz rzeczy o wadze do 3 kg. WYKOŃCZENIE Komodę wykonano z 18 mm płyty meblowej. Mebel pokryto laminatem czarnym i laminatem w kolorze jasnego dębu artisan. Szuflady zamontowano na prowadnicach rolkowych. Uchwyty drzwi oraz szuflad zrobiono z tworzywa sztucznego. Nogi zostały wykonane z tworzywa.', '', 'komoda-do-salonu-z-2-szafkami-salgado', '', '', '', 'Komoda do salonu z 2 szafkami SALGADO', '', '', '', ''),
(53, 1, 1, 'Komoda Round to propozycja do nowoczesnego wnętrza. Ciekawe połączenie kolorystyczne sprawdzi się w wielu aranżacjach. Biel świetnie łączy się z innymi kolorami więc możliwości tworzenia własnych aranżacji są niemal nieograniczone. Połyskujące fronty rozświetlą pomieszczenie oraz wprowadzą do wnętrza powiew świeżości. Linearne uchwyty podkreślają nowoczesny styl mebla oraz dopełniają całość. Mnogość brył systemu pozwala umeblować salon i jadalnię według własnych potrzeb i preferencji. WNĘTRZE Wewnątrz znajdują się półki, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Fronty wykonano z płyty MDF opłaszczowanej folią PCV. Korpusy mebli pokryto laminatem, który łatwo utrzymać w czystości, cechuje go również trwałość.', '', 'komoda-round-b51', '', '', '', 'Komoda ROUND B51', '', '', '', ''),
(54, 1, 1, 'Komoda IMOLA to idealny mebel do przechowywania tekstyliów w sypialni. W obszernym wnętrzu i dużej szufladzie pomieścisz sporą ilość rzeczy. Wraz z pozostałymi meblami z kolekcji pozwala stworzyć elegancką aranżację sypialni w nowoczesnym stylu. Stonowana, chłodna kolorystyka sprzyja wyciszeniu. Meble świetnie prezentują się w surowej, industrialnej przestrzeni lub w otoczeniu dodatków w pastelowych barwach. WNĘTRZE 1 półka dzielą wnętrze komody, umożliwiając przechowywanie odzieży lub pościeli. Na każdej półce możesz umieścić przedmioty ważące maksymalnie 5 kg . 1 duża szuflada to idealne miejsce na przechowywanie drobiazgów lub bielizny i galanterii. WYKOŃCZENIE Meble z kolekcji IMOLA wykończono 3 rodzajami folii. Połączenie chłodnego wybarwienia dębu ribbeck z intrygującym kolorem oxid , które imituje kamienną powierzchnię sprawia, że kolekcja nadaje wnętrzu nowoczesnego i surowego wyglądu. Półki pokryto folią, imitującą strukturę eleganckiej tkaniny. Uchwyty z tworzywa w kolorze metalu, podkreślają nowoczesny charakter kolekcji.', '', 'komoda-imola-2d-1s-typ-14', '', '', '', 'Komoda IMOLA 2D 1S TYP 14', '', '', '', ''),
(55, 1, 1, 'Biała komoda z kolekcji BELPASSO to propozycja dla poszukujących praktycznych rozwiązań oraz ceniących sobie naturalne piękno. Bryły z prezentowanego systemu meblowego zostały wyposażone w system cichego domykania a standardowe uchwyty zastępują tu podfrezowane fronty. Cechą charakterystyczną są również pogrubione ramy mebli , nadające im masywny wygląd. Cała kolekcja została wykonana w jasnej tonacji kolorystycznej, dzięki temu doskonale prezentuje się w przestronnych wnętrzach, dodając im dyskretnej elegancji oraz nutki luksusu. WNĘTRZE Wewnątrz znajdują się dwie pojemne szuflady, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Niepowtarzalne wzornictwo, które w dużej mierze ukształtowała natura wprowadzi do twojego wnętrza wspaniały, domowy klimat.', '', 'komoda-belpasso-k-28', '', '', '', 'Komoda BELPASSO K-28', '', '', '', ''),
(56, 1, 1, 'Komoda LENOX NEW ma intrygujący urok designerskiego mebla z betonu, w którego surową strukturę zatopiono połyskującą, perłową biżuterię. Przechowywane w niej rzeczy osobiste, pamiątki i elementy zastawy stołowej nabierają eleganckiego charakteru. Jej geometryczna bryła daje wrażenie wizualnego ładu, a chłodna kolorystyka wprowadza do wnętrza nowoczesną świeżość. Połyskujące fronty odbijają światło, powiększając optycznie przestrzeń. WNĘTRZE Cztery szuflady przydają się do przechowywania drobnych przedmiotów, dokumentów lub sztućców. Każdą z bocznych szafek wyposażono w półkę. Zawiasy i prowadnice wyposażono w „hamulce”, dzięki czemu wyeliminowano problem trzaskania. Dlatego drzwi i szuflady zamykają się tak lekko i cicho. WYKOŃCZENIE Efektowne połączenie bieli i ciemnoszarego betonu uzyskano dzięki zastosowaniu folii PCV , która cechuje się stosunkowo dużą wytrzymałością na uszkodzenia mechaniczne i łatwo ją utrzymać w czystości. Metalowe, chromowane uchwyty i połyskująca powierzchnia frontów nadają meblowi elegancki charakter. Szafka bardzo dobrze zaprezentuje się wśród granatowych ścian, w towarzystwie zgaszonych barw pastelowych, ale i w przestrzeni, wypełnionej czernią, bielą i szarością. Meble z kolekcji LENOX NEW wkomponują się także w industrialne wnętrza.', '', 'komoda-lennox-new-2d4s', '', '', '', 'Komoda LENNOX NEW 2D4S', '', '', '', ''),
(57, 1, 1, 'Chcesz, aby w Twoim przedpokoju wreszcie zapanował porządek? Przyda Ci się komoda z szufladami SALVE . Ma zaledwie 35 cm głębokości , a możesz w niej posegregować nie tylko obuwie, ale i wszelkie drobne przedmioty i dokumenty, do których chcesz mieć dostęp w przedpokoju. Podwójne drzwi ułatwiają korzystanie z szafki nawet w wąskich pomieszczeniach. WNĘTRZE 2 szuflady przydadzą się do przechowywania drobiazgów. Obuwie i preparaty do czyszczenia rozmieścisz w 3 wnękach . SZAROŚĆ I POŁYSK Korpusy mebli SALVE pokrywa szary laminat z wyrazistym rysunkiem drewna. Prezentuje się nowocześnie i elegancko. Fronty wykończono folią z połyskiem . Dzięki temu odbijają światło i sprawiają, że wnętrze wydaje się większe. NOWOCZEŚNIE I SUBTELNIE Czy zdarza Ci się w pośpiechu szukać butów lub kluczy w przedpokoju? Masz już dość nerwowej atmosfery w trakcie wychodzenia z domu? Posegreguj swoje rzeczy w schowkach kolekcji mebli SALVE i znajdź od razu to, czego potrzebujesz. Połączenie szarości i połyskującej bieli sprawia, że kolekcja wprowadza do wnętrza klimat sprzyjający wyciszeniu. W takim wnętrzu łatwiej się uspokoisz, nawet jeśli bardzo będziesz się śpieszyć.', '', 'szafka-na-buty-z-szufladami-salve', '', '', '', 'Szafka na buty z szufladami SALVE', '', '', '', ''),
(58, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. Komoda Irma świetnie sprawdzi się zarówno w pokoju dziennym, jak i w jadalni. Od ciebie zależy gdzie najlepiej spełni swoją rolę. Jasna kolorystyka wpisze się w aktualne trendy umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadzi do wnętrza wyjątkowy klimat. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WNĘTRZE Wnętrze składa się z szuflady oraz wnęk ( 2 półki) w części zamkniętej, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV. Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'komoda-irma-im3-z-oswietleniem', '', '', '', 'Komoda IRMA IM3 z oświetleniem', '', '', '', ''),
(59, 1, 1, 'Szafka RTV LENOX NEW sprawia, że nawet bardzo duży telewizor zgrabnie wkomponuje się w przestrzeń salonu. Jej geometryczna bryła daje wrażenie wizualnego ładu, a chłodna kolorystyka wprowadza do wnętrza elegancką świeżość w nowoczesnym wydaniu. Połyskujące fronty odbijają światło, powiększając optycznie przestrzeń. WNĘTRZE Szafka posiada dwie oddzielne wnęki na sprzęt. W dwóch szufladach możesz przechowywać płyty DVD oraz akcesoria do telewizora. Prowadnice wyposażono w „ hamulce ”, dzięki czemu wyeliminowano problem trzaskania. Szuflady zamykają się lekko i cicho. WYKOŃCZENIE Efektowne połączenie bieli i ciemnoszarego betonu uzyskano dzięki zastosowaniu folii PCV , która cechuje się stosunkowo dużą wytrzymałością na uszkodzenia mechaniczne i łatwo ją utrzymać w czystości. Metalowe, chromowane uchwyty i połyskująca powierzchnia frontów nadają meblowi elegancki charakter. Szafka bardzo dobrze zaprezentuje się wśród granatowych ścian, w towarzystwie zgaszonych barw pastelowych, ale i w przestrzeni, wypełnionej czernią, bielą i szarością. Meble z kolekcji LENOX NEW wkomponują się także w industrialne wnętrza.', '', 'szafka-rtv-lennox-new-2s', '', '', '', 'Szafka RTV LENNOX NEW 2S', '', '', '', ''),
(60, 1, 1, 'Szafka LENOX NEW przyda się do przechowywania zastawy stołowej i sztućców. Ustawiona w jadalni, ułatwia nakrywanie do stołu. Możesz w niej także przechowywać książki i dokumentacje rodzinną. Jej geometryczna bryła daje wrażenie wizualnego ładu, a chłodna kolorystyka wprowadza do wnętrza nowoczesną świeżość. Połyskujące fronty odbijają światło, powiększając optycznie przestrzeń. WNĘTRZE Osiem wnęk kryjących się za podwójnymi drzwiami pozwala rozdzielić przedmioty. Szeroka szuflada to idealne miejsce na drobiazgi. WYKOŃCZENIE Efektowne połączenie bieli i ciemnoszarego betonu uzyskano dzięki zastosowaniu folii PCV , która cechuje się stosunkowo dużą wytrzymałością na uszkodzenia mechaniczne i łatwo ją utrzymać w czystości. Metalowe, chromowane uchwyty i połyskująca powierzchnia frontów nadają meblowi elegancki charakter. Szafka bardzo dobrze zaprezentuje się wśród granatowych ścian, w towarzystwie zgaszonych barw pastelowych, ale i w przestrzeni, wypełnionej czernią, bielą i szarością. Meble z kolekcji LENOX NEW wkomponują się także w industrialne wnętrza.', '', 'szafka-lennox-new-4d1s', '', '', '', 'Szafka LENNOX NEW 4D1S', '', '', '', ''),
(61, 1, 1, 'Nowoczesna komoda z kolekcji CANNE to mebel, który idealnie sprawdzi się w salonie, sypialni czy w przedpokoju. Uwagę zwracają subtelny, dębowy dekor korpusu i białe, połyskujące fronty, a przede wszystkim duże, metaliczne uchwyty. Twój salon, czy sypialnia wyda się optycznie większy. Całość przykuwa wzrok i sprawia, że nie da się przejść obok niej obojętnie. Modernistyczny styl podkreśla efektowne oświetlenie, które stworzy w pomieszczeniu odpowiedni nastrój. WNĘTRZE Liczne półki, które znajdują się za zamkniętymi drzwiami, pozwolą ci uporządkować przedmioty. WYKOŃCZENIE Płyta meblowa została pokryta laminatem, a płyta mdf folią.', '', 'komoda-canne-z-oswietleniem', '', '', '', 'Komoda CANNE z oświetleniem', '', '', '', ''),
(62, 1, 1, 'Nowoczesna szafka rtv z kolekcji CANNE to mebel, który idealnie sprawdzi się w salonie. Uwagę zwracają subtelny, dębowy dekor korpusu i białe, połyskujące fronty, a przede wszystkim duże, metaliczne uchwyty. Całość przykuwa wzrok i sprawia, że nie da się przejść obok niej obojętnie. Modernistyczny styl podkreśla efektowne oświetlenie dostępne w standardzie , które stworzy w pokoju dziennym odpowiedni nastrój. Masz dużo miejsca, by wygodnie przechować wszelkie akcesoria rtv, płyty i czasopisma. WNĘTRZE Szafka RTV posiada półkę otwartą na sprzęt audio-wideo, oprócz tego mamy jeszcze do dyspozycji szufladę i dwie wnęki ukryte za zamykanymi drzwiczkami. WYKOŃCZENIE Płyta meblowa została pokryta laminatem, a płyta mdf folią.', '', 'szafka-rtv-canne-z-oswietleniem', '', '', '', 'Szafka RTV CANNE z oświetleniem', '', '', '', ''),
(63, 1, 1, 'Dzięki tej komodzie nawet w niewielkim wnętrzu stworzysz praktyczną i estetyczną aranżację. Wprowadzisz do wnętrza atmosferę sprzyjającą relaksowi. Wbudowane oświetlenie LED ułatwia korzystanie z szuflady. Geometryczna bryła i funkcjonalne rozwiązania podkreślają nowoczesny charakter wnętrza. Komodę wyposażono w specjalne hamulce, które eliminują problem trzaskających drzwi. Ślizgacze ułątwiają przesuwanie mebla. WNĘTRZE Dwie wnęki we wnętrzu komody to idealne miejsce na przechowywanie albumów ze zdjęciami lub rodzinnej dokumentacji. Pojemna szuflada przyda się na drobiazgi. WYKOŃCZENIE Mebel wykończono folią , która nadaje mu gładką strukturę i ułatwia czyszczenie. Połączenie białego połysku na froncie z oświetleniem LED tworzy elegancki klimat, a ciemna listwa w kolorze betonu przełamując minimalistyczny desing, intryguje. Kolekcja BRUGIA łączy w sobie kobiecą delikatność, z męskim zdecydowaniem, dzięki czemu dobrze zaprezentuje się zarówno w pastelowych, jak w ciemnych wnętrzach.', '', 'komoda-brugia-bugk221b-z-oswietleniem', '', '', '', 'Komoda BRUGIA BUGK221B z oświetleniem', '', '', '', ''),
(64, 1, 1, 'Komoda GLOSSY to elegancki mebel w nowoczesnym stylu. Doskonale sprawdza się w sypialni, przedpokoju lub w pokoju gościnnym. Wyposażony w trzy pojemne szuflady mebel pozwala zorganizować i uporządkować garderobę oraz osobiste drobiazgi. Fronty w białym połysku świetnie komponują się ze wszystkimi kolorami, co daje nieskończone możliwości w tworzeniu własnych aranżacji. Ponadto z racji jasnej kolorystyki Komoda GLOSSY rozświetla i optycznie powiększa przestrzeń. WYKOŃCZENIE Drzwi szuflad wykonano w systemie bezuchwytowym. Jest to eleganckie rozwiązanie, które podkreśla estetyczne walory mebla.', '', 'komoda-bialy-polysk-glossy', '', '', '', 'Komoda biały połysk GLOSSY', '', '', '', ''),
(65, 1, 1, 'Szafka ATTENTION EXCLUSIVE podkreśla nowoczesny charakter sprzętu RTV. Zawiasy i prowadnice szuflad są wyposażone w praktyczne systemy hamujące, a wygodne uchwyty dodatkowo ułatwiają korzystanie z szafki. Dzięki subtelnemu połączeniu barw i podświetleniu na froncie zaaranżujesz przestrzeń, w której można się wyciszyć. WNĘTRZE Szafkę wyposażono w zamykaną półkę, dwie szuflady i wnękę otwartą. Możesz tak rozmieścić przechowywane akcesoria, ładowarki i piloty, by mieć je zawsze w zasięgu ręki. Szare wnętrze stanowi ciekawe tło dla przechowywanych przedmiotów. WYKOŃCZENIE Meble z kolekcji ATTENTION EXCLUSIVE mają w sobie coś z futuryzmu. Przełamują symetrię przestrzeni, stosując wzornictwo oparte o figury geometryczne. Dobrze prezentują się we wnętrzach wypełnionych odcieniami szarości. Współgrają z pastelowymi dodatkami i komponują się z naturalnymi materiałami wykończeniowymi. Połyskująca powierzchnia frontów rozświetla i powiększa optycznie przestrzeń. Aby pozbyć się zabrudzeń, wystarczy przetrzeć je wilgotną szmatką, a potem wycierać na sucho.', '', 'szafka-rtv-attention-exclusive-z-oswietleniem', '', '', '', 'Szafka RTV ATTENTION EXCLUSIVE z oświetleniem', '', '', '', ''),
(66, 1, 1, 'Komoda dwudrzwiowa z serii Gray jest idealnym rozwiązaniem dla osób ceniących sobie elegancję i oryginalność. To uniwersalny mebel złożony z szuflad i półek, który dopasujesz do każdego wnętrza, bez względu na jego charakter. Nowoczesna kolorystyka, w której połączono biel i grafit będzie pasować również do pokoju młodzieżowego.', '', 'komoda-gray-gr3', '', '', '', 'Komoda GRAY gr3', '', '', '', ''),
(67, 1, 1, 'Komoda z czterema szufladami i półkami w części zamkniętej z serii Gray jest idealnym rozwiązaniem dla osób ceniących sobie elegancję i oryginalność. Nowoczesna kolorystyka, w której połączono matową biel i grafit będzie pasować do każdego pomieszczenia. Jest to kolekcja uniwersalna - można dzięki niej wyposażyć pomieszczenia o różnym przeznaczeniu i charakterze, od pokoju dziennego po biuro.', '', 'komoda-gray-gr2', '', '', '', 'Komoda GRAY gr2', '', '', '', ''),
(68, 1, 1, 'Regał wiszący otwarty ERDEN to funkcjonalny mebel, który uświetni wnętrze pokoju dziennego, młodzieżowego oraz jadalni. Prosty wzór i oszczędny design sprawiają, że najlepiej łączy się z nowoczesnym wystrojem wnętrza. Uniwersalna kolorystyka w odcieniu bieli sprawia, że pomieszczenie wydaje się większe i jaśniejsze, a ponadto dobrze łączy się z kompozycjami aranżacyjnymi. WNĘTRZE Wiszący regał ERDEN posiada trzy otwarte wnęki, które można wykorzystać pod kątem ustawienia książek, dekoracji, kwiatów, zdjęć oraz płyt z muzyką oraz filmami. WYKOŃCZENIE Regał ERDEN został wykonany z płyty meblowej wykończonej laminatem.', '', 'regal-wiszacy-otwarty-erden-125', '', '', '', 'Regał wiszący otwarty ERDEN 125', '', '', '', ''),
(69, 1, 1, 'Na szafce pod telewizor o szerokości 160 cm możesz ustawić naprawdę duży telewizor (nawet ok. 70 cali). Ciemna kolorystyka szafki DECKARD współgra z nowoczesnym wyglądem sprzętu RTV. Minimalistyczny design pozwoli w pełni skupić się na akcji oglądanego filmu. WNĘTRZE Komodę wyposażono w 2 boczne - zamykane szafki. Drzwi posiadają system push to open – dociśnij je lekko, a otworzą się automatycznie. Dodatkowa szuflada to idealne miejsce na drobne przedmioty. We wnęce otwartej możesz wygodnie przechowywać sprzęt RTV. Otwór na kable pomoże Ci zachować porządek. FORNIR JESIONOWY Front mebla jest pokryty fornirem jesionowym o głębokim - przydymionym odcieniu. Jesion słynie z dekoracyjnego usłojenia, które prezentuje się bardzo stylowo. Dzięki zastosowaniu struktury desek możesz obserwować zmieniającą się w ciągu dnia grę światła i cienia. Wykończenie ma formę półmatową. CERAMICZNE BLATY i ZŁOTE NOGI Blat mebla wykończono ceramiką o nieregularnym wzorze. Nogi z metalu pomalowano proszkowo na złoty kolor. Dzięki temu mebel prezentuje się szykownie i niepowtarzalnie. DOSTOJNY MODERNIZM Kolekcja DECKARD łączy w sobie ponadczasowy urok drewna, przepych barwy złota, prostotę stylu retro i industrialną lekkość metalu. To propozycja dla osób, które lubią we wnętrzach łączyć różne style. Dzięki kolekcji DECKARD urządzisz salon zgodnie z panującą modą, a jednocześnie będziesz mieć u siebie coś niespotykanego. Takie meble pozwolą Ci wprowadzić do salonu przepych, ale w lekkim wydaniu, trochę buntowniczym, ale na pewno unikalnym.', '', 'szafka-rtv-z-ceramicznym-blatem-fornirowana-deckard', '', '', '', 'Szafka RTV z ceramicznym blatem fornirowana DECKARD', '', '', '', ''),
(70, 1, 1, 'W komodzie wysokiej DECKARD możesz przechować kolekcję kieliszków czy rodzinnych dokumentów. Może pełnić funkcję barku, w którym przechowujesz ulubione trunki. Możesz trzymać je w jednej z 4 zamykanych szafek i częstować swoich gości, kiedy tylko zechcesz. Komoda o wysokości 141 cm pozwala przechowywać sporo przedmiotów. Możesz też wykorzystać przestrzeń blatu do wyeksponować dekoracji. WNĘTRZE Komodę wysoką wyposażono w 4 drzwi Za każdymi drzwiami masz do dyspozycji 2 wnęki. Drzwi posiadają system push to open – dociśnij je lekko, a otworzą się automatycznie. Dodatkowe 2 szuflady przydadzą się na drobne przedmioty. FORNIR JESIONOWY Front mebla jest pokryty fornirem jesionowym o głębokim - przydymionym odcieniu. Jesion słynie z dekoracyjnego usłojenia, które prezentuje się bardzo stylowo. Dzięki zastosowaniu struktury desek możesz obserwować zmieniającą się w ciągu dnia grę światła i cienia. Wykończenie ma formę półmatową. CERAMICZNE BLATY i ZŁOTE NOGI Blat mebla wykończono ceramiką o nieregularnym wzorze. Nogi z metalu pomalowano proszkowo na złoty kolor. Dzięki temu mebel prezentuje się szykownie i niepowtarzalnie. DOSTOJNY MODERNIZM Kolekcja DECKARD łączy w sobie ponadczasowy urok drewna, przepych barwy złota, prostotę stylu retro i industrialną lekkość metalu. To propozycja dla osób, które lubią we wnętrzach łączyć różne style. Dzięki kolekcji DECKARD urządzisz salon zgodnie z panującą modą, a jednocześnie będziesz mieć u siebie coś niespotykanego. Takie meble pozwolą Ci wprowadzić do salonu przepych, ale w lekkim wydaniu, trochę buntowniczym, ale na pewno unikalnym.', '', 'komoda-wysoka-fornirowana-z-ceramicznym-blatem-deckard', '', '', '', 'Komoda wysoka fornirowana z ceramicznym blatem DECKARD', '', '', '', ''),
(71, 1, 1, 'W komodzie o gabarytach stołu DECKARD możesz przechować całe kolekcje płyt muzycznych, filmów czy gier planszowych. Komoda może także pełnić funkcję barku czy kredensu. Spory blat to idealne miejsce na wyeksponowanie dekoracji i pamiątek. Komoda o szerokości 160 cm estetycznie wypełni przestrzeń przy ścianie w salonie lub jadalni. WNĘTRZE Komodę wyposażono w 4 drzwi Za każdymi drzwiami masz do dyspozycji 2 wnęki. Drzwi posiadają system push to open – dociśnij je lekko, a otworzą się automatycznie. FORNIR JESIONOWY Front mebla jest pokryty fornirem jesionowym o głębokim - przydymionym odcieniu. Jesion słynie z dekoracyjnego usłojenia, które prezentuje się bardzo stylowo. Dzięki zastosowaniu struktury desek możesz obserwować zmieniającą się w ciągu dnia grę światła i cienia. Wykończenie ma formę półmatową. CERAMICZNE BLATY i ZŁOTE NOGI Blat mebla wykończono ceramiką o nieregularnym wzorze. Nogi z metalu pomalowano proszkowo na złoty kolor. Dzięki temu mebel prezentuje się szykownie i niepowtarzalnie. DOSTOJNY MODERNIZM Kolekcja DECKARD łączy w sobie ponadczasowy urok drewna, przepych barwy złota, prostotę stylu retro i industrialną lekkość metalu. To propozycja dla osób, które lubią we wnętrzach łączyć różne style. Dzięki kolekcji DECKARD urządzisz salon zgodnie z panującą modą, a jednocześnie będziesz mieć u siebie coś niespotykanego. Takie meble pozwolą Ci wprowadzić do salonu przepych, ale w lekkim wydaniu, trochę buntowniczym, ale na pewno unikalnym.', '', 'komoda-niska-fornirowana-z-ceramicznym-blatem-deckard', '', '', '', 'Komoda niska fornirowana, z ceramicznym blatem DECKARD', '', '', '', ''),
(72, 1, 1, 'Szafka RTV BERGEN pomaga uporządkować przestrzeń pod telewizorem, a jednocześnie wprowadza do wnętrza rustykalny klimat. Ciemna listwa dekoracyjna komponuje się z czarną barwą sprzętu RTV. Tzw. ślizgacze ułatwiają precyzyjne ustawienie mebla oraz jego przesuwanie podczas sprzątania. WNĘTRZE W trzech wnękach pomieścisz zarówno dekoder, wieżę, jak i konsolę do gier. Wymiary wnęk: głębokość 38,5 cm, wysokość 14 cm, szerokość 47 cm lewa i prawa, 37,5 część środkowa. Szuflady przydadzą się na kable, płyty i dokumentację. WYKOŃCZENIE Laminat, imitujący wyraźną strukturę drewna dębowego w kolorze „wotan” ociepla wnętrze i nadaje mu swojskiego charakteru. Ciemny dekor umożliwia estetyczne wkomponowanie mebli w nowoczesne wnętrza. Wystrój dopełnią drewniane dekoracje lub dodatki w czarnym kolorze.', '', 'szafka-rtv-bergen', '', '', '', 'Szafka RTV BERGEN', '', '', '', ''),
(73, 1, 1, 'Bufet MAGALE w ciemnej tonacji brązu to mebel, który łączy cechy klasyki i nowoczesności. Usytuowany w jadalni, salonie lub pokoju dziennym zwraca uwagę funkcjonalnością oraz dyskretną elegancją, którą podkreślają nóżki oraz uchwyty w kolorze anodowanej miedzi. Bufet MAGALE współgra z aranżacjami utrzymanymi w ciepłej kolorystyce, kojarzoną z wygodą i komfortem. WNĘTRZE Bufet MAGALE to idealny mebel do przechowywania dodatkowych sztućców, obrusów, serwetek oraz innych przydatnych akcesoriów. Dla większej wygody użytkowania drzwi oraz szuflady zostały wyposażone system zamykania z cichym domykiem. WYKOŃCZENIE Korpus z płyty MDF o grubości 15 mm został wykończony fornirem z widocznymi słojami drewna. Zabieg ten nadaje wrażenie, że mebel został wykonany z naturalnego drewna o głębokim brązowym odcieniu. Bufet MAGALE wizualnie pasuje zarówno do jasnych, jak i ciemniejszych wnętrz oraz dodatków w szarym kolorze.', '', 'bufet-magale-2d3sz-m2409001', '', '', '', 'Bufet MAGALE 2D+3SZ M2409001', '', '', '', ''),
(74, 1, 1, 'Masz dość białych, lakierowanych frontów? Wybierając komodę SEVILLA stworzysz unikalne, nowoczesne wnętrze współczesnego salonu . Postaw ją w towarzystwie dzieł mistrzów polskiego plakatu, wśród modnych, egzotycznych kwiatów – uzyskując modernistyczną , pełną inspiracji aranżację. Wyznaczaj trendy wśród swoich znajomych. WNĘTRZE Komody SEVILLA podzielone jest na 10 wnęk, które możesz przeznaczyć na książki, niezbędne dokumenty lub cenne pamiątki rodzinne. Komoda posiada ozdobny akcent w postaci wnęki wykończonej okleiną naturalną w kolorze ciepłego dębu , zamykanej ciemnym, szklanym , hartowanym frontem . Możesz za nim umieścić ozdobną ceramikę, flakon perfum lub szkatułkę z biżuterią. Fronty umieszczone są na metalowych zawiasach . Półki z płyty meblowej wykończone laminatem , pozwolą Ci w łatwy sposób sprzątnąć ukrywający się w rogach kurz; WYKOŃCZENIE Korpus komody SEVILLA wykończony jest w eleganckim kolorze arktycznej szarości . Z zewnątrz pokryty jest matowym lakierem , wewnątrz laminatem – w znaczący sposób ułatwiającym utrzymanie czystości. Metalowe uchwyty stanowią ozdobę lakierowanych frontów z płyty MDF . To praktyczne rozwiązanie, które pomoże uniknąć rys i pęknięć podczas otwierania komody. Unikalny kształt i proste geometryczne podziały bryły podkreślają jej modernistyczny charakter.', '', 'nowoczesna-komoda-do-salonu-z-szyba-sevilla', '', '', '', 'Nowoczesna komoda do salonu z szybą SEVILLA', '', '', '', ''),
(75, 1, 1, 'Komoda FARGO z gracją wkomponuje się we wnętrze pokoju młodzieżowego, utrzymanego w nowoczesnym tonie oraz w pomieszczenia stylizowane na klimat industrialny. Fronty, przypominające strukturą beton, zostały zestawione z korpusami wykończonymi okleiną w ciepłym dekorze drewna, zdobionej dekoracyjnym nadrukiem. Takie połączenie tworzy harmonijny duet podkreślając jednocześnie nieszablonowy charakter mebla. Metalowe uchwyty dopełniają całość. Mnogość brył systemu pozwala na funkcjonalne wyposażenie pokoju nastolatka. WNĘTRZE Komoda została wyposażona w trzy szuflady wysuwane za pomocą prowadnicy kulkowej. WYKOŃCZENIE Mebel został pokryty laminatem, który charakteryzuje się trwałością oraz jest łatwy w utrzymaniu czystości.', '', 'komoda-do-pokoju-mlodziezowego-fargo', '', '', '', 'Komoda do pokoju młodzieżowego FARGO', '', '', '', ''),
(76, 1, 1, 'Regał EXETER to mebel o nowoczesnym designie, uniwersalny pod kątem użytkowym. Połączenie metalowego stelaża i płyty MDF tworzy solidną konstrukcję, która doskonale prezentuje się zarówno w przestronnych, jak i kameralnych wnętrzach. Różna wysokość półek sprawia, że można na nich umieścić dokumenty, książki, zdjęcia oraz inne drobiazgi, elementy dekoracyjne oraz kwiaty i tym samym stworzyć własną, oryginalną aranżację. Regał EXETER stanowi istotne dopełnienie dla wnętrza pokoju dziennego, młodzieżowego oraz domowego gabinetu. WYKOŃCZENIE Na szczególną uwagę zasługuje oprawa kolorystyczna regału EXETER . Jasne wybarwienie dębu dzikiego świetnie komponuje się ze ciemnym, matowym stelażem. Całość idealnie pasuje do jasnych, pełnych światła wnętrz.', '', 'regal-exeter', '', '', '', 'Regał EXETER', '', '', '', ''),
(77, 1, 1, 'Na standardową szafkę zabrakło miejsca? Komoda BERGEN 1D1S wpasuje się nawet w małą przestrzeń, przekształcając ją w funkcjonalny kącik do przechowywania. Komoda łączy cechy rustykalnego mebla z nowoczesnymi elementami wykończeniowymi. Wraz z pozostałymi meblami z serii, tworzy aranżację o sielskim charakterze, wprowadzając do wnętrz przytulny klimat. Ze względu na dużą różnorodność brył, meble te można wkomponować w otwarte, wielofunkcyjne przestrzenie. Tzw. ślizgacze ułatwiają precyzyjne ustawienie mebla oraz jego przesuwanie podczas sprzątania. WNĘTRZE W szafce z półką możesz przechowywać tekstylia, albumy ze zdjęciami lub akcesoria (np. do czyszczenia butów). Praktyczna szuflada przyda się na małe przedmioty. WYKOŃCZENIE Laminat, imitujący wyraźną strukturę drewna dębowego w kolorze „wotan” ociepla wnętrze i nadaje mu swojskiego charakteru. Metalowy uchwyt i ciemny dekor umożliwiają estetyczne wkomponowanie mebli w nowoczesne wnętrza. Wystrój dopełnią drewniane dekoracje lub dodatki w czarnym kolorze.', '', 'komoda-bergen-1d1s', '', '', '', 'Komoda BERGEN 1D1S', '', '', '', ''),
(78, 1, 1, 'Szukasz funkcjonalnej i praktycznej komody do salonu albo sypialni ? Potrzebujesz nie tylko szuflad, ale też pojemnych półek ? Komoda z szufladami loft MADERA to mebel, który spełni Twoje oczekiwania. Dzięki połączeniu modnych kolorów: jasnego dębowego drewna i czerni , komodę MADERA dopasujesz do pomieszczeń urządzonych w stylu nowoczesnym , industrialnym , ale także minimalistycznym . Mebel doskonale pokreśli piękno surowych materiałów , takich jak; beton , szkło i metal . WNĘTRZE 4 szuflady na tekstylia i lżejsze przedmioty pozwolą Ci zachować perfekcyjny porządek wśród eleganckich dodatków i akcesoriów. 2 półki tworzące symetryczne 4 wnęki , na których zmieszczą się rzeczy o wadze do 4 kg . WYKONANIE Komodę z szufladami w loftowym stylu z serii MADERA wykonano z 16 mm płyty meblowej . Mebel pokryto laminatem w kolorze dębu Grandson . Jasny odcień drewna w połączeniu z czarnymi elementami sprawia, że komoda podkreśli każdy nowoczesny lub industrialny salon . W drzwiach i szufladach komody zamontowano metalowe , szerokie , czarne uchwyty . Nogi mebla zostały zrobione z tworzywa sztucznego w kolorze czarnym .', '', 'komoda-z-szufladami-loft-madera', '', '', '', 'Komoda z szufladami loft MADERA', '', '', '', ''),
(79, 1, 1, 'Leniwy weekend spędzony na wspólnym oglądaniu filmów? Romantyczny wieczór w towarzystwie trzasków ulubionej, winylowej płyty? Loftowa szafka MADERA to nieodzowna towarzyszka domowej rozrywki . Na blacie postawisz telewizor albo gramofon. W szafkach zlokalizowanych po bokach; płyty i kolekcję filmów . Szafkę RTV MADERA, podobnie jak pozostałe meble z tej kolekcji , dopasujesz do pomieszczeń urządzonych w stylu loftowym i industrialnym . Wstaw ją do jasnego salonu albo pokoju dziennego i relaksuj się tak, jak lubisz. WNĘTRZE W 2 wnękach znajdujących się po obu stronach mebla zmieścisz pudełka z muzyką i filmami. Pośrodku znajdziesz 2 przestrzenie , które tworzy szklana półka . Na półkach zmieści się dekoder telewizji kablowej oraz konsola . WYKONANIE Loftową szafkę RTV z kolekcji MADERA wykonano z płyty meblowej o grubości 16 mm . Konstrukcję szafki oraz fronty pokryto laminatem w kolorze jasnego dębu Grandson . Uchwyty mebla z metalu w kolorze czarnym podkreślą nowoczesny wygląd bryły. Czarne nogi szafki RTV zostały wykonane z tworzywa sztucznego. Szklana półka to przeźroczyste szkło o grubości 5 mm .', '', 'szafka-rtv-loft-madera', '', '', '', 'Szafka RTV loft MADERA', '', '', '', ''),
(80, 1, 1, 'Komoda HUD jest idealnym dopełnieniem dla wnętrza pokoju dziennego, salonu lub jadalni, a jej design oparty jest na prostocie, nowoczesności i funkcjonalności. Oryginalna kolorystyka dębu klepkowego wzbogacona ciemnymi wstawkami jest doskonałym pomysłem na urozmaicenie wnętrza oraz nadania mu surowego, naturalnego piękna. Szeroka i pojemna komoda wyposażona w szuflady, zamykane szafki i wnęki jest meblem, który doskonale nadaje się do przechowywania elementów zastawy, dokumentów, ubrań oraz innych potrzebnych drobiazgów. Blat można wykorzystać jako przestrzeń ekspozycyjną dla kwiatów lub dekoracji. Komodę HUD można ją zestawić z innymi bryłami kolekcji, jednak sprawdza się również jako pojedynczy mebel, który można dopasować do własnej, indywidualnej koncepcji aranżacji pomieszczenia. WNĘTRZE Komoda HUD posiada zamykaną szafkę z 4 półkami oraz 4 szuflady na prowadnicach kulkowych. 2 otwarte wnęki zostały umieszczone pod blatem. Półki posiadają możliwość obciążenia do 5 kg, natomiast blat 20 kg. WYKOŃCZENIE Komoda HUD została wykonana z płyty meblowej wykończonej folią. Gustownym dopełnieniem są metalowe uchwyty w czarnym kolorze, które korespondują z profilem spełniającym role nóżek mebla. Do komody HUD można zamontować za dopłatą 2-punktowe oświetlenie typu Square o ciepłej barwie.', '', 'komoda-hud-2d4s-hudk231-c791', '', '', '', 'Komoda HUD 2D4S HUDK231-C791', '', '', '', ''),
(81, 1, 1, 'Szukasz dużej komody do salonu wypełnionego roślinami? Mamy dla Ciebie komodę z kolekcji POLYPODY z miejscem do przechowywania kwiatów w specjalnej skrzyni. Komoda ma wbudowaną skrzynię na rośliny, do której należy dokupić wkład z materiału nieprzepuszczającego wodę. Do komody możesz dokupić specjalne oświetlenie o fioletowej barwie, która imituje światło dzienne, dzięki czemu przyśpiesza wzrost roślin. ZA ZAMKNIĘTYMI DRZWIAMI Skorzystasz z 4 zamykanych wnęk - idealnych do trzymania dokumentów oraz kolekcji płyt. Do przechowywania kabli i akcesoriów przydadzą się 3 szuflady . Skrzynkę umieszczoną w blacie możesz wykorzystać jako kwietnik. Dokup donicę z tworzywa, by przechowywać w niej rośliny w bezpieczny sposób. NIE TYLKO DO SALONU URBAN JUNGLE Z komodą wyposażoną w specjalne donice na roślinność stworzysz zielony kącik sprzyjający koncentracji i wyciszeniu. Komoda z miejscem na rośliny idealnie wpasuje się w pokój wypełniony kwiatami, egzotycznymi roślinami i dekoracjami z motywem dżungli. Metalowe nogi i imitacja drewna sprawiają, że meble sprawdzą się także w surowych - loftowych wnętrzach. OZNACZONA ZŁOTYM MEDALEM Kolekcja mebli POLYPODY otrzymała Złoty Medal MTP na Targach Meble Polska 2022. Została stworzona z myślą o osobach, które chcą przebywać w otoczeniu zieleni również w swoich mieszkaniach. Meble z tej kolekcji pozwalają wyeksponować rośliny bez konieczności kupowania dodatkowych stojaków.', '', 'komoda-z-miejscem-na-kwiaty-i-3-szufladami-polypody', '', '', '', 'Komoda z miejscem na kwiaty i 3 szufladami POLYPODY', '', '', '', ''),
(82, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 2 drzwi, w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie komody z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykaną szafkę wypełnione 3 półkami ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce imitującej stare drewno ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-wysoka-2d-loft', '', '', '', 'Komoda TEMPRA 2 wysoka 2D loft', '', '', '', ''),
(83, 1, 1, 'Regał TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. ● cechuje go duża funkcjonalność ● doskonale nadaje się do wnętrz kameralnych oraz przestrzeni związanej z pracą Świetnym przykładem wykorzystania tej przestrzeni jest model regału z 3 wnękami. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie regału z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Regał TEMPRA 2 został wykonany z płyty meblowej, pokrytej folią. ● Całość utrzymana jest w tonacji kolorystycznej imitującej stare drewno', '', 'regal-tempra-2-z-3-wnekami-loft', '', '', '', 'Regał TEMPRA 2 z 3 wnękami LOFT', '', '', '', ''),
(84, 1, 1, 'Kolekcja LOFT doskonale sprawdzi się w salonie jasnym, nowoczesnym, akcentującym nietuzinkowe rozwiązania wnętrzarskie. Oryginalność designu łączy spokojną barwę jasnego odcienia dębu artisan z czarnymi elementami. Eleganckie meble z kolekcji LOFT świetnie wpasują się we wnętrza nowoczesne i industrialne, ale także te utrzymane w stylu nowojorskim, stawiającym na połączenie klasycznej elegancji z przeszkleniami i mocnymi akcentami kolorystycznymi. WNĘTRZE Komoda LOFT wyposażona jest w półkę zamykaną w szafce oraz trzy przestronne szuflady, dzięki czemu stwarza spore możliwości przechowywania i utrzymania porządku w sypialni lub salonie. WYKOŃCZENIE Korpus komody, półki oraz fronty zostały wykonane z płyty meblowej pokrytej laminatem, dzięki czemu mebel jest solidny, odporny na uszkodzenia i łatwy do utrzymania w czystości. Stylowe, metalowe nóżki dodają meblowi lekkości. Utrzymane w czarnej tonacji pięknie korespondują z uchwytem, wnęką półek oraz zdobnym elementem wzdłuż korpusu podkreślając nietuzinkową elegancję komody.', '', 'komoda-loft-lt2-1d3s', '', '', '', 'Komoda LOFT LT2 1D3S', '', '', '', ''),
(85, 1, 1, 'Płyty i sprzęt możesz wygodnie przechować w szafce RTV BARI. Dzięki sprytnie rozdzielonym wnękom, uporządkujesz swoje rzeczy osobiste w taki sposób, by dłużej zachować porządek. Spójny efekt aranżacyjny uzyskasz, jeśli zestawisz go z pozostałymi meblami z kolekcji BARI. WNĘTRZE W zamykanej szafce znajduje się 1 półka (2 wnęki) , na której możesz przechowywać przedmioty ważące 5 kg. W 2 otwartych wnękach możesz wyeksponować dekoder i konsolę. Wymiary wnęki dolnej: szerokość 45,5 cm, głębokość 42,5 cm, wysokość 19 cm Wymiary wnęki górnej: szerokość 45,5 cm, głębokość 42,5 cm, wysokość 17 cm WYKOŃCZENIE Meble z kolekcji BARI wykończono laminatem, który imituje strukturę jasnego drewna. Połączenie wybarwienia dębu piaskowego z szarością sprawia, że meble BARI pozwalają stworzyć jasną aranżację w salonie. Industrialny charakter kolekcji podkreślają metalowe uchwyty i nóżki. Meble BARI estetycznie prezentują się wśród betonowych ścian i metalowych dodatków.', '', 'szafka-rtv-bari-2d-140', '', '', '', 'Szafka RTV BARI 2D/140', '', '', '', ''),
(86, 1, 1, 'Potrzebujesz pojemnej, a zarazem stylowej komody, która wpasuje się w Twoje minimalistyczne wnętrze? KASTENOS charakteryzuje się industrialnymi nóżkami i stylowym ręcznym zdobieniem w formie jodełki na froncie. To propozycja dla tych, którzy lubią łączyć postarzane dodatki z nowoczesnym wystrojem wnętrza. Zestaw komodę z pozostałymi meblami z serii - stwórz unikalny i przytulny klimat w swoim wnętrzu z kolekcją KASTENOS! Najważniejsze cechy: Wyposażony w 3 praktyczne szuflady i 4 wnęki Wykonany w dużej części z drewna Posiada industrialne nóżki Zachwyca minimalistyczną formą Ma stylowe ręczne zdobienie w formie jodełki na froncie 3 SZUFLADY, 4 WNĘKI Komoda ma 45 cm głębokości - zmieści się w niewielkim salonie lub wąskim przedpokoju. Pozwoli przechować przedmioty w różnym rozmiarze - posiada 3 szuflady i 4 wnęki. Zawiasy wyposażono w tzw. cichy domyk, dlatego możesz mieć pewność, że żaden hałas nie będzie rozpraszał Twoich bliskich. RĘCZNIE ZDOBIONE FRONTY Na każdym froncie ręcznie układano drewniane listwy w taki sposób, by powstał nietypowy wzór w jodełkę. Wybierając KASTENOS stawiasz na unikalne rozwiązania. Każdy mebel z kolekcji KASTENOS jest jedyny w swoim rodzaju. MINIMALIZM W ODSŁONIE VINTAGE Meble z kolekcji KASTENOS nawiązują do stylu vintage oraz charakteryzują się minimalizmem. Śmiało zestawiaj je z nowoczesnymi dodatkami, budując unikalny i przytulny klimat w swoim wnętrzu. WYKOŃCZENIE Blat wykonano z naturalnego drewna, które zabezpieczono lakierem UV. Dzięki temu długo będziesz się cieszyć jego oryginalnym urokiem. Jego ciepły odcień i wyrazista struktura z ręcznym zdobieniem na froncie pozwolą Ci stworzyć przytulny klimat w Twoim wnętrzu. Wysokie, industrialne nóżki ułatwią Ci codzienne porządki i dodadzą Twojemu wnętrzu przestronności.', '', 'komoda-drewniana-z-frontem-w-jodelke-kastenos', '', '', '', 'Komoda drewniana z frontem w jodełkę KASTENOS', '', '', '', ''),
(87, 1, 1, 'Nowoczesny telewizor będzie się prezentować jeszcze lepiej na szafce z drewna i metalu. Szafka RTV JANNE sprawi, że salon nabierze industrialnego charakteru. Teraz możesz mieć bezpośredni dostęp do konsoli i dekodera, bo szafka posiada aż 2 wnęki otwarte na sprzęt. W szafkach zamkniętych możesz przechowywac akcesoria i płyty. Wnętrze 3 półki z płyty meblowej wykończonej fornirem udźwigną nawet 25 kg ciężar . Zawiasy z samodomykiem sprawiają, że drzwi nie trzaskają. Industrialny styl Meble w industrialnym stylu sprawiają, że wnętrza wydają się bardziej przestronne. Salon - loft to idealne miejsce na spotkania z przyjaciółmi, gdzie możecie godzinami wspólne biesiadować i słuchać dobrej muzyki. Dąb bałkański i metal Do wykończenia mebli z kolekcji JANNE użyto forniru dębowego. Olejowana powierzchnia podkreśla naturalne usłojenie drewna i zabezpiecza je przed wilgocią i zarysowaniem. Przy odpowiedniej pielęgnacji meble będą służyć długo. Wyraźnie wyczuwalna struktura drewna nadaje meblom niepowtarzalny efekt trójwymiarowości. Dąb bałkański charakteryzuje się różnorodną kolorystyką, która tworzy nieregularny rysunek drewna. By wydobyć kontrast między ciepłym drewnem a mrocznym metalem, nóżki i uchwyty z metalu pomalowano na czarno.', '', 'szafka-rtv-janne-2d', '', '', '', 'Szafka RTV JANNE 2D', '', '', '', ''),
(88, 1, 1, 'Jeśli zawsze brakuje Ci miejsca, aby pomieścić wszystko, co uważasz za istotne, komoda z serii KING z pewnością zwróci Twoją uwagę. Tylko od Ciebie zależy, co do niej włożysz i co na niej ułożysz. Masz do dyspozycji 4 wnęki za drzwiami oraz 3 szufladki , w których zmieścisz zarówno niższe, jak i wyższe przedmioty. Mebel utrzymany w odcieniach jasnego , dębowego drewna z elementami w kolorze czarnym pasuje do nowoczesnych , loftowych pomieszczeń. WNĘTRZE 4 wnęki stworzone przez 2 półki o udźwigu 30 kg schowane za pełnymi drzwiami – to optymalna przestrzeń na przechowywanie. Stworzą idealne miejsce nie tylko dla Twojej odzieży, możesz w nich umieścić także ręczniki lub luksusowy komplet pościeli . 3 szuflady umieszczone w centralnej części komody pomogą Ci zachować porządek wśród designerskich dodatków . WYKOŃCZENIE Korpus komody wykonano z płyty meblowej o grubości 18 mm , w odcieniu jasnego, dębowego drewna . Aby podkreślić indywidualny styl komody industrialnej KING, drzwiczki mebla wykonano z drewna oraz wykończono olejem . W szufladach i szafkach zamontowano aluminiowe uchwyty w czarnym kolorze . Szufladki domykają się w łatwy sposób dzięki specjalnemu systemowi. Konstrukcję osadzono na czarnych , metalowych nogach .', '', 'komoda-industrialna-z-szufladami-king', '', '', '', 'Komoda industrialna z szufladami KING', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(89, 1, 1, 'Kolekcja LAFABRICA to włoskie meble, które przełamują tradycyjne, południowe wzornictwo zaskakująco łącząc je ze skandynawską elegancją. Industrialna stylistyka komody świetnie zestawia jasną kolorystykę w barwie dębu artisan z ciemnym, imitującym beton dekorem nawiązując do surowego minimalizmu japońskiego. Komoda pięknie wyróżni się więc we wnętrzach nowoczesnych, industrialnych oraz tych, których aranżacja hołduje prostocie i kolorystycznemu ascetyzmowi. WNĘTRZE Szeroki blat komody w jasnym wybarwieniu pięknie wyeksponuje ustawione fotografie w ramkach, świeczki oraz wazony z kwiatami; 2 pojemne, zamykane półki idealnie nadają się do przechowywania ubrań, bielizny i akcesoriów w sypialni i garderobie; Regał został uzupełniony o dwie szuflady , dzięki którym znacząco zwiększa się przestrzeń do przechowywania. WYKOŃCZENIE Korpus oraz blat są wykonane z wzmocnionej płyty meblowej o grubości 30 mm , dzięki czemu mebel jest bardziej wytrzymały i znosi znaczniejsze obciążenia; Komoda jest wykończona laminatem , który ma bardzo przyjemną w dotyku, gładką teksturę oraz łatwo utrzymać go w czystości; Niezwykle stylowe, charakterystyczne nogi mebla wykonano z metalu , który pięknie koresponduje kolorystycznie z wykończeniem frontów.', '', 'komoda-lafabrica-2d2s', '', '', '', 'Komoda LAFABRICA 2D2S', '', '', '', ''),
(90, 1, 1, 'Nie ważne, czy grasz, czy oglądasz. Ważne, żebyś robił to z klasą . Szafka RTV KING to mebel, który doda szyku nowoczesnym , industrialnym pomieszczeniom. Połączenie modnej czerni z kolorem naturalnego dębu sprawia, że szafkę industrialną KING dopasujesz do wnętrz o loftowym charakterze . Pokój dzienny, a może gabinet? Wybór zależy od Ciebie! Urządzając wyjątkowe mieszkanie, sprawdź pozostałe meble z kolekcji KING. WNĘTRZE Na blacie zmieścisz telewizor lub stylowy gramofon – unikatową pamiątkę po dziadku. 2 otwarte półki pośrodku szafki, to miejsce, w którym można postawić dekoder i pady do gier – pomocne podczas podłączenia sprzętu okażą się otwory w tyle szafki. Na 4 symetrycznych półkach po bokach szafki, za pełnymi drzwiami, schowasz gry, piloty oraz to, co lubisz mieć pod ręką w domowym centrum rozrywki . Półki wewnątrz szafki RTV udźwigną rzeczy o wadze do 30 kg . WYKOŃCZENIE Szafkę RTV KING wykonano z płyty meblowej o grubości 18 mm. Korpus mebla pokryto melaminą w kolorze jasnego , naturalnego dębu – dzięki niej boki szafki w łatwy sposób utrzymasz w czystości. Industrialny charakter mebla podkreślają olejowane , drewniane fronty . W drzwiach zamontowano czarne , aluminiowe uchwyty . Nogi mebla zostały zrobione z metalu w czarnym kolorze .', '', 'szafka-rtv-industrialna-king', '', '', '', 'Szafka RTV industrialna KING', '', '', '', ''),
(91, 1, 1, 'Kolekcja EXETER doskonale dopełnienia wnętrza urządzone w nowoczesnym stylu, w których króluje minimalizm i funkcjonalność. Wyraźnie geometryczna bryła świetnie komponuje się z kameralnymi wnętrzami, nie dominuje przestrzeni i jest bardzo uniwersalna w użytkowaniu. Regał EXETER stanowi istotne dopełnienie dla wnętrza pokoju dziennego, młodzieżowego oraz domowego gabinetu; Ciekawe rozmieszczenie półek sprzyja ustawieniu na nim nie tylko kolekcji książek ale również przedmiotów o bardziej wyszukanym zastosowaniu, które dobrze mieć pod ręką. Można ustawić na niej kolekcje modeli, statyw, tubę na szkice lub wysokie dekoracje z naturalnych lub sztucznych kwiatów; Stelaż regału jest wykonany z metalu , a półki z płyty MDF , dlatego regał jest lekki i łatwo go przestawić; Wybarwienie stolika w przyjemnym, jasnym kolorze dębu dzikiego pięknie koresponduje z matowym wykończeniem czarnej ramy .', '', 'regal-loftowy-exeter', '', '', '', 'Regał loftowy EXETER', '', '', '', ''),
(92, 1, 1, 'Biała komoda QUEBEC to mebel w najbardziej uniwersalnym kolorze, dzięki któremu łatwo dopasujesz ją do wielu aranżacji. Biel będzie niezastąpiona wszędzie tam gdzie w pomieszczeniu jest niewiele światła, rozjaśniając optycznie pomieszczenie. Komoda znajdzie swoje zastosowanie w przedpokoju, jadalni, salonie czy sypialni. Proste uchwyty w srebrnym kolorze doskonale pasują do bryły mebla. WNĘTRZE Wnętrze jest wyposażone w 3 wnęki za drzwiami i 4 szuflady , co ułatwia rozmieszczenie potrzebnych rzeczy. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej pokrytej laminatem, front mebla jest wykonany z płyty MDF pokrytej folią PCV.', '', 'komoda-quebec-2', '', '', '', 'Komoda QUEBEC 2', '', '', '', ''),
(93, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 2 drzwi oraz 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie komody z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz 2 szuflady ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce imitującej stare drewno ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-niska-2d2s-loft', '', '', '', 'Komoda TEMPRA 2 niska 2D2S loft', '', '', '', ''),
(94, 1, 1, 'Komoda JAKOBINA świetnie sprawdzi się we wnętrzach urządzonych w stylu industrialnym, którego cechami charakterystycznymi są duże, wysokie przestrzenie, surowe materiały, minimalizm oraz prostota. Piękny kolor dębu połączony z czarnymi wstawkami z łatwością wpisze się w aranżacje sypialni urządzonych w takich klimatach. Ściany wykonane z betonu lub cegły będą doskonałym tłem do jej wyeksponowania. Właściwie dobrane dodatki podkreślą charakter wnętrza i dopełnią gustowną aranżację. W skład kolekcji wchodzą również szafy o szerokości 220 i 270 cm, łóżko oraz szafki nocne. Wnętrza urządzone w stylu industrialnym są obecnie uznawane za symbol dobrego smaku oraz wyrafinowanej elegancji. Zaaranżuj swoje wnętrze z kolekcją JAKOBINA . WNĘTRZE Komoda posiada trzy szuflady, w których z łatwością rozmieścisz swoje rzeczy. WYKOŃCZENIE Okleina, którą pokryto mebel, pięknie oddaje naturalne usłojenie drewna. Ciepły kolor dębu w połączeniu z czarnymi wstawkami tworzy spójną całość.', '', 'komoda-jakobina-sirius-crown', '', '', '', 'Komoda JAKOBINA/SIRIUS CROWN', '', '', '', ''),
(95, 1, 1, 'Szafka HUD jest idealnym dopełnieniem dla wnętrza pokoju dziennego, salonu lub jadalni, a jej design oparty jest na prostocie, nowoczesności i funkcjonalności. Oryginalna kolorystyka dębu klepkowego wzbogacona ciemnymi wstawkami jest doskonałym pomysłem na urozmaicenie wnętrza oraz nadania mu surowego, naturalnego piękna. Pojemna szafka HUD wyposażona została w zamykane półki oraz dwie otwarte wnęki. Jest meblem doskonale nadaje się do przechowywania elementów zastawy, książek dokumentów, ubrań oraz innych potrzebnych drobiazgów. Otwarte półki można wykorzystać jako przestrzeń ekspozycyjną dla drobiazgów dekoracyjnych. Szafkę można ją zestawić z innymi bryłami kolekcji HUD . Sprawdza się też jako pojedynczy mebel, który można dopasować do własnej, indywidualnej koncepcji aranżacji pomieszczenia. WNĘTRZE Szafka HUD posiada przestronne wnętrze wypełnione aż 8 półkami. Dodatkowo w środkowej części mebla znajdują się 2 wnęki. Półki posiadają możliwość obciążenia do 5 kg. WYKOŃCZENIE Szafka HUD została wykonana z płyty meblowej wykończonej folią. Gustownym dopełnieniem są metalowe uchwyty w czarnym kolorze, które korespondują z profilem spełniającym role nóżek mebla. Do szafki HUD można zamontować za dopłatą 2-punktowe oświetlenie typu Square o ciepłej barwie.', '', 'szafka-hud-4d-huds422-c791', '', '', '', 'Szafka HUD 4D HUDS422-C791', '', '', '', ''),
(96, 1, 1, 'Komoda LAFABRICA OFFICE , jest meblem zaprojektowanym od podstaw do biura, zwłaszcza w stylu typowo industrialnym. Komoda nadaje się do każdego pomieszczenia, ale w biurze sprawdzi się najlepiej ze względu na wzmocnienia w konstrukcji przydatne przy większych obciążeniach. Na komodzie możemy przechowywać segregatory czy inne przedmioty biurowe. Modna kolorystyka trafia doskonale w wizerunek współczesnego biura. Korpus mebla pokryto laminatem w dekorze dębowym, natomiast front mebla laminatem w dekorze tadao. Otrzymany w ten sposób kontrast sprawia, że cały mebel wygląda znacznie ciekawiej. Do stworzenia korpusu wykorzystano płyty meblowe o grubości aż 38 mm, co odpowiednio wzmacnia całą konstrukcję. WNĘTRZE Wnęki, przegrody, otwierane drzwi klapowe i dwie szuflady zostaną wykorzystane w pełni w każdym biurze. Zastosowane prowadnice rolkowe w szufladach także są przystosowane do większego obciążenia niż inne typy prowadnic. WYKOŃCZENIE Komoda ustawiona jest na metalowych nogach, nadających bryle solidności, podobnie jak uchwyty, wykonane z metalu .', '', 'komoda-lafabrica-office-bs4769k71705', '', '', '', 'Komoda LAFABRICA OFFICE BS4769K71705', '', '', '', ''),
(97, 1, 1, 'Urządzasz mieszkanie w industrialnym stylu? Kolekcja mebli HIGH ROCK to połączenie dekoru dąb riviera z pełną głębi czernią, która przyciągnie Twoją uwagę. Komoda HIGH ROCK to praktyczny mebel do salonu, jadalni czy domowego biura. Duża ilość zamykanych wnęk pozwoli Ci na uporządkowanie ubrań, zastawy stołowej, książek czy dokumentów. Może pełnić też funkcję biblioteczki. WNĘTRZE Komoda posiada 8 zamykanych wnęk, dzięki którym rozważnie uporządkujesz potrzebne przedmioty. W środkowej części mebla możesz umieścić niewielkie dekoracje, płyty lub czasopisma. WYKOŃCZENIE Komoda HIGH ROCK została wykonana z płyty meblowej oraz wykończona laminatem i folią. Fronty komody pokryte są folią w kolorze dąb riviera. Blat wykończony jest płytą laminowaną w czarnym kolorze, a półki płytą foliowaną w barwie dąb riviera. Komoda została wyposażona w czarne, metalowe uchwyty oraz ramy z płyty MDF przechodzące w nogi, co dodatkowo podkreśla industrialny charakter wnętrza. Powierzchnię płyty laminowanej oraz foliowanej bardzo łatwo utrzymać w czystości – wystarczy użyć miękkiej, zwilżonej ściereczki. Meble z kolekcji HIGH ROCK pomogą stworzyć wyjątkowy, loftowy klimat w Twoim mieszkaniu. Świetnie będą się prezentować przy ścianie z czerwonej cegły.', '', 'komoda-industrialna-wysoka-high-rock', '', '', '', 'Komoda industrialna wysoka HIGH ROCK', '', '', '', ''),
(98, 1, 1, 'Szukasz mebla do przechowywania bielizny w sypialni urządzonej w loftowym stylu ? Spodoba Ci się komoda z 3 szufladami NORDIC , bo możesz w niej uporządkować swoje skarpetki i pidżamy. Szeroki na 89 cm mebel zmieści się nawet w niewielkim pokoju. Możesz wykorzystać blat komody, by wyeksponować na nim pamiątki lub książki. WNĘTRZE W 3 szufladach możesz przechować swoje kosmetyki lub dokumenty. WYKOŃCZENIE Komodę wykończono laminatem, dlatego łatwo utrzymasz ją w czystości. Laminat imitujący kolor drewna dębowego z wyraźnym rysunkiem drewna spodoba się miłośnikom loftowych – surowych wnętrz. Metalowa rama komody podkreśli nowoczesny styl Twojej sypialni. Uchwyty z metalu są szerokie, by ułatwić otwieranie szuflad. INDUSTRIALNA SYPIALNIA Chcesz odmienić oblicze swojej sypialni? Połączenie korpusów w kolorze imitującym naturalne drewno dębowe oraz metalowych elementów sprawi, że wnętrze Twojej sypialni stanie się bardziej przytulne.', '', 'komoda-industrialna-nordic', '', '', '', 'Komoda industrialna NORDIC', '', '', '', ''),
(99, 1, 1, 'Szukasz szafki na buty do przedpokoju w stylu loft? Szafka BOOTS nie tylko wpasuje się we wnętrze utrzymane w surowym stylu, ale i pomoże Ci zachować porządek. P Dzięki swojej niedużej głębokości - 34 cm szafka nadaje się do wąskich pomieszczeń. Podwójne drzwi pozwalają wygodnie sięgnąć po buty, nawet w ciasnym wnętrzu. WNĘTRZE Buty i akcesoria możecie poukładać w 6 wnękach. Wiemy, że buty mogą mieć różną wysokość. Dzięki możliwości regulacji wysokości półki, wnętrze szafki możesz dostosować do swoich potrzeb WYKOŃCZENIE Mebel wykonano z płyt meblowych i pokryto folią. Modne połączenie koloru starego drewna z efektem betonu pasuje do industrialnych i loftowych atanżacji.', '', 'szafka-na-buty-boots-loft', '', '', '', 'Szafka na buty BOOTS loft', '', '', '', ''),
(100, 1, 1, 'Komoda CORTE jest trochę minimalistyczna, ale też trochę zadziorna - poziome dekory podkreślają jej pasiasty charakter. Pomieści dokumenty i zastawę stołową - ma ponad 160 cm szerokości. Komoda nie ma uchwytów, a specjalnie wyprofilowane drzwi, aby ułatwić otwieranie. Jest częścią kolekcji masywnych mebli z szarymi elementami - idealnych do nowoczesnych i loftowych wnętrz. WNĘTRZE Masz do dyspozycji 8 wnęk za potrójnymi drzwiami. Na każdej półce z płyty możesz ustawić przedmioty o wadze 8 kg. Szuflada przyda się na drobiazgi - udźwig do 3 kg. Ma prowadnicę z cichym domykiem, która uniemożliwia trzaskanie. WYKOŃCZENIE Komodę wykonano z płyty meblowej o grubości 16 mm. Wykończono ją laminatem w kolorze jasnego dębu coast evoke.', '', 'komoda-w-pasy-z-szuflada-corte', '', '', '', 'Komoda w pasy z szufladą CORTE', '', '', '', ''),
(101, 1, 1, 'Pojemne szuflady i wnęki za drzwiami w komodzie STONE II pomieszczą ubrania, komplety pościeli, jak i dokumenty czy inne akcesoria codziennego użytku. Komoda STONE II wchodzi w skład kolekcji przeznaczonej do pokoju młodzieżowego , ale z powodzeniem możesz wykorzystać ją w innym pomieszczeniu loftowego mieszkania. Kolekcja STONE II to połączenie dekoru dąb artisan z pełną głębi czernią. Świetnie pasuje też do nowoczesnych wnętrz, urządzonych na zasadzie kontrastu. WNĘTRZE Komoda posiada 3 szuflady i 2 wnęki za drzwiami. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Matowe wykończenie w połączeniu czerni z kolorem drewna idealnie pasuje do mieszkania urządzonego w industrialnym stylu.', '', 'komoda-stone-ii-1d3s', '', '', '', 'Komoda STONE II 1D3S', '', '', '', ''),
(102, 1, 1, 'Regał CLIF jak najbardziej wpisuje się w klimat loftowy. Stare fabryki, przestronne wnętrza, surowy beton, stare, kruszące się już cegły, łuszcząca się farba... skojarzeń z industrializmem jest sporo. Objawiają się one w wyglądzie regału oraz całej kolekcji mebli CLIF do pokoju dziennego. Pokrycie regału imituje wyglądem stare, podniszczone deski, co świetnie koresponduje ze zdobiącymi boki listwami stwarzającymi wrażenie betonowych. Ten model regału dedykowany jest do pokoju dziennego - sprawdzi się jednak w każdym dużym wnętrzu, które wyglądem nawiązuje do klimatu fabryk i rewolucji przemysłowej. WNĘTRZE Regał CLIF to przede wszystkim pojemne wnętrze (szerokość mebla to ponad 130 cm ). Górna część mebla jest otwarta, natomiast dolna posiada zamykane szafki. Mebel zawiera łącznie aż 12 wnęk , co sprawia, że można w nim trzymać naprawdę sporo przedmiotów - od książek i płyt do zwykłych rzeczy codziennego użytku,. WYKOŃCZENIE Imitująca nadgryzione przez czas deski, powierzchnia mebla współgra z betonowymi słupami przytwierdzonymi do jej zewnętrznych boków. Tylna ściana wewnątrz również ma odcień betonu. Dopełnieniem stylizacji są proste uchwyty , przytwierdzone do frontów rzucającymi się w oczy śrubami.', '', 'regal-loftowy-z-efektem-starego-drewna-i-betonu-clif', '', '', '', 'Regał loftowy z efektem starego drewna i betonu CLIF', '', '', '', ''),
(103, 1, 1, 'Pragniesz urządzić prawdziwy kącik kinomana? Szafka RTV NOTINA to kompromis pomiędzy przestrzenią w nowoczesnym salonie , a funkcjonalnym rozwiązaniem, który umieścisz tuż pod swoim telewizorem . Stwórz stylową przestrzeń rozrywki w swoim kameralnym mieszkaniu. WNĘTRZE 2 szuflady wykonane z płyty meblowej pokrytej folią , ułatwiają utrzymanie porządku i czystości. Możesz umieścić w ich wnętrzu kolekcję ulubionych płyt z klasyką kina; 2 wnęki , w których ukryjesz niezbędne urządzenia: router lub odtwarzacz DVD . Dodatkowo szafka NOTINA posiada specjalny otwór ułatwiający przeciągnięcie kabli; Jeśli zechcesz wykorzystać tę przestrzeń na unikalne dekoracje , możesz domówić zestaw oświetlania LED , który podkreśli ich designerski charakter; Szuflady poruszają się po metalowych prowadnicach z cichym domykiem. Już nie zbudzisz pupila, który śpi na dywanie pod telewizorem ; WYKOŃCZENIE Dębowe , lite fronty oraz symetryczny podział szuflad i wnęk sprawiają, że bez problemu dopasujesz szafkę RTV do wnętrza swojego nowoczesnego salonu ; Korpus od strony zewnętrznej wykończony jest okleiną naturalną , ciepłą w barwie i dotyku. Szafka RTV NOTINA przełamie chłód betonu i stali w industrialnych aranżacjach ; Od strony wewnętrznej powierzchnia korpusu pokryta jest folią , jednym ruchem pozbędziesz się zalegającego kurzu; 2 metalowe , czarne płozy oraz dodatkowa nóżka sprawia, że szafka RTV stabilnie stoi na swoim miejscu; Metalowe uchwyty w kolorze matowej czerni posiadają wymiar, pozwalający na wygodne wysunięcie szuflad, nawet osobie o większych dłoniach; Szerokość szafki RTV to: 138 cm. Wymiary wnęki: 62x13x33 cm.', '', 'szafka-rtv-pod-tv-notina', '', '', '', 'Szafka RTV pod TV NOTINA', '', '', '', ''),
(104, 1, 1, 'W Twoim domowym gabinecie nie ma już miejsca na dokumenty? Duża komoda DAVINCI pomoże Ci rozwiązać ten problem. Możesz w niej przechowywać segregatory, akcesoria i sprzęt biurowy. Dzięki dużej ilości wnęk i skrytek, zachowasz porządek na długo. To idealny mebel do przechowywania ciężkich teczek – na każdej półce możesz ustawić przedmioty o wadze 28 kg. WNĘTRZE 3 szuflady to dobre miejsce na biurowe akcesoria. W szafkach dolnych możesz posegregować dokumenty w 6 wnękach. W półkach otwartych poukładasz segregatory. Długi blat możesz wykorzystać na wyeksponowanie nagród firmowych. Do 2 dużych - górnych wnęk możesz dostać się za pomocą drzwi klapowych. Wyposażono je w specjalną blokadę, która ułatwia wsadzanie i wyciąganie dokumentów. WYKOŃCZENIE Komodę wykonano z płyty meblowej i wykończono melaminą , dzięki czemu łatwo utrzymać je w czystości. Meble biurowe kolorze drewna to dobry wybór do współczesnych aranżacji. Czarne wstawki i fronty sprawiają, że komoda prezentuje się elegancko. MODNE BIURO W NOWOCZESNYM STYLU Kolekcja mebli DAVINCI pozwoli Ci umeblować domowe biuro lub firmowy gabinet. Minimalistyczny styl mebli pozwoli Ci skupić się na pracy, a połączenie barw: jasnego drewna i czerni wprowadzi do wnętrza przytulność w eleganckim stylu. Meble zaprojektowano w taki sposób, by pomieścić w nich wszystkie dokumenty i zapewnić Ci dużo miejsca na sprzęt biurowy.', '', 'komoda-na-ksiazki-do-biura-wysoka-davinci-office', '', '', '', 'Komoda na książki do biura wysoka DAVINCI OFFICE', '', '', '', ''),
(105, 1, 1, 'Masz salon w stylu industrialnym i szukasz pojemnej komody? Drewniana komoda CING jest właśnie dla Ciebie. Dzięki niej niezbędne przedmioty codziennego użytku będą zawsze pod ręką. WNĘTRZE Poukładaj tekstylia lub dokumenty w 3 szufladach. Wysuń szufladę do końca, bez obawy, że wypadnie. W 2 szafkach znajdziesz 4 wnęki to przechowywania książek, albumów ze zdjęciami lub gier planszowych KOLEKCJA CING Korpus, blaty, półki i fronty wykonane są z drewna sosnowego i pokryte matowym woskiem. Wosk zabezpiecza meble przed zanieczyszczeniami i osadzaniem się kurzu. Meble w dotyku przypominają surowe drewno. Meble osadzone są na ozdobnych, ażurowych nogach wykonanych z metalu. Wysokie nogi sprawiają, że meble nie przytłoczą pomieszczeń o niewielkim metrażu. Dzięki wysokim nóżkom pod mebel wjedzie robot sprzątający, co ułatwi Ci utrzymanie czystości.', '', 'drewniana-komoda-z-szufladami-i-szafkami-cing', '', '', '', 'Drewniana komoda z szufladami i szafkami CING', '', '', '', ''),
(106, 1, 1, 'Jeśli szukasz dużej komody, w której zmieszczą się segregatory z dokumentami lub książki, to komoda DAVINCI spełni Twoje oczekiwania. Komoda ma szerokość 148,8 cm i zapewnia sporo miejsca w szafkach zamykanych, szufladach i wnękach otwartych. To idealny mebel do przechowywania ciężkich teczek – na każdej półce możesz ustawić przedmioty o wadze 28 kg. WNĘTRZE 3 szuflady to dobre miejsce na biurowe akcesoria. W szafkach dolnych możesz posegregować dokumenty w 6 wnękach. W półkach otwartych przechowasz segregatory. Długi blat możesz wykorzystać na wyeksponowanie nagród firmowych. WYKOŃCZENIE Komodę wykonano z płyty meblowej i wykończono melaminą , dzięki czemu łatwo utrzymać je w czystości. Meble biurowe kolorze drewna to dobry wybór do współczesnych aranżacji. Czarne wstawki i fronty sprawiają, że komoda prezentuje się elegancko. MODNE BIURO W NOWOCZESNYM STYLU Kolekcja mebli DAVINCI pozwoli Ci umeblować domowe biuro lub firmowy gabinet. Minimalistyczny styl mebli pozwoli Ci skupić się na pracy, a połączenie barw: jasnego drewna i czerni wprowadzi do wnętrza przytulność w eleganckim stylu. Meble zaprojektowano w taki sposób, by pomieścić w nich wszystkie dokumenty i zapewnić Ci dużo miejsca na sprzęt biurowy.', '', 'komoda-na-ksiazki-do-biura-niska-davinci-office', '', '', '', 'Komoda na książki do biura niska DAVINCI OFFICE', '', '', '', ''),
(107, 1, 1, 'Szafka RTV z kolekcji CING przyda Ci się, jeśli szukasz mebla do niewielkiego salonu w stylu loftowym. Na blacie o szerokości 115 cm postawisz telewizor do 43 cali. Jeśli zdecydujesz się powiesić telewizor nad szafką, blat pozostanie do Twojej aranżacji. Postaw na nim świeczki, kwiaty lub inne dekoracje. WNĘTRZE 2 szafki bez półek pomieszczą segregatory z dokumentami, gry planszowe, puzzle lub elektronikę. 2 wnęki otwarte to miejsce na konsolę, dekoder, kolekcję filmów lub książek. KOLEKCJA CING Korpus, blaty, półki i fronty wykonane są z drewna sosnowego i pokryte matowym woskiem. Wosk zabezpiecza meble przed zanieczyszczeniami i osadzaniem się kurzu. Meble w dotyku przypominają surowe drewno. Meble osadzone są na ozdobnych, ażurowych nogach wykonanych z metalu. Wysokie nogi sprawiają, że meble nie przytłoczą pomieszczeń o niewielkim metrażu. Dzięki wysokim nóżkom pod mebel wjedzie robot sprzątający, co ułatwi Ci utrzymanie czystości.', '', 'drewniana-szafka-rtv-na-wysokich-nozkach-cing', '', '', '', 'Drewniana szafka RTV na wysokich nóżkach CING', '', '', '', ''),
(108, 1, 1, 'Potrzebujesz niewielkiej komody do mieszkania urządzonego w loftowym stylu? Spodoba Ci się drewniana komoda z kolekcji CING. Znajdziesz w niej miejsce na drobne tekstylia, książki lub gry planszowe. Blat pozwoli Ci wyeksponować stylowe dekoracje lub ulubione pamiątki. WNĘTRZE Poukładaj obrusy i ręczniki w 3 szufladach. Wysuń szufladę do końca, bez obawy, że wypadnie. W szafce znajdziesz 2 wnęki do przechowywania dokumentów, książek lub drobnej elektroniki. KOLEKCJA CING Korpus, blaty, półki i fronty wykonane są z drewna sosnowego i pokryte matowym woskiem. Wosk zabezpiecza meble przed zanieczyszczeniami i osadzaniem się kurzu. Meble w dotyku przypominają surowe drewno. Meble osadzone są na ozdobnych, ażurowych nogach wykonanych z metalu. Wysokie nogi sprawiają, że meble nie przytłoczą pomieszczeń o niewielkim metrażu. Dzięki wysokim nóżkom pod mebel wjedzie robot sprzątający, co ułatwi Ci utrzymanie czystości.', '', 'drewniana-komoda-na-wysokich-nozkach-cing', '', '', '', 'Drewniana komoda na wysokich nóżkach CING', '', '', '', ''),
(109, 1, 1, 'Drewniana komoda z kolekcji CING to pojemny mebel, który świetnie sprawdzi się w niewielkim mieszkaniu urządzonym w stylu industrialnym. Komoda z szufladami pomieści tekstylia i dokumenty. Na blacie poustawiaj ramki ze zdjęciami, kwiaty lub ozdoby. SZUFLADY Z BLOKADĄ Poukładaj obrusy i ręczniki w 4 szufladach. Wysuń szufladę do końca, bez obawy, że wypadnie. KOLEKCJA CING Korpus, blaty, półki i fronty wykonane są z drewna sosnowego i pokryte matowym woskiem. Wosk zabezpiecza meble przed zanieczyszczeniami i osadzaniem się kurzu. Meble w dotyku przypominają surowe drewno. Meble osadzone są na ozdobnych, ażurowych nogach wykonanych z metalu. Wysokie nogi sprawiają, że meble nie przytłoczą pomieszczeń o niewielkim metrażu. Dzięki wysokim nóżkom pod mebel wjedzie robot sprzątający, co ułatwi Ci utrzymanie czystości.', '', 'drewniana-komoda-z-szufladami-na-wysokich-nozkach-cing', '', '', '', 'Drewniana komoda z szufladami na wysokich nóżkach CING', '', '', '', ''),
(110, 1, 1, 'Przekonaj się, że rozmiar nie zawsze ma znaczenie. 2 drzwiowa komoda z serii DERBY to doskonałe rozwiązanie do mniejszych mieszkań, urządzonych w nowoczesnym stylu . Podwójne, umieszczone po bokach drzwi i 3 centralnie usytuowane szuflady wystarczą, aby zmieścić w niej komplet ozdobnych talerzy, serwety, sztućce i wszystko to, co jeszcze przyjdzie Ci do głowy. Połączenie modnej czerni z barwą dębu Delano zachęca do wstawienia mebla do wnętrz z loftowym zacięciem albo utrzymanych w industrialnym klimacie . WNĘTRZE Za drzwiami znajdziesz po 2 półki , które udźwigną rzeczy o wadze do 5 kg . Do każdej z 3 szuflad schowasz przedmioty, które chciałbyś mieć zawsze łatwo i szybko dostępne. WYKOŃCZENIE Komodę wykonano z płyty meblowej o grubości 16 mm . Konstrukcję pokryto laminatem w kolorze dębu Delano i w kolorze czarnym, który tworzy wyrazisty kontrast i podkreśla industrialny charakter mebla . W drzwiach i szufladach zamontowano czarne uchwyty z tworzywa sztucznego .', '', 'komoda-2-drzwiowa-z-szufladami-derby-2', '', '', '', 'Komoda 2 drzwiowa z szufladami DERBY 2', '', '', '', ''),
(111, 1, 1, 'Szafka RTV COIMBRA będzie świetnym uzupełnieniem nowoczesnej i eleganckiej aranżacji salonu. Konstrukcja szafki pozwala na łatwe rozmieszczenie sprzętów i akcesoriów. WNĘTRZE Pod blatem możesz umieścić dekoder lub konsolę. We wnęce za drzwiami uporządkujesz potrzebne przedmioty, których nie chcesz eksponować. Szuflada przyda się na przechowanie niewielkich akcesoriów. Szafkę możesz doposażyć w oświetlenie (za dopłatą), dzięki czemu kącik wypoczynkowy zaprezentuje się niezwykle elegancko. Pasujące oświetlenie: SQUARE Z-2SQR-AL-TR-BC-WN. WYKOŃCZENIE Szafka RTV jest wykonana z płyty meblowej i wykończona melaminą. Połączenie czerni z kolorem drewna wprowadza do wnętrza nowoczesny i przytulny klimat .', '', 'szafka-rtv-coimbra-2d1s', '', '', '', 'Szafka RTV COIMBRA 2D1S', '', '', '', ''),
(112, 1, 1, 'Szukasz nowoczesnej szafki pod telewizor i sprzęt stereo? Szafka RTV industrialna LEEDS, to idealne rozwiązanie do pomieszczeń urządzonych w loftowym klimacie. Jasne drewno w połączeniu z antracytem i elementami w kolorze modnej czerni, świetnie komponuje się z dodatkami ze szkła i metalu. Szafka RTV industrialna LEEDS sprawdzi się w loftowym salonie albo pokoju dziennym. WNĘTRZE Szafka RTV industrialna LEEDS została wyposażona w 2 szuflady, umieszczone w środkowej części mebla. Możesz w nich schować piloty, baterie, ładowarki i instrukcje. W każdej z szafek znajdujących się po bokach, znajdziesz po 2 półki o udźwigu do 5 kg. To dobre miejsce np. na pudełka z grami Pod blatem znajdziesz otwartą półkę, która przyda się na dekoder telewizji kablowej albo konsolę. WYKONANIE Konstrukcja szafki została wykonana z 16 i 22 mm płyty meblowej pokrytej laminatem w odcieniu dębu Artisan. Fronty szuflad pokryto laminatem w kolorze antracytowym. Szuflady zamontowano na prowadnicach kulkowych. Czarne uchwyty zrobiono z tworzywa sztucznego. Mebel osadzono na nogach z metalu w kolorze czarnym.', '', 'szafka-rtv-industrialna-leeds', '', '', '', 'Szafka RTV industrialna LEEDS', '', '', '', ''),
(113, 1, 1, 'Cenisz sobie porządek? Szukasz zarówno praktycznego, jak i stylowego mebla do Twojego wnętrza? Przypadnie Ci do gustu bufet EROMI ! Usytuowany w jadalni lub pokoju dziennym zwraca uwagę funkcjonalnością oraz nowoczesną elegancją, którą podkreśla metalowy stelaż. WNĘTRZE Wysoki na 75 cm pozwala zagospodarować przestrzeń nad nim. Na 2 półkach ukrytych za drzwiami możesz poukładać zastawę, obrusy lub dokumenty. 4 otwarte wnęki posłużą jako przestrzeń do ustawienia dekoracji, książek i pamiątek. Prostota designu, czarna podstawa i wykończenie w kolorze dębu - to wszystko sprawia, że mebel z kolekcji EROMI pasuje do wnętrz urządzonych w stylu loftowym. WYKOŃCZENIE Bufet został wykonany z płyty meblowej pokrytej melaminą drewnopodobną. Wybarwienie w kolorze dębu wprowadza do wnętrza przytulny klimat, a metalowe nóżki i uchwyty nadają mu industrialnego stylu. Ścięte nóżki uatrakcyjniają wygląd mebla.', '', 'bufet-loftowy-eromi', '', '', '', 'Bufet loftowy EROMI', '', '', '', ''),
(114, 1, 1, 'Szafka RTV uzupełni Twoje loftowe centrum rozrywki. Możesz ją wykorzystać do ekspozycji sprzętu RTV, książek czy dekoracji. Długi na 160 cm blat sprawia, że na szafce możesz postawić telewizor do 70 cali. Prostota designu, czarna podstawa i wykończenie w kolorze dębu - to wszystko sprawia, że mebel z kolekcji EROMI pasuje do wnętrz urządzonych w stylu loftowym. WNĘTRZE 4 wnęki wykorzystaj na ekspozycję książek czy ważnych pamiątek. W 2 szufladach możesz przechować drobne akcesoria, które warto mieć zawsze pod ręką. WYKOŃCZENIE Szafka została wykonana z płyty meblowej pokrytej melaminą drewnopodobną. Wybarwienie w kolorze dębu wprowadza do wnętrza przytulny klimat, a metalowe nóżki i uchwyty nadają mu industrialnego stylu. Metalowa rama podkreśla surowy styl mebla.', '', 'szafka-rtv-loftowa-eromi', '', '', '', 'Szafka RTV loftowa EROMI', '', '', '', ''),
(115, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model dużej komody TEMPRA wyposażony w 3 drzwi i 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie komody z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz 2 szuflady ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce imitującej stare drewno ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-wysoka-tempra-2-3d2s-loft', '', '', '', 'Komoda wysoka TEMPRA 2 3D2S loft', '', '', '', ''),
(116, 1, 1, 'Stylowa komoda OTIS to wielofunkcyjny mebel, który sprawdzi się w salonie, sypialni, przedpokoju czy jadalni. W zależności od pomieszczenia, pomieści zapasowe szkło, tekstylia stołowe i pościelowe, dokumenty lub ubrania. Komoda z kolekcji OTIS łączy w sobie popularne i lubiane barwy - ciepły odcień dębu oraz połyskującą biel. Dodajmy do tego czarne wstawki - uchwyty, nóżki oraz delikatną, okalającą przód ramkę a otrzymamy niezwykle interesujący element aranżacji wnętrza. Zastosowany w drzwiczkach oraz szufladach system cichego domyku przyczyni się do komfortowego korzystania z komody. WNĘTRZE Za drzwiczkami znajdują się 2 wnęki do przechowywania; Komoda posiada 2 praktyczne szuflady na niezbędne drobiazgi; WYKOŃCZENIE Fronty są wykonane z płyty akrylowej, co zapewnia ich trwałość, odporność oraz wysoki połysk ; Drzwiczki i szuflady są wyposażone w system cichego domyku, dzięki któremu nie trzaskają; Dzięki swojej charakterystycznej kompozycji, komoda OTIS sprawdzi się jako element umeblowania zarówno w stylu nowoczesnym, jak i industrialnym, loftowym a nawet retro.', '', 'komoda-otis-2d2s', '', '', '', 'Komoda OTIS 2D2S', '', '', '', ''),
(117, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 2 drzwi i 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie komody z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz 2 szuflady ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce imitującej stare drewno ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-wysoka-2d2s-loft', '', '', '', 'Komoda TEMPRA 2 wysoka 2D2S loft', '', '', '', ''),
(118, 1, 1, 'Od codziennej zastawy, po komplet zabytkowej porcelany. Masz inny pomysł? Wykorzystaj miejsce w 2-drzwiowej komodzie z serii MANN RIVER i schowaj w niej, co tylko chcesz. Ustaw ją w pokoju dziennym albo jadalni i przechowuj rzeczy, które zawsze warto mieć pod ręką. Podobnie do pozostałych mebli z serii MANN RIVER, komoda świetnie pasuje do przestrzeni utrzymanych w nowoczesnym stylu. WNĘTRZE Za podwójnymi, pełnymi drzwiami znajdziesz 4 półki, na których schowasz rzeczy o wadze do 5 kg. W 3 szufladach zmieścisz obrusy i lżejsze rzeczy. Na półce pod blatem położysz świeżą prasę. WYKOŃCZENIE Płytę meblową, z której wykonano komodę, pokryto folią w odcieniu dębu Waterford. Fronty szuflad oraz fragmenty boków, zostały wykończone laminatem w kolorze czarnym. Szuflady osadzono na prowadnicach kulkowych.', '', 'komoda-loftowa-mann-river', '', '', '', 'Komoda loftowa MANN RIVER', '', '', '', ''),
(119, 1, 1, 'Praktyczna i pojemna komoda NORD bez problemu pomieści niezbędne rzeczy, jak bieliznę czy ręczniki. Jej blat może posłużyć do wyeksponowania dodatków, dodających sypialni przytulnej i miłej atmosfery. Komoda przeznaczona jest przede wszystkim do sypialni, ale ze względu na jej nowoczesny i oryginalny charakter, można ją wykorzystać także w przedpokoju lub pokoju dziennym. WYKOŃCZENIE Komoda została wykończona laminatem w ciepłym odcieniu dębu. Jej oryginalne metalowe nogi to znak charakterystyczny kolekcji NORD , którą odznacza połączenie efektu drewna oraz metalu . Meble z kolekcji idealnie sprawdzą się we wnętrzach urządzonych w nowoczesnym, industrialnym czy loftowym stylu.', '', 'komoda-z-szufladami-nowoczesna-nord', '', '', '', 'Komoda z szufladami nowoczesna NORD', '', '', '', ''),
(120, 1, 1, 'Szafka RTV OTIS to stylowy mebel przeznaczony do salonu. Szafka łączy w sobie popularne i lubiane barwy - ciepły odcień dębu oraz połyskującą biel. Dodajmy do tego czarne wstawki - uchwyty, nóżki - płozy oraz delikatną, okalającą przód ramkę a otrzymamy niezwykle interesujący element aranżacji wnętrza. Zastosowany w drzwiczkach i szufladzie system cichego domyku przyczyni się do komfortowego korzystania z szafki. WNĘTRZE Otwarta wnęka na sprzęt RTV ma kolor czarny, co nadaje szafce intrygujący wygląd; Zakryte wnęki oraz szuflada posłużą do przechowywania podręcznych różności, jak dodatkowe kable, ładowarki, płyty DVD; WYKOŃCZENIE Fronty są wykonane z płyty akrylowej, co zapewnia ich trwałość, odporność oraz wysoki połysk ; Drzwiczki są wyposażone w system cichego domyku, dzięki któremu nie trzaskają; Dzięki swojej charakterystycznej kompozycji, szafka RTV OTIS sprawdzi się jako element umeblowania pomieszczenia zarówno w stylu nowoczesnym, jak i industrialnym, loftowym a nawet retro.', '', 'szafka-rtv-otis-2d1s', '', '', '', 'Szafka RTV OTIS 2D1S', '', '', '', ''),
(121, 1, 1, 'Szukasz industrialnego regału ? Minimalistyczna forma, metalowa konstrukcja i wykończenie z efektem postarzenia sprawiają, że regał GALANDO świetnie wpisze się w surowe przestrzenie loftowe. Wąski regał GALANDO sprawdzi się w przedpokoju, domowym biurze, jadalni, pokoju dziennym czy młodzieżowym - wszędzie tam, gdzie chcesz funkcjonalnie zagospodarować pustą ścianę i stworzyć aranżację, wpisującą się w aktualne trendy. Na 3 półkach możesz ułożyć dekoracje, pamiątki, książki czy niewielkie akcesoria, które będą w zasięgu ręki. WYKOŃCZENIE Czarna, metalowa konstrukcja sprawia, że mebel prezentuje się lekko i nie przytłacza wnętrza. Półki pokryte okleiną z efektem postarzenia .', '', 'regal-galando-3p', '', '', '', 'Regał GALANDO 3P', '', '', '', ''),
(122, 1, 1, 'Komoda 3 drzwiowa z szufladami DERBY to pojemny mebel, który sprawdzi się w pokoju dziennym , sypialni , czy w domowym gabinecie. Od mało istotnych drobiazgów, po ważne dokumenty. Schowaj do niej, co chcesz, bez obaw o to, że nie starczy Ci miejsca. Komoda 3 drzwiowa z serii DERBY to idealny mebel do pomieszczeń urządzonych w industrialnym albo loftowym klimacie . Sprawdzi się także w surowych i minimalistycznych wnętrzach . WNĘTRZE 6 półek o udźwigu do 5 kg . Po 2 schowane za każdą parą pełnych drzwi – możesz w nich schować ubrania i akcesoria, dodatkowe koce i pledy. 3 szuflady pozwolą Ci na zachowanie perfekcyjnego porządku, odtąd bielizna, skarpetki, bluzki mają swoje miejsce. WYKOŃCZENIE Komoda została wykonana z 16 mm płyty meblowe , którą w łatwy sposób utrzymasz w czystości. Mebel pokryto laminatem w kolorze dębu Delano i w kolorze czarnym, który podkreśli nowoczesny wygląd komody. W szufladach i drzwiach zostały zamontowane czarne uchwyty z tworzywa sztucznego .', '', 'komoda-3-drzwiowa-z-szufladami-derby-2', '', '', '', 'Komoda 3 drzwiowa z szufladami DERBY 2', '', '', '', ''),
(123, 1, 1, 'Oglądasz, słuchasz, a może grasz? Bez względu na to, jak relaksujesz się po pracy, stolik RTV DERBY, to idealny mebel do Twojego salonu . Na blacie postawisz telewizor albo sprzęt stereo . W szafkach znajdujących się po bokach zmieścisz płyty z muzyką albo grami. W szufladzie wyląduje pilot, pady i dodatkowe baterie. Na otwartej półce postawisz konsolę . Jeśli preferujesz loftowe lub industrialne przestrzenie , stolik RTV DERBY będzie trafionym wyborem. WNĘTRZE Za pełnymi drzwiami po obu stronach stolika, znajdziesz łącznie 4 półki o udźwigu do 5 kg . W centralnej części stolika znajduje się otwarta półka , która sprawdzi się idealnie pod dekoder do kablówki . Pod otwartą półką umieszczono szufladę , która pomieści drobne przedmioty, które chcesz mieć zawsze pod ręką. WYKOŃCZENIE Stolik RTV DERBY wykonano z 16 mm płyty meblowej . Konstrukcję stolika wykończono laminatem w kolorze czarnym i w kolorze ciemnego dębu Delano . W drzwiach i szufladzie zamontowano czarne uchwyty z tworzywa sztucznego, podkreślające styl szafki RTV .', '', 'stolik-rtv-2-drzwiowy-derby-2', '', '', '', 'Stolik RTV 2 drzwiowy DERBY 2', '', '', '', ''),
(124, 1, 1, 'Szukasz komody w industrialnym stylu? Komoda na metalowych płozach LEEDS spodoba Ci się! WNĘTRZE W witrynie industrialnej z kolekcji LEEDS znajdziesz 4 półki o udźwigu do 5 kg. 4 pojemne szuflady, w której możesz pomieścić swoje drobiazgi. WYKONANIE Konstrukcję mebla wykonano z 16 i 22 mm płyty meblowej, pokrytej laminatem w odcieniu dębu Artisan. Drzwi komody pokryto laminatem w kolorze antracytu. Szklane półki wykonano z przezroczystego, niehartowanego szkła o grubości 6 mm. W drzwiach komody zamontowano czarne uchwyty z tworzywa sztucznego. Konstrukcję osadzono na czarnych, metalowych nogach.', '', 'komoda-z-polkami-i-szufladami-leeds', '', '', '', 'Komoda z półkami i szufladami LEEDS', '', '', '', ''),
(125, 1, 1, 'Masz dość bałaganu przy wejściu? Wszystkie swoje buty i akcesoria poukładasz w szafce BOOTS. Dzięki swojej niedużej głębokości - 34 cm szafka nadaje się do wąskich pomieszczeń. Podwójne drzwi pozwalają wygodnie sięgnąć po buty, nawet w ciasnym wnętrzu. WNĘTRZE Buty i akcesoria możecie poukładać w 6 wnękach. Wiemy, że buty mogą mieć różną wysokość. Dzięki możliwości regulacji wysokości półki, wnętrze szafki możesz dostosować do swoich potrzeb WYKOŃCZENIE Mebel wykonano z płyt meblowych i pokryto folią. Wykończenie w ponadczasowej bieli sprawia, że z łatwością dopasujesz szafkę do własnej aranżacji i innych mebli w mieszkaniu . Świetnie sprawdzi się w nowoczesnych i skandynawskich aranżacjach.', '', 'szafka-na-buty-boots-dab-piaskowy-bialy', '', '', '', 'Szafka na buty BOOTS dąb piaskowy/biały', '', '', '', ''),
(126, 1, 1, 'NOTINA to komoda z szufladami , która odmieni wnętrze Twojego salonu. Ciepła barwa sękatego dębu sprawi, że poczujesz się przy niej niezwykle komfortowo. Skradnie uwagę w każdym loftowym salonie, może stanowić także wyrazisty akcent na tle surowej cegły w przedpokoju lub sypialni . Komoda w widocznych miejscach wykończona jest naturalną okleiną . Fronty z litego drewna posiadają wyraźnie zarysowane sęki, podkreślające i ndustrialny charakter mebla. NOTINA odnajdzie się doskonale jako element wyposażenia domu typu stodoła . Zestawiając ją razem z emaliowanymi naczyniami, retro lampami, stworzysz niepowtarzalny nastrój. Światło świec wydobędzie jej naturalne piękno. Komoda NOTINA pasować będzie również do wnętrz nowoczesnych , umożliwia to prosta bryła i matowe , czarne , metalowe płozy oraz uchwyty . Wystarczy zmienić dodatki. WNĘTRZE 1 niska i 2 wyższe szuflady , to doskonałe miejsce na stylowy koc w szkocką kratę lub kubek na ciepłą herbatę, które wyciągniesz w deszczowy wieczór; Komoda NOTINA posiada 4 wnęki z półkami, które wytrzymają obciążenie 10 kg , twoja kolekcja ozdobnej ceramiki będzie bezpieczna; Wnętrze komody oraz szuflad i półki wykonane z płyty meblowej wykończonej folią , ułatwia utrzymanie czystości; Prowadnica metalowa oraz zawiasy puszkowe posiadają cichy domyk , bez nich lite fronty mogłyby narobić niezłego hałasu; Możliwość regulacji wysokości półek – sam decydujesz o aranżacji przestrzeni wewnątrz komody. WYKOŃCZENIE Matowe, olejowane fronty z litego drewna dębowego posiadają wyrazisty rysunek słojów, który podkreśla surowy wygląd mebla; Komoda posiada geometryczny, przyjemny dla oka podział frontów, powtarzający się w meblach z tej samej kolekcji; Czarne matowe płozy po obu stronach komody sprawiają, że możesz wykorzystać więcej elementów w tym kolorze we wnętrzu; Atutem są dodatkowe nóżki wspierające stabilność mebla; Drzwiczki komody posiadają wzmocnienie łączonych frontów; Jej szerokość, sprawi, że możesz umieścić nad nią szerokie lustro zarówno 160, jak i 150 cm;', '', 'komoda-z-szufladami-do-salonu-notina', '', '', '', 'Komoda z szufladami do salonu NOTINA', '', '', '', ''),
(127, 1, 1, 'Szafka RTV ROMY to mebel, który doda szyku nowoczesnym, industrialnym pomieszczeniom. Połączenie modnego, uniwersalnego szarego odcienia z kolorem naturalnego dębu sprawia, że szafkę ROMY dopasujesz do wnętrz o nowoczesnym charakterze. Urządzając wyjątkowe i przytulne mieszkanie, sprawdź pozostałe meble z kolekcji ROMY. WNĘTRZE Na blacie zmieścisz telewizor , konsolę czy dekoder. W 4 pojemnych szufladach schowasz gry, piloty oraz to, co lubisz mieć pod ręką w domowym centrum rozrywki. Szuflady wyposażono w prowadnice z cichym domykiem - nie trzaskają. WYKOŃCZENIE Szafkę RTV wykonano z płyty wiórowe j i płyty MDF o grubości 16 i 19 mm. Korpus mebla pokryto folią PVC i laminatem - łatwo go czyścić. W półkach zamontowano czarne, metalowe uchwyty. Nogi mebla wykonano z tworzywa sztucznego w czarnym kolorze.', '', 'szafka-rtv-z-4-szufladami-romy', '', '', '', 'Szafka RTV z 4 szufladami ROMY', '', '', '', ''),
(128, 1, 1, 'Lubisz, gdy we wnętrzu panuje ład i porządek? Stawiasz na estetyczne, ale również przemyślane rozwiązania? Spodoba Ci się szeroka komoda ROMY ! Wyposażona w 3 pojemne szuflady oraz 4 półki ukryte za podwójnymi drzwiami będzie doskonałym wyborem do Twojego wnętrza. Szeroki blat o długości 182,5 cm możesz wykorzystać na wyeksponowanie ważnych pamiątek, kwiatów, czy świeczek. Połączenie modnego - szarego odcienia z kolorem naturalnego dębu sprawia, że witrynę dopasujesz do wnętrz o industrialnym i rustykalnym charakterze. WNĘTRZE Dobra organizacja dla ubrań, dokumentów oraz potrzebnych drobiazgów. Półki udźwigną rzeczy o wadze do 5 kg . Zamknięta budowa, pełna półek doskonale nadaje się do wnętrz kameralnych oraz przestrzeni związanej z pracą. WYKOŃCZENIE Komodę wykonano z płyty wiórowej i płyty MDF o grubości 16 i 19 mm. Korpus mebla pokryto folią PVC i laminatem - produkt staje się trwały i odporny uszkodzenia mechaniczne Nogi mebla zostały zrobione z tworzywa sztucznego w czarnym kolorze. Drzwi charakteryzują się cichym domykiem - żaden hałas nie będzie drażnił Ciebie i Twoich bliskich.', '', 'komoda-z-szufladami-romy-1825-cm', '', '', '', 'Komoda z szufladami ROMY 182,5 cm', '', '', '', ''),
(129, 1, 1, 'Lubisz, gdy we wnętrzu panuje ład i porządek? Stawiasz na estetyczne, ale również przemyślane rozwiązania? Z pewnością spodoba Ci się komoda ROMY ! Wyposażona w 3 pojemne szuflady oraz 4 półki ukryte za podwójnymi drzwiami będzie doskonałym wyborem do Twojego wnętrza. Blat o długości 152,5 cm możesz wykorzystać na wyeksponowanie ważnych pamiątek, kwiatów, czy świeczek. Połączenie modnego szarego odcienia z kolorem naturalnego dębu sprawia, że witrynę dopasujesz do wnętrz o industrialnym, nowoczesnym charakterze. WNĘTRZE 3 szuflady to dobry pomysł na organizację ubrań, dokumentów oraz potrzebnych drobiazgów. Półki udźwigną rzeczy o wadze do 5 kg . Zamknięta budowa, pełna półek doskonale nadaje się do wnętrz kameralnych oraz przestrzeni związanej z pracą. WYKOŃCZENIE Komodę wykonano z płyty wiórowej i płyty MDF o grubości 16 i 19 mm. Korpus mebla pokryto folią PVC i laminatem . Nogi mebla wykonano z tworzywa sztucznego w czarnym kolorze. Drzwi wyposażono w tzw. cichy domyk - żaden hałas nie będzie drażnił Ciebie i Twoich bliskich.', '', 'komoda-z-3-szufladami-romy', '', '', '', 'Komoda z 3 szufladami ROMY', '', '', '', ''),
(130, 1, 1, 'Komoda SPOT 3S wchodzi w skład kolekcji przeznaczonej do pokoju młodzieżowego i pomoże uporządkować poskładane ubrania, bieliznę i inne akcesoria. Wyposażona jest w zewnętrze oświetlenie, które podkreśli nowoczesny charakter mieszkania. Taśma LED umieszczona jest w specjalnej wnęce, w górnej części mebla. WNĘTRZE Komoda posiada 3 szuflady , wyposażone w prowadnice kulkowe z pełnym wysuwem. WYKOŃCZENIE Meble SPOT wykonano z płyty meblowej wykończonej laminatem. DLA KOGO JEST KOLEKCJA SPOT? Meble SPOT to propozycja dla wymagających nastolatków, którzy marzą o aranżacji pokoju w nieco tajemniczym klimacie z elementami stylu industrialnego. W nowoczesnym pokoju młodzieżowym nie powinno zabraknąć klimatycznego oświetlenia – meble SPOT wyposażone w zewnętrze oświetlenie stworzą w pomieszczeniu nastrój, który doceni każdy nastolatek. Ze względu na nowoczesny design mebli SPOT, możesz wykorzystać je również w aranżacji przedpokoju, pokoju dziennego, sypialni czy domowego biura.', '', 'komoda-spot-3s-z-oswietleniem', '', '', '', 'Komoda SPOT 3S z oświetleniem', '', '', '', ''),
(131, 1, 1, 'Lubisz niestandardowe i nowoczesne rozwiązania we wnętrzach? Komoda 2D PATRIK to mebel, który odmieni przestrzeń salonu, przedpokoju czy sypialni. Trójwymiarowe fronty wprowadzą do wnętrza dynamiczny i wyrazisty charakter. Biała komoda nada wnętrzu lekkości i nie przytłoczy go. WNĘTRZE Za 3 drzwiami znajdziesz 6 wnęk, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. Brak uchwytów podkreśla minimalistyczny i nowoczesny charakter mebla. Blat możesz wykorzystać na wyeksponowanie stylowych dekoracji, zdjęć czy pamiątek. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się we współczesnych aranżacjach, w których zależy nam na stworzeniu ciekawej i nowoczesnej aranżacji.', '', 'komoda-biala-nowoczesna-dwudrzwiowa-patrik', '', '', '', 'Komoda biała nowoczesna dwudrzwiowa PATRIK', '', '', '', ''),
(132, 1, 1, 'Szeroka szafka RTV ROMY umożliwia funkcjonalne rozplanowanie wnętrza salonu. Połączenie szarego wykończenia z kolorem naturalnego dębu sprawia, że szafkę ROMY dopasujesz do wnętrz o i nowoczesnym charakterze. Urządzając wyjątkowe i przytulne mieszkanie, sprawdź pozostałe meble z kolekcji ROMY. Szuflady wyposażono w prowadnice z tzw. cichym domykiem - zamykają się lekko i nie trzaskają. WNĘTRZE Na szerokim na 182,5 cm blacie zmieścisz telewizor, dekoder a nawet konsolę. W 4 pojemnych szufladach schowasz gry, piloty oraz to, co lubisz mieć pod ręką w domowym centrum rozrywki. WYKOŃCZENIE Szafkę RTV wykonano z płyty wiórowej i płyty MDF o grubości 16 i 19 mm. Korpus mebla pokryto folią PVC i laminatem . W półkach zamontowano czarne, metalowe uchwyty. Nogi mebla zostały zrobione z tworzywa sztucznego w czarnym kolorze.', '', 'szafka-rtv-szeroka-z-4-szufladami-romy', '', '', '', 'Szafka RTV szeroka z 4 szufladami ROMY', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(133, 1, 1, 'Szukasz szafki RTV z szufladami na dokumenty i drobny sprzęt? Wybierz szafkę CORTE. Szafka nie ma uchwytów, a specjalnie wyprofilowane drzwi, aby ułatwić otwieranie. Poziome dekory sprawiają, że wkomponuje się we wnętrze z motywem pasów. Jest częścią kolekcji masywnych mebli z szarymi elementami - idealnych do nowoczesnych i loftowych wnętrz. WNĘTRZE Na blacie postawisz telewizor albo gramofon. W 4 wnękach za zamkniętymi drzwiami schowasz rzeczy o wadze do 5 kg. W 2 szufladach schowasz mniejsze przedmioty - o wadze nieprzekraczającej 3 kg. Dzięki prowadnicom z cichym domykiem szuflada nie trzaska. WYKOŃCZENIE Szafkę wykonano z 16 mm płyty meblowej pokrytej laminatem w kolorze jasnego dębu coast evoke. W drzwiach i szufladzie jako uchwyty zastosowano frezowanie frontów.', '', 'szafka-rtv-z-2-szufladami-corte', '', '', '', 'Szafka RTV z 2 szufladami CORTE', '', '', '', ''),
(134, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. Komoda Irma świetnie sprawdzi się zarówno w pokoju dziennym, jak i w jadalni. Od ciebie zależy gdzie najlepiej spełni swoją rolę. Jasna kolorystyka wpisze się w aktualne trendy umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadzi do wnętrza wyjątkowy klimat. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WNĘTRZE Wnętrze składa się z szuflady oraz półek w części zamkniętej, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV. Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'komoda-irma-im4-z-oswietleniem', '', '', '', 'Komoda IRMA IM4 z oświetleniem', '', '', '', ''),
(135, 1, 1, 'Komoda BOSTON 2D podkreśla nowoczesny charakter pokoju dziennego. Możesz wykorzystać ją również w domowym biurze czy przedpokoju. Dzięki zastosowaniu efektu lameli na froncie, wnętrze nabiera nietuzinkowego charakteru. Kolor naturalnego drewna wizualnie ociepla przestrzeń i wprowadza przytulny klimat. Takie połączenie kolorów - dąb charleston z czarną barwą - pasuje do nowoczesnego wnętrza , które nie unika kontrastów. WNĘTRZE Komoda posiada 2 zamykane wnęki. Maksymalne obciążenie półki wynosi 5 kg . Blat możesz wykorzystać na wyeksponowanie pamiątek lub dekoracji. WYKOŃCZENIE Komoda BOSTON jest wykonana z płyty meblowej o grubości 18 mm i wykończona laminatem. Rolę nóżek pełnią metalowe profile, które stabilizują mebel. Drzwi otwierają się za pomocą systemu push to open. Kolekcja BOSTON To intrygująca propozycja dla osób pragnących stworzyć oryginalny charakter wnętrza. Meble BOSTON sprawdzą się w zarówno w nowoczesnych, jak i industrialnych mieszkaniach – wszędzie tam, gdzie chcemy wprowadzić nowatorski, strukturalny efekt. Obok tej kolekcji nie można przejść obojętnie!', '', 'komoda-boston-2d', '', '', '', 'Komoda BOSTON 2D', '', '', '', ''),
(136, 1, 1, 'Komoda NORTON charakteryzuje się prostą minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz. Laminat w jasnym kolorze dębu sonoma, dekorem przypominający drewno, wprowadzi do pomieszczenia przytulny klimat. Brak tradycyjnych uchwytów sprawia, że mebel łatwiej wkomponować w dowolną aranżację. Uniwersalny kształt i wyposażenie komody sprawia, że można ją postawić zarówno w salonie, jak i sypialni czy przedpokoju. WNĘTRZE W szafkach i szufladach przechowasz wszystko, co chcesz uporządkować i zawsze mieć pod ręką. Dzięki kulkowym prowadnicom z pełnym wysuwem docenisz komfort użytkowania mebla. WYKOŃCZENIE Mebel został pokryty laminatem, łatwiejszym do utrzymania w czystości.', '', 'komoda-norton', '', '', '', 'Komoda NORTON', '', '', '', ''),
(137, 1, 1, 'Szukasz komody, którą możesz ustawić przy długiej ścianie? Komoda BOHOL ma 220 cm szerokości więc wypełni sporą jej część. Wyrazisty rysunek drewna wprowadzi do pokoju swojskość - tylko, że w nowoczesnym wydaniu. Zawiasy wyposażono w system cichego domyku, więc drzwi nie trzaskają. WNĘTRZE Dzięki 6 wnękom możesz posegregować swoje rzeczy, by zachować porządek na dłużej. 3 szuflady przydadzą się do przechowywania dokumentów lub drobiazgów. Na dużym blacie możesz ustawić pamiątki rodzinne lub dekoracje. WYKOŃCZENIE Mebel wykończono dwoma rodzajami folii z rysunkiem drewna. Folia na blacie i półkach ma kolor drewna dębu riviera – sprawia, że we wnętrzu robi się przytulniej. Front i korpus pokrywa granatowa folia, imitująca malowane drewno. Uchwyty z tworzywa mają prostą formę. DREWNO W BARWIE GRANATU Lubisz otaczać się rustykalnymi meblami, ale tym razem szukasz czegoś bardzo oryginalnego? Chcesz wprowadzić do salonu wyrazisty kolor? A co powiesz na meble wykończone w kolorze granatowego drewna? Kolekcja BOHOL to meble o masywnej konstrukcji, z wyraźnym rysunkiem drewna, prostymi uchwytami … i w granatowym odcieniu . Świetnie sprawdzą się w mieszkaniu urządzonym z motywami morskimi, w loftowym – surowym wnętrzu, wśród szarości i wśród kremów. Sprawią, że Twój salon będzie zarazem swojski i wytworny. Podoba Ci się taka koncepcja? Zamów całą kolekcję!', '', 'duza-komoda-granatowa-z-polkami-i-szufladami-bohol', '', '', '', 'Duża komoda granatowa z pólkami i szufladami BOHOL', '', '', '', ''),
(138, 1, 1, 'Biała komoda GRAZ 2D4S świetnie uzupełni aranżację domu lub biura. Prosty design oraz klasyczna, biała barwa sprawiają, że komoda wpasuje się w jasne wnętrza, stając się naturalnym elementem wyposażenia. To idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Przyda się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych czy dokumentów. WNĘTRZE Wnętrze komody dzieli się na 4 wnęki za drzwiami oraz 4 szuflady. Maksymalne obciążenie półki wynosi 15 kg. WYKOŃCZENIE Komodę pokryto białym laminatem, który łatwo jest czyścić. Uchwyty z tworzywa prezentują się nowocześnie.', '', 'komoda-biala-graz-2d4s', '', '', '', 'Komoda biała GRAZ 2D4S', '', '', '', ''),
(139, 1, 1, 'Telewizor? Konsola? Kolekcja ulubionych gier albo filmowych hitów? Wszystko to, co sprawia Ci przyjemność postaw na szafce RTV MANN RIVER. Połączenie jasnego drewna z czarnymi elementami i aluminiowymi uchwytami sprawia, że szafka pięknie prezentuje się w nowoczesnych przestrzeniach. Postaw ją w pokoju dziennym i zaaranżuj miejsce do rozrywki dla całej rodziny. WNĘTRZE 2 wnęki schowane za podwójnymi, pełnymi drzwiami, pomieszczą płyty z muzyką. Szeroka szuflada, to świetne miejsce na pilota, pady, zapasowe baterie i inne drobiazgi. Na półce pod blatem postawisz sprzęt RTV. WYKOŃCZENIE Szafka RTV została wykonana z płyty meblowej i pokryta folią w kolorze dębu wateford. Boki szafki i front szuflady pokryto laminatem w kolorze czarnym. Szufladę zamontowano na prowadnicach kulkowych. Całość dopełniają czarne, aluminiowe uchwyty.', '', 'szafka-rtv-loftowa-mann-river', '', '', '', 'Szafka RTV loftowa MANN RIVER', '', '', '', ''),
(140, 1, 1, 'Komoda LOFT to mebel przeznaczony do pokoju dziennego, wizualnie utrzymany w nowoczesnym stylu. Łączy w sobie prostotę oraz funkcjonalność, a także dyskretną elegancję. Doskonale współpracuje zarówno z odcieniami szarości, jak również ciepła tonacją wnętrza. Pod względem kolorystycznym meble z kolekcji LOFT idealnie wykorzystują zasadę kontrastu, w myśl której płyty wykończone jasnym wybarwieniem są podkreślone czarnymi wstawkami, które wyodrębniają z całej bryły linie szafek oraz szuflad. WNĘTRZE W 2 bocznych szafkach znajdują się po 3 wnęki. 2 szuflady przydadzą się do przechowywania drobiazgów. W otwartej wnęce wyeksponujesz zdjęcia, dekoracje lub książki. WYKOŃCZENIE Komoda LOFT została wykonana z płyty meblowej wykończonej laminatem. Uchwyty służące do otwierania szuflad i szafek są metalowe, okrągłe i ładnie komponują się z linią mebla. Jest to rozwiązanie, które również doskonale sprawdza się pod katem dekoracyjnym.', '', 'komoda-loft-2d2s', '', '', '', 'Komoda LOFT 2D2S', '', '', '', ''),
(141, 1, 1, 'Szafka RTV LOFT to mebel przeznaczony do pokoju dziennego, wizualnie utrzymany w nowoczesnym stylu. Łączy w sobie prostotę oraz funkcjonalność, a także dyskretną elegancję. Doskonale współpracuje zarówno z odcieniami szarości, jak również ciepłą tonacją wnętrza. Pod względem kolorystycznym meble z kolekcji LOFT idealnie wykorzystują zasadę kontrastu, w myśl której płyty wykończone jasnym wybarwieniem są podkreślone czarnymi wstawkami, które wyodrębniają z całej bryły linie szafek oraz szuflad. Szafka RTV LOFT została wykonana z płyty meblowej o grubości 16 mm wykończonej laminatem. Przy drzwiach zostały zamontowane zawiasy puszkowe, a do szuflad prowadnice kulkowe. WNĘTRZE Szafka RTV LOFT posiada szufladę, zamykaną półkę i otwartą wnękę umieszczoną pod blatem – rozwiązanie w sam raz na kolekcje filmów, dokumenty, gazety lub przydatne przedmioty osobiste. Wymiar wnęki wynosi: szer: 83 cm, głęb: 33 cm, wys: 15 cm WYKOŃCZENIE Szafka RTV LOFT została wykonana z płyty meblowej wykończonej laminatem w kolorze dąb wotan. Uchwyty służące do otwierania szuflad i szafek są metalowe , okrągłe i ładnie komponują się z linią mebla. Jest to rozwiązanie, które również doskonale sprawdza się pod katem dekoracyjnym.', '', 'szafka-rtv-loft-150-1d1s', '', '', '', 'Szafka RTV LOFT 150 1D1S', '', '', '', ''),
(142, 1, 1, 'Skrzynia LANZETTE wchodzi w skład kolekcji przeznaczonej do pokoju dziecięcego i młodzieżowego. Nie tylko ułatwi zachowanie porządku , ale też urozmaici pokój ciekawym designem. Połączenie bieli ze złocistym, ciepłym wybarwieniem dębu craft sprawia, że łatwo możesz dopasować skrzynię do własnej aranżacji pomieszczenia. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej laminowanej, jednak front mebla to płyta MDF wykończona folią PVC. MEBLE DO POKOJU DZIECKA Z kolekcją LANZETTE możesz urządzić pokój dziecka w taki sposób, aby za kilka lat mogły służyć jako meble młodzieżowe. Wystarczy, że zmienisz dodatki i w łatwy sposób przekształcisz wnętrze w stylowy pokój nastolatka. Meble LANZETTE sprawdzą się również w innych pomieszczeniach – pojedyncze bryły możesz wykorzystać w mieszkaniu singla, przedpokoju czy sypialni.', '', 'skrzynia-na-zabawki-lanzette', '', '', '', 'Skrzynia na zabawki LANZETTE', '', '', '', ''),
(143, 1, 1, 'Lubisz niestandardowe i nowoczesne rozwiązania we wnętrzach? Szeroka komoda 3D PATRIK to mebel, który odmieni przestrzeń salonu lub pokoju dziennego. Przechowasz w niej nie tylko tekstylia, dokumenty czy poskładane ubrania. Wyposażona w jedne, częściowo przeszklone drzwi pozwala wyeksponować elegancką kolekcję kieliszków czy ulubione pamiątki. Trójwymiarowe fronty wprowadzą do wnętrza dynamiczny i wyrazisty charakter. Biała komoda nada wnętrzu lekkości i nie przytłoczy go. WNĘTRZE Za 3 drzwiami znajdziesz 7 wnęk, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. Brak uchwytów podkreśla minimalistyczny i nowoczesny charakter mebla. Blat możesz wykorzystać na wyeksponowanie stylowych dekoracji, zdjęć czy pamiątek. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się we współczesnych aranżacjach, w których zależy nam na stworzeniu ciekawej i nowoczesnej aranżacji.', '', 'komoda-biala-nowoczesna-szeroka-patrik', '', '', '', 'Komoda biała nowoczesna szeroka PATRIK', '', '', '', ''),
(144, 1, 1, 'Szafka na buty NEBRASKA 4 to mebel który sprosta oczekiwaniom całej rodziny lub prawdziwego miłośnika butów. 12 półek o głębokości 35 cm pomieści pokaźną kolekcję obuwia nawet w największych rozmiarach. Szafka jest idealna do przedpokoju, w którym brakuje światła dziennego. Fronty z lustrem na całej wysokości optycznie powiększą przestrzeń i wprowadzą ład do pomieszczenia. Szafka zmieści wszystkie buty, żadne nie będą już musiały zastawiać miejsca na podłodze. WYKOŃCZENIE korpus szafki jest wykończony laminatem o matowej powierzchni; fronty pokryte są w całości lustrem; uchwyty są wykonane z tworzywa; brak nóżek - daje stabilność i ułatwia utrzymanie porządku', '', 'szafka-na-buty-z-lustrem-nebraska-4', '', '', '', 'Szafka na buty z lustrem NEBRASKA 4', '', '', '', ''),
(145, 1, 1, 'Lubisz niestandardowe i nowoczesne rozwiązania we wnętrzach? Komoda 3D PATRIK to mebel, który odmieni przestrzeń salonu, przedpokoju czy sypialni. Trójwymiarowe fronty wprowadzą do wnętrza dynamiczny i wyrazisty charakter. Biała komoda nada wnętrzu lekkości i nie przytłoczy go. WNĘTRZE Za 3 drzwiami znajdziesz 6 wnęk, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. Brak uchwytów podkreśla minimalistyczny i nowoczesny charakter mebla. Blat możesz wykorzystać na wyeksponowanie stylowych dekoracji, zdjęć czy pamiątek. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się we współczesnych aranżacjach, w których zależy nam na stworzeniu ciekawej i nowoczesnej aranżacji.', '', 'komoda-biala-nowoczesna-trzydrzwiowa-patrik', '', '', '', 'Komoda biała nowoczesna trzydrzwiowa PATRIK', '', '', '', ''),
(146, 1, 1, 'Komoda IKOLI jest nowoczesnym meblem, który idealnie zaaranżuje wnętrze salonu. Stonowane połączenie bieli z barwą dębu sonoma nie zdominuje przestrzeni i wpasuje się we wnętrze jasne i neutralne, stawiające na spokojną prostotę aranżacyjną. WNĘTRZE 4 duże wnęki w zamykanych szafkach po obu stronach komody rozwiążą wiele problemów organizacyjnych umożliwiając schowanie sporej ilości akcesoriów niezbędnych w każdym salonie; 4 pojemne szuflady na prowadnicach kulkowych świetnie sprawdzą się jako dodatkowa przestrzeń do przechowywania gadżetów i akcesoriów domowych; Maksymalne obciążenie półek wynosi 5 kg . WYKOŃCZENIE Komoda jest wykonana z płyty wiórowej o grubości 1,2 cm ; Komoda jest pokryta folią w ciekawym połączeniu barwy dębu sonoma oraz klasycznej bieli . Powierzchnia pokryta folią jest bardzo praktyczna – jest trwała i łatwa do utrzymania w czystości; Srebrny uchwyt z tworzywa odznacza się prostą, minimalistyczną stylistyką świetnie pasując do nowoczesnego designu komody;', '', 'komoda-ikoli-3d4s', '', '', '', 'Komoda IKOLI 3D4S', '', '', '', ''),
(147, 1, 1, 'Telewizor, konsola, pilot, pady i baterie. Do udanego relaksu brakuje Ci jedynie 2-drzwiowej szafki RTV z serii STREET. Na jej blacie położysz duże przedmioty. Za drzwiami i w szufladzie - mniejsze rzeczy, które niekoniecznie muszą leżeć na wierzchu. Szafka RTV 2-drzwiowa STREET to mebel utrzymany w nowoczesnym stylu. Dzięki wykończeniu w kolorze jasnego drewna i czerni pasuje do pomieszczeń industrialnych. WNĘTRZE W dużej wnęce za drzwiami zmieścisz konsolę. W szufladzie schowasz instrukcję do telewizora, pilot, pady i zapasowe baterie. We wnęce otwartej możesz trzymać dekoder. WYKOŃCZENIE Szafkę RTV STREET wykonano z 16 mm płyty meblowej. Mebel pokryto laminatem w kolorze jasnego dębu navarra oraz laminatem w czarnym kolorze. Nogi wykonano z metalu i pomalowano na czarno.', '', 'szafka-rtv-na-skosnych-nogach-street', '', '', '', 'Szafka RTV na skośnych nogach STREET', '', '', '', ''),
(148, 1, 1, 'Nieważne, czy meblujesz mieszkanie studenckie czy chcesz urządzić mały kąt dla miłośnika seansów filmowych? Szafka RTV Basic jest dla Ciebie! Dzięki niej na małej przestrzeni stworzysz miejsce do przechowywania akcesoriów i sprzętu RTV. Mebel jest prosty i pozbawiony zdobień. Bez trudu dopasujesz go do już istniejącej aranżacji w Twoim salonie. ZA ZAMKNIĘTYMI DRZWIAMI W szafce znajdziesz 2 zamykane półki , gdzie możesz schować sprzęt oraz okablowanie RTV lub kolekcję płyt DVD. PODŚWIETLENIE LED 1 szklana półka w centralnej części jest dodatkowo wyposażona w podświetlenie LED , więc możesz postawić tam wyjątkowy dodatek, albo ulubione zdjęcie. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej wykończonej melaminą w białym i czarnym kolorze. Nóżki mebla są z tworzywa sztucznego PCV.', '', 'duza-szafka-rtv-z-oswietleniem-kontrastowa-basic-2', '', '', '', 'Duża szafka RTV z oświetleniem kontrastowa BASIC 2', '', '', '', ''),
(149, 1, 1, 'Komoda MALI 2D4S świetnie uzupełni aranżację przedpokoju, pokoju dziennego, sypialni lub biura. To idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Przyda się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych czy dokumentów. WNĘTRZE Wnętrze komody dzieli się na 4 wnęki za drzwiami oraz 4 szuflady. Maksymalne obciążenie półki wynosi 15 kg. WYKOŃCZENIE Połączenie koloru drewna z czernią sprawia, że komoda MALI dobrze zaprezentuje się w industrialnych i nowoczesnych mieszkaniach.', '', 'komoda-mali-2d4s-dab-craft-czarny', '', '', '', 'Komoda MALI 2D4S dąb craft/czarny', '', '', '', ''),
(150, 1, 1, 'Potrzebujesz dodatkowego mebla do przechowywania, a pokój jest mały? Głęboka na 34 cm komoda OSLO jest idealna do niewielkich pomieszczeń. Sprawdzi się w wąskim przedpokoju, domowym biurze, pokoju dziennym czy młodzieżowym. Jasne fronty połączone z korpusem w kolorze drewna to ponadczasowa propozycja do wielu aranżacji. Dodatkowo takie wybarwienie nie przytłacza wnętrza. WNĘTRZE Za drzwiami znajdziesz 2 wnęki, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się w nowoczesnych i skandynawskich aranżacjach.', '', 'komoda-oslo-2d', '', '', '', 'Komoda OSLO 2D', '', '', '', ''),
(151, 1, 1, 'W małych i wąskich przedpokojach nie ma miejsca na rozgardiasz i porozrzucane buty. Biała szafka na buty z siedziskiem pomoże uporządkować obuwie i akcesoria, a jednocześnie możesz na niej usiąść i wygodnie włożyć buty. WNĘTRZE Obuwie możesz przechowywać w 2 wnękach. Dzięki zastosowaniu drzwi klapowych, łatwiej jest wyciągnąć buty od góry, gdy korzystasz z siedziska. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej o grubości 1,6 cm i pokryta laminatem. Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. Biała szafka na buty z szarym siedziskiem sprawdzi się w jasnych, nowoczesnych aranżacjach. Łatwo dopasujesz ją do innych mebli.', '', 'szafka-na-buty-z-siedziskiem-1k-biala', '', '', '', 'Szafka na buty z siedziskiem 1K BIAŁA', '', '', '', ''),
(152, 1, 1, 'Szukasz mebli do wąskiego przedpokoju ? Dzięki głębokości 33 cm szafka na buty KAPRI to gotowe rozwiązanie do małych pomieszczeń. Szafa na buty jest wysoka, jak standardowa szafa - dzięki czemu możesz przechować w niej jeszcze więcej butów. Jej konstrukcja pozwoli Ci zapanować nad rozgardiaszem w przedpokoju, a wykończenie w kolorze drewna sprawi, że już od wejścia w mieszkaniu zapanuje przytulny klimat. Nowoczesny charakter szafki sprawia, że łatwo wkomponujesz ją w różne aranżacje pomieszczeń. WNĘTRZE W 7 wnękach ułożysz buty i inne akcesoria. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Korpus mebla wykonany jest z płyty meblowej i wykończony melaminą .', '', 'szafa-na-buty-neo-2d', '', '', '', 'Szafa na buty NEO 2D', '', '', '', ''),
(153, 1, 1, 'Komoda NEPTUN 2S/134 pomoże Ci zorganizować potrzebne przedmioty w domowym biurze lub pokoju młodzieżowym. Mebel może pełnić funkcję dostawki do blatu biurka NEPTUN – zarówno z prawej, jak i lewej strony. Przechowasz w niej często używane sprzęty, dokumenty, artykuły biurowe. Jasne fronty komody odbiją światło i dzięki temu rozświetlą pomieszczenie. Nowoczesny design i wybarwienie stworzą przyjazną przestrzeń do pracy . WNĘTRZE Komoda posiada 2 szuflady, wyposażone w prowadnice kulkowe w pełnym wysuwem i 4 otwarte wnęki ; Szuflady mają uniwersalny układ — sam decydujesz, której strony je umieścisz podczas montażu; Na blacie możesz umieścić drukarkę lub potrzebne gadżety, wyeksponować ulubione dekoracje lub ramkę ze zdjęciem. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony laminatem; Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości; Uchwyty w srebrnym kolorze odznaczają się prostą, minimalistyczną stylistyką i świetnie pasują do nowoczesnego designu komody; Podstawą komody są drewniane nóżki , które nadają jej lekkości. Meble NEPTUN – ZESTAW JE JAK CHCESZ Kolekcja NEPTUN wyróżnia się innowacyjnym podejściem do aranżacji miejsca pracy lub nauki. Wielofunkcyjny system pozwoli zrealizować nawet kilkanaście koncepcji na zagospodarowanie przestrzeni domowego biura, gabinetu czy pokoju młodzieżowego.', '', 'komoda-neptun-2s-134', '', '', '', 'Komoda NEPTUN 2S/134', '', '', '', ''),
(154, 1, 1, '2-drzwiowa szafka RTV ERDEN to mebel, który stanowi doskonałe dopełnienie dla wnętrza utrzymanego w jasnej kolorystyce. Znajdzie dla siebie zastosowanie w salonie, pokoju dziennym, młodzieżowym oraz gabinecie. Jej prosty wzór i oszczędny design sprawiają, że najlepiej łączy się z nowoczesnym wystrojem wnętrza. Uniwersalna kolorystyka w odcieniu bieli sprawia, że pomieszczenie wydaje się większe i jaśniejsze, a ponadto dobrze łączy się z kompozycjami aranżacyjnymi. Dodatkową zaletą są funkcjonalne półki otwarte umiejscowione pod blatem. WNĘTRZE RTV ERDEN posiada dwie zamykane szafki oraz półki otwarte w centralnej części mebla. Idealnie sprawdza się zarówno jako mebel eksponujący sprzęt RTV oraz miejsce na kolekcję filmów oraz muzyki. Wymiary wnęki dolnej: szerokość 39 cm, głębokość 31,5 cm, wysokość 18 cm Wymiary wnęki górnej: szerokość 39 cm, głębokość 31,5 cm, wysokość 13 cm (20 cm licząc bez listwy) WYKOŃCZENIE Wykonana z płyty meblowej szafka RTV ERDEN wykończona została laminatem. Nogi są zaopatrzone w ślizgacze z tworzywa, które ułatwiają przesuwanie mebla i chronią powierzchnię podłogi przed zarysowaniem.', '', 'szafka-rtv-erden-2d-125', '', '', '', 'Szafka RTV ERDEN 2D 125', '', '', '', ''),
(155, 1, 1, 'Regał MAURO to minimalistyczna bryła w ciepłym kolorze naturalnego drewna. Sprawdzi się w małych wnętrzach lub może być podstawą większej kombinacji, kiedy zmienią się Twoje potrzeby. Regał możesz wykorzystać jako miejsce do uporządkowania dokumentów w domowym biurze lub jako półkę na książki i czasopisma w kąciku do czytania. Możesz ustawić na nim kwiaty lub stylowe dekoracje. Wnęka ma wymiary: 33x33 cm. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. Regał MAURO MXXR111 występuje w czterech wariantach kolorystycznych: czarnym, białym, szarym i dębowym.', '', 'regal-mauro-728x382-cm-debowy', '', '', '', 'Regał MAURO 72,8x38,2 cm dębowy', '', '', '', ''),
(156, 1, 1, 'Okazała komoda LISSE 3D2S przeznaczona jest do salonu lub jadalni. Mocny biały kolor z połyskiem rozjaśni i optycznie powiększy przestrzeń. Dodatkowo zamontowane oświetlenie LED wprowadzi przyjemną, przytulną atmosferę. Komoda jest jednym z elementów uniwersalnej kolekcji LISSE ale dzięki swojej białej barwie i ponadczasowej, prostej formie sprawdzi się w połączeniu z innymi meblami wykończonymi w bieli lub jasnych odcieniach drewna. Będzie idealną bazą dla aranżacji wnętrza w różnych stylach, w szczególności nowoczesnym i skandynawskim. WNĘTRZE Wnętrze komody kryje wiele wnęk do przechowywania zapasowych naczyń, obrusów czy serwetek oraz eksponowania eleganckiego szkła i dodatków. Zawiasy wyposażono w komfortowy system „cichego domyku” a prowadnice szuflad posiadają hamulce, dzięki czemu ich domykanie nie powoduje hałasu. WYKOŃCZENIE Fronty są wykończone folią w połysku. W szklanej części użyto czystego szkła hartowanego o grubości 4 mm, natomiast szklane półki są wykonane ze szkła niehartowanego o grubości 5 mm. Uchwyty są wykonane z metalu.', '', 'komoda-do-salonu-biala-lisse', '', '', '', 'Komoda do salonu biała LISSE', '', '', '', ''),
(157, 1, 1, 'Komoda z półką IMOLA łączy w sobie charakter mebla, na którym możesz odłożyć książkę lub postawić głośniki oraz szafki, w której schowasz akcesoria szkolne. MIEJSCE DO PRZECHOWYWANIA Za drzwiami komody IMOLA znajdują się 2 pojemne wnęki do przechowywania . W komodzie jest również 1 szuflada oraz otwarta wnęka . 3 KOLORY Połączenie 3 kolorów to mieszanka koloru szarego przypominającego surowy beton , bieli oraz dębu. Meble wprowadzą do pokoju młodego człowieka estetyczny wygląd, ale również ponadczasowość na ładnych kilka lat! MEBLE DO ZADAŃ SPECJALNYCH W pokoju Twojego nastolatka zawsze dużo się dzieje, więc utrzymanie w nim porządku może być nie lada wyzwaniem. Jeśli szukasz mebli, które pomogą Ci uporządkować rzeczy dziecka, mamy dla Ciebie kolekcję do zadań specjalnych - IMOLA . Meble mają dużo wydzielonych wnęk do przechowywania pamiątek, którymi Twój nastolatek będzie chciał się pochwalić, a także półek za zamkniętymi drzwiami w sam raz do ukrywania skarbów.', '', 'komoda-wysoka-z-polka-imola', '', '', '', 'Komoda wysoka z półką IMOLA', '', '', '', ''),
(158, 1, 1, 'Komoda BERGEN 3D3S może pełnić funkcję bufetu, biblioteczki lub bieliźniarki. Łączy cechy rustykalnych mebli z nowoczesnymi elementami wykończeniowymi. Wraz z pozostałymi meblami z serii, tworzy aranżację o sielskim charakterze, wprowadzając do wnętrz przytulny klimat. Ze względu na dużą różnorodność brył, meble te można wkomponować w otwarte, wielofunkcyjne przestrzenie. Tzw. ślizgacze ułatwiają precyzyjne ustawienie mebla oraz jego przesuwanie podczas sprzątania. WNĘTRZE Sześć wnęk pozwala tak rozmieścić przedmioty, by nie musieć ich potem długo szukać. W trzech szufladach możesz przechowywać mniejsze akcesoria lub bieliznę. WYKOŃCZENIE Laminat, imitujący wyraźną strukturę drewna dębowego w kolorze „wotan” ociepla wnętrze i nadaje mu swojskiego charakteru. Metalowe uchwyty i ciemny dekor umożliwiają estetyczne wkomponowanie mebli w nowoczesne wnętrza. Wystrój dopełnią drewniane dekoracje lub dodatki w czarnym kolorze.', '', 'komoda-bergen-3d3s', '', '', '', 'Komoda BERGEN 3D3S', '', '', '', ''),
(159, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model dużej komody TEMPRA wyposażony w 2 drzwi oraz 5 szuflad umieszczonych w środkowej sekcji mebla. Komoda została w całości wykonana z płyty meblowej i wykończona folią. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie komody z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz 5 szuflad ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce imitującej stare drewno ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-niska-2d5s-loft', '', '', '', 'Komoda TEMPRA 2 niska 2D5S loft', '', '', '', ''),
(160, 1, 1, 'Szafka RTV BILBAO podkreśli przytulny klimat w mieszkaniu i pomoże uporządkować wszystkie akcesoria w kąciku wypoczynkowym. WNĘTRZE W otwartej części szafki zmieści się dekoder i konsola. Wymiary otwartych wnęk: 58x39x18,5 cm i 58x39x20 cm. We wnękach za drzwiami uporządkujesz akcesoria, gry lub płyty. Szafkę wyposażono w zawiasy z cichym domykiem , więc unikniesz hałasu trzaskających drzwi. WYKOŃCZENIE Matowe wykończenie, połączenie bieli z kolorem drewna , wysokie nóżki i czarne uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. NOWOCZESNE MEBLE DO SALONU Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty w kilku bryłach kolekcji nadają wnętrzu nietuzinkowego charakteru. Duża ilość brył BILBAO w różnych rozmiarach pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz oraz urządzić salon z jadalnią w spójnym stylu .', '', 'szafka-rtv-bilbao-2d', '', '', '', 'Szafka RTV BILBAO 2D', '', '', '', ''),
(161, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 2 drzwi , w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie komody z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykaną szafkę wypełnione 3 półkami ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce imitującej stare drewno ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-niska-2d-loft', '', '', '', 'Komoda TEMPRA 2 niska 2D loft', '', '', '', ''),
(162, 1, 1, 'Poszukujesz praktycznej i pojemnej komody do pokoju nastolatka? Mamy dla Ciebie komodę KUBO, która pomieści niezbędne rzeczy w pokoju Twojego dziecka i pomoże w zachowaniu organizacji w pomieszczeniu. Jej blat może posłużyć do wyeksponowania dodatków i ciekawych gadżetów młodego człowieka, a wnętrze pomieści małe skarby. PORZĄDEK W ZASIĘGU RĘKI W komodzie jest do dyspozycji 3 szuflady do przechowywania ubrań lub akcesoriów. Dodatkowo Twoje dziecko może skorzystać z otwartej wnęki o wymiarach: 75 x 35,5 x 17,5 odpowiedniej do postawienia na przykład niskich pudełek dekoracyjnych. DWA KOLORY Ciepła kolorystyka boków sprawia, że meble z kolekcji KUBO dodadzą przytulności pomieszczeniu. Białe, błyszczące fronty dodatkowo odbijają najwięcej promieni słonecznych, dlatego rozjaśnią i optycznie powiększą przestrzeń Twojego pokoju. MEBLE DLA NASTOLATKA W pokoju nastolatka nie trudno o chaos, dlatego najlepiej sprawdzą się w nim meble ułatwiające przechowywanie i ukrywanie swoich małych skarbów. Meble z serii KUBO to kolekcja brył, gdzie możecie posegregować i schować zarówno podręczniki, jak i zabawki i kolekcję ulubionych przedmiotów.', '', 'komoda-z-wneka-do-pokoju-mlodziezowego-kubo', '', '', '', 'Komoda z wnęką do pokoju młodzieżowego KUBO', '', '', '', ''),
(163, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 2 drzwi, w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka dąb artisan o charakterystycznym wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie z meblami w stylu nowoczesnym oraz skandynawskim. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce dąb artisan ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-niska-2d-dab-artisan', '', '', '', 'Komoda TEMPRA 2 niska 2D dąb artisan', '', '', '', ''),
(164, 1, 1, 'Lubisz czarne, matowe elementy we wnętrzach? Nie chcesz jednak, by zbytnio Cię przytłoczyły? Komoda NOVENA stanowi idealny kompromis między bielą frontów a wyrazistym akcentem czerni w Twoim salonie . Geometryczna bryła, nowoczesne rozwiązanie w postaci 2 szuflad skrytych za 1 frontem oraz jasny, funkcjonalny podział komody sprawi, że nawet największy miłośnik symetrii będzie spać spokojnie. Zwłaszcza gdy zdecyduje się dzielić z NOVENĄ sypialnię . Zawiasy wyposażono w cichy domyk. Dzięki temu drzwi nie trzaskają. WNĘTRZE Za jednym frontem szuflady kryją się tak naprawdę 2 wnętrza - po jednej szufladzie dla pana i pani domu. 10 wnęk umożliwia Ci perfekcyjne rozmieszczenie rzeczy. WYKOŃCZENIE Lubisz minimalistyczne aranżacje? Meble z kolekcji NOVENA zachwycą Cię swoją prostą konstrukcją. Białe fronty sprawiają, że przestrzeń wyda się jaśniejsza i większa. Czarne wstawki i dekory w kolorze drewna podkreślają nowoczesny charakter aranżacji. Meble wykończono laminatem.', '', 'komoda-z-szuflada-novena', '', '', '', 'Komoda z szufladą NOVENA', '', '', '', ''),
(165, 1, 1, 'Szafka RTV VINCENT NEW V-8 nawiązuje stylistyką do designu lat 60-tych oraz 70-tych. Panujący wówczas styl modernistyczny był odwrotem od przeszłości i spojrzeniem w przyszłość- pełen futurystycznych brył, stawiający na prostotę i lekkość formy. Wówczas szafka RTV już nawet z racji swej funkcji była meblem nowoczesnym- telewizor stanowił przejaw najnowszej techniki i dla wielu pozostawał wciąż niemożliwym do spełnienia marzeniem. Mebel świetnie wkomponuje się w nowoczesne wnętrza, ale również te, które utrzymane są w stylistyce vintage. Nieskomplikowane linie oraz białe wybarwienie połączone z imitacją dębowego drewna tworzą mebel subtelny i elegancki. WNĘTRZE Na wnętrze mebla składają się dwie szafeczki , a pośrodku znajduje się wnęka o wymiarach 46/38/10 cm . Wewnątrz niej zamontowano jeden punkt oświetlenia LED , które pomoże stworzyć ciekawy efekt wizualny. WYKOŃCZENIE Fronty szafki RTV VINCENT NEW V-8 zamontowano na zawiasach z funkcją cichego domyku, co podwyższa komfort korzystania z mebla. Funkcję uchwytów pełnią tutaj frezowania we frontach. Bryła szafki połączenie bieli z okleiną imitującą drewno dębowe, co jest rozwiązaniem na tyle uniwersalnym, że bez problemu dopasujesz mebel do dowolnej kolorystyki ścian, tekstyliów i dodatków dekoracyjnych. Szafkę VINCENT NEW z powodzeniem wkomponujesz we wnętrze o nowoczesnym, minimalistycznym wystroju. Jest wręcz stworzona do aranżacji utrzymanych w stylistyce skandynawskiej- ze względu na swą prostotę, wybarwienie oraz charakterystyczny kształt drewnianych nóżek. Doskonale wkomponuje się również w przestrzenie w charakterze vintage, wypełnione wyrazistymi wzorami oraz intensywnymi, żywymi kolorami.', '', 'szafka-rtv-vincent-new-v-8-z-oswietleniem', '', '', '', 'Szafka RTV VINCENT NEW V-8 z oświetleniem', '', '', '', ''),
(166, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model dużej komody TEMPRA wyposażony w 3 drzwi oraz 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie komody z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz 2 szuflady ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce imitującej stare drewno ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-niska-tempra-2-3d2s-loft', '', '', '', 'Komoda niska TEMPRA 2 3D2S loft', '', '', '', ''),
(167, 1, 1, 'Komoda TEMPRA z 3 wnękami TEMPRA 2 2D2S wyposażona jest w 2 drzwi oraz 2 szuflady . Dzięki takiemu rozkładowi jest idealnym meblem do przechowywania książek i drobnych gadżetów. WNĘTRZE W 3 wnękach możesz przechowywać przedmioty o wadze maksymalnej 5 kg 2 szuflady to idealne miejsce na drobiazgi WYKOŃCZENIE Została wykonana z płyty meblowej, pokrytej folią. Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla. Kolorystyka dąb artisan umożliwia zestawienie komody z meblami w stylu rustykalnym oraz industrialnym. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. MIEJSCE NA WSZYSTKO Kolekcja komód i regałów TEMPRA 2 sprawi, że w Twoim domu znajdzie się miejsce na wszystko. Przy jej pomocy możesz urządzić domową czytelnię, gabinet lub przedpokój. Dzięki tej kolekcji zachowasz porządek wśród ubrań, dokumentów, potrzebnych drobiazgów, a nawet ubrań.', '', 'komoda-tempra-2-wysoka-2d2s-dab-artisan', '', '', '', 'Komoda TEMPRA 2 wysoka 2D2S dąb artisan', '', '', '', ''),
(168, 1, 1, 'Komoda TEMPRA 2 2D to idealny mebel do przechowywania przedmiotów na półkach. Może pełnić funkcje miniregału, szafki na zabawki lub znaleźć swoje zastosowanie w przedpokoju. WNĘTRZE W 3 wnękach możesz przechowywać przedmioty o wadze maksymalnej 5 kg Wykorzystaj miejsce na blacie na wyeksponowanie pamiątek i dekoracji. WYKOŃCZENIE Została wykonana z płyty meblowej, pokrytej folią. Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla. Kolorystyka dąb artisan umożliwia zestawienie komody z meblami w stylu rustykalnym oraz industrialnym. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. MIEJSCE NA WSZYSTKO Kolekcja komód i regałów TEMPRA 2 sprawi, że w Twoim domu znajdzie się miejsce na wszystko. Przy jej pomocy możesz urządzić domową czytelnię, gabinet lub przedpokój. Dzięki tej kolekcji zachowasz porządek wśród ubrań, dokumentów, potrzebnych drobiazgów, a nawet ubrań.', '', 'komoda-tempra-2-wysoka-2d-dab-artisan', '', '', '', 'Komoda TEMPRA 2 wysoka 2D dąb artisan', '', '', '', ''),
(169, 1, 1, 'Nie wszystko musisz przechowywać na widoku. To czego nie chcesz pokazać, schowaj w szufladach komody FEMII. Ubrania? Książki? Tylko od Ciebie zależy, co do nich włożysz. Komoda FEMII w kolorze alpejskiej bieli sprawdzi się zarówno w pokojach dziewczynek i chłopców. Jej prosta nienachalna forma pasuje do minimalistycznych wnętrz, utrzymanych w jasnych barwach. WNĘTRZE Komoda FEMII wyposażona jest w 3 szuflady, w których możesz przechowywać rzeczy o wadze nieprzekraczającej 3 kg. Na blacie komody możesz położyć nawet 10 kg przedmioty. WYKOŃCZENIE Komodę wykonano z 16 mm płyty meblowej, która została pokryta laminatem w kolorze alpejskiej bieli. Szuflady komody FEMII zamontowano na prowadnicach kulkowych. Uchwyty szuflad wykonano z metalu.', '', 'biala-komoda-z-szufladami-dla-nastolatka-femii', '', '', '', 'Biała komoda z szufladami dla nastolatka FEMII', '', '', '', ''),
(170, 1, 1, 'Szafka na buty LANZETTE to praktyczny, bardzo kompaktowy schowek, który pomieści obuwie całej rodziny, nie zajmując zbyt wiele miejsca. Można ją skompletować z wieszakiem, by zaoszczędzić miejsce w przedpokoju. To część kolekcji, która pozwala nawet na niewielkiej przestrzeni rozmieścić odzież wierzchnią, obuwie i akcesoria całej rodziny, tak, by wszystko, co potrzebne przed wyjściem z domu było pod ręką. Jak jest wykonana szafka na buty LANZETTE? Szafka na buty LANZETTE została wykonana z płyty meblowej laminowanej , jednak front mebla skonstruowano z płyty MDF wykończonej folią PVC . Drzwiczki otwierane klapowo to bardzo wygodne rozwiązanie nawet do małego przedpokoju, którego ograniczona przestrzeń nie pozostawia zbyt wiele swobody. Solidny, czarny uchwyt z tworzywa ładnie komplementuje frezowanie na froncie drzwiczek. Szafka jest umieszczona na dyskretnych nóżkach ślizgaczach , które nie rysują podłogi podczas przesuwania. Do jakich wnętrz pasuje szafka na buty LANZETTE? Połączenie bieli inspirowanej barwami płatków lilii wodnej ze złocistym, ciepłym wybarwieniem dębu craft sprawia, że kolekcja LANZETTE idealnie pasuje do jasnych wnętrz wzbogaconych soczystymi barwami. Jasne meble sprawiają, że przedpokój wydaje się większy.', '', 'szafka-na-buty-lanzette', '', '', '', 'Szafka na buty LANZETTE', '', '', '', ''),
(171, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 2 drzwi oraz 5 szuflad umieszczonych w centralnej części bryły. Kolorystyka dąb artisan o charakterystycznym wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie z meblami w stylu nowoczesnym oraz skandynawskim. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz 5 szuflad ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce dąb artisan ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-2d5s-dab-artisan', '', '', '', 'Komoda TEMPRA 2 2D5S dąb artisan', '', '', '', ''),
(172, 1, 1, 'Chcesz uporządkować dodatki w przedpokoju? A może potrzebujesz mebla, na którym ustawisz kolekcję zdjęć rodzinnych w salonie? Komoda DOORSET ułatwi Ci poukładanie wszystkich rzeczy, które przydają się w salonie, przedpokoju lub jadalni. Mebel w ciepłym kolorze drewna pomoże wprowadzić do wnętrza przytulny, domowy nastrój. WNĘTRZE Komoda posiada 4 zamykane wnęki , w których uporządkujesz ubrania, zastawę stołową czy dokumenty. 4 szuflady pomieszczą niewielkie akcesoria. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Wykończenie utrzymane jest w barwie dąb navarra, dzięki któremu wnętrze nabiera domowej i ciepłej atmosfery. Uwagę zwracają ładnie wkomponowane w bryłę uchwyty. KOLEKCJA MEBLI DOORSET Kolekcja mebli DOORSET w całości jest wykonana w kolorze imitujący barwę surowego drewna, z widocznymi słojami i sękami, dlatego też świetnie sprawdzi się we wnętrzach urządzonych w stylu rustykalnym. Ciepły odcień dębu navarra pomoże Ci otrzymać w jadalni przytulną atmosferę potrzebną do wspólnego spożywania posiłku lub spotkań ze znajomymi, z którymi chcesz pograć w planszówki.', '', 'komoda-z-szufladami-i-polkami-doorset', '', '', '', 'Komoda z szufladami i półkami DOORSET', '', '', '', ''),
(173, 1, 1, 'Regał EXETER to mebel o nowoczesnym designie, uniwersalny pod kątem użytkowym. 114 cm wysokości oraz doskonałe rozmieszczenie półek sprzyja ustawieniu na nim nie tylko książek i dokumentów ale również przedmiotów o bardziej specjalistycznym zastosowaniu, które dobrze mieć pod ręką. Można ustawić na niej statyw dla aparatu fotograficznego, tubę na szkice, gitarę lub wysokie dekoracje z naturalnych lub sztucznych kwiatów. Połączenie metalowego stelaża i płyty MDF tworzy solidną konstrukcję, która doskonale prezentuje się zarówno w przestronnych, jak i kameralnych wnętrzach. Regał EXETER stanowi istotne dopełnienie dla wnętrza pokoju dziennego, młodzieżowego oraz domowego gabinetu. WYKOŃCZENIE Na szczególną uwagę zasługuje jego oprawa kolorystyczna regału EXETER. Jasne wybarwienie dębu dzikiego świetnie komponuje się ze czarnym, matowym stelażem. Całość idealnie pasuje do jasnych i pełnych światła wnętrz.', '', 'regal-metalowy-industrialny-exeter-77x114-cm', '', '', '', 'Regał metalowy industrialny EXETER 77x114 cm', '', '', '', ''),
(174, 1, 1, 'Szukasz nieoczywistej komody do pokoju swojego dziecka? Komoda z półkami z kolekcji mebli IMOLA to mebel, w którym Twoje dziecko będzie mogło schować nie tylko bibeloty i gry, ale również podręczniki i zeszyty szkolne. ZA DRZWIAMI Komoda ma 2 duże wnęki do przechowywania. 1 duża otwarta wnęka, gdzie twoje dziecko może odłożyć telefon lub pokazać kolekcję komiksów. Meble wprowadzą do pokoju młodego człowieka estetyczny wygląd, ale również ponadczasowość na ładnych kilka lat! Na dole meble jest szuflada, w której można schować przedmioty o łącznej wadze maksymalnej 3 kg. 3 KOLORY Połączenie 3 kolorów to mieszanka koloru szarego przypominającego surowy beton , bieli oraz dębu. Meble wprowadzą do pokoju młodego człowieka estetyczny wygląd, ale również ponadczasowość na ładnych kilka lat! MEBLE DO ZADAŃ SPECJALNYCH W pokoju Twojego nastolatka zawsze dużo się dzieje, więc utrzymanie w nim porządku może być nie lada wyzwaniem. Jeśli szukasz mebli, które pomogą Ci uporządkować rzeczy dziecka, mamy dla Ciebie kolekcję do zadań specjalnych - IMOLA . Meble mają dużo wydzielonych wnęk do przechowywania pamiątek, którymi Twój nastolatek będzie chciał się pochwalić, a także półek za zamkniętymi drzwiami w sam raz do ukrywania skarbów.', '', 'wysoka-komoda-do-pokoju-mlodziezowego-imola', '', '', '', 'Wysoka komoda do pokoju młodzieżowego IMOLA', '', '', '', ''),
(175, 1, 1, 'Urządzasz mieszkanie w industrialnym stylu? Spodoba Ci się komoda z kolekcji HIGH ROCK. Duża ilość miejsca do przechowywania umożliwi funkcjonalne rozplanowanie wnętrza salonu, jadalni czy domowego biura. Możesz uporządkować w niej ubrania, zastawę stołową czy dokumenty. Blat pozwoli Ci wyeksponować stylowe dekoracje lub ulubione pamiątki. Kolekcja mebli HIGH ROCK to połączenie dekoru dąb riviera z pełną głębi czernią, która przyciągnie Twoją uwagę. WNĘTRZE Komoda posiada 2 zamykane wnęki oraz 3 szuflady, dzięki którym rozważnie uporządkujesz potrzebne przedmioty; W otwartych wnękach możesz umieścić niewielkie dekoracje lub płyty; WYKOŃCZENIE Komoda HIGH ROCK została wykonana z płyty meblowej oraz wykończona laminatem i folią. Fronty komody pokryte są folią w kolorze dąb riviera. Blat wykończony jest płytą laminowaną w czarnym kolorze, a półki płytą foliowaną w barwie dąb riviera. Komoda została wyposażona w czarne, metalowe uchwyty oraz ramy z płyty MDF przechodzące w nogi, co dodatkowo podkreśla industrialny charakter wnętrza. Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. Meble z kolekcji HIGH ROCK pomogą stworzyć wyjątkowy, loftowy klimat w Twoim mieszkaniu. Świetnie będą się prezentować przy ścianie z czerwonej cegły.', '', 'komoda-industrialna-szeroka-z-szufladami-i-polkami-high-rock', '', '', '', 'Komoda industrialna szeroka z szufladami i półkami HIGH ROCK', '', '', '', ''),
(176, 1, 1, 'Szukasz komody, która zmieści się przy ścianie o szerokości 160 cm? W Twój pokój wpasuje się ta komoda NOVENA. Zapewni Ci miejsce do przechowywania w 7 wnękach i podwójnej szufladzie. Zawiasy wyposażono w cichy domyk. Dzięki temu drzwi nie trzaskają. WNĘTRZE Za 1 frontem szuflady kryją się 2 wnętrza. Masz do dyspozycji 7 wnęk, w których łatwo posegregujesz ubrania na najbliższy tydzień. WYKOŃCZENIE Lubisz minimalistyczne aranżacje? Meble z kolekcji NOVENA zachwycą Cię swoją prostą konstrukcją. Białe fronty sprawiają, że przestrzeń wyda się jaśniejsza i większa. Czarne wstawki i dekory w kolorze drewna podkreślają nowoczesny charakter aranżacji. Meble wykończono laminatem.', '', 'komoda-do-salonu-novena', '', '', '', 'Komoda do salonu NOVENA', '', '', '', ''),
(177, 1, 1, 'Jeżeli szukasz szafki RTV o loftowym charakterze to szafka RTV NEYLE jest dla Ciebie! Wysokie, metalowe nóżki sprawiają, że szafka nie przytłoczy małych pomieszczeń. Mebel ma około 137 cm szerokości , a na jego blacie możesz postawić aż 40 kg . Sprawia to, że na szafce możesz postawić telewizor do 70 cali . MAŁA I POJEMNA Szafka RTV NEYLE ma 3 otwarte wnęki, w których postawisz dekoder, konsolę oraz inny potrzebny sprzęt elektroniczny. Za zamkniętymi drzwiami możesz schować mniej atrakcyjne dodatki. Mebel posiada klasyczne uchwyty w kolorze czarnym, oraz wyższe nóżki które nadają mu lekkości oraz pozwalają na łatwiejsze sprzątanie pod szafką. DODATKOWE ZABEZPIECZENIE W zestawie znajdują specjalne okucia, dzięki którym dodatkowo zabezpieczysz stabilność mebla montując go do ściany.', '', 'szafka-rtv-z-wysokimi-nozkami-neyle', '', '', '', 'Szafka RTV z wysokimi nóżkami NEYLE', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(178, 1, 1, 'Komoda IKOLI jest nowoczesnym meblem, który idealnie zaaranżuje wnętrze salonu. Stonowane połączenie bieli z barwą dębu sonoma nie zdominuje przestrzeni i wpasuje się we wnętrze jasne i neutralne, stawiające na spokojną prostotę aranżacyjną. WNĘTRZE 4 duże, zamykane wnęki rozmieszczone symetrycznie po obu stronach komody rozwiążą wiele problemów organizacyjnych umożliwiając schowanie sporej ilości akcesoriów niezbędnych w każdym salonie; 4 pojemne szuflady na prowadnicach kulkowych świetnie sprawdzą się jako dodatkowa przestrzeń do przechowywania gadżetów i akcesoriów domowych; Maksymalne obciążenie półek wynosi 5 kg . WYKOŃCZENIE Komoda jest wykonana z płyty wiórowej o grubości 1,2 cm ; Komoda jest pokryta folią w ciekawym połączeniu barwy dębu sonoma oraz klasycznej bieli . Powierzchnia pokryta folią jest bardzo praktyczna – jest trwała i łatwa do utrzymania w czystości; Srebrny uchwyt z tworzywa odznacza się prostą, minimalistyczną stylistyką świetnie pasując do nowoczesnego designu komody;', '', 'komoda-ikoli-2d4s', '', '', '', 'Komoda IKOLI 2D4S', '', '', '', ''),
(179, 1, 1, 'Szukasz szafki na buty, która pozwoli Ci utrzymać porządek w przedpokoju? Szafka na buty SIENNA , dzięki wysokości 171,3 cm pomieści obuwie Twojej rodziny. Dzięki specjalnym drzwiom klapowym chowanie i wyciąganie butów będzie bardzo wygodne. Wysoka i wąska szafka pozwoli przechowywać buty nawet w wąskim przedpokoju. Szafka wyposażona jest w 4 drzwi klapowe z wygodnym, frezowanym uchwytem. WYKOŃCZENIE Szafka wykonana jest z płyt meblowych i wykończona folią. Białe, połyskujące fronty rozświetlą mały przedpokój. Połączenie koloru dębu piaskowego z bielą ociepli i optycznie powiększy wnętrze małego przedpokoju. Biała kolorystyka z połyskiem sprawdzi się szczególnie we wnętrzach nowoczesnych i minimalistycznych.', '', 'szafka-na-buty-sienna-4k', '', '', '', 'Szafka na buty SIENNA 4K', '', '', '', ''),
(180, 1, 1, 'Nowoczesny telewizor na rustykalnej szafce? Tak – zwłaszcza, jeśli szafka jest granatowa . Szafka RTV z kolekcji BOHOL ma ponad 160 cm szerokości więc zapewni podstawę dla dużego telewizora. Dzięki bocznym szafkom, wnęce otwartej i szufladzie znajdzie się miejsce na przechowanie wszystkich Twoich elektronicznych skarbów. Wyrazisty rysunek drewna wprowadzi do strefy wypoczynkowej swojskość - tylko, że w nowoczesnym wydaniu. Zawiasy wyposażono w system cichego domyku, więc drzwi nie trzaskają. Możesz dokupić oświetlenie do wnęki otwartej. Gdy zgasisz główne światło i zapalisz podświetlenie, zrobi się jeszcze bardziej klimatycznie. WNĘTRZE W 2 szafkach bocznych możesz schować płyty i akcesoria do gier. Szuflada przyda się do przechowywania drobniejszej elektroniki. Konsolę lub dekoder możesz ustawić we wnęce. Dzięki temu będziesz mieć do niej wygodny dostęp. WYKOŃCZENIE Mebel wykończono dwoma rodzajami folii z rysunkiem drewna. Folia na blacie i półkach ma kolor drewna dębu riviera – sprawia, że we wnętrzu robi się przytulniej. Front i korpus pokrywa granatowa folia, imitująca malowane drewno. Uchwyty z tworzywa mają prostą formę. DREWNO W BARWIE GRANATU Lubisz otaczać się rustykalnymi meblami, ale tym razem szukasz czegoś bardzo oryginalnego? Chcesz wprowadzić do salonu wyrazisty kolor? A co powiesz na meble wykończone w kolorze granatowego drewna? Kolekcja BOHOL to meble o masywnej konstrukcji, z wyraźnym rysunkiem drewna, prostymi uchwytami … i w granatowym odcieniu . Świetnie sprawdzą się w mieszkaniu urządzonym z motywami morskimi, w loftowym – surowym wnętrzu, wśród szarości i wśród kremów. Sprawią, że Twój salon będzie zarazem swojski i wytworny. Podoba Ci się taka koncepcja? Zamów całą kolekcję!', '', 'szafka-rtv-granatowa-bohol-z-szuflada', '', '', '', 'Szafka RTV granatowa BOHOL z szufladą', '', '', '', ''),
(181, 1, 1, 'Komoda Norton charakteryzuje się prostą minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz. Laminat w jasnym kolorze dębu sonoma, dekorem przypominający drewno wprowadzi w pomieszczeniu przytulny klimat. Brak tradycyjnych uchwytów sprawia, że mebel łatwiej wkomponować w dowolną aranżację. WNĘTRZE W szafkach i szufladzie przechowasz wszystko, co chcesz uporządkować i zawsze mieć pod ręką. Dzięki kulkowym prowadnicom z pełnym wysuwem docenisz komfort użytkowania mebla. WYKOŃCZENIE Mebel został pokryty laminatem, łatwiejszym w utrzymaniu czystości.', '', 'komoda-norton', '', '', '', 'Komoda NORTON', '', '', '', ''),
(182, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model niskiego regału w całości wykonanego z płyty meblowej i wykończony folią w matowym odcieniu. Kolorystyka dąb artisan o charakterystycznym wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie regału z meblami w stylu nowoczesnym oraz skandynawskim. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Regał TEMPRA 2 posiada 3 otwarte półki ● Został wykonany z płyty meblowej, pokrytej folią ● Regał jest utrzymany w kolorystyce dąb artisan', '', 'regal-niski-tempra-z-3-wnekami-2-dab-artisan', '', '', '', 'Regał niski TEMPRA z 3 wnękami 2 dąb artisan', '', '', '', ''),
(183, 1, 1, 'Meblujesz pokój swojego dziecka i szukasz pojemnej komody? Mamy dla Ciebie komodę IMOLA, która pomieści niezbędne rzeczy w pokoju Twojego dziecka i pomoże w zachowaniu organizacji w pomieszczeniu. POJEMNE WNĘTRZE Komoda ma 4 pojemne szuflady o różnych wysokościach. Do każdej z nich z powodzeniem można schować bieliznę oraz mniejsze części garderoby. Szuflada udźwignie maksymalnie 3 kg 3 KOLORY Połączenie 3 kolorów to mieszanka koloru szarego przypominającego surowy beton , bieli oraz dębu. Meble wprowadzą do pokoju młodego człowieka estetyczny wygląd, ale również ponadczasowość na ładnych kilka lat! MEBLE DO ZADAŃ SPECJALNYCH W pokoju Twojego nastolatka zawsze dużo się dzieje, więc utrzymanie w nim porządku może być nie lada wyzwaniem. Jeśli szukasz mebli, które pomogą Ci uporządkować rzeczy dziecka, mamy dla Ciebie kolekcję do zadań specjalnych - IMOLA . Meble mają dużo wydzielonych wnęk do przechowywania pamiątek, którymi Twój nastolatek będzie chciał się pochwalić, a także półek za zamkniętymi drzwiami w sam raz do ukrywania skarbów.', '', 'komoda-do-pokoju-mlodziezowego-imola', '', '', '', 'Komoda do pokoju młodzieżowego Imola', '', '', '', ''),
(184, 1, 1, 'Szafka na buty LANZETTE to nie tylko praktyczny, bardzo kompaktowy schowek, ale jednocześnie siedzisko, na którym można przysiąść i wygodnie włożyć buty. Można ją skompletować z wieszakiem, by zaoszczędzić miejsce w przedpokoju. To część kolekcji, która pozwala nawet na niewielkiej przestrzeni rozmieścić odzież wierzchnią, obuwie i akcesoria całej rodziny, tak, by wszystko, co potrzebne przed wyjściem z domu było pod ręką. Jak jest wykonana szafka na buty LANZETTE? Szafka na buty LANZETTE została wykonana z płyty meblowej laminowanej , jednak front mebla skonstruowano z płyty MDF wykończonej folią PVC . Drzwiczki otwierane klapowo to bardzo wygodne rozwiązanie nawet do małego przedpokoju, którego podłoga jest zastawiona butami. Solidny, czarny uchwyt z tworzywa ładnie komplementuje frezowanie na froncie drzwiczek. Szafka jest umieszczona na dyskretnych nóżkach ślizgaczach , które nie rysują podłogi podczas przesuwania. Do jakich wnętrz pasuje szafka na buty LANZETTE? Połączenie nimfea alba (nazwa inspirowanej barwami płatków lilii wodnej) ze złocistym, ciepłym wybarwieniem dębu craft sprawia, że kolekcja LANZETTE idealnie pasuje do jasnych wnętrz wzbogaconych soczystymi barwami. Jasne meble sprawiają, że przedpokój wydaje się większy.', '', 'szafka-na-buty-lanzette', '', '', '', 'Szafka na buty LANZETTE', '', '', '', ''),
(185, 1, 1, 'Komoda LUPO to cześć kolekcji przeznaczonej do pokoju dziecięcego i młodzieżowego. W szafkach i szufladzie możesz ułożyć ubrania lub uporządkować zabawki, a niewielka wysokość komody sprawia, że dziecko będzie mogło swobodnie po nie sięgać. Dzięki wykończeniu w kolorze bieli i drewna łatwo dopasujesz komodę LUPO do większości aranżacji. Komoda sprawdzi się zarówno w pokoju dziewczynki, jak i chłopca. WNĘTRZE Komoda posiada 6 wnęk oraz 3 szuflady na prowadnicach rolkowych. Blat możesz wykorzystać jako miejsce na organizery, dekoracje czy zabawki. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej i wykończona laminatem . Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. MEBLE LUPO DO POKOJU DZIECIĘCEGO I MŁODZIEŻOWEGO Meble z kolekcji LUPO pomogą urządzić pokój dziecięcy w taki sposób, aby za kilka lat mogły służyć jako meble młodzieżowe. Połączenie bieli z ciepłym kolorem drewna to dobre rozwiązanie do większości aranżacji, które zapewnia swobodę w wyborze i zmianie dodatków. Meble młodzieżowe LUPO pozwolą urządzić nawet niewielki pokój nastolatka , a ich prosta konstrukcja i kolor sprawiają, że z łatwością wkomponujesz je również w inne pomieszczenia.', '', 'komoda-lupo-3d3s', '', '', '', 'Komoda LUPO 3D3S', '', '', '', ''),
(186, 1, 1, 'Stylowa komoda DENVER to mebel przeznaczony do salonu, ale sprawdzi się też w sypialni lub przedpokoju. Wykończona w ciepłym odcieniu dębu, z charakterystycznymi poprzecznymi frezami, stanowi doskonałe uzupełnienie jasnej i przytulnej aranżacji wnętrza. Prosta, przysadzista bryła osadzona na szczupłych nóżkach sprawia wrażenie lekkiej. Dzięki pięknej barwie oraz tradycyjnej formie komoda nadaje się do pomieszczenia urządzonego w stylu industrialnym, rustykalnym. Można zestawić ją z pozostałymi meblami z kolekcji DENVER lub innymi - zarówno w podobnej kolorystyce, jak i wykończonymi w bieli czy szarościach. WNĘTRZE 4 wnęki posłużą do przechowywania akcesoriów niezbędnych w pomieszczeniu, w którym komoda się znajduje. W 2 szufladach swoje miejsce odnajdą różne drobiazgi, które chcemy mieć pod ręką. WYKOŃCZENIE Komoda wykończona jest laminatem oraz folią, imitującymi naturalny dąb w odcieniu Coast Evoke. Charakterystyczne, podłużne uchwyty są wykonane z metalu.', '', 'komoda-denver-3d2s', '', '', '', 'Komoda DENVER 3D2S', '', '', '', ''),
(187, 1, 1, 'Komoda ERDEN to mebel, który znajdzie dla siebie zastosowanie w salonie, pokoju dziennym, młodzieżowym oraz gabinecie. Szeroka bryła doskonałe dopełnienie dla wnętrza utrzymanego w jasnej kolorystyce. Jej prosty wzór i oszczędny design sprawiają, że najlepiej łączy się z nowoczesnym wystrojem wnętrza. Uniwersalna kolorystyka witryny ERDEN w odcieniu bieli sprawia, że pomieszczenie wydaje się większe i jaśniejsze, a ponadto dobrze łączy się z kompozycjami aranżacyjnymi utrzymanymi w nowoczesnym stylu. Na szczególną uwagę zasługuje przestrzeń ekspozycyjna, na blacie mebla, którą można wypełnić elementami ozdobnej zastawy, książkami oraz dodatkami dekoracyjnymi. WNĘTRZE Komoda ERDEN to pojemny mebel, w którym bez trudu możne pomieścić komplet kieliszków lub naczyń. 2 szuflady przydadzą się na drobiazgi. Kwiaty oraz ozdobne bibeloty można wyeksponować w na blacie. WYKOŃCZENIE Wykonana z płyty meblowej komoda ERDEN wykończona została laminatem. Nogi są zaopatrzone w ślizgacze z tworzywa, które ułatwiają przesuwanie i chronią powierzchnię podłogi przed zarysowaniem.', '', 'komoda-erden-3d2s', '', '', '', 'Komoda ERDEN 3D2S', '', '', '', ''),
(188, 1, 1, 'Szafka na buty OLA świetnie sprawdzi się nawet w niewielkim przedpokoju – dzięki ergonomicznym wymiarom pomieści wiele par butów nie zagracając przestrzeni. Białe wybarwienie szafki oraz jasny brąz szuflad neutralnie wpasują się w wiele aranżacji. WNĘTRZE ● dziesięć pojemnych wnęk umożliwi całej rodzinie swobodne umieszczenie butów; ● głębokość wnęki to 35 cm ; ● dwie pojemne szuflady pomieszczą podręczne akcesoria do pielęgnacji obuwia, a także szale, czapki, rękawiczki oraz inne drobne elementy garderoby. WYKOŃCZENIE ● korpus, fronty oraz półki szafki OLA zostały wykonane z płyty meblowej pokrytej laminatem , dzięki czemu mebel jest trwały i łatwy do utrzymania w czystości; ● proste uchwyty z tworzywa neutralnie dopełniają spokojny design szafki umożliwiając wygodne otwarcie szafek oraz szuflad; ● mebel umieszczony jest na dyskretnych nóżkach z tworzywa .', '', 'szafka-na-buty-ola-4d2s', '', '', '', 'Szafka na buty OLA 4D2S', '', '', '', ''),
(189, 1, 1, 'Kolekcja mebli do salonu SARDINIA to nowoczesna propozycja stawiająca na zdecydowane akcenty i funkcjonalną prostotę aranżacyjną. Połączenie barwy dębu artisan z ciemnymi akcentami podkreśla elegancję kolekcji a salonowi nadaje stylowy wyraz luksusowej przestrzeni. Kolekcja pięknie sprawdzi się we wnętrzach inspirowanych naturą i loftowych, ale także stworzy świetną bazę do urządzenia wnętrza w stylu marynistycznym. Szafka RTV SARDINIA to idealne rozwiązanie aranżacyjne do kącika rozrywkowego w salonie. Stwarza funkcjonalną przestrzeń w kąciku rozrywkowym elegancko komponując telewizor i sprzęt RTV we wnętrzu. WNĘTRZE ● Dwie szafki swobodnie pomieszczą akcesoria i gadżety; ● Umieszczona pośrodku otwarta wnęka ze szklaną półką pozwala elegancko i estetycznie umieścić sprzęt RTV. Wymiary wnęki dolnej - szer.60 cm, gł.40,5 cm, wys.20 cm (17,5 cm górnej). ● Maksymalne obciążenie szklanych półek wynosi 2 kg . WYKOŃCZENIE ● Korpus, półki oraz fronty są wykonane z płyty wiórowej i pokryte melaminą , która jest materiałem łatwym do utrzymania w czystości oraz nadaje atrakcyjny wygląd struktury powierzchni; ● Kontrastujący czarny dekor szafki zdecydowanie podkreśla oryginalność designu szafki korespondując z czarnymi uchwytami i nóżkami oraz wnętrzem otwartej wnęki; ● Drzwiczki szafek wyposażone są w duże, metalowe uchwyty ; ● Mebel jest umieszczony na eleganckich płozach z metalu ; ● Za dodatkową opłatą można wyposażyć szafkę w oświetlenie LED, które pięknie podkreśli szyk wystroju wnętrza.', '', 'szafka-rtv-sardinia-2d', '', '', '', 'Szafka RTV SARDINIA 2D', '', '', '', ''),
(190, 1, 1, 'Szafka RTV BELL stworzy doskonałą bazę pod sprzęt i akcesoria domowego sprzętu elektronicznego. Świetnie sprawdzi się we wnętrzach nowoczesnych i minimalistycznych, ale także stworzy świetną podstawę dla urządzenia wnętrza opartego na kontraście – świetnie wypadnie w zestawieniu z mocnymi barwami ścian lub obrazów, detali dekoracyjnych i tekstyliów domowych. WNĘTRZE 4 pojemne, zamykane wnęki w 2 szafkach pozwolą rozsądnie uporządkować potrzebne akcesoria i gadżety; Maksymalne obciążenie półki wynosi 8 kg; Szeroka przestrzeń pod blatem została podzielona na trzy oddzielne wnęki, co pozwala na rozsądne zorganizowanie rozmieszczenia sprzętu RTV, akcesoriów i gadżetów; W tylnych ścianach wnęk, na optymalnej wysokości są umieszczone otwory, przez które można przełożyć kable, by podłączyć sprzęt do gniazdka; Trzy szuflady świetnie sprawdzą się jako dodatkowe miejsce do przechowywania - swobodnie pomieszczą niezbędne kable i konsole, zapasowe baterie oraz mnóstwo różnego rodzaju akcesoriów niezbędnych w salonie. WYKOŃCZENIE Korpus mebla, blat oraz półki są wykonane z płyty wiórowej o grubości 16 mm i wykończone laminatem w klasycznej bieli; Fronty szafki są wykonane z płyty MDF o grubości 16 mm i pokryte białą folią PVC o wysokim połysku; W standardzie mebla jest oświetlenie na pasku LED o zimnej, niebieskiej barwie, która podkreśli elegancki charakter pomieszczenia; Mebel jest umieszczony na dyskretnych nóżkach z tworzywa; Drzwiczki szafek i szuflady otwierają się dzięki nowoczesnemu systemowi push to open, co podkreśla minimalistyczny i nowoczesny design szafki. Na blacie umieszczono dyskretny otwór z zaślepką, umożliwiając wyprowadzenie kabli poprzez blat szafki.', '', 'szafka-pod-telewizor-biala-bell', '', '', '', 'Szafka pod telewizor biała BELL', '', '', '', ''),
(191, 1, 1, 'Urządzasz mieszkanie w industrialnym stylu? Kolekcja mebli HIGH ROCK to połączenie dekoru dąb riviera z pełną głębi czernią, która przyciągnie Twoją uwagę. Szafka RTV HIGH ROCK podkreśli loftowy charakter salonu. To niezbędny mebel w każdym pokoju dziennym, który pomoże uporządkować sprzęty i akcesoria. WNĘTRZE Szafka posiada otwarte wnęki, w których bezpiecznie umieścisz dekoder czy konsolę. Uwagę przyciągają otwarte, małe półki, na których zmieszczą się niewielkie dekoracje lub akcesoria. Szuflada pozwoli Ci uporządkować gry lub inne dodatki. WYKOŃCZENIE Szafka została wykonana z płyty meblowej oraz wykończona laminatem i folią. Fronty szuflady oraz panelu tworzącego półki pokryte są folią w kolorze dąb riviera. Blat wykończony jest płytą laminowaną w czarnym kolorze. Szafka została wyposażona w czarne, metalowe uchwyty oraz ramy z płyty MDF przechodzące w nogi, co dodatkowo podkreśla industrialny charakter wnętrza. Powierzchnię płyty laminowanej oraz foliowanej bardzo łatwo utrzymać w czystości – wystarczy użyć miękkiej, zwilżonej ściereczki. Meble z kolekcji HIGH ROCK pomogą stworzyć wyjątkowy, loftowy klimat w Twoim mieszkaniu. Świetnie będą się prezentować przy ścianie z czerwonej cegły.', '', 'szafka-rtv-industrialna-szeroka-high-rock', '', '', '', 'Szafka RTV industrialna szeroka HIGH ROCK', '', '', '', ''),
(192, 1, 1, 'Komoda LANZETTE to mebel przeznaczony do salonu lub jadalni. Szeroka i pojemna, wyposażona w trzy szuflady i dwie zamykane szafki jest meblem doskonale nadaje się do przechowywania elementów zastawy, dokumentów, ubrań oraz innych potrzebnych drobiazgów. Może znaleźć swoje miejsce zarówno jako część aranżacji o charakterze nowoczesnym, jak również klasycznym. Połączenie bieli nimfea alba ze złocistym, ciepłym wybarwieniem dębu craft sprawia, że kolekcja LANZETTE idealnie pasuje do jasnych wnętrz wzbogaconych soczystymi barwami. Komodę można zestawić z innymi meblami kolekcji, jednak sprawdza się również jako pojedynczy mebel, który można dopasować do własnej aranżacji pomieszczenia. WNĘTRZE Komoda LANZETTE ma klasyczny układ - w środkowej części znajdują się szuflady, a po bokach zamykane szafki. Blat mebla można wykorzystać jako część ekspozycyjną pod kątem umieszczenia kwiatów i ozdobnych drobiazgów. Szuflady na prowadnicach kulkowych. Półki posiadają możliwość obciążenia do 5 kg. WYKOŃCZENIE Korpus, blaty i półki komody LANZETTE zostały wykonane z płyty meblowej laminowanej, jednak front mebla to płyta MDF wykończona folią PVC. Znaczącym elementem są również wyprofilowane, kontrastowe wobec kolorystki bryły - czarne uchwyty z tworzywa.', '', 'komoda-lanzette-2d3sz-e', '', '', '', 'Komoda LANZETTE 2D3SZ E', '', '', '', ''),
(193, 1, 1, 'Regał MAURO to minimalistyczna bryła w białym kolorze. Sprawdzi się w niewielkich wnętrzach lub może być podstawą większej kombinacji, kiedy zmienią się Twoje potrzeby. Regał możesz wykorzystać jako miejsce do uporządkowania dokumentów w domowym biurze lub jako półkę na książki i czasopisma w kąciku do czytania. Możesz ustawić na nim kwiaty lub stylowe dekoracje. Lekka i uniwersalna konstrukcja pozwala na wiele możliwości wykorzystania bryły. Wnęka ma wymiary: 33x33 cm. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. Regał MAURO MXXR221 występuje w czterech wariantach kolorystycznych: czarnym, białym, szarym i dębowym.', '', 'regal-mauro-727x728-cm-bialy', '', '', '', 'Regał MAURO 72,7x72,8 cm biały', '', '', '', ''),
(194, 1, 1, 'Szafka RTV LANZETTE to mebel przeznaczony do salonu lub jadalni. Można na niej ustawić telewizor lub sprzęt grający, albo wykorzystać blat jako podstawę dla kwiatów, książek oraz dekoracji. Mebel może znaleźć swoje miejsce zarówno jako część aranżacji o charakterze nowoczesnym, jak również klasycznym. Połączenie bieli nimfea alba ze złocistym, ciepłym wybarwieniem dębu craft sprawia, że kolekcja LANZETTE idealnie pasuje do jasnych wnętrz wzbogaconych soczystymi barwami. Szafkę RTV można zestawić z innymi meblami kolekcji, jednak sprawdza się również jako pojedynczy mebel, który można dopasować do własnej aranżacji pomieszczenia. WNĘTRZE RTV LANZETTE posiada 2 zamykane szafki, natomiast jej centralna część mieści otwartą półkę oraz szufladę na prowadnicach kulkowych. Wymiary wnęki: szerokość 68,5 cm, głębokość 40,5 cm, wysokość 17,5 cm (22 cm licząc z listwą) Półki można obciążyć maksymalnie ciężarem 5 kg. WYKOŃCZENIE Korpus, blaty i półki mebla zostały wykonane z płyty meblowej laminowanej, jednak front mebla to płyta MDF wykończona folią PVC. Znaczącym elementem są również wyprofilowane, kontrastowe wobec kolorystki bryły - czarne uchwyty z tworzywa.', '', 'szafka-rtv-lanzette-2d1-sz-b', '', '', '', 'Szafka RTV LANZETTE 2D1 SZ B', '', '', '', ''),
(195, 1, 1, 'Komoda SIENNA umożliwia uporządkowanie najpotrzebniejszych rzeczy w Twoim domowym biurze, sypialni czy przedpokoju. W tym niewielkim meblu z dużą ilością półek i szuflad poukładasz najważniejszych rzeczy w sposób zorganizowany. Jeżeli szukasz miejsca na rzeczy dla niemowlaka, zabawki lub rodzinne dokumenty komoda SIENNA sprawdzi się idealnie. WNĘTRZE Za zamkniętymi drzwiami zamontowano po jednej półce, dzięki czemu masz do dyspozycji aż 4 wnęki W 4 szufladach poukładasz wszelkie drobiazgi w taki sposób, by zawsze znaleźć to, czego szykasz/ WYKOŃCZENIE Komoda wykonana jest z płyt meblowych i wykończona folią. Białe, połyskujące fronty rozświetlą i ożywią pomieszczenie. Komoda posiada frezowane uchwyty, a brak nóżek sprawia, że łatwej będzie Ci utrzymać czystość. Uwagę przyciągają frezowane uchwyty, które nadają jej minimalistyczny wygląd. Biała kolorystyka z połyskiem sprawia, że mebel wkomponuje się w praktycznie każdy rodzaj i kolor pomieszczeń.', '', 'komoda-sienna-4s2d', '', '', '', 'Komoda SIENNA 4S2D', '', '', '', ''),
(196, 1, 1, 'Komoda ERDEN to mebel, który znajdzie dla siebie zastosowanie w salonie, pokoju dziennym, młodzieżowym oraz gabinecie. Szeroka bryła doskonałe dopełnienie dla wnętrza utrzymanego w jasnej kolorystyce. Jej prosty wzór i oszczędny design sprawiają, że najlepiej łączy się z nowoczesnym wystrojem wnętrza. Uniwersalna kolorystyka witryny ERDEN w odcieniu bieli sprawia, że pomieszczenie wydaje się większe i jaśniejsze, a ponadto dobrze łączy się z kompozycjami aranżacyjnymi utrzymanymi w nowoczesnym stylu. Na szczególną uwagę zasługuje przestrzeń ekspozycyjna, na blacie mebla, którą można wypełnić elementami ozdobnej zastawy, książkami oraz dodatkami dekoracyjnymi. WNĘTRZE Komoda ERDEN to pojemny mebel, w którym bez trudu możne pomieścić elementy zastawy, obrusy, ubrania lub przydatne drobiazgi. Kwiaty oraz ozdobne bibeloty można wyeksponować w na blacie. Wnętrze szafki jest podzielona na dwie wnęki. Komoda osiada również szufladę. WYKOŃCZENIE Wykonana z płyty meblowej komoda ERDEN wykończona została laminatem. Nogi są zaopatrzone w ślizgacze z tworzywa, które ułatwiają przesuwanie i chronią powierzchnię podłogi przed zarysowaniem.', '', 'komoda-erden-2d1s', '', '', '', 'Komoda ERDEN 2D1S', '', '', '', ''),
(197, 1, 1, 'Komoda LOFT to mebel przeznaczony do pokoju dziennego, wizualnie utrzymany w nowoczesnym stylu. Łączy w sobie prostotę oraz funkcjonalność, a także dyskretną elegancję. Doskonale współpracuje zarówno z odcieniami szarości, jak również ciepła tonacją wnętrza. Pod względem kolorystycznym meble z kolekcji LOFT idealnie wykorzystują zasadę kontrastu, w myśl której płyty wykończone jasnym wybarwieniem są podkreślone czarnymi wstawkami, które wyodrębniają z całej bryły linie szafek oraz szuflad. Komoda LOFT została wykonana z płyty meblowej o grubości 16 mm wykończonej laminatem. Przy drzwiach zostały zamontowane zawiasy puszkowe, a do szuflad prowadnice kulkowe. WNĘTRZE Komoda LOFT posiada zamykaną szafkę oraz umieszczoną w dole bryły szufladę – idealne rozwiązanie pod kątem umieszczenia w nich ubrań, dokumentów lub przydatnych przedmiotów osobistych. WYKOŃCZENIE Komoda LOFT została wykonana z płyty meblowej wykończonej laminatem w kolorze dąb wotan . Uchwyty służące do otwierania szuflad i szafek są metalowe, okrągłe i ładnie komponują się z linią mebla.', '', 'komoda-loft-60-1d1s', '', '', '', 'Komoda LOFT 60 1D1S', '', '', '', ''),
(198, 1, 1, 'Konstrukcja wnętrza komody JAWA pozwala idealnie posegregować odzież, a praktyczne szuflady zapewniają łatwy dostęp do bielizny. Wraz z pozostałymi meblami z serii JAWA umożliwia stworzenie przytulnej oraz eleganckiej aranżacji sypialni. Łączy w sobie rustykalną swojskość z szykiem stylu glamour .Komodę możesz wkomponować zarówno we wnętrza wykończone w tzw. męskim stylu, jak i nowoczesne industrialne przestrzenie Komoda sprawdza się w każdym pomieszczeniu: salonie, jadalni czy sypialni lub przedpokoju. WNĘTRZE 3 szufladach pozwalają rozdzielić bieliznę i galanterię. Za potrójnymi drzwiami znajduje się 6 wnęk . WYKOŃCZENIE Komoda została wykonana z płyty meblowej pokrytej dwoma rodzajami folii. W zastosowanym wykończeniu połączono imitację szlachetnego usłojenia drewna dębowego z połyskującą taflą szuflad w grafitowym kolorze. Szerokie uchwyty podkreślają nowoczesny charakter mebla.', '', 'komoda-jawa-3d3s-jwk232-c587', '', '', '', 'Komoda JAWA 3D3S JWK232- C587', '', '', '', ''),
(199, 1, 1, 'Szukasz prostej szafki RTV do salonu ? Może urządzasz mieszkanie dla studenta lub na wynajem? Meble BASIC to oferta specjalnie dla Ciebie. Szafka RTV BASIC to minimalistycznie rozwiązanie do niewielkiego salonu lub kawalerki. Prosta forma bryły, wykończona białym korpusem i frontem sprawi, że z łatwością wkomponujesz ją w nowoczesne wnętrze . Może stanowić także element salonu, który pragniesz wyposażyć w meble inspirowane naturą. Postaw na niej obły wazon lub ciekawą figurkę i spraw, że Twój salon nabierze unikatowego stylu. WNĘTRZE Jeśli lubisz, gdy wszystko jest poukładane, skorzystaj z otwartej półki – możesz w niej umieścić np. router. Kolekcję cennych płyt lub kaset ukryjesz w zamykanej frontem wewnętrznej półce . Dostęp do niej ułatwi zawias 110° . WYKOŃCZENIE Szafkę RTV wykonano z płyty meblowej 18 mm i pokryto białym laminatem . Biel frontu i korpusu stanowić będzie tło dla bardziej wyrazistych elementów aranżacji kuchennej.', '', 'szafka-biala-rtv-basic', '', '', '', 'Szafka biała RTV BASIC', '', '', '', ''),
(200, 1, 1, 'Nie zajmuje wiele miejsca, a w jej 8 wnękach umieścisz sporo swoich skarbów. Zachwyca też połączeniem granatowym frontów, złotych uchwytów i nóżek. Komoda ROSE jest zarazem minimalistyczna i wytworna - idealna do pełnego elegancji, nowoczesnego wnętrza. Zawiasy z cichym domykiem sprawiają, że drzwi nie trzaskają. WNĘTRZE Komoda posiada 4 drzwi , za którymi skrywa się 8 wnęk. To idealne miejsce dla Twoich eleganckich swetrów, bielizny lub koszulek. WYKOŃCZENIE Korpus oraz fronty szafki wykonano z laminowanej płyty meblowej w granatowym kolorze. Kolekcję ROSE charakteryzują metalowe uchwyty i wysokie nóżki w złotym odcieniu . Od frontu komoda posiada kwadratowy kształt , symetryczne podziały drzwi sprawią, że nie przytłacza ona pomieszczenia. IKONA STYLU Granatowe meble ROSE doskonale komponują się z: elementami wykonanymi z jasnego drewna w chłodnym odcieniu, również bielonego drewna , jasnym marmurem , szarym marmurem, stonowanymi odcieniami kamieni i betonu, modnym lastryko , eleganckim, ciemnym drewnem – zwłaszcza w postaci stylizowanego oparcia łóżka lub podłogi, która dzięki renowacji odzyskała dawny blask, jeśli lubisz grę kontrastów możesz urozmaicić aranżacje dekoracjami w ceglanym odcieniu czerwieni – zwłaszcza, gdy łączy się ona z welurem . ELEGANCJA NA ZŁOTYCH NOGACH Pragniesz, by Twoje mieszkanie wyróżniała elegancja i styl? Elegancka linia mebli ROSE w ciemnoniebieskim odcieniu sprawi, że wnętrze nabierze klasy i szyku. Dzięki ROSE możesz płynnie igrać z najnowszymi trendami panującymi w nowoczesnych wnętrzach . Od klasyki , poprzez minimalizm , aż do new hampton ... Dzięki ROSE to Ty decydujesz, jak wyglądać będzie Twój wymarzony salon lub sypialnia .', '', 'komoda-granatowa-z-8-wnekami-rose', '', '', '', 'Komoda granatowa z 8 wnękami ROSE', '', '', '', ''),
(201, 1, 1, 'Komoda GRAZ 2D4S świetnie uzupełni aranżację domu lub biura. Prosty design oraz ciepły kolor drewna sprawiają, że komoda wpasuje się w jasne wnętrza, stając się naturalnym elementem wyposażenia. To idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Przyda się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych czy dokumentów. WNĘTRZE Wnętrze komody dzieli się na 4 wnęki za drzwiami oraz 4 szuflady. Maksymalne obciążenie półki wynosi 15 kg. WYKOŃCZENIE Komoda jest wykończona laminatem, który wygląda jak drewno w kolorze dąb sonoma. Uchwyty z tworzywa prezentują się nowocześnie.', '', 'komoda-graz-2d4s-dab-sonoma', '', '', '', 'Komoda GRAZ 2D4S dąb sonoma', '', '', '', ''),
(202, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 3 drzwi, w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka dąb artisan o charakterystycznym wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie z meblami w stylu nowoczesnym oraz skandynawskim. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz szuflady ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce dąb artisan ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-niska-tempra-2-3d2s-dab-artisan', '', '', '', 'Komoda niska TEMPRA 2 3D2S dąb artisan', '', '', '', ''),
(203, 1, 1, 'Komoda NEPTUN 2D/3S została zaprojektowana z myślą o domowych biurach lub pokojach młodzieżowych, w których zależy nam na odpowiedniej organizacji przestrzeni do pracy czy nauki. Przechowasz w niej dokumenty, artykuły biurowe lub ubrania i przedmioty codziennego użytku. Jasne fronty komody odbiją światło i dzięki temu rozświetlą pomieszczenie. Nowoczesny design i wybarwienie stworzą przyjazną przestrzeń , w której wszystko ma swoje miejsce. WNĘTRZE Komoda posiada 3 szuflady, wyposażone w prowadnice kulkowe w pełnym wysuwem i 4 zamknięte wnęki ; Na blacie możesz umieścić ulubione dekoracje, gadżety lub roślinę doniczkową. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony laminatem; Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości; Uchwyty w srebrnym kolorze odznaczają się prostą, minimalistyczną stylistyką i świetnie pasują do nowoczesnego designu komody; Podstawą komody są drewniane nóżki , które nadają jej lekkości.', '', 'komoda-neptun-2d3s', '', '', '', 'Komoda NEPTUN 2D3S', '', '', '', ''),
(204, 1, 1, 'Komoda POLDARK świetnie uzupełni wyposażenie salonu lub sypialni. Przyjemny dla oka design oraz duża pojemność stanowią wyróżnik komody. Przestrzeń na blacie idealnie nadaje się do eksponowania dekoracji i fotografii, książek lub cennych pamiątek. WNĘTRZE 8 pojemnych wnęk to bardzo funkcjonalna przestrzeń do przechowywania domowych tekstyliów, ubrań i różnego rodzaju sprzętów i akcesoriów. Maksymalne obciążenie półek wynosi 5 kg . Szuflada na prowadnicach kulkowych przyda się na drobiazgi. JAK JEST ZBUDOWANA KOMODA POLDARK? Korpus oraz półki komody są wykonane z płyty wiórowej o grubości 1,6 cm i wykończone laminatem . Fronty drzwi oraz szuflady są wykonane z połączenia płyty wiórowej i płyty MDF . Wykończenie frontów folią PVC w barwie dąb wotan sprawia, że komodę łatwo utrzymać w czystości. DO JAKIEGO WNĘTRZA PASUJE KOMODA POLDARK? Komoda sprawdzi się we wnętrzach inspirowanych naturą i nowoczesnych, stawiających na ciepłe barwy i nieprzesadną stylistykę, ale także stworzy świetną bazę do urządzenia mieszkania w stylu retro. Meble z kolekcji POLDARK wniosą do mieszkania przytulny klimat ponadczasowej estetyki prostoty i komfortu bezpieczeństwa. Ciepłe odcienie w barwie dąb appalachi i dąb wotan pozwolą strzyć przytulną atmosferę w sypialni.', '', 'komoda-poldark-3d1s', '', '', '', 'Komoda POLDARK 3D1S', '', '', '', ''),
(205, 1, 1, 'Urządzasz mieszkanie w industrialnym stylu? Kolekcja mebli HIGH ROCK to połączenie dekoru dąb riviera z pełną głębi czernią, która przyciągnie Twoją uwagę. Duża ilość miejsca do przechowywania umożliwi funkcjonalne rozplanowanie wnętrza salonu, jadalni czy domowego biura. Możesz uporządkować w niej ubrania, zastawę stołową czy dokumenty. Blat pozwoli Ci wyeksponować stylowe dekoracje lub ulubione pamiątki. WNĘTRZE Komoda posiada 1 zamykaną szafkę oraz 3 szuflady, wyposażone w prowadnice kulkowe. WYKOŃCZENIE Komoda HIGH ROCK została wykonana z płyty meblowej oraz wykończona laminatem i folią; Fronty komody pokryte są folią w kolorze dąb riviera; Blat wykończony jest płytą laminowaną w czarnym kolorze, a półki płytą foliowaną w barwie dąb riviera; Komoda została wyposażona w czarne, metalowe uchwyty oraz ramy z płyty MDF przechodzące w nogi, co dodatkowo podkreśla industrialny charakter wnętrza; Powierzchnię płyty laminowanej oraz foliowanej bardzo łatwo utrzymać w czystości – wystarczy użyć miękkiej, zwilżonej ściereczki. Meble z kolekcji HIGH ROCK pomogą stworzyć wyjątkowy, loftowy klimat w Twoim mieszkaniu. Świetnie będą się prezentować przy ścianie z czerwonej cegły.', '', 'komoda-industrialna-szeroka-high-rock', '', '', '', 'Komoda industrialna szeroka HIGH ROCK', '', '', '', ''),
(206, 1, 1, 'Komoda IKOLI jest nowoczesnym meblem, który idealnie zaaranżuje wnętrze salonu. Stonowane połączenie bieli z barwą dębu sonoma nie zdominuje przestrzeni i wpasuje się we wnętrze jasne i neutralne, stawiające na spokojną prostotę aranżacyjną. WNĘTRZE 3 duże wnęki w 2 szafkach komody rozwiążą wiele problemów organizacyjnych umożliwiając schowanie sporej ilości akcesoriów niezbędnych w każdym salonie; 2 pojemne szuflady na prowadnicach kulkowych świetnie sprawdzą się jako dodatkowa przestrzeń do przechowywania gadżetów i akcesoriów domowych; Maksymalne obciążenie półek wynosi 5 kg . WYKOŃCZENIE Komoda jest wykonana z płyty wiórowej o grubości 1,2 cm ; Komoda jest pokryta folią w ciekawym połączeniu barwy dębu sonoma oraz klasycznej bieli . Powierzchnia pokryta folią jest bardzo praktyczna – jest trwała i łatwa do utrzymania w czystości; Srebrny uchwyt z tworzywa odznacza się prostą, minimalistyczną stylistyką świetnie pasując do nowoczesnego designu komody;', '', 'komoda-ikoli-2d2s', '', '', '', 'Komoda IKOLI 2D2S', '', '', '', ''),
(207, 1, 1, 'Komoda IKOLI jest nowoczesnym meblem, który idealnie zaaranżuje wnętrze salonu. Stonowane połączenie bieli z barwą dębu sonoma nie zdominuje przestrzeni i wpasuje się we wnętrze jasne i neutralne, stawiające na spokojną prostotę aranżacyjną. WNĘTRZE 2 duże wnęki po lewej stronie komody rozwiążą wiele problemów organizacyjnych umożliwiając schowanie sporej ilości akcesoriów niezbędnych w każdym salonie; 1 wnęka umieszczona po prawej stronie zwiększa możliwości przechowywania; 2 pojemne szuflady na prowadnicach kulkowych świetnie sprawdzą się jako dodatkowa przestrzeń do przechowywania gadżetów i akcesoriów domowych; Maksymalne obciążenie półek wynosi 5 kg . WYKOŃCZENIE Komoda jest wykonana z płyty wiórowej o grubości 1,2 cm ; Komoda jest pokryta folią w ciekawym połączeniu barwy dębu sonoma oraz klasycznej bieli . Powierzchnia pokryta folią jest bardzo praktyczna – jest trwała i łatwa do utrzymania w czystości; Srebrny uchwyt z tworzywa odznacza się prostą, minimalistyczną stylistyką świetnie pasując do nowoczesnego designu komody;', '', 'komoda-ikoli-3d2s', '', '', '', 'Komoda IKOLI 3D2S', '', '', '', ''),
(208, 1, 1, 'Urządzasz mieszkanie w industrialnym stylu? Kolekcja mebli HIGH ROCK to połączenie dekoru dąb riviera z pełną głębi czernią, która przyciągnie Twoją uwagę. Szafka RTV HIGH ROCK podkreśli loftowy charakter salonu. To niezbędny mebel w każdym pokoju dziennym, który pomoże uporządkować sprzęty i akcesoria. WNĘTRZE Szafka posiada 2 otwarte wnęki, w których bezpiecznie umieścisz dekoder czy konsolę. Zamykana półka i szuflada pozwoli Ci uporządkować urządzenia elektroniczne, akcesoria, gry i inne dodatki. WYKOŃCZENIE Szafka została wykonana z płyty meblowej oraz wykończona laminatem i folią. Front pokryty jest folią w kolorze dąb riviera. Blat wykończony jest płytą laminowaną w czarnym kolorze. Szafka została wyposażona w czarne, metalowe uchwyty oraz ramy z płyty MDF przechodzące w nogi, co dodatkowo podkreśla industrialny charakter wnętrza. Powierzchnię płyty laminowanej oraz foliowanej bardzo łatwo utrzymać w czystości – wystarczy użyć miękkiej, zwilżonej ściereczki. Meble z kolekcji HIGH ROCK pomogą stworzyć wyjątkowy, loftowy klimat w Twoim mieszkaniu. Świetnie będą się prezentować przy ścianie z czerwonej cegły.', '', 'szafka-rtv-industrialna-z-szuflada-i-polka-high-rock', '', '', '', 'Szafka RTV industrialna z szufladą i półką HIGH ROCK', '', '', '', ''),
(209, 1, 1, 'Komoda DORIAN wchodzi w skład kolekcji mebli przeznaczonej dla salonu, pokoju dziennego lub jadalni. Doskonale prezentuje się jako mebel funkcjonalny oraz ekspozycyjny. Można na niej ustawić ozdoby dekoracyjne, kwiaty lub rodzinne pamiątki. Natomiast wewnątrz schować elementy zastawy, obrusy, dokumenty lub potrzebne na co dzień drobiazgi. Jasna kolorystyka mebla w odcieniu dąb april została wzbogacona czarnymi wstawkami, ponadto zamiast nóżek w komodzie DORIAN zastosowano ozdobny cokół - również utrzymany w czarnym kolorze. Kontrastowe zestawienie sprawia, że kolekcja DORIAN może zostać ustawione zarówno w jasnym, jak i ciemniejszym wnętrzu, świetnie prezentuje się w towarzystwie szarości oraz w zestawieniu z meblami utrzymanymi w nowoczesnej stylistyce. WNĘTRZE Komoda DORIAN posiada 3 szuflady na prowadnicach kulkowych i zamykaną szafkę. Maksymalne obciążenie półek wynosi 5 kg . WYKOŃCZENIE Korpus, blat i półki komody DORIAN wykonane zostały z płyty meblowej i wykończone laminatem. Natomiast frontowa część z płyty MDF opatrzonej wysokiej jakości folią PVC. Całości dopełniają minimalistyczne uchwyty z tworzywa sztucznego. Komoda DORIAN została wyposażona w system podświetlenia ciepłym, białym światłem. Jego klasa energetyczna to A++ .', '', 'komoda-dorian-dn3-2d3s-z-oswietleniem', '', '', '', 'Komoda DORIAN DN3 2D3S z oświetleniem', '', '', '', ''),
(210, 1, 1, 'Regał TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. ● cechuje go duża funkcjonalność ● doskonale nadaje się do wnętrz kameralnych oraz przestrzeni związanej z pracą Świetnym przykładem wykorzystania tej przestrzeni jest model niskiego regału z 3 wnękami. Kolorystyka o wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie regału z meblami w stylu nowoczesnym oraz loftowym. Charakterystyczny efekt imitujący drewniane, sfatygowane deski przyciąga wzrok oraz tworzy nowe możliwości aranżacyjne. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości a także z ciepłą kolorystyką złota i brązu. Można również uzupełnić je o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Regał TEMPRA 2 został wykonany z płyty meblowej, pokrytej folią. ● Całość utrzymana jest w tonacji kolorystycznej imitującej stare drewno', '', 'regal-niskitempra-2-z-3-wnekami-loft', '', '', '', 'Regał niskiTEMPRA 2 z 3 wnękami loft', '', '', '', ''),
(211, 1, 1, 'Brak porządku w przedpokoju i buty widoczne tuż po wejściu do pomieszczenia, w szybki sposób rozwiąże szafka na buty BOOTS . Prosta w konstrukcji i funkcjonalna pozwala na utrzymanie porządku. Dwudrzwiowa szafka podzielona na 6 równych części z możliwością regulacji wysokości półki to mebel, który jest potrzebny w każdym przedpokoju. Szafka ma wystarczającą pojemność dla całej rodziny. Kolorystyka szafki to jasnoszary beton i biel , która świetnie wpisuje się w aktualne trendy. WYKOŃCZENIE Mebel wykonano z płyt meblowych i pokryto folią.', '', 'szafka-na-buty-boots-bts321', '', '', '', 'Szafka na buty BOOTS BTS321', '', '', '', ''),
(212, 1, 1, 'Komoda MALI 2D4S świetnie uzupełni aranżację przedpokoju, pokoju dziennego, sypialni lub biura. To idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Przyda się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych czy dokumentów. WNĘTRZE Wnętrze komody dzieli się na 4 szuflady, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 15 kg. WYKOŃCZENIE Połączenie koloru drewna z czernią sprawia, że komoda MALI dobrze zaprezentuje się w industrialnych i nowoczesnych mieszkaniach.', '', 'komoda-mali-4s-dab-craft-czarny', '', '', '', 'Komoda MALI 4S dąb craft/czarny', '', '', '', ''),
(213, 1, 1, 'Szafka RTV NORTON charakteryzuje się prostą, minimalistyczną formą, która sprawia, że mebel jest wprost stworzony do nowoczesnych wnętrz. Laminat w jasnym kolorze dębu sonoma, dekorem przypominający drewno, wprowadzi do pomieszczenia przytulny klimat. Brak tradycyjnych uchwytów sprawia, że mebel łatwiej wkomponować w dowolną aranżację. WNĘTRZE W szafce i na półkach możesz umieścić sprzęt rtv, ale również przechować podręczne przedmioty - czasopisma, filmy czy piloty. Wymiary wnęki dolnej: szerokość 40 cm, głębokość 39 cm, wysokość 15,5 cm Wymiary wnęki górnej: szerokość 40 cm, głębokość 39 cm, wysokość 13 cm (22,5 cm licząc z listwą) WYKOŃCZENIE Mebel został pokryty laminatem, łatwym do utrzymania w czystości i cechującym się większą trwałością.', '', 'szafka-rtv-norton', '', '', '', 'Szafka RTV NORTON', '', '', '', ''),
(214, 1, 1, 'Potrzebujesz dodatkowego mebla do przechowywania, a pokój jest mały? Głęboka na 34 cm komoda OSLO jest idealna do niewielkich pomieszczeń. Sprawdzi się w wąskim przedpokoju, domowym biurze, pokoju dziennym czy młodzieżowym. Jasne fronty połączone z korpusem w kolorze drewna to ponadczasowa propozycja do wielu aranżacji. Dodatkowo takie wybarwienie nie przytłacza wnętrza. WNĘTRZE Za drzwiami znajdziesz 3 wnęki, w których łatwo uporządkujesz potrzebne przedmioty. 2 szuflady przydadzą się na drobne akcesoria. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się w nowoczesnych i skandynawskich aranżacjach.', '', 'komoda-oslo-3d2s', '', '', '', 'Komoda OSLO 3D2S', '', '', '', ''),
(215, 1, 1, 'Szafka RTV VINCENT NEW V-7 nawiązuje stylistyką do designu lat 60-tych oraz 70-tych. Panujący wówczas styl modernistyczny był odwrotem od przeszłości i spojrzeniem w przyszłość- pełen futurystycznych brył, stawiający na prostotę i lekkość formy.Wówczas szafka RTV już nawet z racji swej funkcji była meblem nowoczesnym- telewizor stanowił przejaw najnowszej techniki i dla wielu pozostawał wciąż niemożliwe do spełnienia marzenie. Szafka RTV VINCENT NEW V-7 świetnie wkomponuje się w nowoczesne wnętrza, ale również te, które utrzymane są w stylistyce vintage. Nieskomplikowane linie oraz białe wybarwienie połączone z imitacją dębowego drewna tworzą mebel subtelny i elegancki. WNĘTRZE Na wnętrze mebla składają się dwie szafeczki oraz dwie szuflady wyposażone w prowadnice z cichym domykiem. Pośrodku znajduje się wnęka o wymiarach 81/38/10 cm. Wewnątrz otwartej półki zamontowano dwa punkty oświetlenia LED, które pomogą stworzyć ciekawy efekt wizualny. WYKOŃCZENIE Fronty szafki RTV VINCENT NEW V-7 zamontowano na zawiasach z funkcją cichego domyku. co podwyższa komfort korzystania z mebla. Funkcję uchwytów pełnią tutaj frezowania we frontach. Bryła szafki połączenie bieli z okleiną imitującą drewno dębowe, co jest rozwiązaniem na tyle uniwersalnym, że bez problemu dopasujesz mebel do dowolnej kolorystyki ścian, tekstyliów i dodatków dekoracyjnych. Szafkę VINCENT NEW z powodzeniem wkomponujesz we wnętrze o nowoczesnym, minimalistycznym wystroju. Jest wręcz stworzona do aranżacji utrzymanych w stylistyce skandynawskiej- ze względu na swą prostotę, wybarwienie oraz charakterystyczny kształt drewnianych nóżek. Doskonale wkomponuje się również w przestrzenie w charakterze vintage, wypełnione wyrazistymi wzorami oraz intensywnymi, żywymi kolorami.', '', 'szafka-rtv-vincent-new-v-7-z-oswietleniem', '', '', '', 'Szafka RTV VINCENT NEW V-7 z oświetleniem', '', '', '', ''),
(216, 1, 1, 'Niska biblioteczka DISEGNO OFFICE to mebel o uniwersalnym zastosowaniu i modnym, nowoczesnym wyglądzie. Umożliwia przechowywanie dokumentacji, książek, płyt i zabawek, jednocześnie wprowadzając do wnętrza klimat surowego minimalizmu. Najlepiej zaprezentuje się w towarzystwie pozostałych mebli z tej serii, stanowiąc nowoczesne wyposażenie domowego gabinetu lub biura. Wszystkie biblioteczki z serii DISEGNO OFFICE zostały zaprojektowane z myślą o zróżnicowanych potrzebach użytkowników. Umożliwiając dowolne łączenie frontów z regałami. Dzięki temu meble można w łatwy sposób wkomponować w każdą przestrzeń biurową. WNĘTRZE Biblioteczkę wyposażono w dwie półki, dzielące przestrzeń na trzy wnęki. Górny blat mebla można wykorzystać na ekspozycję dekoracji, zdjęć lub oświetlenia. WYKOŃCZENIE Korpus mebla wykończono folią, która imituje nieregularną barwę betonu ułatwia utrzymanie mebla w czystości. Mebel wpasuje się zarówno w minimalistyczne, industrialne, jak i loftowe aranżacje.', '', 'biblioteka-disegno-office-niska', '', '', '', 'Biblioteka DISEGNO OFFICE niska', '', '', '', ''),
(217, 1, 1, 'Szukasz komody do swojego domku letniskowego lub chcesz podkreślić swojski charakter swojego salonu? Spodoba Ci się biała komoda ELARA z imitacją desek na froncie. Komoda w salonie i sypialni Dobre rozplanowanie przestrzeni wewnątrz mebla sprawia, że umieścisz w niej: pościel, obrusy, bieliznę oraz inne ubrania, które nie wymagają wieszaków. Komoda w gabinecie Teczki, dokumenty, albumy oraz także inne przedmioty biurowe i osobiste również mogą znaleźć swoje miejsce w komodzie ELARA . WNĘTRZE Posiada 1 szufladę pod blatem w środkowej sekcji mebla. Główna przestrzeń komody to 3 szafki podzielone półkami. Maksymalne obciążenie półek to 5 kg. WYKOŃCZENIE Została wykonana z płyt meblowych oraz MDF pokrytych folią. Korpus i fronty komody są w białym kolorze, natomiast blaty wykończono wybarwieniem imitującym drewno. Uchwyty są z tworzywa - proste, nowoczesne i w czarnym kolorze.', '', 'komoda-biala-z-szuflada-elara', '', '', '', 'Komoda biała z szufladą ELARA', '', '', '', ''),
(218, 1, 1, 'Szafka RTV może być ozdobą wnętrza - tak, jak szafka pod telewizor ROSE z granatowymi frontami, złotymi uchwytami i nóżkami. Idealnie nada się do przechowywania dekodera, pilotów i kolekcji gier. Zawiasy z cichym domykiem sprawiają, że drzwi nie trzaskają. WNĘTRZE Szafka RTV z serii ROSE posiada 1 otwartą półkę – na której umieścić możesz niezbędny sprzęt RTV. Wymiar wnęki otwartej: 100x120x40 cm. Dzięki 2 skrytym za frontami półkom , posłuży także jako miejsce na dokumenty lub dodatki, które cierpliwie czekają na kolejny sezon. Szeroka szuflada sprawdzi się doskonale jako przestrzeń, w której Twoja kolekcja klasyków kina lub gier będzie perfekcyjnie poukładana. WYKOŃCZENIE Korpus oraz fronty szafki wykonano z laminowanej płyty meblowej w unikatowym kolorze. Kolekcję ROSE charakteryzują metalowe uchwyty i wysokie nóżki w złotym odcieniu . Szuflada wysuwa się dzięki prowadnicom kulkowym . IKONA STYLU Granatowe meble ROSE doskonale komponują się z: elementami wykonanymi z jasnego drewna w chłodnym odcieniu, również bielonego drewna . jasnym marmurem , szarym marmurem, stonowanymi odcieniami kamieni i betonu. modnym lastryko . eleganckim, ciemnym drewnem – zwłaszcza w postaci stylizowanego oparcia łóżka lub podłogi, która dzięki renowacji odzyskała dawny blask. jeśli lubisz grę kontrastów możesz urozmaicić aranżacje dekoracjami w ceglanym odcieniu czerwieni – zwłaszcza, gdy łączy się ona z welurem . GRANATOWA ELEGANCJA Pragniesz, by Twoją sypialnię wyróżniała elegancja i styl? Elegancka linia mebli ROSE w ciemnoniebieskim odcieniu sprawi, że wnętrze nabierze klasy i szyku. Dzięki ROSE możesz igrać z najnowszymi trendami panującymi w nowoczesnych wnętrzach. Od klasyki , poprzez minimalizm , aż do new hampton ... Dzięki ROSE to Ty decydujesz, jak wyglądać będzie Twój wymarzony salon .', '', 'szafka-rtv-granatowa-z-szuflada-rose', '', '', '', 'Szafka RTV granatowa z szufladą ROSE', '', '', '', ''),
(219, 1, 1, 'Masz dość bałaganu przy wejściu? Wszystkie swoje buty i akcesoria poukładasz w szafce na BOOTS. Dzięki swojej niedużej głębokości - 34 cm szafka nadaje się do wąskich pomieszczeń. Podwójne drzwi pozwalają wygodnie sięgnąć po buty, nawet w ciasnym wnętrzu. WNĘTRZE Buty i akcesoria możecie poukładać w 6 wnękach. Wiemy, że buty mogą mieć różną wysokość. Dzięki możliwości regulacji wysokości półki, wnętrze szafki możesz dostosować do swoich potrzeb WYKOŃCZENIE Mebel wykonano z płyt meblowych i pokryto folią. Wykończenie w ponadczasowej bieli sprawia, że z łatwością dopasujesz szafkę do własnej aranżacji i innych mebli w mieszkaniu .', '', 'szafka-na-buty-boots-biala', '', '', '', 'Szafka na buty BOOTS biała', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(220, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody TEMPRA wyposażony w 4 szuflady w całości wykonany z płyty meblowej i wykończony folią. Kolorystyka dąb artisan o charakterystycznym wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie z meblami w stylu nowoczesnym oraz skandynawskim. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Komoda TEMPRA 2 posiada 4 duże szuflady ● Została wykonana z płyty meblowej, pokrytej folią ● Komoda jest utrzymana w kolorystyce dąb artisan ● Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla', '', 'komoda-tempra-2-4s-dab-artisan', '', '', '', 'Komoda TEMPRA 2 4S dąb artisan', '', '', '', ''),
(221, 1, 1, 'Komoda GAYA 2D4S to praktyczny mebel do salonu lub sypialni, stylizowany na pochodzący z lat 60-tych. Dzięki wysokim, skośnym nóżkom oraz długim, poziomym uchwytom wprowadzi do pomieszczenia nutę klimatu retro. Ciepły odcień drewna sprawi, że w pomieszczeniu zrobi się bardziej przytulnie. Duża komoda to niezwykle funkcjonalny mebel, dający możliwość przechowywania znacznej ilości przedmiotów. Komoda jest elementem ciekawej kolekcji GAYA - meblami z kolekcji można urządzić pomieszczenie nowocześnie, z elementami stylu industrialnego oraz retro. To idealna kolekcja dla miłośników niebanalnych rozwiązań we wnętrzach, która nie przytłoczy ale będzie doskonałym uzupełnieniem aranżacji pomieszczenia. WNĘTRZE Wnętrze komody kryje 4 pojemne wnęki oraz 4 szuflady. Blat posłuży do eksponowania interesujących dodatków czy pamiątek. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej wykończonej laminatem imitującym drzewo z orzecha. Nóżki oraz uchwyty mebla są z tworzywa sztucznego.', '', 'komoda-gaya-2d4s', '', '', '', 'Komoda GAYA 2D4S', '', '', '', ''),
(222, 1, 1, 'Komoda Norton charakteryzuje się prostą minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz. Laminat w jasnym kolorze dębu sonoma, przypominający dekorem drewno wprowadzi w pomieszczeniu przytulny klimat. Kolor jest bardzo popularny, co ułatwia dopasowanie mebla z innymi. Brak tradycyjnych uchwytów sprawia, że mebel łatwiej wkomponować w dowolną aranżację. Komoda dzięki swojej uniwersalności sprawdzi się zarówno w sypialni, przedpokoju jak i salonie. Duża ilość brył dostępna w programie Norton czyni kolekcję bardzo atrakcyjną. WNĘTRZE W szafce i szufladzie przechowasz wszystko, co chcesz uporządkować i mieć zawsze pod ręką. Dzięki kulkowym prowadnicom z pełnym wysuwem docenisz komfort użytkowania mebla. WYKOŃCZENIE Mebel został pokryty laminatem, łatwiejszym w utrzymaniu czystości.', '', 'komoda-norton-1d1s', '', '', '', 'Komoda NORTON 1D1S', '', '', '', ''),
(223, 1, 1, 'Kolekcja mebli do sypialni SARDINIA to nowoczesna propozycja stawiająca na zdecydowane akcenty i funkcjonalną prostotę aranżacyjną. Połączenie barwy dębu artisan z ciemnymi akcentami podkreśla elegancję kolekcji a sypialni nadaje stylowy wyraz luksusowej przestrzeni. Kolekcja pięknie sprawdzi się we wnętrzach inspirowanych naturą i loftowych, ale także stworzy świetną bazę do urządzenia wnętrza w stylu marynistycznym. Komoda SARDINIA świetnie sprawdzi się jako dodatkowa przestrzeń przechowywania wyposażenia domu, ale także jako elegancka powierzchnia do umieszczenia fotografii, dekoracyjnych bibelotów lub roślin doniczkowych. WNĘTRZE W dwóch zamykanych szafkach znajdują się cztery wnęki , które swobodnie pomieszczą różne akcesoria i sprzęty domowe. Maksymalne obciążenie półek wynosi 5 kg ; Maksymalne obciążenie blatu wynosi 40 kg. Cztery pojemne szuflady na prowadnicach rolkowych znacząco zwiększają przestrzeń przechowywania drobnych elementów wyposażenia domowego lub dokumentów. WYKOŃCZENIE ● Korpus, półki oraz fronty komody są wykonane z płyty wiórowej i pokryte melaminą , która jest materiałem łatwym do utrzymania w czystości oraz nadaje atrakcyjny wygląd struktury powierzchni; ● Kontrastujący czarny dekor komody zdecydowanie podkreśla oryginalność designu mebla korespondując z czarnymi uchwytami i nóżkami; ● Drzwiczki szafek oraz fronty szuflad wyposażone są w duże, metalowe uchwyty ; ● Mebel jest umieszczony na eleganckich płozach z tworzywa ;', '', 'komoda-sardinia-2d4s', '', '', '', 'Komoda SARDINIA 2D4S', '', '', '', ''),
(224, 1, 1, 'Komoda SARDINIA świetnie sprawdza się jako dodatkowa przestrzeń przechowywania wyposażenia domu, ale także jako elegancka powierzchnia do umieszczenia fotografii, dekoracyjnych bibelotów lub roślin doniczkowych. WNĘTRZE Cztery pojemne szuflady na prowadnicach rolkowych przydają się do przechowywania drobiazgów lub dokumentów. WYKOŃCZENIE ● Korpus, półki oraz fronty komody są wykonane z płyty wiórowej i pokryte melaminą , która jest materiałem łatwym do utrzymania w czystości oraz nadaje atrakcyjny wygląd struktury powierzchni; ● Kontrastujący czarny dekor komody zdecydowanie podkreśla oryginalność designu mebla korespondując z czarnymi uchwytami i nóżkami; ● Drzwiczki szafek oraz fronty szuflad wyposażone są w duże, metalowe uchwyty ; ● Mebel jest umieszczony na eleganckich płozach z metalu Maksymalne obciążenie blatu wynosi 40 kg. ARANŻACJA Kolekcja mebli do sypialni SARDINIA to nowoczesna propozycja stawiająca na zdecydowane akcenty i funkcjonalną prostotę aranżacyjną. Połączenie barwy dębu artisan z ciemnymi akcentami podkreśla elegancję kolekcji a salonowi nadaje stylowy wyraz luksusowej przestrzeni. Kolekcja pięknie sprawdzi się we wnętrzach inspirowanych naturą i loftowych, ale także stworzy świetną bazę do urządzenia wnętrza w stylu marynistycznym.', '', 'komoda-sardinia-4s', '', '', '', 'Komoda SARDINIA 4S', '', '', '', ''),
(225, 1, 1, 'Komoda dwudrzwiowa Norton charakteryzuje się prostą minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz. Laminat w jasnym kolorze dębu sonoma dekorem przypominający drewno wprowadzi do twojego pokoju dziennego przytulny klimat. Brak tradycyjnych uchwytów sprawia, że mebel łatwiej wkomponować w dowolną aranżację. WNĘTRZE W szafkach i szufladzie przechowasz wszystko, co chcesz uporządkować i zawsze mieć pod ręką. Dzięki kulkowym prowadnicom z pełnym wysuwem docenisz komfort użytkowania mebla. WYKOŃCZENIE Mebel został pokryty laminatem, łatwiejszym w utrzymaniu czystości.', '', 'komoda-norton', '', '', '', 'Komoda NORTON', '', '', '', ''),
(226, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. Szafka RTV Irma świetnie sprawdzi się w pokoju dziennym. Jasna kolorystyka wpisze się w aktualne trendy umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadzi do wnętrza wyjątkowy klimat. Mnogość brył systemu pozwala na umeblowanie salonu i jadalni według własnych potrzeb i preferencji. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WNĘTRZE Wnętrze składa się z półek w części zamkniętej oraz półek otwartych przeznaczonych na sprzęt RTV. Wymiary wnęk: szerokość 54 cm, głębokość 41 cm, wysokość 14 cm WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV. Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'szafka-rtv-irma-im2-z-oswietleniem', '', '', '', 'Szafka RTV IRMA IM2 z oświetleniem', '', '', '', ''),
(227, 1, 1, 'Na szafce RTV ELARA ustawisz 50-calowy telewizor lub wieżę. Najważniejsze, aby łączna waga ustawionych na niej sprzętów nie przekraczała 40 kg. Biel i jasne wybarwienie dębu bianco nadaje jej naturalny wygląd. Front wykonano w taki sposób, by imitował drewniane deski. Oszczędna estetyka sprawia, że szybko zaadoptujesz mebel do własnego pomysłu na wystrój wnętrza WNĘTRZE Przestrzeń RTV jest podzielona na 3 sekcje - zamykane szafki i otwarty środek. Pozwoli Ci to rozmieścić wszystkie przedmioty. W środkowej części znajdują się 2 otwarte wnęki bez tylnej ścianki. Dzięki temu z łatwością przeciągniesz wszystkie kable. Wnętrze bocznych szafek są przedzielone półką na 2 wnęki. Blat szafki RTV ma udźwig do 40 kg, a maksymalne obciążenie każdej z półek to 5 kg. WYKOŃCZENIE Szafkę wykonano z płyt meblowych oraz MDF pokrytych folią. Korpus i fronty są w białym, matowym kolorze. Wnętrza i górny blat wykończono wybarwieniem imitującym drewno dębowe. Uchwyty przy frontach są z tworzywa w czarnym kolorze.', '', 'szafka-rtv-biala-elara', '', '', '', 'Szafka RTV biała ELARA', '', '', '', ''),
(228, 1, 1, 'Szukasz masywnej szafki pod telewizor z wnęką na sprzęt? Wybierz szafkę CORTE i ciesz się jej nowoczesnym wyglądem. Szafka nie ma uchwytów, a specjalnie wyprofilowane drzwi, aby ułatwić otwieranie. Poziome dekory sprawiają, że wkomponuje się we wnętrze z motywem pasów. Jest częścią kolekcji masywnych mebli z szarymi elementami - idealnych do nowoczesnych i loftowych wnętrz. WNĘTRZE Na blacie postawisz telewizor albo gramofon. W 4 wnękach za zamkniętymi drzwiami schowasz rzeczy o wadze do 5 kg. Wnęka otwarta o udźwigu do 5 kg to idealne miejsce na dekoder. W szufladzie schowasz mniejsze przedmioty - o wadze nieprzekraczającej 3 kg. Dzięki prowadnicom z cichym domykiem szuflada nie trzaska. WYKOŃCZENIE Szafkę wykonano z 16 mm płyty meblowej pokrytej laminatem w kolorze jasnego dębu coast evoke. W drzwiach i szufladzie jako uchwyty zastosowano frezowanie frontów.', '', 'szafka-pod-telewizor-z-wneka-corte', '', '', '', 'Szafka pod telewizor z wnęką CORTE', '', '', '', ''),
(229, 1, 1, 'Potrzebujesz dodatkowego mebla do przechowywania, który doskonale wykorzysta dostępną przestrzeń? Narożna komoda OSLO idealnie dopasuje się do pustego miejsca w rogu pokoju, a Ty zyskasz kolejne miejsce do przechowywania. Sprawdzi się przedpokoju, domowym biurze, pokoju dziennym czy młodzieżowym. Jasny front połączony z korpusem w kolorze drewna to ponadczasowa propozycja do wielu aranżacji. Dodatkowo takie wybarwienie nie przytłacza wnętrza. Drzwi możesz zamontować w taki sposób, by otwierały się na lewą lub na prawą stronę. WNĘTRZE Za drzwiami znajdziesz 2 wnęki, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się w nowoczesnych i skandynawskich aranżacjach.', '', 'komoda-narozna-oslo-1d', '', '', '', 'Komoda narożna OSLO 1D', '', '', '', ''),
(230, 1, 1, 'Modernizm stanowił w historii sztuki całkowity odwrót od przeszłości. Wzrok świata artystycznego skierowany został w to, co miało nadejść. Lata 60-te oraz 70-te zaowocowały meblami o prostych liniach, charakteryzujących się lekkością. Inspirację stanowiło funkcjonalne, szwedzkie wzornictwo początków XX wieku. W obliczu panującej obecnie mody na vintage, komoda VINCENT NEW V-6 jest strzałem w dziesiątkę. Geometryczna bryła uzupełniona o smukłe, drewniane nóżki, świetnie wpasuje się we współczesne wnętrza tych, którzy podążają za trendami. WNĘTRZE Konstrukcja wnętrza komody to ukryta za frontami przestrzeń przedzielona półką oraz trzy szuflady wyposażone w funkcję cichego domyku . Dzięki tak podzielonej przestrzeni wewnątrz mebla, z łatwością utrzymasz porządek i zawsze znajdziesz to, czego szukasz. WYKOŃCZENIE Niemal cały korpus komody VINCENT NEW V-6 został wykończony białą barwą. Monotonię przełamuje dekor imitujący dębowe drewno, pokrywający zarówno blat, jak i dolną część komody. W podobnym odcieniu są nóżki- element decydujący o stylistyce mebla i stanowiący nawiązanie do stylistyki vintage. Funkcję uchwytów pełnią tutaj subtelne frezowania we frontach.', '', 'komoda-vincent-new-v-6', '', '', '', 'Komoda VINCENT NEW V-6', '', '', '', ''),
(231, 1, 1, 'Lubisz niestandardowe i nowoczesne rozwiązania we wnętrzach? Komoda 3D PATRIK to mebel, który odmieni przestrzeń salonu, przedpokoju czy sypialni. Trójwymiarowe fronty wprowadzą do wnętrza dynamiczny i wyrazisty charakter. Komoda w kolorze dąb artisan nada wnętrzu przytulny charakter i nie przytłoczy go. WNĘTRZE Za 3 drzwiami znajdziesz 6 wnęk, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. Brak uchwytów podkreśla minimalistyczny i nowoczesny charakter mebla. Blat możesz wykorzystać na wyeksponowanie stylowych dekoracji, zdjęć czy pamiątek. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się we współczesnych aranżacjach, w których zależy nam na stworzeniu ciekawej i nowoczesnej aranżacji.', '', 'komoda-nowoczesna-trzydrzwiowa-patrik', '', '', '', 'Komoda nowoczesna trzydrzwiowa PATRIK', '', '', '', ''),
(232, 1, 1, 'W tej szerokiej k omodzie PORTO możesz przechowywać elementy zastawy stołowej lub książki i dokumentację rodzinną. Głęboki odcień orzecha columbia wprowadza do wnętrza klimat elegancji i luksusu. Cechą charakterystyczną kolekcji jest wstawka z czarnego szkła lacobel , która nadaje meblowi oryginalny styl. Podfrezowane fronty zastępują tradycyjne uchwyty, co podnosi atrakcyjność kolekcji oraz usprawnia użytkowanie mebla. Bryły wchodzące w skład kolekcji umożliwiają gustowne umeblowanie pokoju dziennego w nowoczesnym stylu. WNĘTRZE Wnętrze składa się z 3 szuflad oraz 6 wnęk w części zamkniętej. WYKOŃCZENIE Fronty wykonano z płyty MDF pokrytej folią PCV. Korpus mebla wykończono laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'komoda-porto-szeroka', '', '', '', 'Komoda PORTO szeroka', '', '', '', ''),
(233, 1, 1, 'Kolorystyka w komodzie THOR to dominująca biel z czarnymi akcentami znajdującymi się na wstawkach. Będzie odpowiednia do nowocześnie urządzonych wnętrz. Biel rozjaśni optycznie pomieszczenie nadając mu wrażenie przestronności. Zamiast uchwytów podfrezowano frontowe części drzwi i szuflad. Nowoczesne materiały wykorzystane do produkcji zwiększają atrakcyjność mebla i zapewniają mu większą trwałość i łatwiejsze utrzymanie czystości. Komodę THOR z powodzeniem zastosujesz w jadalni jak i przedpokoju. WNĘTRZE Komoda została podzielona trzema szufladami i trzema półkami usprawniając zagospodarowanie wnętrza. WYKOŃCZENIE Korpus wykonano z płyty meblowej pokrytej laminatem, front z płyty MDF pokrytej folią PCV.', '', 'komoda-thor', '', '', '', 'Komoda THOR', '', '', '', ''),
(234, 1, 1, 'Potrzebujesz więcej miejsca? Nie wiesz gdzie schować zastawę, sztućce i wykrochmalone obrusy? Ta komoda CORTE bez problemu pomieści nadprogramowe talerze, szklanki i kieliszki, bo ma aż 201,2 cm szerokości i 10 wnęk. Komoda nie ma uchwytów, a specjalnie wyprofilowane drzwi, aby ułatwić otwieranie. Jest częścią kolekcji masywnych mebli z szarymi elementami - idealnych do nowoczesnych i loftowych wnętrz. WNĘTRZE We wnętrzu znajduje się aż 10 wnęk. Na każdej półce postawisz przedmioty o wadze do 5 kg. 2 szuflady przydadzą się na drobiazgi - możesz je obciążyć do 3 kg. Dzięki prowadnicom z cichym domykiem, szuflady nie trzaskają. WYKOŃCZENIE Komodę pokryto laminatem z ciekawym rysunkiem drewna. Ciemne dekory układają się w pasiasty wzór, co nadaje komodzie nowoczesny wygląd. Tak wykończona komoda świetnie zaprezentuje się wśród betonowych ścian i drewnianych dekoracji. Możesz wpasować ją we wnętrza z motywem pasów.', '', 'komoda-do-salonu-corte', '', '', '', 'Komoda do salonu CORTE', '', '', '', ''),
(235, 1, 1, 'Komoda z kolekcji SANDY to nowoczesny mebel do zastosowania w salonie, przedpokoju lub sypialni. Dzięki szerokim listwom wzdłuż boków szafki oraz krótkim, nieregulowanym nóżkom meble z kolekcji SANDY sprawiają wrażenie solidnych i masywnych. Ciepły odcień dębu dodaje pomieszczeniu przytulności, którą dodatkowo wzmaga jeszcze oświetlenie LED o ciepłej, białej barwie. Brak widocznych uchwytów i delikatne żłobienia na froncie dodają meblom elegancji. WNĘTRZE Wnętrze komody kryje praktyczne wnęki przedzielone półkami oraz dwie szuflady na chowanie niezbędnych drobiazgów. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej pokrytej laminatem, natomiast front jest wykonany z płyty MDF pokrytej folią PVC.', '', 'komoda-sandy-3d2s-s3-z-oswietleniem', '', '', '', 'Komoda SANDY 3D2S S3 z oświetleniem', '', '', '', ''),
(236, 1, 1, 'Komoda LOFT to mebel przeznaczony do pokoju dziennego, wizualnie utrzymany w nowoczesnym stylu. Łączy w sobie prostotę oraz funkcjonalność, a także dyskretną elegancję. Doskonale współpracuje zarówno z odcieniami szarości, jak również ciepła tonacją wnętrza. Pod względem kolorystycznym meble z kolekcji LOFT idealnie wykorzystują zasadę kontrastu, w myśl której płyty wykończone jasnym wybarwieniem są podkreślone czarnymi wstawkami, które wyodrębniają z całej bryły linie szafek oraz szuflad. Komoda LOFT została wykonana z płyty meblowej o grubości 16 mm wykończonej laminatem. Przy drzwiach zostały zamontowane zawiasy puszkowe, a do szuflad prowadnice kulkowe. WNĘTRZE Komoda LOFT posiada zamykane oraz otwarte półki. W części zamkniętej znajdują się 2 półki - 3 wnęki. Całości dopełnia umieszczona w dole bryły szuflada – idealne rozwiązanie pod kątem umieszczenia w nich ubrań, dokumentów lub przydatnych przedmiotów osobistych. WYKOŃCZENIE Komoda LOFT została wykonana z płyty meblowej wykończonej laminatem w kolorze dąb wotan . Uchwyty służące do otwierania szuflad i szafek są metalowe, okrągłe i ładnie komponują się z linią mebla.', '', 'komoda-loft-90-1d1s', '', '', '', 'Komoda LOFT 90 1D1S', '', '', '', ''),
(237, 1, 1, 'Strefa rozrywki w zieleni? Tak i to najlepiej z szafką RTV CAMBRIDGE . To propozycja dla miłośników dobrego stylu i nietuzinkowych aranżacji. Doskonale przemyślana konstrukcja idealnie wypełni wnętrze pokoju dziennego i pozwoli uporządkować wszystkie akcesoria w kąciku wypoczynkowym. WNĘTRZE W 2 otwartych wnękach możesz umieścić dekoder czy konsolę. Akcesoria, gry, płyty czy piloty zmieszczą się w 2 zamykanych wnękach. Maksymalne obciążenie półki wynosi 10 kg. KOLEKCJA CAMBRIDGE – do salonu i jadalni Marzysz o harmonii i spokoju w swoim wnętrzu? Postaw na wyjątkowe meble w ciemnozielonym kolorze, które połączone z blatem imitującym naturalne drewno wprowadzą do niego przytulny, a zarazem elegancki klimat. Z czym połączyć tę barwę? Pełna głębi zieleń chętnie połączy się z jasnymi kolorami – bielami, szarościami czy beżami. WYKOŃCZENIE Kolekcja CAMBRIDGE jest wykonana z płyty meblowej i wykończona laminatem.', '', 'szafka-rtv-zielona-cambridge-2d', '', '', '', 'Szafka RTV zielona CAMBRIDGE 2D', '', '', '', ''),
(238, 1, 1, 'Komoda NEPTUN 2S/90 cechuje się lekką wizualnie formą i niewielkim wymiarem, który umożliwia wkomponowanie jej nawet w kameralne pomieszczenia. Mebel może pełnić funkcję dostawki do blatu biurka NEPTUN – zarówno z prawej, jak i lewej strony. Przechowasz w niej często używane sprzęty, dokumenty, artykuły biurowe. Jasne fronty komody odbiją światło i dzięki temu rozświetlą pomieszczenie. Nowoczesny design i wybarwienie stworzą przyjazną przestrzeń do pracy . WNĘTRZE Komoda posiada 2 szuflady, wyposażone w prowadnice kulkowe w pełnym wysuwem i 2 otwarte wnęki ; Szuflady mają uniwersalny układ — sam decydujesz, której strony je umieścisz podczas montażu; Na blacie możesz umieścić drukarkę, wyeksponować dekoracje lub ramkę ze zdjęciem. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony laminatem. Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. Uchwyty w srebrnym kolorze odznaczają się prostą, minimalistyczną stylistyką i świetnie pasują do nowoczesnego designu komody. Podstawą komody są drewniane nóżki , które nadają jej lekkości. Meble NEPTUN – ZESTAW JE JAK CHCESZ Kolekcja NEPTUN wyróżnia się innowacyjnym podejściem do aranżacji miejsca pracy lub nauki. Wielofunkcyjny system pozwoli zrealizować nawet kilkanaście koncepcji na zagospodarowanie przestrzeni domowego biura, gabinetu czy pokoju młodzieżowego.', '', 'komoda-neptun-2s-90', '', '', '', 'Komoda NEPTUN 2S/90', '', '', '', ''),
(239, 1, 1, 'Szafka RTV PRISCO świetnie prezentuje się w salonie oraz jadalni. Można ją wykorzystać dla ekspozycji sprzętu RTV oraz książek, dekoracji oraz osobistych drobiazgów. Nowoczesny design RTV PRISCO cechują wyważone elementy dekoracyjne oraz kolorystyka, która łączy wybarwienie złotego dąbu craft z czarnym kolorem . WNĘTRZE: RTV posiada 2 zamykane szafki - 2 wnęki idealne do przechowywania płyt i akcesoriów Szuflada znajduje się w środkowej części mebla Wnęka na sprzęt RTV jest pod blatem (wymiar wnęki: 35 x 13 x 42 cm) Na szafce możesz ustawić sprzęt o wadze maksymalnej 20 kg WYKOŃCZENIE: RTV została wykonana z płyty meblowej, wykończonej laminatem Frezowane fronty pełnią funkcję Uchwytów. Są wygodne w użyciu i estetycznie wykonane Wnętrze można swobodnie wykorzystać do trzymania książek, zastawy, dekoracji oraz osobistych drobiazgów', '', 'szafka-rtv-z-szuflada-prisco', '', '', '', 'Szafka RTV z szufladą PRISCO', '', '', '', ''),
(240, 1, 1, 'Komoda Norton charakteryzuje się prostą minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz. Laminat w jasnym kolorze dębu sonoma, przypominający dekorem drewno wprowadzi w pomieszczeniu przytulny klimat. Kolor jest bardzo popularny, co ułatwia dopasowanie mebla z innymi. Brak tradycyjnych uchwytów sprawia, że mebel łatwiej wkomponować w dowolną aranżację. Komoda dzięki swojej uniwersalności sprawdzi się zarówno w sypialni, przedpokoju jak i salonie. Duża ilość brył dostępna w programie Norton czyni kolekcję bardzo atrakcyjną. WNĘTRZE Komoda posiada cztery szuflady, w których przechowasz wszystko co chcesz uporządkować i mieć zawsze pod ręką. Dzięki kulkowym prowadnicom z pełnym wysuwem docenisz komfort użytkowania mebla. WYKOŃCZENIE Mebel został pokryty laminatem, łatwiejszym w utrzymaniu czystości.', '', 'komoda-z-szufladami-dab-sonoma-norton', '', '', '', 'Komoda z szufladami dąb sonoma NORTON', '', '', '', ''),
(241, 1, 1, 'Biała komoda GRAZ 4S świetnie uzupełni aranżację domu lub biura. Prosty design oraz klasyczna, biała barwa sprawiają, że komoda wpasuje się w jasne wnętrza, stając się naturalnym elementem wyposażenia. To idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Przyda się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych czy dokumentów. WNĘTRZE Do dyspozycji masz 4 szuflady , w których łatwo pogrupujesz potrzebne przedmioty. WYKOŃCZENIE Komodę wykończono laminatem, dzięki czemu jest łatwa w utrzymaniu czystości. Uchwyty z tworzywa prezentują się nowocześnie.', '', 'komoda-biala-graz-4s', '', '', '', 'Komoda biała GRAZ 4S', '', '', '', ''),
(242, 1, 1, 'Szafka TORONTO wprowadza swobodną atmosferę do domowej strefy rozrywki, a czarny dekor współgra z nowoczesnym designem sprzętu RTV . Swoją konstrukcją nawiązuje do stylu rustykalnego , wzbogacając go jednak o nowoczesny element w postaci dekoru o kontrastowej barwie. Dzięki temu możesz zestawiać ją z elegancką czernią i wkomponować we wnętrza wypełnione chłodnymi szarościami. WNĘTRZA W szerokiej wnęce zmieścisz zarówno dekoder, jak i konsolę. Szafka posiada 2 pojemne szuflady, które przydadzą się na płyty DVD i na akcesoria. Wymiar wnęki: 53,4 cm x 33,4 cm x 11,0 cm WYKOŃCZENIE Korpus szafki wykończono laminatem, imitującym strukturę drewna o ciepłej barwie dębu wotan (na tylnej ścianie - dąb złoty craft). Front pokryto folią PVC. Ciemny dekor współgra z nowoczesnymi elementami wykończenia. Dzięki takiemu wykończeniu, szafka wprowadza przytulną atmosferę (nawet do wnętrz typu - loft) i świetnie prezentuje się wśród tzw. barw ziemi, otoczona roślinnością lub dekoracjami z modnym motywem „urban jungle” .', '', 'szafka-rtv-toronto-2s-b', '', '', '', 'Szafka RTV TORONTO 2S B', '', '', '', ''),
(243, 1, 1, 'Szafka z szufladami RTV w stylu skandynawskim PLISSEE sprawdzi się w niewielkim salonie. Jasny odcień wykończenia urozmaicony o pionowe paski wprowadzą do pomieszczenia nutę nonszalancji. Blat oraz spód szafki z nogami w dębowym kolorze podkreślają geometryczną bryłę mebla . Stwórz przejrzystą przestrzeń i dodaj jej odrobinę wyrazistości dzięki błękitnym, granatowym lub czerwonym dodatkom. WNĘTRZE 2 szuflady to nieodzowna pomoc w odpowiednim skompletowaniu garderoby. Odtąd wszystkie dodatki możesz posegregować i utrzymywać perfekcyjny porządek. Do dyspozycji posiadasz 4 wnęki ukryte za frontami. Większe elementy możesz ułożyć na półce o udźwigu 5 kg . WYKOŃCZENIE Korpus oraz dół szafki RTV wykończono laminatem w białym oraz dębowym kolorze. Fronty to połączenie płyty meblowej i płyty mdf, które pokryto laminatem oraz folią . Front mebla posiada charakterystyczne żłobienie przypominające plisę. Daje on ciekawy efekt 3D, który wyróżnia bryłę spośród innych. Zawiasy z cichym domykiem pozwolą Ci delikatnie zamknąć szafkę, nie budząc przy tym drzemiącego na kanapie męża.', '', 'szafka-rtv-z-ryflowanym-frontem-plissee-1448-cm', '', '', '', 'Szafka RTV z ryflowanym frontem PLISSEE 144,8 cm', '', '', '', ''),
(244, 1, 1, 'W komodzie BESTO z łatwością posegregujesz swoje obrusy i rodzinne dokumenty. Komoda posiada 2 szuflady oraz 2 szafki z półkami. Dzięki takiemu rozkładowi w łatwy sposób oddzielisz swoje rzeczy od ulubionych przedmiotów partnera, a segregatory poukładasz według kolorów. WNĘTRZE Komoda podzielona jest na 2 szafki, w których możesz posegregować rzeczy w wygodny dla Ciebie sposób. W środku znajdziesz łącznie 4 wnęki. Każda półka wytrzyma obciążenie do 5 kg. 2 szuflady na prowadnicach kulkowych dają wygodny dostęp do przechowywanych w nich rzeczy. BARWA DREWNA I BIEL Z POŁYSKIEM Jasne drewno, białe fronty i proste, grafitowe uchwyty - to cechy charakterystyczne kolekcji BESTO. Dzięki takiemu połączeniu wnętrze nabierze przytulnego charakteru. Takie meble nawet w niewielkim pokoju, nie przytłoczą. Połyskujące, białe fronty odbiją światło i sprawią, że wnętrze wyda się większe. Serią BESTO możesz umeblować nie tylko salon. W kolekcji znajdują się także meble do sypialni i jadalni. WYKOŃCZENIE Meble wykonano z płyty meblowej i pokryto laminatem, który zapewnia łatwe czyszczenie. Fronty wykończono połyskującą folią, która dodaje meblom elegancji. Komoda postawiona jest na 4 nóżkach z tworzywa sztucznego.', '', 'komoda-do-salonu-besto', '', '', '', 'Komoda do salonu BESTO', '', '', '', ''),
(245, 1, 1, 'Komodę BESTO wpasujesz nawet w niewielki kącik. Doskonale sprawdzi się zarówno w przedpokoju, jak i sypialni. Możesz poukładać w niej ubrania, bieliznę lub poustawiać buty. Na blacie komody o szerokości 99 cm ustawisz kwiaty, ramki ze zdjęciami lub ozdobne figurki. WNĘTRZE W zamykanej szafce znajdziesz 2 wnęki, na których możesz poukładać ubrania, tekstylia lub inne rzeczy. Maksymalne obciążenie półki to 5 kg. Szuflada mocowana jest na prowadnicach kulkowych, dzięki czemu jej działanie jest płynne i umożliwia wygodny dostęp do wszystkich przedmiotów przechowywanych w środku. BARWA DREWNA I BIEL Z POŁYSKIEM Jasne drewno, białe fronty i proste, grafitowe uchwyty - to cechy charakterystyczne kolekcji BESTO. Dzięki takiemu połączeniu wnętrze nabierze przytulnego charakteru. Takie meble nawet w niewielkim pokoju, nie przytłoczą. Połyskujące, białe fronty odbiją światło i sprawią, że wnętrze wyda się większe. Serią BESTO możesz umeblować nie tylko sypialnia. W kolekcji znajdują się także meble do salonu i jadalni. WYKOŃCZENIE Meble wykonano z płyty meblowej i pokryto laminatem, który zapewnia łatwe czyszczenie. Fronty wykończono połyskującą folią, która dodaje meblom elegancji. Komoda postawiona jest na 4 nóżkach z tworzywa sztucznego.', '', 'komoda-do-sypialni-besto', '', '', '', 'Komoda do sypialni BESTO', '', '', '', ''),
(246, 1, 1, 'Komoda VINCENT NEW V-5 to pełen prostoty, a jednocześnie elegancki mebel. Nieskomplikowana bryła, smukłe, lekko ukośne nóżki oraz pozbawione tradycyjnych uchwytów fronty- wszystko to składa się na nowoczesny wygląd komody, jednocześnie stanowiąc ukłon w stronę modernistycznego wzornictwa. Komoda VINCENT NEW doskonale wkomponuje się we wnętrza utrzymane w stylistyce skandynawskiej czy vintage, jednak równie dobrze będzie wyglądać w całkiem współczesnych, minimalistycznych aranżacjach. WNĘTRZE Pojemne wnętrze komody podzielono na siedem mniejszych wnęk , co pozwoli uporządkować przechowywane w niej przedmioty. Fronty zamocowano na zawiasach z funkcją cichego domyku. Pośrodku mebla znajduje się otwarta wnęka wyposażona w dwupunktowe oświetlenie LED - w tym miejscu wyeksponujesz te przedmioty, których urodę warto podkreślić. Dodatkowe źródło światła w pomieszczeniu, nawet niezbyt intensywnego, będzie pomocne w tworzeniu przytulnej atmosfery podczas wieczornego wypoczynku w pomieszczeniu. Pojedyncza szuflada to doskonałe miejsce na wszelkie drobiazgi lub dokumenty. Zamontowana na prowadnicy firmy HETICH, domyka się z łatwością i po cichu , co zwiększa komfort użytkowania. WYKOŃCZENIE Funkcję uchwytów w komodzie VINCENT NEW V-5 pełnią specjalne frezowania. Stabilną podstawę stanowią wykonane z dębowego drewna nóżki, które pokryto lakierem. Kontrastowe połączen ie imitacji dębowego drewna z białą powierzchnią wygląda nietuzinkowo, a jednocześnie pod kątem kolorystycznym jest dość uniwersalne- bez problemu skomponuje się z dowolną kolorystyką ścian czy dodatków dekoracyjnych.', '', 'komoda-z-oswietleniem-vincent-new-v-5', '', '', '', 'Komoda z oświetleniem VINCENT NEW V-5', '', '', '', ''),
(247, 1, 1, 'Szafka RTV NAPOLI wyglądem nawiązuje do rustykalnej estetyki prostych i funkcjonalnych mebli w naturalnej kolorystyce drewna. Idealnie komponuje się z przestronnym, jasnym wnętrzem. Uświetnia, wzbogaca i doskonale organizuje przestrzeń pokoju dziennego lub salonu stanowiąc centralny element zestawu. Korpus oraz pełne RTV NAPOLI zostały wykonane z płyty meblowej, wykończonej melaminą, natomiast frontowa część z olejowanych fragmentów litego drewna łączonego techniką mikrowczepów. Przy płytach stworzonych w tej technologii słoje układają są w różnym kierunku co sprawia, że posiadają wysoką odporność na odkształcanie się, wypaczanie oraz pękanie. WNĘTRZE RTV NAPOLI została wyposażona w 2 szafki zamykane na drzwi klapowe oraz znajdujące się nad nimi wnęki. Jest meblem, który doskonale nadaje się dla eksponowania nie tylko urządzeń RTV (max. udźwig 40 kg) ale również elementów dekoracyjnych, które dodają pomieszczeniu elegancji. WYKOŃCZENIE RTV NAPOLI została wykończona w kolorze naturalnym dębu z widocznymi sękami i przebarwieniami charakterystycznymi dla tego typu drewna. Uroku dodają również ładnie wkomponowane w bryłę aluminiowe uchwyty. Nóżki mebla stanowią ślizgi wbijane w podstawę. Do szafki można również dobrać zestaw dwupunktowego oświetlenia.', '', 'szafka-rtv-z-drzwiami-klapowymi-napoli-ne41', '', '', '', 'Szafka RTV z drzwiami klapowymi NAPOLI NE41', '', '', '', ''),
(248, 1, 1, 'Szafka RTV GAYA 2D to praktyczny i pojemny mebel do salonu, stylizowany na pochodzący z lat 60-tych. Dzięki wysokim, skośnym nóżkom oraz długim, poziomym uchwytom wprowadzi do pomieszczenia nutę klimatu retro . Ciepły odcień drewna sprawi, że w pomieszczeniu zrobi się bardziej przytulnie. Szafka jest elementem ciekawej kolekcji GAYA, charakteryzującej się harmonijnym połączeniem efektu drewna z czarnymi wstawkami. Meblami z kolekcji można urządzić pomieszczenie nowocześnie, z elementami stylu industrialnego oraz retro. To idealna kolekcja dla miłośników niebanalnych rozwiązań we wnętrzach, nie przytłoczy ale będzie doskonałym uzupełnieniem aranżacji pomieszczenia. WNĘTRZE Otwarte wnęki posłużą do przechowywania sprzętu RTV. 2 zamknięte wnęki pomieszczą dowolne przedmioty, które chcemy mieć w zasięgu ręki, ale nie na wierzchu, jak piloty, dodatkowe kable czy baterie. Wymiary wnęki - szerokość 60 cm, głębokość 35 cm, wysokość 16 cm górna, 18,5 cm dolna. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej wykończonej laminatem, imitującym drzewo z orzecha. Nóżki oraz uchwyty mebla są z tworzywa sztucznego.', '', 'szafka-rtv-gaya-2d', '', '', '', 'Szafka RTV GAYA 2D', '', '', '', ''),
(249, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją prosta, nowoczesna linia oraz funkcjonalność. Większość brył z tej kolekcji ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model niskiego regału w całości wykonanego z płyty meblowej i wykończony folią w matowym odcieniu. Kolorystyka dąb artisan o charakterystycznym wybarwieniu zbliżonym do naturalnego drewna umożliwia zestawienie regału z meblami w stylu nowoczesnym oraz skandynawskim. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE ● Regał TEMPRA 2 posiada 3 otwarte półki ● Został wykonany z płyty meblowej, pokrytej folią ● Regał jest utrzymany w kolorystyce dąb artisan', '', 'regal-tempra-2-dab-artisan', '', '', '', 'Regał TEMPRA 2 dąb artisan', '', '', '', ''),
(250, 1, 1, 'Komoda TEMPRA 2 wysoka 2D2S wyposażona jest w 2 drzwi oraz 2 szuflady . Dzięki takiemu rozkładowi jest idealnym meblem do przechowywania książek i drobnych gadżetów. WNĘTRZE W 6 wnękach możesz przechowywać przedmioty o wadze maksymalnej 5 kg 2 szuflady to idealne miejsce na drobiazgi WYKOŃCZENIE Została wykonana z płyty meblowej, pokrytej folią. Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla. Kolorystyka dąb artisan umożliwia zestawienie komody z meblami w stylu rustykalnym oraz industrialnym. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. MIEJSCE NA WSZYSTKO Kolekcja komód i regałów TEMPRA 2 sprawi, że w Twoim domu znajdzie się miejsce na wszystko. Przy jej pomocy możesz urządzić domową czytelnię, gabinet lub przedpokój. Dzięki tej kolekcji zachowasz porządek wśród ubrań, dokumentów, potrzebnych drobiazgów, a nawet ubrań.', '', 'komoda-wysoka-tempra-2-3d2s-dab-artisan', '', '', '', 'Komoda wysoka TEMPRA 2 3D2S dąb artisan', '', '', '', ''),
(251, 1, 1, 'Komoda WENECJA wyglądem nawiązuje do rustykalnej estetyki prostych i funkcjonalnych mebli w naturalnej kolorystyce dębowego drewna. Wyposażona w 3 drzwi i 3 szuflady znajdzie swoje miejsce w jadalni, salonie sypialni lub gabinecie. Pojemne wnętrze świetnie sprawdza się do przechowywania ubrań, obrusów oraz osobistych drobiazgów. WNĘTRZE 3 szuflady to idealne miejsce na akcesoria i dokumentację. Pościel, segregatory lub odzież możesz rozdzielić w 4 zamykanych wnękach. WYKOŃCZENIE Frontowa część mebla została wykonana z olejowanych fragmentów litego drewna łączonego techniką mikrowczepów. Przy płytach stworzonych w tej technologii słoje układają są w różnym kierunku co sprawia, że posiadają wysoką odporność na odkształcanie się, wypaczanie oraz pękanie. WENECJA została wykończone w kolorze naturalnym dębu z widocznymi sękami i przebarwieniami charakterystycznymi dla tego typu drewna. Uroku dodają również ładnie wkomponowane w bryłę aluminiowe uchwyty. Nóżki mebla stanowią ślizgi wbijane w podstawę.', '', 'komoda-wenecja-3d3s-we10', '', '', '', 'Komoda WENECJA 3D3S WE10', '', '', '', ''),
(252, 1, 1, 'Kolekcja ulubionych płyt winylowych? Seria książek? Ważne dokumenty, a może jeszcze coś innego? Wszystko, co tylko chcesz, schowasz w komodzie LISABON. Dzięki modnej kolorystyce mebel bez problemu dopasujesz do pomieszczeń utrzymanych w nowoczesnej stylistyce. Sprawdzi się w pokoju dziennym, gabinecie albo sypialni. Wybierz sam! WNĘTRZE Za zamkniętymi drzwiami masz znajdują się 4 wnęki. Z prawej strony umieszczono 4 szuflady o udźwigu do 3 kg. Na blacie postawisz gramofon albo zdjęcia przyjaciół. WYKOŃCZENIE Korpus komody LISABON wykonano z płyty meblowej o grubości 16 mm. Front pokryto folią PVC w kolorze szarego matu. Blat został zrobiony z 16 mm płyty meblowej wykończonej melaminą w kolorze dębu artisan. Szuflady umieszczono na prowadnicach kulkowych i zamontowano w nich plastikowe uchwyty.', '', 'komoda-szara-z-4-szufladami-lisabon', '', '', '', 'Komoda szara z 4 szufladami LISABON', '', '', '', ''),
(253, 1, 1, 'Szafka RTV ALMOND świetnie wkomponuje się reprezentacyjną część salonu lub pokoju dziennego. Będzie stylową podstawą dla telewizora lub różnych dekoracji. Nowoczesny design i minimalistyczna forma sprawiają, że możesz wykorzystać mebel w wielu aranżacjach. Kolekcja ALMOND wyróżnia się dużą ilością brył, dzięki którym możesz urządzić mieszkanie w spójnym stylu. Meble z kolekcji ALMOND sprawią, że Twoje wnętrze będzie jasne i pełne ciepła. WNĘTRZE Szafka posiada zamykaną wnękę i szufladę , dzięki którym zachowasz porządek w pomieszczeniu; W otwartej wnęce możesz umieścić dekoder lub konsolę; Maksymalne obciążenie półki wynosi 20 kg . WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony laminatem ; Połączenie frontów w kaszmirowym kolorze z ciepłą barwą dębu burgundzkiego wprowadzi do pomieszczenia przytulny klimat; Brak uchwytów podkreśla minimalistyczny charakter kolekcji; Powierzchnia laminowana jest łatwa w utrzymaniu czystości.', '', 'szafka-rtv-almond', '', '', '', 'Szafka RTV ALMOND', '', '', '', ''),
(254, 1, 1, 'Nie możesz się oprzeć jasnym, przejrzystym wnętrzom? Inspirujesz się stylem skandynawskim , gdzie króluje biel i oryginalne rozwiązania? Szafka z szerokim szufladami RTV PLISSEE to propozycja, która z pewnością przypadnie Ci do gustu. Charakterystyczne zdobienie frontów w postaci frezowanych żłobień przypominających plisy sprawi, że wnętrze Twojego nowoczesnego salonu nabierze odrobiny nonszalancji. Geometryczną bryłę mebla podkreślają blat oraz spód szafki z nogami w dębowym kolorze . Charakter szafki podkreślą unikalne ozdoby i dekoracje, które przywiozłeś ze skandynawskiej wycieczki. WNĘTRZE 2 szerokie szuflady to nieodzowna pomoc w odpowiednim skompletowaniu garderoby. Odtąd wszystkie dodatki możesz posegregować i utrzymywać perfekcyjny porządek. Dodatkowe pledy i koce oraz elementy dekoracyjne umieścisz na 3 półkach za uchylnymi drzwiami . Zawiasy z cichym domykiem pozwolą Ci delikatnie zamknąć szafkę, nie budząc przy tym drzemiącego na kanapie kota. WYKOŃCZENIE Długi blat w odcieniu naturalnego dębu pomieści kolekcję rodzinnych zdjęć z wakacji. Korpus oraz dół szafki RTV wykończono laminatem w białym oraz dębowym kolorze . Fronty to połączenie płyty meblowej i płyty mdf , które pokryto laminatem oraz folią – łatwo pozbędziesz się kurzu. Front mebla posiada charakterystyczne żłobienie przypominające plisę . Daje on ciekawy efekt 3D , który wyróżnia bryłę spośród innych.', '', 'szafka-rtv-z-ryflowanym-frontem-plissee-1838-cm', '', '', '', 'Szafka RTV z ryflowanym frontem PLISSEE 183,8 cm', '', '', '', ''),
(255, 1, 1, 'Szafka RTV jest częścią kolekcji mebli salonowych GOBI . Zamykana na drzwi klapowe z otwartymi półkami oraz zewnętrznym oświetleniem idealnie podkreśla nowoczesny styl pokoju dziennego. Pozwala nie tylko znaleźć miejsce na sprzęt audiowizualny, ale także pomaga w organizacji przestrzeni wewnątrz domu lub mieszkania. Może stanowić doskonałe miejsce do trzymania kolekcji filmów, dokumentów lub przydatnych, potrzebnych na codzień drobiazgów. RTV GOBI pod względem kolorystycznym łączy wybarwienie dębu artisan z połyskującą bielą części frontowej oraz matowym wykończeniem blatów i korpusów. Elementem wyróżniającym jest oświetlenie w postaci taśmy LED umieszczonej w centralnej części mebla. Brak uchwytów i podchwytów rekompensuje w całości system push to open. RTV GOBI WNĘTRZE RTV posiada pojedynczą szafkę zamykaną na drzwi klapowe funkcja push to open znacznie podwyższają komfort obsługi mebla łącznie RTV posiada 4 wnęki otwarte maksymalny udźwig półek wynosi 5 kg RTV GOBI WYKOŃCZENIE korpus i półki RTV są wykonane z płyty meblowej, wykończonej laminatem całości dopełniają fronty z płyty MDF wykończonej folią z widocznym połyskiem KOLEKCJA GOBI GOBI to kolekcja mebli przeznaczona do wnętrza utrzymanego w nowoczesnej stylistyce. Biała kolorystyka frontów połączona z elementami dębu artisan wprowadza naturalność, która jest cechą charakterystyczną stylu skandynawskiego. Wkomponowane w większość brył z kolekcji oświetlenie LED wspaniale współgra z połyskiem i w naturalny sposób łączy funkcjonalność z walorami ozdobnymi. W skład kompletu GOBI wchodzą: komoda, witryny, szafki RTV, półki wiszące oraz ława. Dzięki nim można w kompletny sposób umeblować salon oraz jadalnię.', '', 'szafka-rtv-1-drzwiowa-z-oswietleniem-gobi', '', '', '', 'Szafka RTV 1-drzwiowa z oświetleniem GOBI', '', '', '', ''),
(256, 1, 1, 'Szafka KOMFORT z pojedynczymi drzwiami klapowymi pozwoli zorganizować przestrzeń do przechowywania obuwia nawet w małym przedpokoju. Projektanci skupili się na funkcjonalności, tworząc szafkę, która dodatkowo służy jako siedzisko. W 2 wnękach z łatwością przechować buty i kapcie. Drzwi otwierane klapowo to bardzo wygodne rozwiązanie nawet do małego przedpokoju, którego podłoga jest zastawiona butami. Praktyczne nóżki-ślizgacze z tworzywa ułatwiają przesuwanie mebla. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej o grubości 15 mm i pokryta folią imitującą drewno dębowe w jasnym wybarwieniu sonoma . Takie wykończenie pasuje do nowoczesnych pomieszczeń urządzonych w stylu skandynawskim. Blat szafki pokryto brązowym - polerowanym welurem. Tworzy siedzisko, dzięki czemu możesz na nim usiąść, by wygodnie włożyć buty.', '', 'szafka-na-buty-z-drzwiami-klapowymi-komfort', '', '', '', 'Szafka na buty z drzwiami klapowymi KOMFORT', '', '', '', ''),
(257, 1, 1, 'Cenisz sobie minimalistyczne , proste rozwiązania inspirowane skandynawskim stylem ? Komoda z szufladą PLISSEE to ciekawa bryła, która podkreśli wygląd pokoju dziennego. Fronty zdobione pionowymi żłobieniami przypominającymi plisy nadadzą bryle nietuzinkowego wyglądu i przykują wzrok. Jasna, przestronna przestrzeń urozmaicona unikatową komodą sprawi, że wnętrze salonu nabierze wyjątkowego charakteru. WNĘTRZE W górnej części pod blatem znajdziesz 2 szuflady , idealne na dodatkowe, dekoracyjne części garderoby. Wnętrze komody pozwoli Ci na ergonomiczne zagospodarowanie przestrzeni. Odtąd wszystkie dodatki możesz posegregować i utrzymywać perfekcyjny porządek. Większe elementy możesz ułożyć na półkach o udźwigu 5 kg . WYKOŃCZENIE Wygląd komody podkreślony został poprzez drewniane nóżki oraz minimalistyczne uchwyty z tworzywa . Charakterystyczną cechą komody jest zdobienie w postaci pionowych pasków na frontach. Korpus szafki RTV wykończono laminatem w białym oraz dębowym kolorze . Fronty to połączenie płyty meblowej i płyty mdf , które pokryto laminatem oraz folią. Zawiasy z cichym domykiem pozwolą Ci delikatnie zamknąć szafkę, nie budząc przy tym pupila drzemiącego na kanapie. Front mebla posiada charakterystyczne żłobienie przypominające plisę . Daje on ciekawy efekt 3D , który wyróżnia bryłę spośród innych.', '', 'komoda-z-szufladami-i-ryflowanym-frontem-plissee-1448-cm', '', '', '', 'Komoda z szufladami i ryflowanym frontem PLISSEE 144,8 cm', '', '', '', ''),
(258, 1, 1, 'Szafka KOMFORT pozwoli zorganizować przestrzeń do przechowywania obuwia nawet w małym przedpokoju. Projektanci skupili się na funkcjonalności, tworząc szafkę, która dodatkowo służy jako siedzisko. 2 wnęki pozwalają zorganizować przestrzeń wewnątrz szafki według własnych potrzeb. Drzwiczki otwierane klapowo to bardzo wygodne rozwiązanie nawet do małego przedpokoju, którego podłoga jest zastawiona butami. Praktyczne nóżki-ślizgacze z tworzywa ułatwiają przesuwanie mebla. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej o grubości 15 mm i pokryta melaminą w kolorze dąb sonoma . Takie wykończenie pasuje do nowoczesnych pomieszczeń urządzonych w stylu skandynawskim. Siedzisko pokryto brązowym welurem polerowanym - prezentuje się elegancko.', '', 'szafka-na-buty-z-2-wnekami-komfort', '', '', '', 'Szafka na buty z 2 wnękami KOMFORT', '', '', '', ''),
(259, 1, 1, 'Chcesz uporządkować dodatki w przedpokoju? A może potrzebujesz mebla, na którym ustawisz kolekcję zdjęć rodzinnych w salonie? Komoda DOORSET jest dla Ciebie idealnym wyborem. Ułatwi poukładanie wszystkich rzeczy, które przydają się w salonie, przedpokoju lub jadalni. A jej design wykończony w ciepłym kolorze drewna pomoże wprowadzić do przytulny, domowy nastrój. WYKOŃCZENIE Komoda posiada zamykane wnęki, w których uporządkujesz ubrania, zastawę stołową czy dokumenty. Maksymalne obciążenie blatu oraz półki wewnętrznej wynosi 5 kg. W KOLORZE DREWNA Kolekcja mebli DOORSET w całości jest wykonana w kolorze imitującym barwę surowego drewna, z widocznymi słojami i sękami, dlatego też świetnie sprawdzi się we wnętrzach urządzonych w stylu rustykalnym oraz klasycznym.', '', 'komoda-do-salonu-z-2-wnekami-doorset', '', '', '', 'Komoda do salonu z 2 wnękami DOORSET', '', '', '', ''),
(260, 1, 1, 'Komoda GAYA 2D to praktyczny mebel do salonu lub sypialni, stylizowany na pochodzący z lat 60-tych. Dzięki wysokim, skośnym nóżkom oraz długim, poziomym uchwytom wprowadzi do pomieszczenia nutę klimatu retro. Ciepły odcień drewna sprawi, że w pomieszczeniu zrobi się bardziej przytulnie. Niewielkich rozmiarów komoda świetnie sprawdzi się w małych wnętrzach czy kawalerkach. Komoda jest elementem ciekawej kolekcji GAYA - meblami z kolekcji można urządzić pomieszczenie nowocześnie, z elementami stylu industrialnego oraz retro. To idealna kolekcja dla miłośników niebanalnych rozwiązań we wnętrzach - nie przytłoczy ale będzie doskonałym uzupełnieniem aranżacji pomieszczenia. WNĘTRZE Wnętrze komody kryje 4 pojemne wnęki. Blat posłuży do eksponowania interesujących dodatków czy pamiątek. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej wykończonej laminatem imitującym drzewo z orzecha. Nóżki oraz uchwyty mebla są z tworzywa sztucznego.', '', 'komoda-gaya-2d', '', '', '', 'Komoda GAYA 2D', '', '', '', ''),
(261, 1, 1, 'Komoda LUPO wchodzi w skład kolekcji przeznaczonej do pokoju dziecięcego i młodzieżowego. W szafce i szufladzie możesz ułożyć ubrania lub zabawki, a niewielka wysokość komody sprawia, że dziecko będzie mogło swobodnie po nie sięgać. Dzięki wykończeniu w kolorze bieli i drewna łatwo dopasujesz komodę LUPO do większości aranżacji i sprawdzi się zarówno w pokoju dziewczynki, jak i chłopca. WNĘTRZE Komoda posiada 2 zamknięte wnęki oraz szufladę na prowadnicach rolkowych. Blat możesz wykorzystać jako miejsce na organizery, dekoracje czy zabawki. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej i wykończona laminatem . Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. MEBLE LUPO DO POKOJU DZIECIĘCEGO I MŁODZIEŻOWEGO Meble z kolekcji LUPO pomogą urządzić pokój dziecięcy w taki sposób, aby za kilka lat mogły służyć jako meble młodzieżowe. Połączenie bieli z ciepłym kolorem drewna to dobre rozwiązanie do większości aranżacji, które zapewnia swobodę w wyborze i zmianie dodatków. Meble młodzieżowe LUPO pozwolą urządzić nawet niewielki pokój nastolatka , a ich prosta konstrukcja i kolor sprawiają, że z łatwością wkomponujesz je również w inne pomieszczenia.', '', 'komoda-lupo-2d1s', '', '', '', 'Komoda LUPO 2D1S', '', '', '', ''),
(262, 1, 1, 'Koniec z walającymi się na podłodze butami. Zamykana na drzwi szafka DOORSET pomieści buty Twoje i Twoich dzieci. Szafka na buty jest częścią kolekcji DOORSET i możesz ją zestawić z pozostałymi meblami z tej serii. Szafka wykonana jest z płyty w jasnym kolorze z imitacją drewna. Proste, czarne uchwyty sprawiają, że meble z tej kolekcji pasują do wnętrz urządzonych zarówno w stylu klasycznym, jak i nowoczesnym. WNĘTRZE Szafka posiada 2 półki, na których możesz przechowywać buty. WYKOŃCZENIE Korpus oraz fronty szafki wykonane są z płyty meblowej i pokryte laminatem. Czystość szafki zachowasz poprzez regularne przecieranie jej ściereczką.', '', 'szafka-na-buty-do-przedpokoju-doorset', '', '', '', 'Szafka na buty do przedpokoju DOORSET', '', '', '', ''),
(263, 1, 1, 'Szafka na buty DOORSET to wygodne rozwiązanie do utrzymania porządku w przedpokoju nawet o niewielkim metrażu. Szafka posiada 3 przegrody otwierane klapowo, w których z łatwością posegregujesz buty swoje i swojej rodziny. Możesz skomponować go z wieszakiem z serii DOORSET i stworzyć przedpokój, w którym już zawsze będzie panował ład. WNĘTRZE 3 szafki otwierane klapowo z przegrodami na buty. WYKOŃCZENIE Korpus i fronty szafki wykonane są z płyty meblowej oraz pokryte laminatem.', '', 'szafka-na-buty-waska-doorset', '', '', '', 'Szafka na buty wąska DOORSET', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(264, 1, 1, 'Szkło stołowe, albumy ze zdjęciami, obrusy, dekoracje – komoda KALIKST pozwoli Ci na uporządkowanie rzeczy, które chcesz mieć w zasięgu ręki, przebywając w salonie lub jadalni. Mebel w ciepłym kolorze drewna pomoże wprowadzić do wnętrza przytulny, domowy nastrój. Na blacie możesz ułożyć stylowe ozdoby lub ramki ze zdjęciami. Ozdobnym elementem mebla są skrzyżowane listewki na drzwiach frontowych. WNĘTRZE Komoda posiada 4 zamykane wnęki. Ułożysz w nich przedmioty, których nie chcesz eksponować. W środkowej części mebla umieszczono 4 otwarte wnęki. Mebel został wyposażony w dwie szuflady, w których uporządkujesz drobne przedmioty. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Wykończenie utrzymane jest w barwie dębu waterford, dzięki której wnętrze staje się bardziej przytulne i cieplejsze. Uwagę zwracają ładnie wkomponowane w bryłę metalowe uchwyty z widocznym efektem postarzenia. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości – wystarczy miękka, zwilżona ściereczka. KOLEKCJA KALIKST – SIELSKOŚĆ W NOWOCZESNYM WYDANI Kolekcja KALIKST stanowi doskonałą bazę do stworzenia eklektycznej stylizacji. Kolekcja wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Tłem dla kolekcji KALIKST może być pełny głębi szmaragdowy kolor ścian lub ciepły odcień beżu. Mieszanie stylów jest dziś popularne, ponieważ daje dużo przestrzeni dla indywidualizmu. Duża ilość brył pozwoli Ci urządzić mieszkanie w spójnym stylu.', '', 'komoda-kalikst-2d2s', '', '', '', 'Komoda KALIKST 2D2S', '', '', '', ''),
(265, 1, 1, 'Szafka RTV KALIKST będzie doskonałą podstawą dla Twojego telewizora. To niezbędny mebel w każdym pokoju dziennym, który pomoże uporządkować sprzęty i akcesoria. Mebel w ciepłym kolorze drewna wprowadzi do wnętrza przytulny, domowy nastrój. Ozdobnym elementem mebla są skrzyżowane listewki na drzwiach frontowych. WNĘTRZE Szafka posiada 2 zamykane wnęki, których uporządkujesz urządzenia elektroniczne, akcesoria, gry i inne dodatki. W otwartych wnękach możesz bezpiecznie umieścić dekoder lub konsolę. Otwarte wnęki mają wymiar: szerokość - 41 cm, wysokość górnej wnęki - 12cm, wysokość pozostałych wnęk - 14 cm, głębokość - 38 cm W tylnej części mebla został wycięty otwór, który umożliwi na dyskretne i estetyczne przełożenie kabli. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Wykończenie utrzymane jest w barwie dębu waterford, dzięki której wnętrze staje się bardziej przytulne i cieplejsze. Uwagę zwracają ładnie wkomponowane w bryłę metalowe uchwyty z widocznym efektem postarzenia. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości – wystarczy miękka, zwilżona ściereczka. KOLEKCJA KALIKST – SIELSKOŚĆ W NOWOCZESNYM WYDANIU Kolekcja KALIKST stanowi doskonałą bazę do stworzenia eklektycznej stylizacji. Kolekcja wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Tłem dla kolekcji KALIKST może być pełny głębi szmaragdowy kolor ścian lub ciepły odcień beżu. Mieszanie stylów jest dziś popularne, ponieważ daje dużo przestrzeni dla indywidualizmu. Duża ilość brył pozwoli Ci urządzić mieszkanie w spójnym stylu.', '', 'szafka-rtv-kalikst-2d', '', '', '', 'Szafka RTV KALIKST 2D', '', '', '', ''),
(266, 1, 1, 'Komoda KALIKST z barkiem pomoże Ci zorganizować przestrzeń w salonie lub jadalni. Decydując się na komodę z barkiem, zyskujesz dodatkową przestrzeń na kieliszki, zastawę stołową czy potrzebne akcesoria. Mebel ułatwi wiele czynności podczas przyjmowania gości. Możesz częstować ich ulubionymi trunkami, nie wychodząc z salonu. Mebel w ciepłym kolorze drewna pomoże wprowadzić do wnętrza przytulny, domowy nastrój. Na blacie możesz ułożyć stylowe ozdoby lub ramki ze zdjęciami. Ozdobnym elementem mebla są skrzyżowane listewki na drzwiach frontowych. WNĘTRZE Komoda posiada 6 zamykanych wnęk. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Wykończenie utrzymane jest w barwie dębu waterford, dzięki której wnętrze staje się bardziej przytulne i cieplejsze. Uwagę zwracają ładnie wkomponowane w bryłę metalowe uchwyty z widocznym efektem postarzenia. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości – wystarczy miękka, zwilżona ściereczka. KOLEKCJA KALIKST – SIELSKOŚĆ W NOWOCZESNYM WYDANIU Kolekcja KALIKST stanowi doskonałą bazę do stworzenia eklektycznej stylizacji. Kolekcja wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Tłem dla kolekcji KALIKST może być pełny głębi szmaragdowy kolor ścian lub ciepły odcień beżu. Mieszanie stylów jest dziś popularne, ponieważ daje dużo przestrzeni dla indywidualizmu. Duża ilość brył pozwoli Ci urządzić mieszkanie w spójnym stylu.', '', 'komoda-z-barkiem-kalikst', '', '', '', 'Komoda z barkiem KALIKST', '', '', '', ''),
(267, 1, 1, 'Komoda KALIKST ułatwi Ci uporządkowania wszystkich rzeczy, które przydają się w salonie lub jadalni. Sprawdzi się nie tylko jako miejsce do przechowywania. Pełni również funkcję dekoracyjną. Mebel w ciepłym kolorze drewna pomoże wprowadzić do wnętrza przytulny, domowy nastrój. Na blacie możesz ułożyć stylowe dekoracje lub ramki ze zdjęciami. Ozdobnym elementem mebla są skrzyżowane listewki na drzwiach frontowych. WNĘTRZE Komoda posiada 6 zamykanych wnęk, których uporządkujesz domowe tekstylia, zastawę stołową czy dokumenty. Maksymalne obciążenie półki wynosi 5 kg . W górnej części mebla umieszczono 3 szuflady, w których łatwo przechowasz drobne przedmioty. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Wykończenie utrzymane jest w barwie dębu waterford, dzięki której wnętrze staje się bardziej przytulne i cieplejsze. Uwagę zwracają ładnie wkomponowane w bryłę metalowe uchwyty z widocznym efektem postarzenia. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości – wystarczy miękka, zwilżona ściereczka. KOLEKCJA KALIKST – SIELSKOŚĆ W NOWOCZESNYM WYDANIU Kolekcja KALIKST stanowi doskonałą bazę do stworzenia eklektycznej stylizacji. Kolekcja wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Tłem dla kolekcji KALIKST może być pełny głębi szmaragdowy kolor ścian lub ciepły odcień beżu. Mieszanie stylów jest dziś popularne, ponieważ daje dużo przestrzeni dla indywidualizmu. Duża ilość brył pozwoli Ci urządzić mieszkanie w spójnym stylu.', '', 'komoda-kalikst-3d3s', '', '', '', 'Komoda KALIKST 3D3S', '', '', '', ''),
(268, 1, 1, 'Wydawałoby się, że do wnętrz prowansalskich czy rustykalnych telewizor nijak nie pasuje. Jak jednak współczesne wnętrze może obyć się bez tego sprzętu? Dzięki szafce RTV konsekwentnie zrealizujesz swoją wizję salonu stylizowanego na wnętrza domostw z krainy lawendy. Bryła mebla umieszczona została na ozdobnym cokole, a metalowe uchwyty świetnie korespondują z jasnym wybarwieniem, imitującym pobielane drewno. Dodatkowym ozdobnym akcentem są skrzyżowane listewki na froncie. WNĘTRZE 2 wnęki pozwalają podłączyć więcej sprzętu. W szufladzie możesz przechowywać mniejsze akcesoria. Przestrzeń zamkniętej szafki dzieli półka. Możesz w niej posegregować ilubione filmy, gry lub płyty CD. Wymiary górnej wnęki: 54,05 cm x 46,3 cm x 15,1 cm Wymiary dolnej wnęki: 54,05 cm x 46,3 cm x 12.3 cm WYKOŃCZENIE Wybarwienie w modnym - chłodnym odcieniu wpasuje się w większość współczesnych wnętrz. Mebel wykończono folią imitującą strukturę drewna, dzięki czemu zyskuje on nietuzinkowy wygląd. Jasna barwa optycznie powiększa przestrzeń. Stylizowane uchwyty w kolorze starego srebra podkreślają sielski styl mebla.', '', 'szafka-rtv-styl-prowansalski-kashmir', '', '', '', 'Szafka RTV styl prowansalski KASHMIR', '', '', '', ''),
(269, 1, 1, 'Komoda Kashmir to element kolekcji mebli, które będą idealne do pomieszczeń zainspirowanych słoneczną Prowansją. Masywne wieńce i cokoły sprawiają, że komoda zdecydowanie wyróżnia się na tle nowoczesnych, minimalistycznych mebli. Skrzyżowane listewki zdobiące fronty oraz niespotykany kształt uchwytów w kolorze starego srebra - to wszystko przykuwa uwagę i nadaje uroku jasnej bryle. WNĘTRZE Komoda posiada jedną szufladę oraz półki w części zamkniętej. WYKOŃCZENIE Mebel pokryto folią w odcieniu białej pinii, stwarzającej wrażenie, jakby powierzchnia komody została wykończona przecierką. Jasne wybarwienie dodaje lekkości i jednocześnie jest bezpośrednim nawiązaniem do wnętrz rodem z południa Francji. Stylizowane uchwyty w kolorze starego srebra podkreślają charakter mebla.', '', 'komoda-styl-prowansalski-kashmir', '', '', '', 'Komoda styl prowansalski KASHMIR', '', '', '', ''),
(270, 1, 1, 'Komoda KALIKST ułatwi Ci uporządkowanie wszystkich rzeczy, które przydają się w salonie lub jadalni. Sprawdzi się nie tylko jako miejsce do przechowywania. Pełni również funkcję dekoracyjną. Mebel w ciepłym kolorze drewna pomoże wprowadzić do wnętrza przytulny, domowy nastrój. Na blacie możesz ułożyć stylowe dekoracje lub ramki ze zdjęciami. Ozdobnym elementem mebla są skrzyżowane listewki na drzwiach frontowych. WNĘTRZE Komoda posiada 4 zamykane wnęki, których uporządkujesz domowe tekstylia, zastawę stołową czy dokumenty. Maksymalne obciążenie półki wynosi 5 kg . W środkowej części mebla umieszczono 3 szuflady, w których łatwo przechowasz drobne przedmioty. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Wykończenie utrzymane jest w barwie dębu waterford, dzięki której wnętrze staje się bardziej przytulne i cieplejsze. Uwagę zwracają ładnie wkomponowane w bryłę metalowe uchwyty z widocznym efektem postarzenia. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości – wystarczy miękka, zwilżona ściereczka. KOLEKCJA KALIKST – SIELSKOŚĆ W NOWOCZESNYM WYDANIU Kolekcja KALIKST stanowi doskonałą bazę do stworzenia eklektycznej stylizacji. Kolekcja wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Tłem dla kolekcji KALIKST może być pełny głębi szmaragdowy kolor ścian lub ciepły odcień beżu. Mieszanie stylów jest dziś popularne, ponieważ daje dużo przestrzeni dla indywidualizmu. Duża ilość brył pozwoli Ci urządzić mieszkanie w spójnym stylu.', '', 'komoda-kalikst-2d3s', '', '', '', 'Komoda KALIKST 2D3S', '', '', '', ''),
(271, 1, 1, 'Możesz częstować gości domową nalewką, bez konieczności opuszczania salonu. W komodzie KASHMIR 2D1K przechowasz ulubione trudnki oraz komplety eleganckich kielichów. To część ponadczasowej kolekcji, która przypadnie do gustu miłośnikom stylu prowansalskiego . Wprowadza do wnętrza sielski powiew świeżości. Jej bryła umieszczona została na ozdobnym cokole, a metalowe uchwyty świetnie korespondują z jasnym wybarwieniem, imitującym pobielane drewno. Dodatkowym ozdobnym akcentem są skrzyżowane listewki na froncie. WNĘTRZE W 4 wnękach przechowasz szklanki, kufle i kieliszki. Otwierane klapowo drzwi do barku, ułatwiają wyciąganie szklanych naczyń. WYKOŃCZENIE Wybarwienie w chłodnym odcieniu wpasuje się w większość współczesnych wnętrz. Komodę wykończono folią imitującą strukturę sosnowego drewna ( pinia biała ), dzięki czemu zyskuje ona nietuzinkowy wygląd. Jasna barwa optycznie powiększa przestrzeń . Stylizowane uchwyty w kolorze starego srebra podkreślają sielski styl komody.', '', 'komoda-z-barkiem-styl-prowansalski-szeroka-kashmir', '', '', '', 'Komoda z barkiem styl prowansalski szeroka KASHMIR', '', '', '', ''),
(272, 1, 1, 'Zastawa stołowa, albumy, obrusy, dekoracje i pamiątki pomieszczą się w komodzie MEDIOLAN . Drewniana komoda MEDIOLAN szczególnie spodoba się miłośnikom stylu rustykalnego. Wykorzystasz ją w jadalni lub pokoju dziennym. WNĘTRZE Witryna posiada 4 wnęki za drzwiami. Przechowasz w nich przedmioty, których nie chcesz eksponować. 4 otwarte wnęki to świetnie miejsce na pamiątki lub stylowe dekoracje. 2 szuflady przydadzą się na uporządkowanie drobnych przedmiotów. WYKOŃCZENIE Korpus witryny wykonano z płyty meblowej, a fronty z litego drewna. Mebel wykończono olejem. Komoda w kolorze dębu naturalnego z wyraźnym rysunkiem drewna, widocznymi sękami i przebarwieniami doda uroku każdemu pomieszczeniu. Świetnie wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie . Kolekcja MEDIOLAN może być również świetnym wyborem do eklektycznych aranżacji.', '', 'komoda-mediolan-4d2s', '', '', '', 'Komoda MEDIOLAN 4D2S', '', '', '', ''),
(273, 1, 1, 'Nowoczesny sprzęt też możesz przechowywać w stylowy sposób. Szafka RTV ALVERA spełnia oczekiwania współczesnego miłośnika kina domowego, a jednocześnie wprowadza do wnętrza jakiś rodzaj nostalgii, przywodząc na myśl przytulne wnętrza z czasów kolonializmu. To część kolekcji drewnianych mebli, dzięki którym urządzisz pokój dzienny w taki sposób, że nikt nie będzie chciał z niego wychodzić. Szuflada i 2 wnęki na sprzęt ● 2 wnęki otwarte przydadzą się, jeśli poza dekoderem używasz też na co dzień konsoli lub odtwarzacza DVD. Przez otwory w tylnej ściance łatwo jest przeciągnąć kable. ● Boczne szafki kryją po 2 wnęki - to idealne miejsce na kolekcję płyt. Wymiar jednej wnęki to szerokość 48 cm, głębokość 40 cm, wysokość 11,5 cm ● Szuflada przyda się do przechowywania drobiazgów, pilotów i kabli. Lakierowane drewno akacjowe Meble z kolekcji ALVERA wykonano z drewna akacjowego , które charakteryzuje się głęboką barwą, ciekawym usłojeniem i dużą twardością – wytrzymałością. Warstwa lakieru nitrocelulozowego nie tylko zabezpiecza meble przed działaniem wilgoci. Nałożono ją w taki sposób, by nadać meblom strukturę surowego drewna . Rustykalny kolonializm Postarzona struktura drewna sprawia, że meble z kolekcji ALVERA wprowadzają do wnętrz rustykalną surowość . Charakterystyczne frezowanie na frontach nawiązuje zaś do stylu kolonialnego . Ciepła barwa drewna sprawia, że wnętrze prezentuje się przytulnie. Żeliwne gałki podkreślają surowy charakter mebli. Kolekcja sprawdza się więc zarówno w wakacyjnym domu na wsi, jak i w stylowym apartamencie podróżnika lub artysty. Meble warto łączyć z ciepłymi barwami, charakterystycznymi dla stylów afrykańskich. Niezwykły charakter kolekcji podkreślą pamiątki z podróży, stare mapy czy pejzaże malowane na płótnie.', '', 'szafka-rtv-alvera-2d1sz-hfu-a-05', '', '', '', 'Szafka RTV ALVERA 2D+1SZ HFU-A-05', '', '', '', ''),
(274, 1, 1, 'Wydawałoby się, że do wnętrz prowansalskich czy rustykalnych telewizor nijak nie pasuje. Jak jednak współczesne wnętrze może obyć się bez tego sprzętu? Dzięki szafce RTV KASHMIR konsekwentnie zrealizujesz swoją wizję salonu stylizowanego na wnętrza domostw z krainy lawendy. Bryła mebla umieszczona została na ozdobnym cokole, a metalowe uchwyty świetnie korespondują z jasnym wybarwieniem. Dodatkowym ozdobnym akcentem są skrzyżowane listewki na froncie szafki. WNĘTRZE 3 wnęki pozwalają podłączyć więcej sprzętu. Dwie boczne szafki pozwalają posegregować ulubione filmy, gry lub płyty CD. Wymiary gornej wnęki: 43,2 cm x 46,3 cm x 11,2 cm Wymiary środkowej wnęki: 43,2 cm x 46,3 cm x 13,8 cm Wymiary dolnej wnęki: 43,2 cm x 46,3 cm x 14,8 cm WYKOŃCZENIE Wybarwienie w modnym - chłodnym odcieniu wpasuje się w większość współczesnych wnętrz. Mebel wykończono folią imitującą strukturę pobielanego drewna, dzięki czemu zyskuje on nietuzinkowy wygląd. Jasna barwa optycznie powiększa przestrzeń. Stylizowane uchwyty w kolorze starego srebra podkreślają sielski styl mebla.', '', 'szafka-rtv-szeroka-styl-prowansalski-kashmir', '', '', '', 'Szafka RTV szeroka styl prowansalski KASHMIR', '', '', '', ''),
(275, 1, 1, 'Szafka RTV MEDIOLAN pomoże stworzyć przytulną aranżację kącika telewizyjnego. Drewniana szafka RTV szczególnie spodoba się miłośnikom stylu rustykalnego. Wytyczy odpowiednią strefę pod duży telewizor , a dzięki naturalnemu wykończeniu będzie prawdziwą ozdobą wnętrza. WNĘTRZE Otwarta wnęka to świetne miejsce na dekoder lub konsolę. W szufladzie i wnękach za drzwiami pomieścisz wszystkie akcesoria. WYKOŃCZENIE Korpus szafki wykonano z płyty meblowej, a fronty z litego drewna. Mebel wykończono olejem. Szafka RTV w kolorze dębu naturalnego z wyraźnym rysunkiem drewna, widocznymi sękami i przebarwieniami doda uroku każdemu pomieszczeniu. Świetnie wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Kolekcja MEDIOLAN może być również świetnym wyborem do eklektycznych aranżacji.', '', 'szafka-rtv-mediolan-2d1s', '', '', '', 'Szafka RTV MEDIOLAN 2D1S', '', '', '', ''),
(276, 1, 1, 'Ta szafka RTV nadaje wnętrzu niepowtarzalny klimat, a jednocześnie pozwala uporządkować przestrzeń w salonie. Dzięki niebanalnym frezom i połączeniu wyraźnej struktury drewna ze stalowymi elementami, mebel dobrze wpasuje się zarówno w klasyczne, jak i w surowe wnętrza. Najlepiej prezentuje się w towarzystwie pozostałych mebli z kolekcji ARTISTICO . Szczególnie spodoba się miłośnikom rustykalnego stylu. WNĘTRZE W szafce pomieścisz sprzęt, niezbędne akcesoria, a także czasopisma i płyty. Wyposażono ją w dwie zamykane i jedną otwartą wnękę oraz w praktyczną szufladę. Otwór w tylnej ścianie mebla pozwoli w uporządkowany sposób przechowywać niezbędne okablowanie. Wnęka ma wymiar: szerokość 44, wysokość 18, głębokość 40,5 cm WYKOŃCZENIE Meble wykonano z nietypowego i rzadko spotykanego surowca - drewna mango . Jego ciepła barwa sprawia, że wnętrza nabierają oryginalnego i przytulnego charakteru. Drewno zostało dodatkowo postarzone i zabezpieczone matowym lakierem, dzięki czemu meble z serii ARTISTICO przenoszą nas w przeszłość, tworząc spokojną i trochę romantyczną aranżację.', '', 'szafka-rtv-z-litego-drewna-artistico', '', '', '', 'Szafka RTV z litego drewna ARTISTICO', '', '', '', ''),
(277, 1, 1, 'Szukasz minimalistycznych mebli, które podkreślą loftowy charakter wnętrza? Spodoba Ci się metalowy regał EXETER . Regał EXETER to mebel o nowoczesnym designie, uniwersalny pod kątem użytkowym. Różne rozmieszczenie półek sprzyja ustawieniu na nim nie tylko książek i dokumentów, ale też innych drobiazgów, elementów dekoracyjnych lub kwiatów. Za pomocą regału EXETER możesz stworzyć własną, oryginalną aranżację. Regał EXETER stanowi istotne dopełnienie dla wnętrza pokoju dziennego, młodzieżowego oraz domowego gabinetu. Wykorzystasz go również w kąciku do czytania. WYKOŃCZENIE Na szczególną uwagę zasługuje jego oprawa kolorystyczna regału EXETER . Jasne wybarwienie dębu dzikiego świetnie komponuje się z ciemnym, matowym stelażem. Regał EXETER doskonale prezentuje we wnętrzach industrialnych, rustykalnych, minimalistycznych lub nowoczesnych.', '', 'regal-exeter-dab', '', '', '', 'Regał EXETER dąb', '', '', '', ''),
(278, 1, 1, 'Komoda LUPO z szufladami wchodzi w skład kolekcji przeznaczonej do pokoju dziecięcego i młodzieżowego. Dzięki wykończeniu w kolorze bieli i drewna łatwo dopasujesz komodę LUPO do większości aranżacji i sprawdzi się zarówno w pokoju dziewczynki, jak i chłopca. WNĘTRZE Komoda posiada 5 szuflad na prowadnicach rolkowych. Łatwo uporządkujesz w nich ubrania lub akcesoria. Blat możesz wykorzystać jako miejsce na organizery, dekoracje czy zabawki. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej i wykończona laminatem . Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. MEBLE LUPO DO POKOJU DZIECIĘCEGO I MŁODZIEŻOWEGO Meble z kolekcji LUPO pomogą urządzić pokój dziecięcy w taki sposób, aby za kilka lat mogły służyć jako meble młodzieżowe. Połączenie bieli z ciepłym kolorem drewna to dobre rozwiązanie do większości aranżacji, które zapewnia swobodę w wyborze i zmianie dodatków. Meble młodzieżowe LUPO pozwolą urządzić nawet niewielki pokój nastolatka , a ich prosta konstrukcja i kolor sprawiają, że z łatwością wkomponujesz je również w inne pomieszczenia.', '', 'komoda-lupo-5s', '', '', '', 'Komoda LUPO 5S', '', '', '', ''),
(279, 1, 1, 'Chcesz, aby Twój salon był przytulny, uporządkowany i reprezentacyjny? Wisząca szafka RTV VIVIEN w kolorze naturalnego drewna to świetny wybór zarówno do przestronnych wnętrz, jak i mniejszych mieszkań. Szafka wisząca to stylowa podstawa dla sprzętu, a dzięki swojemu wybarwieniu wprowadza do pomieszczenia ciepły klimat. Ze względu na prostą konstrukcję szafki, możesz wykorzystać ją jako dodatkowy mebel do przechowywania w różnych pomieszczeniach. WNĘTRZE W 2 zamykanych wnękach uporządkujesz niezbędne akcesoria. Dzięki drzwiom klapowym (otwieranym w dół) możesz wygodnie dostać się do swojego sprzętu. Górna krawędź drzwi jest podfrezowana . Możesz umieścić palce we wgłębieniu, by zręcznie otwierać drzwi. Maksymalne obciążenie szafki wynosi 15 kg . WYKOŃCZENIE Szafka została wykonana z płyty meblowej pokrytej laminatem. Ciepły kolor naturalnego drewna wprowadza do mieszkania przytulny klimat. Brak widocznych uchwytów podkreśla minimalistyczny charakter kolekcji. WISZĄCE MEBLE DO SALONU Kolekcja VIVIEN to ukłon w stronę minimalistycznego wnętrza. Wiszące meble VIVIEN sprawdzą się zarówno w przestronnych salonach, jak i mniejszych mieszkaniach, w których zależy nam na maksymalnym wykorzystaniu dostępnej przestrzeni. Z kolekcją VIVIEN możesz skompletować zestaw , który najlepiej sprawdzi się w Twoim mieszkaniu. System mebli wiszących VIVIEN szczególnie dobrze wypełni minimalistyczne, nowoczesne i skandynawskie wnętrza.', '', 'szafka-rtv-wiszaca-vivien-03-dab', '', '', '', 'Szafka RTV wisząca VIVIEN 03 DĄB', '', '', '', ''),
(280, 1, 1, 'Pojemne wnętrze bufetu pomieści zastawę stołową, a także obrusy i dekoracje. Mebel pomaga utrzymać porządek w salonie lub jadalni, ułatwiając też nakrywanie do stołu. Dzięki niebanalnym frezom i połączeniu wyraźnej struktury drewna ze stalowymi elementami, mebel dobrze wpasuje się zarówno w klasyczne, jak i w surowe wnętrza. Najlepiej prezentuje się w towarzystwie pozostałych mebli z kolekcji ARTISTICO . Szczególnie spodoba się miłośnikom rustykalnego stylu. WNĘTRZE Wnętrze bufetu podzielono na trzy części. W sześciu obszernych półkach zmieszczą się zarówno talerze, szklanki, kieliszki, jak i tekstylia i dodatki. W trzech dodatkowych szufladach możesz przechowywać sztućce lub domową dokumentację WYKOŃCZENIE Mebel wykonano z nietypowego i rzadko spotykanego surowca - drewna mango. Jego ciekawa barwa sprawia, że wnętrza nabierają oryginalnego i przytulnego charakteru. Drewno zostało dodatkowo postarzone i zabezpieczone matowym lakierem, dzięki czemu meble z serii ARTISTICO przenoszą nas w przeszłość, tworząc spokojną i trochę romantyczną aranżację.', '', 'bufet-komoda-z-litego-drewna-artistico', '', '', '', 'Bufet komoda z litego drewna ARTISTICO', '', '', '', ''),
(281, 1, 1, 'Chcesz, aby Twój salon był przytulny, uporządkowany i reprezentacyjny? Wisząca szafka RTV VIVIEN w kolorze naturalnego drewna to świetny wybór zarówno do przestronnych wnętrz, jak i mniejszych mieszkań. Szafka wisząca to stylowa podstawa dla sprzętu, a dzięki swojemu wybarwieniu wprowadza do pomieszczenia ciepły klimat. Ze względu na prostą konstrukcję szafki, możesz wykorzystać ją jako dodatkowy mebel do przechowywania w różnych pomieszczeniach. WNĘTRZE W 2 zamykanych wnękach uporządkujesz niezbędne akcesoria. Dzięki drzwiom klapowym (otwieranym w dół) możesz wygodnie dostać się do swojego sprzętu. Górna krawędź drzwi jest podfrezowana. Możesz umieścić palce we wgłębieniu, by z łatwością otwierać drzwi. Maksymalne obciążenie szafki wynosi 15 kg . WYKOŃCZENIE Szafka została wykonana z płyty meblowej pokrytej laminatem. Ciepły kolor naturalnego drewna wprowadza do mieszkania przytulny klimat. Brak widocznych uchwytów podkreśla minimalistyczny charakter kolekcji. WISZĄCE MEBLE DO SALONU Kolekcja VIVIEN to ukłon w stronę minimalistycznego wnętrza. Wiszące meble VIVIEN sprawdzą się zarówno w przestronnych salonach, jak i mniejszych mieszkaniach, w których zależy nam na maksymalnym wykorzystaniu dostępnej przestrzeni. Z kolekcją VIVIEN możesz skompletować zestaw , który najlepiej sprawdzi się w Twoim mieszkaniu. System mebli wiszących VIVIEN szczególnie dobrze wypełni minimalistyczne, nowoczesne i skandynawskie wnętrza.', '', 'szafka-wiszaca-rtv-vivien-01-dab', '', '', '', 'Szafka wisząca RTV VIVIEN 01 DĄB', '', '', '', ''),
(282, 1, 1, 'Szafka RTV ALTAMURA to mebel dla prawdziwego miłośnika kina. Szeroki blat (190 cm) pozwoli Ci postawić na szafce telewizor do 86 cali. Jeśli zdecydujesz się powiesić telewizor nad szafką, na blacie możesz postawić świeczki, kwiaty lub inne dekoracje. WNĘTRZE 2 otwarte wnęki oddzielone półką sprawdzą się w sam raz na dekoder lub router. Szafka RTV posiada otwór , przez który w łatwy sposób przeciągniesz kable od telewizora. W szafce znajdziesz 2 półki na dokumenty lub przydatne elementy, które chciałbyś schować. 2 szuflady wykorzystasz do przechowywania ulubionych gier lub kolekcji filmów. WYKOŃCZENIE Szafka wykonana jest z płyty meblowej pokrytej okleiną naturalną oraz folią . Fronty wykonane są z litego drewna dębowego i zabezpieczone olejem. Wstęgi szuflad pokryte są folią. Metalowe, proste uchwyty stanowią elegancki element ozdobny i służą wygodnemu otwarciu szuflady Jeśli chcesz, by Twój kącik kinomana został bardziej wyeksponowany, możesz domówić zestaw oświetlenia w postaci 2 pkt oczka led', '', 'szafka-rtv-szeroka-altamura', '', '', '', 'Szafka RTV szeroka ALTAMURA', '', '', '', ''),
(283, 1, 1, 'ALTAMURA to komoda z szufladami , która odmieni wnętrze Twojego salonu. Ciepła barwa sękatego dębu sprawi, że pokój nabierze przytulności. Korpus komody wykończony jest naturalną okleiną . Fronty z litego drewna posiadają wyraźnie zarysowane sęki - jeśli lubisz przebywać blisko natury, takie wykonanie skradnie Twoje serce. WNĘTRZE 1 niska i 2 wyższe szuflady , to doskonałe miejsce na ręczniki, obrusy lub inne tekstylia. Komoda ALTAMURA posiada 4 wnęki z półkami, które wytrzymają obciążenie 10 kg - Twoja kolekcja ozdobnej ceramiki będzie bezpieczna. WYKOŃCZENIE Komoda wykonana jest z płyty meblowej pokrytej okleiną naturalną oraz wewnątrz - folią . Fronty wykonane są z litego drewna dębowego i zabezpieczone olejem. Wstęga szuflady pokryta jest folią. Metalowe, proste uchwyt stanowią elegancki element ozdobny i służą wygodnemu otwarciu szuflad i szafek.', '', 'komoda-z-szufladami-do-salonu-altamura', '', '', '', 'Komoda z szufladami do salonu ALTAMURA', '', '', '', ''),
(284, 1, 1, 'Pragniesz w swoim salonie stworzyć kącik multimedialny? Szafka RTV BESTO na pewno Ci się przyda. Telewizor możesz postawić bezpośrednio na szafce lub wybrać opcję z powieszeniem go na ścianie. Drugi wariant daje Ci możliwość wykorzystania blatu jako podstawy pod konsolę lub odtwarzacz. Szafka RTV BESTO posiada również miejsce do przechowywania. W 2 szafkach możesz schować dokumenty, gry planszowe lub ulubioną kolekcję filmów. Miejsce do uporządkowania rzeczy znajdziesz również w szufladzie. Na otwartej półce możesz postawić dekoracje lub książki. Szafka RTV stanowi część kolekcji BESTO. Zestaw ją z pozostałymi meblami z tej kolekcji. WNĘTRZE W szafce są 2 wnęki z drzwiami, w których poukładasz rzeczy. Szuflada zamocowana na prowadnicach kulkowych daje Ci wygodny dostęp do przechowywanych w niej przedmiotów. WYKOŃCZENIE Korpus i blat szafki RTV wykonane są z płyty meblowej oraz pokryte laminatem. Szafka osadzona jest na nóżkach wykonanych z tworzywa sztucznego. BARWA DREWNA I BIEL Z POŁYSKIEM Jasne drewno, białe fronty i proste, grafitowe uchwyty - to cechy charakterystyczne kolekcji BESTO. Dzięki takiemu połączeniu wnętrze nabierze przytulnego charakteru. Takie meble nawet w niewielkim pokoju, nie przytłoczą. Połyskujące, białe fronty odbiją światło i sprawią, że wnętrze wyda się większe. Serią BESTO możesz umeblować nie tylko sypialnia. W kolekcji znajdują się także meble do salonu i jadalni.', '', 'szafka-rtv-nowoczesna-do-salonu-besto', '', '', '', 'Szafka RTV nowoczesna do salonu BESTO', '', '', '', ''),
(285, 1, 1, 'Niska komoda LUPO świetnie sprawdzi się w pokoju dziecięcym — w otwartych wnękach możesz ułożyć zabawki lub książeczki, aby dziecko mogło swobodnie po nie sięgać. Dzięki wykończeniu w kolorze bieli i drewna łatwo dopasujesz komodę LUPO do większości aranżacji i sprawdzi się zarówno w pokoju dziewczynki, jak i chłopca. WNĘTRZE Komoda posiada 2 otwarte wnęki oraz szufladę na prowadnicach rolkowych. Blat możesz wykorzystać jako miejsce na organizery, dekoracje czy zabawki. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej i wykończona laminatem . Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. MEBLE LUPO DO POKOJU DZIECIĘCEGO I MŁODZIEŻOWEGO Meble z kolekcji LUPO pomogą urządzić pokój dziecięcy w taki sposób, aby za kilka lat mogły służyć jako meble młodzieżowe. Połączenie bieli z ciepłym kolorem drewna to dobre rozwiązanie do większości aranżacji, które zapewnia swobodę w wyborze i zmianie dodatków. Meble młodzieżowe LUPO pozwolą urządzić nawet niewielki pokój nastolatka , a ich prosta konstrukcja i kolor sprawiają, że z łatwością wkomponujesz je również w inne pomieszczenia.', '', 'komoda-lupo-1s', '', '', '', 'Komoda LUPO 1S', '', '', '', ''),
(286, 1, 1, 'Biała komoda BIANCO sprawdzi się zarówno w sypialni, pokoju dziennym czy przedpokoju i zapewni dodatkowe miejsce do przechowywania. WNĘTRZE Komoda została wyposażona w 3 szuflady na prowadnicach teleskopowych z cichym domykiem. Przechowasz w nich poskładane ubrania, bieliznę lub akcesoria. 2 wnęki ukryte za drzwiami ułatwią uporządkowanie większych przedmiotów. WYKOŃCZENIE Blat i fronty wykończono na wysoki połysk. Dzięki temu meble prezentują się bardzo elegancko – wykorzystasz je w nowoczesnych aranżacjach i w tych z elementami glamour. BIAŁE MEBLE DO SYPIALNI Z kolekcją BIANCO możesz urządzić sypialnię w spójnym stylu, lub wykorzystać bryły w własnej aranżacji innego pomieszczenia. Dzięki dużej ilości mebli w różnych wymiarach, bryły z kolekcji BIANCO pozwolą urządzić zarówno dużą garderobę , jak i niewielką sypialnię. Białe meble to dobry wybór do współczesnych wnętrz. Biel wprowadza uczucie ładu, porządku i świeżości do wnętrza oraz zapewnia swobodę w wyborze dodatków.', '', 'komoda-bianco-1d3s', '', '', '', 'Komoda BIANCO 1D3S', '', '', '', ''),
(287, 1, 1, 'Szafka RTV CARISMA pozwala zorganizować i uporządkować sprzęt elektroniczny, płytotekę i akcesoria. Wyposażono ją w 2 wnęki, w których możesz przechowywać dekoder i konsolę. Połączenie tak stylowej szafki z nowoczesnym sprzętem pozwala uzyskać zaskakujący efekt aranżacyjny. 2 wnęki na sprzęt ● W 4 wnękach zamkniętych możesz przechowywać płyty CD oraz czasopisma. ● Szuflada przyda się na drobiazgi, ładowarki i kable. ● Na 2 półkach otwartych postaw sprzęt, do którego chcesz mieć bezpośredni dostęp. ● Zawiasy i prowadnice wyposażono w system cichego domyku, dzięki czemu szuflady i drzwi nie trzaskają. Biały połysk Komodę wykończono specjalnym lakierem, który tworząc gładką taflę, odbija światło. Dzięki temu komoda powiększa optycznie przestrzeń. Jak w apartamencie gwiazdy filmowej ● Kolekcja mebli CARISMA przeistoczy zwyczajny salon w kobiece wnętrze rodem z pierwszych stron magazynów wnętrzarskich. ● Konstrukcja mebla nawiązuje do stylu ludwikowskiego, który wprowadza do pomieszczeń poczucie wytworności. ● Gładka struktura wykończenia i urokliwe uchwyty w kształcie kryształków sprawiają, że we własnym domu poczujesz się, jak w apartamencie gwiazdy. ● To idealne meble do stworzenia aranżacji w stylu „glamour” .', '', 'szafka-rtv-carisma-cm02-2d1s', '', '', '', 'Szafka RTV CARISMA CM02 2D1S', '', '', '', ''),
(288, 1, 1, 'Biała komoda BIANCO sprawdzi się zarówno w sypialni, pokoju dziennym czy przedpokoju. Zapewni dodatkowe miejsce do przechowywania. WNĘTRZE Komoda została wyposażona w 6 szuflad na prowadnicach teleskopowych z cichym domykiem. Łatwo uporządkujesz w nich bieliznę, akcesoria czy poskładane ubrania. WYKOŃCZENIE Blat i fronty wykończono na wysoki połysk. Dzięki temu meble prezentują się bardzo elegancko – wykorzystasz je w nowoczesnych aranżacjach i tych z elementami glamour. BIAŁE MEBLE DO SYPIALNI Z kolekcją BIANCO możesz urządzić sypialnię w spójnym stylu, lub wykorzystać bryły w własnej aranżacji innego pomieszczenia. Dzięki dużej ilości mebli w różnych wymiarach, meble z kolekcji BIANCO pozwolą urządzić zarówno dużą garderobę , jak i niewielką sypialnię. Białe meble to dobry wybór do współczesnych wnętrz. Biel wprowadza uczucie ładu, porządku i świeżości oraz zapewnia swobodę w wyborze dodatków.', '', 'komoda-z-6-szufladami-bianco', '', '', '', 'Komoda z 6 szufladami BIANCO', '', '', '', ''),
(289, 1, 1, 'Niewielka komoda z kolekcji DIAMENT to element wyposażenia zarówno praktyczny, jak i dekoracyjny. Umieszczona w sypialni pomieści niezbędne drobiazgi jak bieliznę czy ręczniki. Jej blat może posłużyć do wyeksponowania dodatków, dodających sypialni przytulnej i miłej atmosfery. Komoda jest elementem niezwykle eleganckiej i stylowej kolekcji DIAMENT , przeznaczonej do sypialni. Sprawdzi się również jako samodzielny, ozdobny mebel w pomieszczeniu wykończonym w stylu klasycznym czy z elementami glamour i vintage, wprowadzi do wnętrza romantyczny klimat . WYKOŃCZENIE Komoda została wykończona białym lakierem w wysokim połysku , ozdobne nóżki są wykonane z litego drewna, uchwyt jest zdobiony kryształkami.', '', 'komoda-diament-dt02-3s', '', '', '', 'Komoda DIAMENT DT02 3S', '', '', '', ''),
(290, 1, 1, 'Komoda CARISMA 0M04 to idealne miejsce na przechowywanie tekstyliów lub dokumentów. Zarówno prowadnice, jak i zawiasy wyposażono w system „cichego domyku”, dzięki czemu szuflady i drzwi nie trzaskają. Uniwersalne wnętrze ●W 4 wnękach możesz przechowywać segregatory lub komplety pościeli. ●3 szuflady to idealne miejsce na sztućce lub drobiazgi. Biały połysk Komodę wykończono połyskującym lakierem. Dzięki temu komoda powiększa optycznie przestrzeń. Jak w apartamencie gwiazdy filmowej ●Kolekcja mebli CARISMA przeistoczy zwyczajny salon w kobiece wnętrze rodem z pierwszych stron magazynów wnętrzarskich. ●Konstrukcja mebla nawiązuje do stylu ludwikowskiego, który wprowadza do pomieszczeń poczucie wytworności. ●Gładka struktura wykończenia i urokliwe uchwyty w kształcie kryształków sprawiają, że we własnym domu poczujesz się, jak w apartamencie gwiazdy. ●To idealne meble do stworzenia aranżacji w stylu „glamour” .', '', 'komoda-carisma-cm03-2d3s', '', '', '', 'Komoda CARISMA CM03 2D3S', '', '', '', ''),
(291, 1, 1, 'Elegancki charakter domowego centrum rozrywki podkreśli szafka RTV BRODWAY. Zaprojektowano ją w taki sposób, byś mógł wyeksponować ulubiony sprzęt i uporządkować domową płytotekę. Zawiasy i prowadnice wyposażono w system „cichego domyku”, dzięki czemu drzwi i szuflady nie trzaskają. Eksponuj i przechowuj ● Wnęka otwarta przyda się na sprzęt, do którego chcesz mieć bezpośredni dostep. ● W szafkach możesz przechowywać ulubione filmy na DVD lub gry na konsolę. Biały połysk Fronty komody wykończono połyskującym lakierem, który tworzy gładką taflę i powiększa optycznie przestrzeń. Szkło lacobel na blacie prezentuje się bardzo elegancko. Chromowane uchwyty podkreślają nowoczesny charakter mebla. Kwintesencja nowoczesnej elegancji ● Kolekcja mebli BRODWAY wprowadza do wnętrza odrobinę szyku. ● Pozwala stworzyć aranżację, łączącą zamiłowanie do połysku z symetrią, charakterystyczną dla geometrycznych brył nowoczesnych mebli. ● Meble BRODWAY możesz wkomponować zarówno w industrialną przestrzeń, wypełnioną szkłem i połyskującym metalem, jak i wytworne wnętrze w stylu glamour.', '', 'szafka-rtv-brodway-by02', '', '', '', 'Szafka RTV BRODWAY BY02', '', '', '', ''),
(292, 1, 1, 'W komodzie BRODWAY możesz przechowywać dokumenty lub tekstylia. Przechowywane przedmioty możesz rozdzielić we wnękach, by zachować porządek na dłużej. Zawiasy wyposażono w system „cichego domyku”, dzięki czemu drzwi nie trzaskają. Biały połysk Fronty komody wykończono połyskującym lakierem, który tworzy gładką taflę i powiększa optycznie przestrzeń. Szkło lacobel na blacie prezentuje się bardzo elegancko. Chromowane uchwyty podkreślają nowoczesny charakter mebla. Kwintesencja nowoczesnej elegancji ●Kolekcja mebli BRODWAY wprowadza do wnętrza odrobinę szyku. ●Pozwala stworzyć aranżację, łączącą zamiłowanie do połysku z symetrią, charakterystyczną dla geometrycznych brył nowoczesnych mebli. ●Meble BRODWAY możesz wkomponować zarówno w industrialną przestrzeń, wypełnioną szkłem i połyskującym metalem, jak i wytworne wnętrze w stylu glamour.', '', 'komoda-brodway-by04-3d', '', '', '', 'Komoda BRODWAY BY04 3D', '', '', '', ''),
(293, 1, 1, 'W komodzie BRODWAY możesz przechowywać dokumenty lub tekstylia. Przechowywane przedmioty możesz rozdzielić we wnękach. Dzięki takiemu układowi wnętrza, zachowasz porządek na dłużej. Zarówno prowadnice, jak i zawiasy wyposażono w system „cichego domyku”, dzięki czemu szuflady i drzwi nie trzaskają. Wysoki połysk Fronty komody wykończono połyskującym lakierem, który tworzy gładką taflę i powiększa optycznie przestrzeń. Szkło lacobel na blacie prezentuje się bardzo elegancko. Chromowane uchwyty podkreślają nowoczesny charakter mebla. Kwintesencja nowoczesnej elegancji ●Kolekcja mebli BRODWAY wprowadza do wnętrza odrobinę szyku. ●Pozwala stworzyć aranżację łączącą zamiłowanie do połysku z symetrią, charakterystyczną dla geometrycznych brył nowoczesnych mebli. ●Meble BRODWAY możesz wkomponować zarówno w industrialną przestrzeń, wypełnioną szkłem i połyskującym metalem, jak i wytworne wnętrze w stylu glamour.', '', 'komoda-czarna-trzydrzwiowa-brodway', '', '', '', 'Komoda czarna trzydrzwiowa BRODWAY', '', '', '', ''),
(294, 1, 1, 'Bufet ALVERA zaprojektowano po to, by nakrywanie stołu stawało się prostsze. Możesz ustawić go w pobliżu stołu i przechowywać w nim talerze, kieliszki, dekoracje i sztućce. To część kolekcji drewnianych mebli, łączących cechy stylu kolonialnego i rustykalnego , dzięki którym urządzisz salon w taki sposób, że nikt nie będzie chciał z niego wychodzić. 4 wnęki i 4 szuflady ● W każdej z bocznych szafek znajduje się 1 półka . Możesz rozdzielić przechowywane elementy zastawy stołowej na 4 kategorie. ● 4 szuflady przydadzą się do przechowywania sztućców oraz dekoracji. Lakierowane drewno akacjowe Meble z kolekcji ALVERA wykonano z drewna akacjowego , które charakteryzuje się głęboką barwą, ciekawym usłojeniem i dużą twardością – wytrzymałością. Warstwa lakieru nitrocelulozowego nie tylko zabezpiecza meble przed działaniem wilgoci. Nałożono ją w taki sposób, by nadać meblom strukturę surowego drewna . Rustykalny kolonializm Postarzona struktura drewna sprawia, że meble z kolekcji ALVERA wprowadzają do wnętrz rustykalną surowość . Charakterystyczne frezowanie na frontach nawiązuje zaś do stylu kolonialnego . Ciepła barwa drewna sprawia, że wnętrze prezentuje się przytulnie. Żeliwne gałki podkreślają surowy charakter mebli. Kolekcja sprawdza się więc zarówno w wakacyjnym domu na wsi, jak i w stylowym apartamencie podróżnika lub artysty. Meble warto łączyć z ciepłymi barwami, charakterystycznymi dla stylów afrykańskich. Niezwykły charakter kolekcji podkreślą pamiątki z podróży, stare mapy czy pejzaże malowane na płótnie.', '', 'bufet-alvera-2d4sz-hfu-a-04-genova', '', '', '', 'Bufet ALVERA 2D+4SZ HFU-A-04 GENOVA', '', '', '', ''),
