(300, 1, 1, 'W komodzie BRODWAY możesz przechowywać stylowe dekoracje stołowe, ulubione pamiątki rodzinne, dokumenty lub tekstylia. Przechowywane przedmioty możesz rozdzielić w szufladach i wnękach. Dzięki takiemu układowi wnętrza, zachowasz porządek na dłużej. Zarówno prowadnice, jak i zawiasy wyposażono w system „cichego domyku”, dzięki czemu szuflady i drzwi nie trzaskają. 3 szuflady, 6 wnęk ●W 6 wnękach możesz przechowywać książki, tekstylia lub elementy zastawy stołowej. ●3 szuflady to idealne miejsce na sztućce lub dokumenty. Wysoki połysk Fronty komody wykończono połyskującym lakierem, który tworzy gładką taflę i powiększa optycznie przestrzeń. Szkło lacobel na blacie prezentuje się bardzo elegancko. Chromowane uchwyty podkreślają nowoczesny charakter mebla. Kwintesencja nowoczesnej elegancji ●Kolekcja mebli BRODWAY wprowadza do wnętrza odrobinę szyku. ●Pozwala stworzyć aranżację łączącą zamiłowanie do połysku z symetrią, charakterystyczną dla geometrycznych brył nowoczesnych mebli. ●Meble BRODWAY możesz wkomponować zarówno w industrialną przestrzeń, wypełnioną szkłem i połyskującym metalem, jak i wytworne wnętrze w stylu glamour.', '', 'komoda-czarna-brodway-3d3s', '', '', '', 'Komoda czarna BRODWAY 3D3S', '', '', '', ''),
(301, 1, 1, 'Elegancki charakter domowego centrum rozrywki podkreśli szafka RTV BRODWAY . Zaprojektowano ją w taki sposób, byś mógł podłączyć do telewizora zarówno dekoder, jak i konsolę i uporządkować domową płytotekę. Zawiasy i prowadnice wyposażono w system „cichego domyku”, dzięki czemu drzwi i szuflady nie trzaskają. Eksponuj i przechowuj ● 2 wnęki otwarte przydarzą się na sprzęt, do którego chcesz mieć bezpośredni dostęp. ● W 2 bocznych szafkach możesz przechowywać ulubione filmy na DVD lub gry na konsolę. Wysoki połysk Fronty szafki wykończono połyskującym lakierem, który tworzy gładką taflę i powiększa optycznie przestrzeń. Szkło lacobel na blacie prezentuje się bardzo elegancko. Chromowane uchwyty podkreślają nowoczesny charakter mebla. Kwintesencja nowoczesnej elegancji ●Kolekcja mebli BRODWAY wprowadza do wnętrza odrobinę szyku. ●Pozwala stworzyć aranżację łączącą zamiłowanie do połysku z symetrią, charakterystyczną dla geometrycznych brył nowoczesnych mebli. ●Meble BRODWAY możesz wkomponować zarówno w industrialną przestrzeń, wypełnioną szkłem i połyskującym metalem, jak i wytworne wnętrze w stylu glamour.', '', 'szafka-rtv-brodway-by01-2d', '', '', '', 'Szafka RTV BRODWAY BY01 2D', '', '', '', ''),
(302, 1, 1, 'Drewniana szafka RTV HAVONA elegancko wyeksponuje Twój sprzęt. Szklana półka doda Twojemu wnętrzu wyjątkowego szyku, natomiast 2 szafki pozwolą przechować wszystkie potrzebne dokumenty Zestaw ją z pozostałymi meblami z kolekcji i zyskaj wnętrze pełne elegancji z motywem czarnego drewna. Dzięki zastosowaniu zawiasów z cichym domykiem, drzwi szafki nie trzaskają. WYKOŃCZENIE Mebel wykonano z płyty MDF i pokryto czarnym fornirem dębowym o wyrazistej - unikatowej strukturze. Matowe wykończenie sprawia, że mebel zyskuje naturalny wygląd i ponadczasowość. Szklane półki, wykonane ze szkła hartowanego gwarantują trwałość i odporność na działanie temperatury, oraz pozwalają elegancko i estetycznie wyeksponować Twoje sprzęty. CZARNY MINIMALIZM Szukasz mebli, idealnych do minimalistycznych i nowoczesnych wnętrz? Kolekcja HAVONA jest stworzona dla Ciebie! Meble wpasują się w industrialne wnętrza. Doskonale wyeksponujesz na nich dodatki, czy ważne dla Ciebie pamiątki. Ich czarny kolor dodaje szyku i elegancji Twoim pomieszczeniom, naturalny rysunek drewna tworzy wrażenie intymności i nadaje przytulny klimat.', '', 'szafka-rtv-fornirowana-czarna-havona', '', '', '', 'Szafka RTV fornirowana czarna HAVONA', '', '', '', ''),
(303, 1, 1, 'Komoda CARISMA 0M04 może pełnić funkcję biblioteczki, szafki na kosmetyki i biżuterię, ale także barku, który pozwala częstować gości ulubionymi trunkami, nie wychodząc z salonu. W witrynach warto wyeksponować najładniejsze kieliszki i porcelanowe filiżanki. Zarówno prowadnice, jak i zawiasy wyposażono w system „cichego domyku”, dzięki czemu szuflady i drzwi nie trzaskają. 6 wnęk, 3 szuflady i barek ● W 6 wnękach, za przeszklonymi drzwiami możesz przechowywać książki, dekoracje lub elementy zastawy stołowej. ● 3 szuflady to idealne miejsce na sztućce lub dokumenty. ● Środkowa wnęka może pełnić funkcję barku na ulubione trunki lub schowka na biżuterię. Biały połysk Komodę wykończono połyskującym lakierem. Dzięki temu komoda powiększa optycznie przestrzeń. Jak w apartamencie gwiazdy filmowej ● Kolekcja mebli CARISMA przeistoczy zwyczajny salon w kobiece wnętrze rodem z pierwszych stron magazynów wnętrzarskich. ● Konstrukcja mebla nawiązuje do stylu ludwikowskiego, który wprowadza do pomieszczeń poczucie wytworności. ● Gładka struktura wykończenia i urokliwe uchwyty w kształcie kryształków sprawiają, że we własnym domu poczujesz się, jak w apartamencie gwiazdy. ● To idealne meble do stworzenia aranżacji w stylu „glamour” o kobiecym charakterze.', '', 'komoda-carisma-cm04-3d3s-z-barkiem', '', '', '', 'Komoda CARISMA CM04 3D3S, z barkiem', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(304, 1, 1, 'Komoda z kolekcji HAVONA zachwyca czarną barwą i wyrazistym rysunkiem drewna. Dzięki zastosowaniu zawiasów z cichym domykiem, drzwi szafki nie trzaskają. Zestaw ją z pozostałymi meblami z kolekcji i zyskaj wnętrze pełne elegancji z motywem czarnego drewna. WNĘTRZE Mebel posiada 3 wysuwane półki, oraz 2 zamykane szafki. Z powodzeniem przechowasz w nim elementy zastawy czy inne potrzebne akcesoria, które chcesz mieć zawsze pod ręką. CZARNY MINIMALIZM Szukasz mebli, idealnych do minimalistycznych i nowoczesnych wnętrz? Kolekcja HAVONA jest stworzona dla Ciebie! Meble wpasują się w industrialne wnętrza. Doskonale wyeksponujesz na nich dodatki czy ważne dla Ciebie pamiątki. Ich czarny kolor dodaje szyku i elegancji Twoim pomieszczeniom, natomiast drewniane elementy nadają przytulnego klimatu. WYKOŃCZENIE Mebel wykonano z płyty MDF i pokryto czarnym fornirem dębowym o wyrazistej - unikatowej strukturze. Matowe wykończenie sprawia, że mebel zyskuje naturalny wygląd i ponadczasowość.', '', 'komoda-czarna-fornirowana-havona', '', '', '', 'Komoda czarna fornirowana HAVONA', '', '', '', ''),
(305, 1, 1, 'W komodzie BRODWAY możesz przechowywać stylowe dekoracje stołowe, ulubione pamiątki rodzinne, dokumenty lub tekstylia. Przechowywane przedmioty możesz rozdzielić w szufladach i wnękach. Dzięki takiemu układowi wnętrza, zachowasz porządek na dłużej. Zarówno prowadnice, jak i zawiasy wyposażono w system „cichego domyku”, dzięki czemu szuflady i drzwi nie trzaskają. 3 szuflady, 6 wnęk ●W 6 wnękach możesz przechowywać książki, tekstylia lub elementy zastawy stołowej. ●3 szuflady to idealne miejsce na sztućce lub dokumenty. Biały połysk Fronty komody wykończono połyskującym lakierem, który tworzy gładką taflę i powiększa optycznie przestrzeń. Szkło lacobel na blacie prezentuje się bardzo elegancko. Chromowane uchwyty podkreślają nowoczesny charakter mebla. Kwintesencja nowoczesnej elegancji ●Kolekcja mebli BRODWAY wprowadza do wnętrza odrobinę szyku. ●Pozwala stworzyć aranżację, łączącą zamiłowanie do połysku z symetrią, charakterystyczną dla geometrycznych brył nowoczesnych mebli. ●Meble BRODWAY możesz wkomponować zarówno w industrialną przestrzeń, wypełnioną szkłem i połyskującym metalem, jak i wytworne wnętrze w stylu glamour.', '', 'komoda-brodway-by03-3d3s', '', '', '', 'Komoda BRODWAY BY03 3D3S', '', '', '', ''),
(306, 1, 1, 'Z czym kojarzy się styl glamour? To połysk, elegancja i wytworność. Jeżeli marzysz o niebanalnie urządzonym salonie i aranżacji, która łączy te cechy, kolekcja GLAMOUR spełni wszystkie wymagania. Telewizor we wnętrzu w stylu glamour? Wymaga odpowiedniej podstawy, jak szafka RTV z kolekcji GLAMOUR. Białe połyskujące fronty oraz uchwyty w formie kryształków sprawiają, że świetnie odnajdzie się w salonie urządzonym w najbardziej wytwornym stylu. Szafka jest także wyposażona w oświetlenie LED - wzdłuż blatu . Białe światło wprowadzi do wnętrza przytulny klimat. WNĘTRZE otwarta wnęka posłuży do przechowywania dekodera; wymiary wnęki otwartej 71x36x20; szuflada zmieści różnego rodzaju podręczne drobiazgi - piloty, baterie; po bokach szafki znajdują się 4 niewielkie zamknięte wnęki - na dokumenty, płyty CD, książki; komfortowe zawiasy z cichym domykiem zapobiegną trzaskaniu drzwiczkami; z boku szafki znajduje się dyskretny włącznik podblatowego oświetlenia LED; włącznik dotykowy posiada funkcję ściemniania z pamięcią dokonanej nastawy intensywności oświetlenia. WYKOŃCZENIE fronty wykończone są laminatem w modnym połysku; uchwyty w formie kryształków, chromowana dolna listwa oraz wycięte w charakterystyczny sposób drzwiczki - zaokrąglone w dolnej części, to znaki rozpoznawcze kolekcji GLAMOUR .', '', 'szafka-rtv-bialy-polysk-z-oswietleniem-glamour', '', '', '', 'Szafka RTV biały połysk z oświetleniem GLAMOUR', '', '', '', ''),
(307, 1, 1, 'Biała komoda BIANCO sprawdzi się zarówno w sypialni, pokoju dziennym czy przedpokoju i zapewni dodatkowe miejsce do przechowywania. WNĘTRZE Komoda została wyposażona w 3 szuflady na prowadnicach teleskopowych z cichym domykiem. 2 wnęki ukryte za drzwiami ułatwią uporządkowanie potrzebnych przedmiotów. WYKOŃCZENIE Blat i fronty wykończono na wysoki połysk. Dzięki temu meble prezentują się bardzo elegancko – wykorzystasz je w nowoczesnych aranżacjach i tych z elementami glamour. BIAŁE MEBLE DO SYPIALNI Z kolekcją BIANCO możesz urządzić sypialnię w spójnym stylu, lub wykorzystać bryły w własnej aranżacji innego pomieszczenia. Dzięki dużej ilości mebli w różnych wymiarach, meble z kolekcji BIANCO pozwolą urządzić zarówno dużą garderobę , jak i niewielką sypialnię. Białe meble to dobry wybór do współczesnych wnętrz. Biel wprowadza uczucie ładu, porządku i świeżości oraz zapewnia swobodę w wyborze dodatków.', '', 'komoda-bianco-2d3s', '', '', '', 'Komoda BIANCO 2D3S', '', '', '', ''),
(308, 1, 1, 'Każdy rodzaj sprzętu RTV w dziewczęcym pokoju młodzieżowym będzie się świetnie prezentować na tej romantycznej szafce MIA . Jej delikatna kolorystyka: połączenie spokojnej bieli z jasnoróżowym blatem oraz falujące wykończenie frontu, nada wnętrzu kobiecego charakteru. Mebel najlepiej prezentuje się w towarzystwie pozostałych propozycji z serii. Ich dziewczęcy urok sprawi, że nie będzie wątpliwości, że pokój należy do młodej damy. WNĘTRZE Zadbano o komfort przechowywania sprzętu RTV, projektując w tej niewielkiej szafce dwie oddzielne półki z praktycznymi otworami na kable. W dodatkowej szerokiej szufladzie (zamontowanej na wytrzymałej prowadnicy rolkowej) można przechować piloty, płyty DVD lub gry na konsolę. WYKOŃCZENIE Wszystkie meble z serii MIA wykończono laminatem - są więc trwałe oraz łatwe w czyszczeniu.', '', 'szafka-rtv-mia-mi-13', '', '', '', 'Szafka RTV MIA MI-13', '', '', '', ''),
(309, 1, 1, 'Komoda z szufladami ELSA pomoże uporządkować rozgardiasz w pokoju dziecka. Możesz ułożyć w niej poskładane ubrania, bieliznę czy inne akcesoria. Biała komoda do pokoju dziecięcego wchodzi w skład kolekcji, która wyróżnia się nietuzinkowym designem, nawiązującym do pałacowego stylu. WNĘTRZE Komoda posiada 4 pojemne szuflady. WYKOŃCZENIE Matowe, białe wykończenie , ciekawie wykończone fronty i metalowe uchwyty nadają całości oryginalnego charakteru. MEBLE DLA KSIĘŻNICZKI Fantazyjny projekt mebli dziecięcych sprawi, że w pokoju dziewczynki zapanuje prawdziwie królewski klimat. Zaokrąglone fronty, subtelne zdobienie i oryginalne uchwyty , świetnie komponujące się z całością to elementy, które nadają kolekcji ELSA romantyczny wygląd.', '', 'komoda-elsa-4s', '', '', '', 'Komoda ELSA 4S', '', '', '', ''),
(310, 1, 1, 'Kolekcja MIA to lekko klasyczne meble dedykowane dla dzieci i młodzieży w różnym wieku. Biała kolorystyka całego mebla z delikatnymi akcentami różowymi będą pasować do młodzieżowych wnętrz. Spora liczba elementów do wyboru i dbałość o szczegóły z pewnością przypadnie do gustu młodym użytkownikom. Komoda MIA to funkcjonalny i uniwersalny mebel, który możesz wykorzystać w dowolnym pomieszczeniu w zależności od tego co chcesz w nim przechowywać. Szeroka szuflada i dwoje drzwi, za którymi znajdziesz półki pozwolą na uporządkowanie wszystkich rzeczy. Meble MIA są dostępne wyłącznie w salonach Agata. WNĘTRZE Komoda posiada szeroką szufladę wysuwaną za pomocą prowadnicy rolkowej i półki. WYKOŃCZENIE Mebel został wykonany z płyty laminowanej, cechującej się trwałością i jest łatwiejszy w utrzymaniu czystości.', '', 'komoda-mia-mi-11', '', '', '', 'Komoda MIA MI-11', '', '', '', ''),
(311, 1, 1, 'Biała komoda MARSYLIA sprawdzi się zarówno w sypialni, pokoju dziennym czy przedpokoju. Wszędzie tam, gdzie potrzebujesz dodatkowego miejsca do przechowywania. WNĘTRZE Komoda została wyposażona w 4 pojemne szuflady. Blat komody to świetna podstawa na ulubione pamiątki, stylowe dekoracje czy organizery. WYKOŃCZENIE Fronty wykończono na wysoki połysk. Dzięki temu meble MARSYLIA prezentują się bardzo elegancko – wykorzystasz je w nowoczesnych aranżacjach i tych z elementami glamour. Korpus ma matowe pokrycie.', '', 'biala-komoda-marsylia-polysk', '', '', '', 'Biała komoda MARSYLIA połysk', '', '', '', ''),
(312, 1, 1, 'SKRZYNIA MIA Kolekcja MIA to lekko klasyczne meble dedykowane dla dzieci i młodzieży w różnym wieku. Biała kolorystyka całego mebla z delikatnymi akcentami różowymi będą pasować do młodzieżowych wnętrz. Spora liczba elementów do wyboru i dbałość o szczegóły z pewnością przypadnie do gustu młodym użytkownikom. Skrzynia MIA to mebel doskonały do przechowywania wszystkich zabawek w jednym miejscu. Meble MIA są dostępne wyłącznie w salonach Agata. WNĘTRZE Skrzynia posiada drzwi uchylne pod którymi znajduje się cała przestrzeń do wykorzystania. WYKOŃCZENIE Mebel został wykonany z płyty laminowanej. Laminat cechuje się trwałością i jest łatwiejszy w utrzymaniu czystości.', '', 'skrzynia-mia-mi-10', '', '', '', 'Skrzynia MIA MI-10', '', '', '', ''),
(313, 1, 1, 'Wysoka komoda MORTIZ sprawdzi się zarówno w rustykalnym wnętrzu , jak i bardziej nowoczesnej przestrzeni . Dzięki szerokości 80 cm zmieści się w niejednym przedpokoju , tworząc idealne miejsce na wiele przydatnych przedmiotów. WNĘTRZE Przestrzeń wewnątrz komody podzielona jest na 3, równe przestrzenie. Każda z półek udźwignie do 5 kg Twoich rzeczy. Półki wykonane z płyty meblowej pokryte są laminatem w kolorze korpusu i frontów. WYKOŃCZENIE Chcesz zmienić wygląd komody? Możesz opcjonalnie umieścić ozdobne okucia. Fronty w kolorze dębu wotan , wzmocnione są ramiakiem MDF. Dzięki zawiasom kątowym swobodnie i pewnie otworzysz drzwi komody. Korpus, półki oraz fronty komody wykonane są z płyty meblowej, pokrytej laminatem w kolorze naturalnego drewna. Masywne, wykonane z tworzywa uchwyty nadają komodzie MORTIZ wyjątkowego charakteru.', '', 'komoda-wysoka-do-przedpokoju-mortiz', '', '', '', 'Komoda wysoka do przedpokoju MORTIZ', '', '', '', ''),
(314, 1, 1, 'Z czym kojarzy się styl glamour? To połysk, elegancja i wytworność. Jeżeli marzysz o niebanalnie urządzonym salonie i aranżacji, która łączy te cechy, kolekcja GLAMOUR spełni wszystkie wymagania. Duża komoda z kolekcji GLAMOUR przeznaczona jest do salonu lub eleganckiej sypialni. Białe, połyskujące fronty oraz uchwyty w formie kryształków sprawiają, że będzie idealną bazą dla aranżacji w stylu glamour. Komoda jest także wyposażona w oświetlenie LED - wzdłuż blatu . Białe światło wprowadzi do wnętrza przytulny klimat. WNĘTRZE 3 szuflady posłużą przechowywania różnego rodzaju drobiazgów - w zależności od pomieszczenia. W salonie może to być dodatkowy komplet sztućców, serwetki, obrusy lub różnego rodzaju dokumenty. W sypialni w szufladach przechowamy bieliznę i drobne dodatki; po bokach komody znajdują się 4 zamknięte wnęki; komfortowe zawiasy z cichym domykiem zapobiegną trzaskaniu drzwiczkami; z boku komody znajduje się dyskretny włącznik podblatowego oświetlenia LED włącznik dotykowy posiada funkcję ściemniania z pamięcią dokonanej nastawy intensywności oświetlenia. WYKOŃCZENIE fronty wykończone są laminatem w modnym połysku; uchwyty w formie kryształków, chromowana dolna listwa oraz wycięte w charakterystyczny sposób drzwiczki - zaokrąglone w dolnej części, to znaki rozpoznawcze kolekcji GLAMOUR .', '', 'komoda-biala-wysoki-polysk-z-oswietleniem-glamour-2d2s', '', '', '', 'Komoda biała wysoki połysk z oświetleniem GLAMOUR 2D2S', '', '', '', ''),
(315, 1, 1, 'Szeroka komoda SALVADOR estetycznie wypełnia przestrzeń przy długiej ścianie i pozwala przechowywać elementy zastawy stołowej lub dokumentację rodzinną w salonie czy jadalni. Do nowoczesnego pokoju dziennego wprowadza przytulność i rustykalny klimat. Masz do dyspozycji aż 3 szuflady i 6 wnęk zamkniętych, a szeroki blat możesz wykorzystać na wyeksponowanie ulubionych dekoracji. WNĘTRZE W 3 szufladach możesz przechowywać dokumenty i drobne przedmioty W każdej zamykanej szafce znajdują się po 2 półki, na których możesz przechowywać przedmioty ważące nawet 10 kg. WYKOŃCZENIE Korpus mebla pokryto okleiną naturalną, która dodatkowo została zabezpieczona olejem. Front z litego drewna dębowego dodaje bryle szlachetnego charakteru. Półki wykończono łatwą w czyszczeniu folią ze wzorem dębowego drewna. Metalowe uchwyty podkreślają nowoczesny charakter kolekcji SALVADOR ARANŻACJA Masywne bryły mebli SALVADOR i ciekawa struktura wykończenia z wyrazistym rysunkiem drewna nadaje kolekcji rustykalnego charakteru. Dębowe drewno ma uniwersalne zastosowanie aranżacyjne. Równie dobrze prezentuje się we wnętrzu w stylu EKO, jak i w surowej przestrzeni industrialnej. Meble z kolekcji SAVADOR możesz zestawić z dodatkami z metalu i drewna', '', 'komoda-szeroka-salvador', '', '', '', 'Komoda szeroka SALVADOR', '', '', '', ''),
(316, 1, 1, 'Szukasz szafki RTV, na której zmieścisz swój 50 calowy telewizor? Szafka RTV DOORSET ma 135 cm szerokości , więc bez problemu pomieści tak duży sprzęt elektroniczny. Ozdobnym elementem mebla są fronty przypominające naturalne drewno. . WNĘTRZE Otwarta wnęka pomieści dekoder lub konsolę . Szuflada i zamykana wnęka przydadzą się na drobne akcesoria w kąciku wypoczynkowym. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Wykończenie utrzymane jest w barwie dąb navarra, dzięki któremu wnętrze nabiera domowej i ciepłej atmosfery. Uwagę zwracają ładnie wkomponowane w bryłę uchwyty. KOLEKCJA MEBLI DOORSET Kolekcja mebli DOORSET w całości jest wykonana w kolorze imitujący barwę surowego drewna, z widocznymi słojami i sękami, dlatego też świetnie sprawdzi się we wnętrzach urządzonych w stylu rustykalnym oraz klasycznym. Ciepły odcień dębu navarra pomoże Ci otrzymać w salonie przytulną atmosferę idealną do odpoczynku i spotkań ze znajomymi.', '', 'szafka-rtv-z-szuflada-doorset-135-cm', '', '', '', 'Szafka RTV z szufladą DOORSET 135 cm', '', '', '', ''),
(317, 1, 1, 'Albumy ze zdjęciami, obrusy, szkło stołowe i dekoracje – pojemna komoda KASHMIR KSM26 ułatwia uporządkowanie wszystkich rzeczy, po które lubisz sięgać, przebywając w salonie i w jadalni. To część ponadczasowej kolekcji, która przypadnie do gustu miłośnikom stylu prowansalskiego . Wprowadza do wnętrza sielski powiew świeżości. Jej bryła umieszczona została na ozdobnym cokole, a metalowe uchwyty świetnie korespondują z jasnym wybarwieniem, imitującym pobielane drewno. Dodatkowym ozdobnym akcentem są skrzyżowane listewki na froncie. WNĘTRZE W 4 szufladach przechowasz wszystkie te drobne przedmioty, które wymagają segregacji. Każdą z bocznych szafek wyposażono w półkę . Na szerokim blacie możesz wyeksponować rodzinne pamiątki lub fotografie. WYKOŃCZENIE Wybarwienie w chłodnym odcieniu wpasuje się w większość współczesnych wnętrz. Komodę wykończono folią imitującą strukturę sosnowego drewna ( pinia biała ), dzięki czemu zyskuje ona nietuzinkowy wygląd. Jasna barwa optycznie powiększa przestrzeń . Stylizowane uchwyty w kolorze starego srebra podkreślają sielski styl komody.', '', 'komoda-styl-prowansalski-szeroka-kashmir', '', '', '', 'Komoda styl prowansalski szeroka KASHMIR', '', '', '', ''),
(318, 1, 1, 'Pojemna komoda RAPALLO przydaje się do przechowywania dekoracji, książek i elementów zastawy stołowej. Symetryczny projekt i ergonomiczny rozkład wnętrza sprawią, że w strefie rozrywkowej wreszcie zagości porządek. Meblując pokój dzienny kolekcją RAPOLLO uzyskasz we wnętrzu ciekawy efekt - łączący cechy stylu rustykalnego i industrialnego. WNĘTRZE 5 wnęk zamykanych i 5 otwartych pozwala rozdzielić przedmioty w taki sposób, by zachować porządek na dłużej. Na półkach możesz przechowywać przedmioty ważące maksymalnie 5 kg. WYKOŃCZENIE Płytę meblową pokryto 2 rodzajami laminatu . Ciepłe wybarwienia kasztanowca sprawia, że meble wprowadzają do wnętrza przytulną atmosferę. Metalowe uchwyty korespondują z głębokim wybarwieniem szarej matery, dodając meblom industrialnego charakteru. ARANŻACJA Meble RAPALLO wprowadzają do wnętrza klimat wiejskiego domku. Dzięki masywnej bryle i wyrazistej strukturze drewna dodają aranżacji surowości. Podkreślają rustykalny charakter wnętrza i współgrają z dodatkami w industrialnym stylu. Sprawdzą się w loftowym poddaszu lub nowoczesnym mieszkaniu w bloku.', '', 'komoda-rustykalna-wysoka-rapallo', '', '', '', 'Komoda rustykalna wysoka RAPALLO', '', '', '', ''),
(319, 1, 1, 'Stylowa komoda DENVER to mebel przeznaczony do salonu, ale sprawdzi się też w sypialni lub przedpokoju. Wykończona w ciepłym odcieniu dębu, z charakterystycznymi poprzecznymi frezami, stanowi doskonałe uzupełnienie jasnej i przytulnej aranżacji wnętrza. Prosta, lekko przysadzista bryła osadzona na szczupłych nóżkach sprawia wrażenie lekkiej. Dzięki pięknej barwie oraz tradycyjnej formie komoda nadaje się do pomieszczenia urządzonego w stylu industrialnym i rustykalnym. Można zestawić ją z pozostałymi meblami z kolekcji DENVER lub innymi - wykończonymi w podobnej kolorystyce, jak i w bieli czy szarościach. WNĘTRZE 2 pojemne wnęki posłużą do przechowywania akcesoriów niezbędnych w pomieszczeniu, w którym komoda się znajduje. WYKOŃCZENIE Komoda jest wykończona laminatem oraz folią, imitującymi naturalny dąb w odcieniu Coast Evoke. Charakterystyczne podłużne uchwyty są wykonane z metalu.', '', 'komoda-denver-2d', '', '', '', 'Komoda DENVER 2D', '', '', '', ''),
(320, 1, 1, 'Komoda MORTIZ ułatwi Ci uporządkowanie rzeczy, które przydają się w salonie lub jadalni. Mebel w ciepłym kolorze drewna pomoże wprowadzić do wnętrza przytulny, domowy nastrój. Ozdobnym elementem mebla są listewki na froncie mebla . Sam decydujesz, czy chcesz je zamontować. Przydadzą się też, kiedy postanowisz zmienić charakter mebli i nadać wnętrzu więcej surowego klimatu. Opcjonalne okucia zostały wykończone z efektem postarzenia. WNĘTRZE Komoda posiada zamykane wnęki, w których uporządkujesz ubrania, zastawę stołową czy dokumenty. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony laminatem. Wykończenie utrzymane jest w barwie dąb wotan, dzięki któremu wnętrze nabiera domowej i ciepłej atmosfery. Uwagę zwracają ładnie wkomponowane w bryłę uchwyty z efektem postarzenia.', '', 'komoda-mortiz-2d', '', '', '', 'Komoda MORTIZ 2D', '', '', '', ''),
(321, 1, 1, 'Szafka na buty w kolorze dąb wotan stanowi część kolekcji mebli MORTIZ. Razem z wieszakiem tworzy zgrany duet w przedpokoju - niezależnie od jego wielkości. Posiada ozdobne okucia, które nadają jej rustykalnego charakteru oraz stylizowany, wykonany z tworzywa uchwyt. Wygląd szafki możesz zmienić, rezygnując z montażu okuć. Kolor laminatu przypomina wygląd surowego drewna. Pod szafką na buty znajduje się przestrzeń, ułatwiająca pracę odkurzaczem. WNĘTRZE W szafce znajdują się 2 wnęki - idealne na buty lub pantofle. WYKOŃCZENIE Okucia posiadają elementy ozdobne imitujące śruby. Wygodne uchwyty wykonane są z tworzywa sztucznego. Front wzmocniony ramiakiem MDF.', '', 'szafka-na-buty-do-przedpokoju-mortiz', '', '', '', 'Szafka na buty do przedpokoju MORTIZ', '', '', '', ''),
(322, 1, 1, 'Szafka RTV ANTHONY to propozycja dla miłośników prowansalskich klimatów. Doskonale przemyślana konstrukcja idealnie wypełni wnętrze pokoju dziennego i pozwoli uporządkować wszystkie akcesoria w kąciku wypoczynkowym. WNĘTRZE W 2 otwartych wnękach możesz umieścić dekoder czy konsolę. Akcesoria, gry, płyty czy piloty zmieszczą się w 2 zamykanych wnękach. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Szafka RTV jest wykonana z płyty meblowej i wykończona laminatem w kolorze sosny andersen i dąb wotan. Takie wykończenie wprowadza do wnętrza przytulny klimat. Uroku dodają ładnie wkomponowane w bryłę uchwyty. Meble do pokoju dziennego i jadalni Kolekcja mebli ANTHONY świetnie wypełni wnętrze mieszkania urządzonego w stylu prowansalskim. Jasna kolorystyka nadaje dużym bryłom lekkości, a intrygujący rysunek drewna wprowadza do aranżacji odrobinę surowego charakteru. Możesz zestawić je z dodatkami z wizerunkiem polnych kwiatów i elementami z jasnego drewna.', '', 'szafka-rtv-anthony-2d', '', '', '', 'Szafka RTV ANTHONY 2D', '', '', '', ''),
(323, 1, 1, 'Szafka RTV DENVER to stylowy mebel przeznaczony do salonu. Wykończona w ciepłym odcieniu dębu, z charakterystycznymi poprzecznymi frezami, stanowi doskonałe uzupełnienie jasnej i przytulnej aranżacji wnętrza. Prosta, przysadzista bryła osadzona na szczupłych nóżkach sprawia wrażenie lekkiej. Dzięki pięknej barwie oraz tradycyjnej formie szafka nadaje się do pomieszczenia urządzonego w stylu industrialnym lub rustykalnym. Szafkę można zestawić z pozostałymi meblami z kolekcji DENVER lub innymi - zarówno wykończonymi w podobnej kolorystyce, jak i w bieli czy szarościach. WNĘTRZE 2 zamykane wnęki posłużą do przechowywania podręcznych różności, jak dodatkowe kable, ładowarki, płyty DVD. Wymiar wnęk otwartych: 72,9x38x21 cm WYKOŃCZENIE Szafka jest wykończona laminatem oraz folią, imitującymi naturalny dąb w odcieniu Coast Evoke. Charakterystyczne uchwyty są wykonane z metalu.', '', 'szafka-rtv-denver-2d', '', '', '', 'Szafka RTV DENVER 2D', '', '', '', ''),
(324, 1, 1, 'Komoda z szufladami DOORSET to świetne rozwiązanie jeśli potrzebujesz uporządkować rzeczy, na które zabrakło Ci miejsca w szafie. Schowasz tu bieliznę, akcesoria zimowe albo drobne tekstylia. Komoda z szufladami DOORSET wykonana jest z płyty meblowej w kolorze jasnego drewna. Czarne, proste uchwyty sprawiają, że komoda sprawdzi się zarówno we wnętrzach urządzonych w tylu klasycznym, jak i nowoczesnym. WNĘTRZE 4 szuflady są bardzo wygodne w użytkowaniu. Szuflady osadzone na prowadnicach kulkowych działają płynnie i pozwalają na pełny wysuw Możesz wysunąć szufladę do końca i bez problemu ocenić jej zawartość. WYKOŃCZENIE Korpus, fronty oraz blat komody pokryte są laminatem, dzięki czemu z łatwością zachowasz ich czystość bez obaw o przebarwienia.', '', 'komoda-z-szufladami-doorset', '', '', '', 'Komoda z szufladami DOORSET', '', '', '', ''),
(325, 1, 1, 'Jeśli chcesz uporządkować dokumenty, dodatki dekoracyjne, lub potrzebujesz mebla, na którym ustawisz kolekcję zdjęć, przyda Ci się szeroka na 160 cm komoda DOORSET . Ułatwi poukładanie wszystkich rzeczy, które przydają się w salonie, przedpokoju lub jadalni. A jej design wykończony ciepłym kolorem drewna pomoże wprowadzić do przytulny, domowy nastrój. WYKOŃCZENIE Komoda posiada zamykane wnęki, w których uporządkujesz ubrania, zastawę stołową czy dokumenty. Maksymalne obciążenie blatu oraz półek wewnętrznych wynosi 5 kg. W BARWIE DREWNA Kolekcja mebli DOORSET w całości jest wykonana w kolorze imitującym barwę surowego drewna, z widocznymi słojami i sękami, dlatego też świetnie sprawdzi się we wnętrzach urządzonych w stylu rustykalnym oraz klasycznym. Ciepły odcień dębu navarra pomoże Ci otrzymać w salonie przytulną atmosferę - idealną do odpoczynku i spotkań ze znajomymi.', '', 'komoda-4-drzwiowa-z-szuflada-doorset', '', '', '', 'Komoda 4-drzwiowa z szufladą DOORSET', '', '', '', ''),
(326, 1, 1, 'Szukasz mebla do przechowywania bielizny w sypialni urządzonej w loftowym stylu? Spodoba Ci się komoda z 3 szufladami JABIM , bo możesz w niej uporządkować swoje skarpetki i pidżamy. Szeroki na 99 cm mebel zmieści się nawet w niewielkim pokoju. Możesz wykorzystać blat komody, by wyeksponować na nim pamiątki lub książki. WNĘTRZE W 3 szufladach możesz przechować swoje kosmetyki lub dokumenty. WYKOŃCZENIE Komodę wykończono 2 rodzajami folii . Folia imitująca drewno świerkowe z wyraźnym rysunkiem drewna spodoba się miłośnikom loftowych – surowych wnętrz. Czarne wykończone podkreśli nowoczesny styl Twojej sypialni. Uchwyty z aluminium są szerokie, by ułatwić otwieranie szuflad. SYPIALNIA O WYRAZISTYM CHARAKTERZE Lubisz kontrastujące kolory i czarne dodatki? Spodoba Ci się kolekcja JABIM z ciemnymi wstawkami i wyrazistym rysunkiem drewna na folii wykończeniowej. Meble z kolekcji JABIM możesz wpasować we wnętrza loftowe, łączyć z dekoracjami ze skóry, czarnego metalu i drewna.', '', 'komoda-do-sypialni-z-3-szufladami-jabim', '', '', '', 'Komoda do sypialni z 3 szufladami JABIM', '', '', '', ''),
(327, 1, 1, 'Komoda w salonie może pełnić funkcję bufetu, który ułatwia nakrywanie do stołu. W komodzie RAPALLO możesz przechowywać nie tylko elementy zastawy stołowej i dekoracje. Specjalne wnęki w centralnej części mebla sprawia, że szafka RARALLO to wymarzony mebel dla konesera win. WNĘTRZE 4 wnęki zamknięte to idealne miejsce na zastawę stołową i obrusy. W szufladach możesz przechowywać sztućce. We wnękach na wino zmieści się aż 8 butelek . WYKOŃCZENIE Płytę meblową pokryto 2 rodzajami laminatu . Ciepłe wybarwienia kasztanowca sprawia, że meble wprowadzają do wnętrza przytulną atmosferę. Metalowe uchwyty korespondują z głębokim wybarwieniem szarej matery, dodając meblom industrialnego charakteru. ARANŻACJA Meble RAPALLO wprowadzają do wnętrza klimat wiejskiego domku. Dzięki masywnej bryle i wyrazistej strukturze drewna dodają aranżacji surowości. Podkreślają rustykalny charakter wnętrza i współgrają z dodatkami w industrialnym stylu. Sprawdzą się w loftowym poddaszu lub nowoczesnym mieszkaniu w bloku.', '', 'komoda-rustykalna-z-miejscem-na-wino-rapallo', '', '', '', 'Komoda rustykalna z miejscem na wino RAPALLO', '', '', '', ''),
(328, 1, 1, 'Masz duży telewizor i sporą ilość sprzętu? Szafka RTV SALVADOR pomoże Ci to wszystko rozdzielić i przechować w sposób uporządkowany. Dzięki imponującemu rozmiarowi (szerokość szafki przekracza 2 m) mebel efektownie prezentuje się w salonie. Nawet do dużych industrialnych przestrzeni wprowadza przytulny klimat z odrobiną rustykalnej surowości. WNĘTRZE Dekoder i konsolę możesz trzymać we wnękach otwartych - 119.6 cm x48 cm x 9,6 cm. 2 szuflady pozwolą okiełznać drobne akcesoria i kable. Na półkach z płyty meblowej możesz przechowywać przedmioty ważące 10 kg . Każda z zamykanych szafek jest wyposażona w 1 półkę. WYKOŃCZENIE Korpus mebla pokryto okleiną naturalną, która dodatkowo została zabezpieczona olejem. Front z litego drewna dębowego dodaje bryle szlachetnego charakteru. Półki wykończono łatwą w czyszczeniu folią ze wzorem dębowego drewna. Metalowe uchwyty podkreślają nowoczesny charakter kolekcji SALVADOR . ARANŻACJA Masywne bryły mebli SALVADOR i ciekawa struktura wykończenia z wyrazistym rysunkiem drewna i sękami nadaje kolekcji rustykalnego charakteru. Dębowe drewno ma uniwersalne zastosowanie aranżacyjne. Równie dobrze prezentuje się we wnętrzu w stylu EKO , jak i w surowej przestrzeni industrialnej. Meble z kolekcji SAVADOR możesz zestawić z dodatkami z metalu i drewna.', '', 'szafka-rtv-salvador-2d2s-typ32', '', '', '', 'Szafka RTV SALVADOR 2D2S TYP32', '', '', '', ''),
(329, 1, 1, 'Szeroka komoda ANTHONY ustawiona w pokoju dziennym, jadalni czy przestronnym przedpokoju pozwoli łatwo uporządkować potrzebne przedmioty. WNĘTRZE 4 zamykane wnęki stanowią doskonałe miejsce do przechowywania rzeczy, których nie chcesz eksponować. Dostaniesz się do nich za pomocą drzwi przesuwnych. 3 szuflady pomogą zorganizować drobne przedmioty. Blat wykorzystaj jako miejsce na stylowe dodatki, które podkreślą charakter Twojego wnętrza. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej i wykończona laminatem w kolorze sosny andersen i dąb wotan. Takie wykończenie wprowadza do wnętrza przytulny klimat. Uroku dodają ładnie wkomponowane w bryłę uchwyty. Meble do pokoju dziennego i jadalni Kolekcja mebli ANTHONY świetnie wypełni wnętrze mieszkania urządzonego w stylu prowansalskim. Jasna kolorystyka nadaje dużym bryłom lekkości, a intrygujący rysunek drewna wprowadza do aranżacji odrobinę surowego charakteru. Możesz zestawić je z dodatkami z wizerunkiem polnych kwiatów i elementami z jasnego drewna.', '', 'komoda-anthony-2d3s', '', '', '', 'Komoda ANTHONY 2D3S', '', '', '', ''),
(330, 1, 1, 'Komoda MORTIZ znakomicie sprawdzi się w sypialni , salonie lub przedpokoju . Dzięki 3 szufladom przechowasz w niej swoją bieliznę lub drobne przedmioty. Kolor dąb wotan , możesz podkreślić dodatkami w nowoczesnym lub rustykalnym stylu . Komoda ma ozdobne okucia , z których możesz zrezygnować, stworzysz w ten sposób mebel o bardziej modernistycznym charakterze. Decyzja należy do Ciebie. WNĘTRZE 3 szuflady na prowadnicach kulkowych , sprawnie sięgniesz po to, czego właśnie szukasz. Duża szerokość szuflad pozwala na maksymalne wykorzystanie przestrzeni. Perfekcyjnie poskładasz w nich podkoszulki, skarpety i bieliznę. WYKONANIE Wysokość komody to 84 cm , idealna do wyeksponowania stylowych dodatków. Fronty wyposażone w masywny uchwyt , wzmocnione ramiakiem mdf , tworzącym estetyczne wykończenie. Stylizowane uchwyty i okucia z tworzywa imitują metal z elementami przypominającymi śruby. Komoda wykończona laminatem jest łatwa w utrzymaniu czystości.', '', 'komoda-z-3-szufladami-mortiz', '', '', '', 'Komoda z 3 szufladami MORTIZ', '', '', '', ''),
(331, 1, 1, 'Meble wykonane z drewna to zawsze dobry wybór. Nigdy nie wyjdą z mody a z czasem nabiorą szlachetności i jeszcze więcej uroku. Szafka RTV CAMPINAS to mebel przeznaczony do salonu. Wykonana w dużej mierze z drewna ociepli pomieszczenie i wprowadzi do niego przytulny nastrój - czy to w niewielkim mieszkaniu, czy w dużym salonie wolnostojącego domu. Z szafką RTV CAMPINAS zaaranżujesz wnętrze na kilka sposobów. Drewno to ulubiony materiał stylu skandynawskiego i rustykalnego. A dzięki metalowym akcentom w postaci uchwytów oraz czarnej listwie okalającej szuflady, komoda sprawdzi się nawet w aranżacji inspirowanej stylem industrialnym i loftowym. Szafka RTV jest elementem nowoczesnej kolekcji CAMPINAS, oferującej proste bryły z drewnianymi frontami i charakterystycznymi metalowymi uchwytami . Wszystkie meble stoją na cokołach, dzięki którym łatwo utrzymać wokół nich czystość. WNĘTRZE 1 praktyczna szuflada, dzielona na 2 części; 2 zamykane wnęki - na gry, płyty DVD czy czasopisma; 2 otwarte wnęki - na sprzęt RTV; drzwiczki oraz szuflady zostały wyposażone w komfortowy system cichego domyku ; WYKOŃCZENIE korpus mebla jest wykonany z płyty meblowej wykończonej naturalną okleiną dębową, olejowaną; fronty są wykonane z drewna dębowego olejowanego ; metalowe uchwyty;', '', 'szafka-rtv-campinas', '', '', '', 'Szafka RTV CAMPINAS', '', '', '', ''),
(332, 1, 1, 'Szafka RTV pod telewizor do salonu NOTINA to idealne rozwiązanie, jeśli lubisz, gdy otacza Cię harmonia, należy bowiem do kolekcji nowoczesnych mebli w kolorze sękatego dębu . Czarne , matowe , metalowe płozy oraz nowoczesny design , sprawią, że pasować będzie zarówno do salonu w domu typu stodoła, jak i pokoju dziennego każdego miłośnika mieszanki stylów. Wybierając więcej metalowych dodatków , nadasz wnętrzu bardziej industrialnego wyglądu . WNĘTRZE Dwie otwarte wnęki oddzielone półką sprawdzą się w sam raz na dekoder lub router. Szafka RTV posiada otwór , przez który w łatwy sposób przeciągniesz kable od telewizora. Za dwoma zamykanymi frontami znajdziesz także miejsce na tablet lub przydatne elementy, które chciałbyś schować. WYKONANIE Szafka wykonana jest z płyty meblowej pokrytej okleiną naturalną oraz folią . Charakterystyczne czarne, metalowe uchwyty oraz nogi podkreślą prostą bryłę mebla, a wykończone olejem fronty z litego drewna nadadzą wnętrzu naturalnego stylu. Jeśli chcesz, by Twój kącik kinomana został bardziej wyeksponowany, możesz domówić zestaw oświetlenia w postaci 2 pkt oczka led .', '', 'szafka-rtv-pod-telewizor-do-salonu-notina', '', '', '', 'Szafka RTV pod telewizor do salonu NOTINA', '', '', '', ''),
(333, 1, 1, 'Meble wykonane z drewna to zawsze dobry wybór. Nigdy nie wyjdą z mody a z czasem nabiorą szlachetności i jeszcze więcej uroku. Komoda CAMPINAS to mebel przeznaczony do salonu. Wykonana w dużej mierze z drewna ociepli pomieszczenie i wprowadzi do niego przytulny nastrój - czy to w niewielkim mieszkaniu, czy w dużym salonie wolnostojącego domu. Z komodą CAMPINAS zaaranżujesz wnętrze na kilka sposobów. Drewno to ulubiony materiał stylu skandynawskiego i rustykalnego. A dzięki metalowym akcentom w postaci uchwytów oraz czarnej listwie okalającej szuflady, komoda sprawdzi się nawet w aranżacji inspirowanej stylem industrialnym. Komoda jest elementem nowoczesnej kolekcji CAMPINAS , oferującej proste bryły z drewnianymi frontami i charakterystycznymi metalowymi uchwytami. Wszystkie meble stoją na cokołach, dzięki którym łatwo utrzymać wokół nich czystość. WNĘTRZE 2 praktyczne, pojemne szuflady - nie tylko na drobiazgi; 4 zamykane wnęki - na dokumenty lub tekstylia; 1 otwarta wnęka - na podręczne gadżety; drzwiczki oraz szuflady zostały wyposażone w komfortowy system cichego domyku ; WYKOŃCZENIE korpus mebla jest wykonany z płyty meblowej wykończonej naturalną okleiną dębową, olejowaną; fronty są wykonane z drewna dębowego olejowanego ; metalowe uchwyty;', '', 'komoda-campinas', '', '', '', 'Komoda CAMPINAS', '', '', '', ''),
(334, 1, 1, 'Nie upychaj rzeczy po kątach. Chcesz coś schować? Schowaj to w komodzie z 3 szufladami JANTAR. To pojemny mebel, w którym przechowasz dodatkową zastawę i świeżą pościel, która przyda się podczas wizyty gości. W 3 szufladach zmieścisz notatniki, drobną elektronikę i drobiazgi, które warto mieć pod ręką. Kolor jasnego, bukowego drewna zachęca do postawienia jej w salonie, jadalni albo sypialni w rustykalnym klimacie. WNĘTRZE Na 6 półkach schowanych za drzwiami zmieścisz rzeczy o wadze do 20 kg. W szufladach przechowasz rzeczy do 3 kg. WYKOŃCZENIE Komodę wykonano z 18 mm płyty meblowej. Mebel pokryto laminatem w kolorze jasnego dębu artisan. W drzwiach i szufladach zamontowano uchwyty z tworzywa sztucznego. W szufladach zastosowano prowadnice kulkowe z pełnym wysuwem.', '', 'komoda-z-3-szufladami-jantar', '', '', '', 'Komoda z 3 szufladami JANTAR', '', '', '', ''),
(335, 1, 1, 'Lewa strona dla Ciebie: na pady do konsoli, gry i ulubione gazety. Prawa dla niego: na pilot, baterie i rzeczy, które tylko on rozumie. 2 szafki, 2 półki i blat - to wystarczająca ilość miejsca, żeby zmieścić wszystko, co potrzebne do spędzenia udanego wieczoru przed telewizorem. Szafka RTV JANTAR utrzymana w kolorze jasnego dębu pasuje do nowoczesnych pomieszczeń o przytulnym charakterze. WNĘTRZE 2 wnęki pod blatem to świetne miejsce na konsolę i dekoder. Postawisz tam sprzęt ważący do 20 kg. W 2 szafkach schowasz kolekcję płyt lub dokumenty. Szafki są wyposażone w drzwi klapowe, co ułatwia wyciąganie przedmiotów. WYKOŃCZENIE Szafkę RTV JANTAR wykonano z płyty meblowej o grubości 18 mm. W szufladach zamontowano uchwyty z tworzywa sztucznego.', '', 'szafka-rtv-z-2-szufladami-jantar', '', '', '', 'Szafka RTV z 2 szufladami JANTAR', '', '', '', ''),
(336, 1, 1, 'Szukasz szafki z 2 wnękami na sprzęt RTV? Skorzystaj z szafki RAPALLO i posegreguj wszystkie swoje akcesoria. Meblując pokój dzienny kolekcją RAPOLLO uzyskasz we wnętrzu ciekawy efekt - łączący cechy stylu rustykalnego i industrialnego. WNĘTRZE Za zamkniętymi drzwiami znajdują się 2 wnęki. 2 otwarte wnęki przydadzą się do przechowywania dekodera i konsoli lub kolekcji płyt DVD. WYKOŃCZENIE Płytę meblową pokryto 2 rodzajami laminatu . Ciepłe wybarwienia kasztanowca sprawia, że meble wprowadzają do wnętrza przytulną atmosferę. Metalowe uchwyty korespondują z głębokim wybarwieniem szarej matery, dodając meblom industrialnego charakteru. ARANŻACJA Meble RAPALLO wprowadzają do wnętrza klimat wiejskiego domku. Dzięki masywnej bryle i wyrazistej strukturze drewna dodają aranżacji surowości. Podkreślają rustykalny charakter wnętrza i współgrają z dodatkami w industrialnym stylu. Sprawdzą się w loftowym poddaszu lub nowoczesnym mieszkaniu w bloku.', '', 'szafka-rtv-rustykalna-rapallo', '', '', '', 'Szafka RTV rustykalna RAPALLO', '', '', '', ''),
(337, 1, 1, 'Nieco mniejsza od swojej 3 drzwiowej siostry, ale równie atrakcyjna. 2 drzwiowa komoda z sosnowego drewna z serii CLASSIC WOOD sprawdzi się w niewielkich jadalniach i pokojach dziennych. Jeśli lubisz styl rustykalny, ta komoda jest dla Ciebie. WNĘTRZE Za podwójnymi drzwiami schowasz paterę, talerze i szklanki. W 2 szufladach zmieścisz sztućce i inne drobne przedmioty. WYKOŃCZENIE Komodę wykończono woskiem w kolorze miodowym. W drzwiach i szufladach zamontowano metalowe uchwyty. W miejscu nóg zamontowano drewniane, sosnowe kule.', '', 'komoda-2-drzwiowa-classic-wood', '', '', '', 'Komoda 2 drzwiowa CLASSIC WOOD', '', '', '', ''),
(338, 1, 1, '2 wnęki na sprzęt RTV przydadzą się zwłaszcza, gdy jesteś fanem gier na konsolę. W szafce RTV RAPALLO zmieścisz i poukładasz też akcesoria i płyty. Symetryczny projekt i ergonomiczny rozkład wnętrza sprawią, że w strefie rozrywkowej wreszcie zagości porządek. Meblując pokój dzienny kolekcją RAPOLLO uzyskasz we wnętrzu ciekawy efekt - łączący cechy stylu rustykalnego i industrialnego. WNĘTRZE Każdą z szafek zamkniętych wyposażono w 1 półkę. 2 otwarte wnęki przydadzą się do przechowywania dekodera i konsoli lub kolekcji płyt DVD. WYKOŃCZENIE Płytę meblową pokryto 2 rodzajami laminatu . Ciepłe wybarwienia kasztanowca sprawia, że meble wprowadzają do wnętrza przytulną atmosferę. Metalowe uchwyty korespondują z głębokim wybarwieniem szarej matery, dodając meblom industrialnego charakteru. ARANŻACJA Meble RAPALLO wprowadzają do wnętrza klimat wiejskiego domku. Dzięki masywnej bryle i wyrazistej strukturze drewna dodają aranżacji surowości. Podkreślają rustykalny charakter wnętrza i współgrają z dodatkami w industrialnym stylu. Sprawdzą się w loftowym poddaszu lub nowoczesnym mieszkaniu w bloku.', '', 'szafka-rtv-rustykalna-rapallo', '', '', '', 'Szafka RTV rustykalna RAPALLO', '', '', '', ''),
(339, 1, 1, 'Szafka na buty DOORSET to mebel idealny do kawalerek lub przedpokojów o niewielkim metrażu. W 2 szafkach poukładasz swoje buty, a klapowy system otwierania drzwi ułatwi ich wyjęcie, bez obaw, że zaklinujesz się między ścianą a szafką. Szafka ma wysokość 80,7 cm. Dobierz do niej wieszak z serii DOORSET i stwórz w swoim przedpokoju stylowy kącik, w którym buty i odzież wierzchnia czekają, by znów wyruszyć z Tobą w drogę. WNĘTRZE 2 szafki otwierane klapowo z przegrodami na buty. WYKOŃCZENIE Korpus i fronty szafki wykonane są z płyty meblowej oraz pokryte laminatem.', '', 'szafka-na-buty-klapowa-doorset', '', '', '', 'Szafka na buty klapowa DOORSET', '', '', '', ''),
(340, 1, 1, 'Od pościeli, po zabawki i sprzęt sportowy. Pojemna skrzynia CLASSIC WOOD, to mebel, który sprawdzi się w pokoju dziennym, jadalni, sypialni, a nawet w przedpokoju. Wykonana w całości z sosnowego drewna, zaimpregnowanego woskiem, pięknie się prezentuje i wprowadza przytulny klimat do wnętrza. Pasuje do pomieszczeń w rustykalnym klimacie. WNĘTRZE Do pojemnego wnętrza sosnowej skrzyni CLASSIC WOOD schowasz rzeczy, które nie zmieściły się gdzie indziej. Gruba puchowa kołdra albo ulubiony koc, to nie problem. WYKOŃCZENIE Drewno zostało wykończone woskiem w miodowym kolorze. W skrzyni zamontowano metalowe okucia i uchwyty. W miejscu klasycznych nóg zamontowano sosnowe, drewniane kule.', '', 'skrzynia-sosnowa-classic-wood', '', '', '', 'Skrzynia sosnowa CLASSIC WOOD', '', '', '', ''),
(341, 1, 1, 'Do pokoju dziennego? Do jadalni? Szafka RTV CLASSIC WOOD sprawdzi się wszędzie tam, gdzie lubisz oglądać swoje ulubione filmy, czy seriale. Tradycyjny wygląd i uwydatnione słoje sosnowego drewna sprawiają, że mebel pasuje do przestronnych, jasnych pomieszczeń. Świetnie wkomponuje się w przestrzenie w rustykalnym stylu. WNĘTRZE Na blacie postawisz telewizor. Za znajdującymi się po obu stronach szafki drzwiami, schowasz gry albo kolekcję filmów. We wnęce umieszczonej pośrodku zmieścisz konsolę. W szufladzie zmieści się pilot, dodatkowe baterie i gazeta z programem. WYKOŃCZENIE Szafka została pokryta woskiem nadającym jej miodowy kolor. Szuflady zamontowano na drewnianych prowadnicach. Drzwi oraz szuflada posiadają wytrzymałe, metalowe uchwyty. Rolę nóg pełnią drewniane, sosnowe kule.', '', 'szafka-rtv-classic-wood', '', '', '', 'Szafka RTV CLASSIC WOOD', '', '', '', ''),
(342, 1, 1, 'Na szafce RTV DOORSET ustawisz 50 calowy telewizor z całkiem sporym zapasem. Jest to największa RTV w kolekcji DOORSET - przeznaczona specjalnie do dużego, przestronnego salonu. Ma wysokość 63,4 cm więc docenią ją szczególnie osoby, które lubią oglądać telewizor na wyższej szafce. Ma 180 cm długości , więc bez problemu pomieści tak sprzęt elektroniczny, dodatki dekoracyjne, kwiaty doniczkowe oraz zdjęcia. Ozdobnym elementem mebla są fronty przypominające naturalne drewno. WNĘTRZE Otwarta wnęka pomieści dekoder lub konsolę. Szuflada i zamykane wnęki przydadzą się na: potrzebne dokumenty, gazety, kolekcję sudoku czy drobne akcesoria. Maksymalne obciążenie półki wynosi 5 kg , a blatu 10 kg . WYKOŃCZENIE Wykończenie utrzymane jest w barwie dąb navarra , dzięki któremu wnętrze nabiera domowej i ciepłej atmosfery. Uwagę zwracają ładnie wkomponowane w bryłę uchwyty. W BARWIE DREWNA Kolekcja mebli DOORSET w całości jest wykonana w kolorze imitującym barwę surowego drewna, z widocznymi słojami i sękami, dlatego też świetnie sprawdzi się we wnętrzach urządzonych w stylu rustykalnym oraz klasycznym. Ciepły odcień dębu navarra pomoże Ci otrzymać w salonie przytulną atmosferę - idealną do odpoczynku i spotkań ze znajomymi.', '', 'szafka-rtv-z-szuflada-doorset', '', '', '', 'Szafka RTV z szufladą DOORSET', '', '', '', ''),
(343, 1, 1, 'Od codziennej zastawy stołowej, po tę w różyczki, na specjalne okazje. 3 drzwiowa komoda CLASSIC WOOD pomieści wszystko to, co warto mieć pod ręką w jadalni, czy pokoju dziennym. Komoda z serii CLASSIC WOOD, to ukłon w stronę miłośników naturalnych materiałów. Wykonana z jasnego sosnowego drewna o miodowym zabarwieniu, idealnie wpasuje się we wnętrza utrzymane w stylu rustykalnym. WNĘTRZE Wnętrze 3 drzwiowej komody CLASSIC WOOD zostało schowane z potrójnymi drzwiami, za którymi zmieszczą się; szklanki, kieliszki oraz mniejsze i większe talerze. W 3 szufladach przechowasz sztućce i inne drobiazgi niezbędne podczas wspólnych posiłków. WYKOŃCZENIE Korpus, front i blat komody wykończono woskiem w miodowym kolorze. Uchwyty i zawiasy zewnętrze wykonano z metalu. Są trwałe i dodają meblowi tradycyjnego wyglądu. Klasyczne nogi zastąpiono drewnianymi, sosnowymi kulami.', '', 'komoda-3-drzwiowa-classic-wood', '', '', '', 'Komoda 3 drzwiowa CLASSIC WOOD', '', '', '', ''),
(344, 1, 1, 'Nowoczesna szafka do przedpokoju DOORSET ułatwi Ci uporządkowanie butów oraz drobnych akcesoriów, które są przydatne, a na które często brakuje miejsca. Dzięki prostym czarnym uchwytom świetnie sprawdzi się w nowoczesnych wnętrzach. Jasny kolor nada Twojemu pomieszczeniu ciepła, a wzór imitujący drewno stworzy niepowtarzalny klimat. WNĘTRZE Za drzwiami schowane są 2 półki, na których możesz przechowywać buty. 1 półka otwarta może służyć do trzymania butów lub drobnych elementów garderoby (czapki, szaliki, rękawiczki). Szuflada daje dodatkową przestrzeń, którą może przeznaczyć na kapcie lub buciki dziecięce. WYKOŃCZENIE Korpus i fronty szafki wykonane są z płyty meblowej oraz pokryte laminatem. Laminat umożliwia łatwe czyszczenie szafki: wystarczy przetrzeć ją zwilżona ściereczką.', '', 'nowoczesna-szafka-na-buty-do-przedpokoju-doorset', '', '', '', 'Nowoczesna szafka na buty do przedpokoju DOORSET', '', '', '', ''),
(345, 1, 1, 'Wiszący regał z kolekcji DOORSET jest meblem o uniwersalnym zastosowaniu. Możesz go wykorzystać w kameralnych wnętrzach gabinetu, sypialni lub pokoju młodzieżowego. Korpus oraz półki mebla pokrywa laminat, który przypomina strukturą surowe drewno o naturalnym wybarwieniu. Dopasujesz go do jasnego, pełnego przestrzeni wnętrza. REGAŁ WISZĄCY Wiszący regał ma prawie 40 cm wysokości i 80 cm długości. Został podzielony na 2 wnęki, które możesz zagospodarować na zdjęcia, kilka książek, ozdoby lub kwiaty. Udźwig pełnych półek wynosi 5 kg. WYKOŃCZENIe Regał DOORSET wykonano z płyty meblowej i wykończono laminatem. Wykończenie utrzymane jest w jasnym, ciepłym kolorze dębu navarra . W BARWIE DREWNA Kolekcja mebli DOORSET w całości jest wykonana w kolorze imitującym barwę surowego drewna, z widocznymi słojami i sękami. Świetnie sprawdzi się we wnętrzach urządzonych w stylu rustykalnym oraz klasycznym. Ciepły odcień dębu navarra pomoże Ci otrzymać w salonie przytulną atmosferę - idealną do odpoczynku i spotkań ze znajomymi.', '', 'regal-otwarty-wiszacy-doorset-80', '', '', '', 'Regał otwarty wiszący DOORSET 80', '', '', '', ''),
(346, 1, 1, 'Mała komoda BILBAO pomoże uporządkować drobiazgi w przedpokoju. Geometryczne wykończenie frontów kolekcji BILBAO podkreśli nietuzinkowy design wnętrza. WNĘTRZE Za drzwiami znajduje się 1 duża wnęka. Maksymalne obciążenie półki wynosi 5 kg . 2 szuflady są wyposażone w prowadnice kulkowe . Na blacie możesz ułożyć stylowe dekoracje lub ramki z ulubionymi zdjęciami domowników, które wprowadzą rodzinny klimat do wnętrza. Komodę wyposażono w zawiasy z cichym domykiem , więc unikniesz hałasu przy zamykaniu frontu. WYKOŃCZENIE Białe fronty są wykończone w macie,dlatego nadają przytulności wnętrzu. Połączenie dwóch kolorów: bieli i dębu artisan sprawia, że meble pasują do nowoczesnego mieszkania. MEBLE Z GEOMETRYCZNYM WZOREM Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty nadają wnętrzu nietuzinkowy charakter. Duża ilość mebli z kolekcji BILBAO pozwoli zaaranżować przestrzeń zarówno w przedpokoju, jak i pokoju dziennego.', '', 'komoda-z-geometrycznym-wzorem-bilbao', '', '', '', 'Komoda z geometrycznym wzorem BILBAO', '', '', '', ''),
(347, 1, 1, 'Chcesz urządzić przytulny kącik do czytania? Szukasz mebla, który wyeksponuje Twoje ulubione przedmioty? Kolekcję książek, płyt, pamiątki czy dekoracje możesz ułożyć w regale BILBAO. WNĘTRZE Za drzwiami znajduje się mała wnęka na drobne akcesoria. 7 otwartych wnęk różnej wielkości posłuży do wyeksponowania Twoich ulubionych przedmiotów. Wymiary otwartych wnęk: 3 x 39x39x39 cm i 4 x 18,5x39x39 cm. Na blacie możesz ułożyć stylowe dekoracje lub pamiątki, które wprowadzą ciepły i rodzinny klimat do wnętrza. WYKOŃCZENIE Matowe wykończenie w połączeniu bieli z kolorem drewna, wysokie nóżki i czarny uchwyt idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. NOWOCZESNE MEBLE DO SALONU Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty w kilku bryłach kolekcji nadają wnętrzu nietuzinkowego charakteru. Duża ilość brył BILBAO w różnych rozmiarach pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz oraz urządzić salon z jadalnią w spójnym stylu.', '', 'regal-bilbao-1d', '', '', '', 'Regał BILBAO 1D', '', '', '', ''),
(348, 1, 1, 'Szukasz komody, w której będziesz mógł uporządkować swoje rzeczy? Komoda MOOD ma pojemne szuflady, w który schowasz wszystko to, co chcesz schować przed wzrokiem gości. Przyda się na przechowanie tekstyliów domowych, bielizny lub poskładanych ubrań. Obniżony blat to świetne miejsce na wyeksponowanie stylowych dekoracji. WNĘTRZE Mebel ma 3 szuflady zostały wyposażone w prowadnice kulkowe z pełnym wysuwem, dzięki któremu będziesz mieć wygodny dostęp do zawartości całej szuflady. WYKOŃCZENIE Matowe wykończenie , wysokie ukośne nóżki i białe uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. MEBLE DO POKOJU MŁODZIEŻOWEGO, SYPIALNI, SALONU Szukasz pomysłu na przytulne wnętrze w połączeniu bieli, szarości i koloru drewna? Kolekcja MOOD jest dla Ciebie! Meble MOOD pomogą Ci urządzić zarówno nowoczesny pokój młodzieżowy, pokój dzienny, czy sypialnię singla. Duża ilość brył MOOD pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz.', '', 'komoda-z-szufladami-mood', '', '', '', 'Komoda z szufladami MOOD', '', '', '', ''),
(349, 1, 1, 'Szukasz przeszklonej komody , która będzie pasować do Twojego minimalistycznego domu? Wykończenie komody LACO w ciepłym odcieniu dębu nada wnętrzu Twojego salonu przytulnego charakteru. Jednocześnie prosta w formie bryła komody oraz transparentny , szklany front sprawi, że odnajdzie się doskonale w nowoczesnej przestrzeni. WNĘTRZE Na szklanej półce za transparentnym, hartowanym frontem możesz ułożyć ozdobne pudełka, książki lub unikalne zestawy do parzenia Twojej ulubionej herbaty. Komoda LACO posiada 5 półek z płyty meblowej o udźwigu 5 kg , na których umieścisz cięższe przedmioty. Możesz je również wykorzystać jako dodatkowe miejsce do przechowywania odzieży. Wysokość 86,6 cm pozwala na wyeksponowanie designerskich dodatków, pamiątek z wakacji, pięknych rodzinnych fotografii. WYKOŃCZENIE Korpus i półki wykonano z laminowanej płyty meblowej , dzięki temu szybko zetrzesz kurz i pozbędziesz się drobnych zabrudzeń. Czarna ramka na przodzie jest wykończona w wysokim połysku, natomiast część w kolorze dębu ma matowe wykończenie, więc mebel będzie pasował do nowoczesnych oraz bardziej klasycznych wnętrz. KOLEKCJA LACO To propozycja dla osób pragnących stworzyć oryginalny charakter wnętrza. Meble LACO sprawdzą się w zarówno w nowoczesnych, jak i industrialnych mieszkaniach – wszędzie tam, gdzie chcemy wprowadzić nowatorski, strukturalny efekt. Obok tej kolekcji nie można przejść obojętnie!', '', 'komoda-z-przeszkleniem-laco', '', '', '', 'Komoda z przeszkleniem LACO', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(350, 1, 1, 'SZAFKA RTV TES Szafka RTV TES pozwoli uzyskać oryginalne oraz dobrze zaaranżowane wnętrze. Korpus i front w kolorze orzecha ociepli wnętrze. W połączeniu z ryflowaną wstawką na tle kontrastowego czarnego szkła prezentuje się bardzo nowocześnie. Proste linie podkreślają geometryczne kształty mebla. Tes nawiązuje do natury, oferując jednocześnie funkcjonalne rozwiązania, takie jak system push zastępujący tradycyjne uchwyty czy regulowane stopki, które pozwolą ci dopasować mebel do indywidualnych potrzeb. WNĘTRZE Szafka pod telewizor umożliwi wyeksponowanie i przechowanie niezbędnych akcesoriów rtv. Wymiary wnęki lewa/prawa: szerokość 85,5 cm, głębokość 46 cm, wysokość 14 cm WYKOŃCZENIE Korpus mebla wykonany został z płyty laminowanej, łatwiejszej w utrzymaniu czystości, fronty mebla wykonane zostały z płyty MDF.', '', 'szafka-rtv-tes-ts1', '', '', '', 'Szafka RTV TES TS1', '', '', '', ''),
(351, 1, 1, 'Regał MAURO to minimalistyczna bryła. Sprawdzi się w małych wnętrzach lub może być podstawą większej kombinacji, kiedy zmienią się Twoje potrzeby. Regał sprawdzi się jako półka na książki i czasopisma w kąciku do czytania. Możesz ustawić na nim kwiaty lub stylowe dekoracje. Regał MAURO wykorzystasz również jako szafkę nocną w minimalistycznych, loftowych lub industrialnych wnętrzach. Na blacie umieścisz lampkę nocną i odłożysz telefon. Wnęka ma wymiary: 33x33 cm. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości – wystarczy miękka, zwilżona ściereczka. Regał MAURO MXXR011 występuje w czterech wariantach kolorystycznych: czarnym, białym, szarym i dębowym.', '', 'regal-mauro-382x382-cm-debowy', '', '', '', 'Regał MAURO 38,2x38,2 cm dębowy', '', '', '', ''),
(352, 1, 1, 'Nowoczesna komoda o nietuzinkowym wyglądzie, która będzie atrakcyjnym akcentem, a jednocześnie zwiększy funkcjonalność wnętrza. Korpus w kolorze dębu antycznego łączy się z frontami w beżowym połysku. Takie oryginalne wybarwienie świetnie komponuje się z innymi kolorami, więc możliwości tworzenia własnych aranżacji są niemal nieograniczone. To mebel dla osób, które cenią funkcjonalność połączoną z ciekawym designem. Jej przeznaczeniem może być niemal każde pomieszczenie w domu. WNĘTRZE We wnętrzu znajdują się cztery półki, w których bez problemu schowasz, co tylko zechcesz – od biżuterii po ubrania. WYKOŃCZENIE Fronty wykonano z płyty MDF i wykończono folią PCV. Charakterystycznym elementem kolekcji są niestandardowe uchwyty, które świetnie komponują się z całością.', '', 'komoda-tiziano', '', '', '', 'Komoda TIZIANO', '', '', '', ''),
(353, 1, 1, 'Nawiązująca do wzornictwa lat 60 oraz 70, kolekcja mebli HAVANNA charakteryzuje się prostymi, geometrycznymi bryłami oraz dekoracjami sprowadzonymi do minimum. Pokryta okleiną imitującą dębowe drewno szafka RTV będzie doskonałym elementem umeblowania zarówno salonu w nowoczesnej stylistyce, jak i w aranżacjach vintage. WNĘTRZE Szafka to dwie szuflady oraz wnęka pod blatem, pełniąca funkcję półki. W szufladach umieścisz wszelkie drobiazgi czy swoją kolekcję płyt, natomiast półka to doskonałe miejsce na dekoder czy piloty. WYKOŃCZENIE Szafkę pokryto okleiną w dekorze dąb postarzany. Szuflady otworzysz za pomocą podłużnych, czarnych uchwytów, które kontrastują z jasną kolorystyką szafki, ale jednocześnie współgrają z jej prostym kształtem.', '', 'szafka-rtv-havanna-2s', '', '', '', 'Szafka RTV HAVANNA 2S', '', '', '', ''),
(354, 1, 1, 'Dwudrzwiowa komoda MAREY to połączenie interesującego koloru dębu szlachetnego oraz struktury imitującej fakturę drewna z popularną i uniwersalną bielą w połysku na frontowej części mebla. Komoda wyróżnia się swoją konstrukcją, oprócz klasycznych półek zamkniętych jej górna część składa się z półek otwartych, na których można umieścić np. dekoracje. Masywne ramki otaczające mebel tworzą ciekawy wzór. Komoda jest wyposażona w szufladę z systemem samodomykającym i zawiasy z systemem cichego domyku. Duże uchwyty w srebrnym kolorze podkreślają kształt mebla. WNĘTRZE Komoda składa się z półek otwartych, zamkniętych i szuflady. WYKOŃCZENIE Kolorystyka mebla, która opiera się na połączeniu ciemnego drewna i bieli tworzy przyjemny dla oka kontrast, który doskonale sprawdza się przy wielu aranżacjach. Całości dopełniają uchwyty w kolorze chrom. Komoda MAREY została wyposażona w zawiasy slide-on z hamulcem, który zapobiega szybkiemu zużyciu mebla w trakcie eksploatacji oraz prowadnice typu quadro. .', '', 'komoda-marey-2d1s', '', '', '', 'Komoda MAREY 2D1S', '', '', '', ''),
(355, 1, 1, 'Komoda Locarno to połączenie funkcjonalności z nowoczesnym designem. Jasna kolorystyka Dębu Nelson została przełamana ryflowanymi wstawkami w głębokim odcieniu szarości, które są znakiem rozpoznawczym całej kolekcji. Subtelnie zaokrąglone fronty dodają bryłom uroku a poziome srebrne uchwyty podkreślają nowoczesny charakter mebli. WNĘTRZE Wewnątrz znajdują się pojemne półki, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Górna i dolna część drzwi oraz ryflowana wstawka zostały wykonane z płyty MDF. Srebrne uchwyty świetnie prezentują się na tle dekoru dębowego tworząc przyjemny, nowoczesny akcent.', '', 'komoda-locarno-lcrk221', '', '', '', 'Komoda LOCARNO LCRK221', '', '', '', ''),
(356, 1, 1, 'Masz niewielki pokój dzienny i szukasz odpowiedniej szafki RTV? Mamy dla Ciebie Szafka RTV BASIC 2! Biała kolorystyka i minimalistyczne wzornictwo sprawiają, że bez trudu można ją dopasować do już istniejącej aranżacji. Na szklanej półce, która jest dodatkowo wyposażona w oświetlenie LED , pokażesz ulubiony drobiazg. Za zamykanymi drzwiami schowasz np. płyty DVD lub akcesoria RTV. WNĘTRZE W 2 otwartych wnękach możesz układać czasopisma, płyty i akcesoria. WYKOŃCZENIE Szafka RTV BASIC została wykonana z płyty meblowej, wykończonej matową melaminą, natomiast nóżki mebla z tworzywa sztucznego PVC. Szafkę możesz wkomponować w nowoczesne, chłodne przestrzenie; wypełnione szarością, bielą lub granatem.', '', 'nowoczesna-szafka-rtv-z-oswietleniem-basic-2', '', '', '', 'Nowoczesna szafka RTV z oświetleniem BASIC 2', '', '', '', ''),
(357, 1, 1, 'Komoda z kolekcji WITALIA to propozycja dla wielbicieli naturalnych materiałów we wnętrzach, do zastosowania w jadalni lub salonie. Mebel został wykonany w całości z litego drewna akacjowego - twardego i trwałego, z dużą odpornością na zarysowania. Dodatkowo drewno zostało poddane postarzającemu szczotkowaniu , co jeszcze bardziej podkreśla jego autentyczność. Natomiast ciemno-szara kolorystyka oraz metalowe uchwyty i nogi dodają meblowi industrialnego charakteru. Wykorzystanie naturalnych materiałów sprawia, że komoda będzie ponadczasowym elementem wyposażenia. Drewno wygląda zawsze szlachetnie, ociepla pomieszczenie i świetnie komponuje się z dodatkami wykonanymi z różnych materiałów, w różnych stylach. WNĘTRZE Komoda składa się z 4 otwartych wnęk, przedzielonych szklanymi półkami, które posłużą do wyeksponowania książek, interesujących dodatków czy szkła. 2 praktyczne szuflady oraz 2 zamknięte wnęki posłużą do przechowywania różnych drobiazgów - dodatkowych sztućców, obrusów, serwetek czy innych akcesoriów przydatnych w jadalni lub salonie. Dla większej wygody użytkowania drzwiczki zostały wyposażone w zawiasy z cichym domykiem. WYKOŃCZENIE Całość mebla została wykonana z litego drewna akacjowego. Użyte metalowe uchwyty doskonale komponują się z całością. Drewno kojarzy się z klasyką, jednak oryginalne nogi mebla dodają mu nowoczesnego charakteru, z lekkim nawiązaniem do stylu retro.', '', 'komoda-witalia-l05', '', '', '', 'Komoda WITALIA L05', '', '', '', ''),
(358, 1, 1, 'Komoda PORTO 2D2S wkomponuje się w niewielką przestrzeń, tworząc praktyczny kąt do przechowywania. Możesz przechowywać w nim akcesoria biurowe oraz ksiażki i segregatory lub elementy zastawy stołowej i sztućce. Głęboki odcień orzecha columbia wprowadza do wnętrza klimat elegancji i luksusu. Cechą charakterystyczną kolekcji jest wstawka z czarnego szkła lacobel , która nadaje meblowi oryginalny styl. Podfrezowane fronty zastępują tradycyjne uchwyty, co podnosi atrakcyjność kolekcji oraz usprawnia użytkowanie mebla. Bryły wchodzące w skład kolekcji umożliwiają gustowne umeblowanie pokoju dziennego w nowoczesnym stylu. Kolekcja dostępna jest wyłącznie w salonach Agata. WNĘTRZE Wnętrze składa się z 2 szuflad oraz 4 wnęk w części zamkniętej. WYKOŃCZENIE Fronty wykonano z płyty MDF pokrytej folią PCV. Korpus mebla wykończono laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'komoda-porto-2d2s', '', '', '', 'Komoda PORTO 2D2S', '', '', '', ''),
(359, 1, 1, 'Dzięki szafce RTV BASIC 2 na małej przestrzeni stworzysz miejsce do przechowywania akcesoriów i sprzętu RTV. Mebel jest prosty i pozbawiony zdobień, dlatego bez trudu dopasujesz go do już istniejącej aranżacji w Twoim salonie. ZA ZAMKNIĘTYMI DRZWIAMI W szafce znajdziesz 2 zamykane półki , gdzie możesz schować sprzęt oraz okablowanie RTV lub kolekcję płyt DVD. PODŚWIETLENIE LED 1 szklana półka w centralnej części jest dodatkowo wyposażona w podświetlenie LED , więc możesz postawić tam wyjątkowy dodatek, albo ulubione zdjęcie. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej wykończonej matową melaminą w białym kolorze. Nóżki mebla są z tworzywa sztucznego PCV.', '', 'nowoczesna-szafka-rtv-ze-szklana-polka-basic-2', '', '', '', 'Nowoczesna szafka RTV ze szklaną półką BASIC 2', '', '', '', ''),
(360, 1, 1, 'Komoda MODEX przeznaczona jest do pokoju dziecięcego i młodzieżowego. Jej kolorowe, błyszczące fronty wprowadzą do pomieszczenia wesoły, beztroski klimat. W trzech praktycznych szufladach zmieszczą się ubrania i bielizna. Komoda sprawdzi się zarówno jako mebel dla dziewczynki jak i dla chłopca. Jest jednym z elementów ciekawej kolekcji MODEX, meblami z tej serii można kompletnie urządzić pokój nastolatka. WYKOŃCZENIE Fronty zostały wykończone oryginalnym szaroniebieskim oraz białym laminatem w połysku . Pięknie łączą się z ciepłym odcieniem dębu złotego na blacie. Prosty laminowany blat jest wytrzymały i łatwo utrzymać go w czystości.', '', 'komoda-z-szufladami-do-pokoju-mlodziezowego-modex', '', '', '', 'Komoda z szufladami do pokoju młodzieżowego MODEX', '', '', '', ''),
(361, 1, 1, 'Szafkę RTV LOWBOARDS z łatwością wpasujemy w nowoczesne wnętrze, urządzone w jasnych kolorach oraz w bieli. Prosta, niska szafka przeznaczona jest do pokoju dziennego, gdzie posłuży jako baza dla strefy telewizyjnej w pomieszczeniu. Szafka pomieści telewizor oraz inne sprzęty RTV a akcesoria do nich ułożysz na półkach lub schowasz w zamkniętej wnęce. Wygodne, klapowe drzwiczki wyposażone w system cichego domyku , pozwolą na komfortowe, bezgłośne korzystanie z szafki. Ze względu na małą wysokość szafki - 38,1 cm , możesz także zawiesić telewizor na ścianie nad nią, natomiast jej blat wykorzystać jako przestrzeń dla dekoracji lub umieszczenia innych elektronicznych gadżetów. WYKOŃCZENIE: Szafka została wykończona folią, która nadaje jej powierzchni matowy wygląd; Wykonany z tworzywa uchwyt imituje aluminiowy;', '', 'szafka-rtv-lowboards-1s', '', '', '', 'Szafka RTV LOWBOARDS 1S', '', '', '', ''),
(362, 1, 1, 'Masz dość upychania swoich rzeczy, gdzie się da? Przyda Ci się pojemna komoda z szufladami i zamykanymi szafkami - taka jak BOTAN . Gładkie fronty wyposażono w system push to open. Dzięki niemu otwieranie drzwi i szuflad jest takie proste. WNĘTRZE W 3 szufladach zmieścisz swoje drobiazgi. Otwarta wnęka przyda się do eksponowania książek i dekoracji. Możesz korzystać z 6 wnęk zamkniętych, by posegregować swoje rzeczy. WYKOŃCZENIE Meble z kolekcji BOTAN wykończono folią, dzięki czemu z łatwością utrzymasz meble w czystości. Połączenie białego wykończenia z imitacją betonu sprawia, że meble wpasujesz nie tylko w minimalistyczne, ale i w loftowe wnętrze. Połyskujące wykończenie powiększa optycznie przestrzeń.', '', 'duza-komoda-z-polyskiem-botan', '', '', '', 'Duża komoda z połyskiem BOTAN', '', '', '', ''),
(363, 1, 1, 'Szukasz eleganckiej komody, w której można przechowywać przedmioty o różnej wielkości? Ta komoda ROSA zachwyci Cię granatowymi frontami, uchwytami i nóżkami w kolorze złota oraz uniwersalnym układem wnętrza: z 2 szufladami i 4 wnękami. Zawiasy z cichym domykiem sprawiają, że drzwi nie trzaskają. WNĘTRZE Komoda do salonu ROSE posiada 3 praktyczne szuflady – idealne na szaliki, czapki lub stylowe dodatki do garderoby. Jeśli zdecydujesz, że komoda znajdzie się w Twojej sypialni – szuflady sprawdzą się także jako miejsce na elegancką bieliznę . Za 2 drzwiami z wysoko umieszczonym uchwytem znajdziesz miejsce na dodatkowe koce, ubrania lub dokumenty. 4 wnęki utworzone dzięki 2 półkom o udźwigu 5 kg sprawią, że odtąd wszystko znajdzie swoje miejsce . WYKOŃCZENIE Korpus oraz fronty szafki wykonano z laminowanej płyty meblowej w unikatowym kolorze. Kolekcję ROSE charakteryzują metalowe uchwyty i wysokie nóżki w złotym odcieniu . Szuflady wysuwają się dzięki prowadnicom kulkowym . Uchwyt zastosowany w komodzie ROSE to delikatna, złota gałka . IKONA STYLU Granatowe meble ROSE doskonale komponują się z: elementami wykonanymi z jasnego drewna w chłodnym odcieniu, również bielonego drewna . jasnym marmurem , szarym marmurem, stonowanymi odcieniami kamieni i betonu. modnym lastryko . eleganckim, ciemnym drewnem – zwłaszcza w postaci stylizowanego oparcia łóżka lub podłogi, która dzięki renowacji odzyskała dawny blask. jeśli lubisz grę kontrastów możesz urozmaicić aranżacje dekoracjami w ceglanym odcieniu czerwieni – zwłaszcza, gdy łączy się ona z welurem . GRANATOWA ELEGANCJA Pragniesz, by Twoje mieszkanie wyróżniała elegancja i styl? Elegancka linia mebli ROSE w ciemnoniebieskim odcieniu sprawi, że wnętrze nabierze klasy i szyku. Dzięki ROSE możesz płynnie igrać z najnowszymi trendami panującymi w nowoczesnych wnętrzach. Od klasyki , poprzez minimalizm , aż do new hampton ... Dzięki ROSE to Ty decydujesz, jak wyglądać będzie Twój wymarzony salon lub sypialnia .', '', 'komoda-z-3-szufladami-granatowa-rose', '', '', '', 'Komoda z 3 szufladami granatowa ROSE', '', '', '', ''),
(364, 1, 1, 'Dekoracje, rośliny, organizery ułóż w regale KOMAD . Nowoczesny regał to świetny sposób na przyciągającą wzrok aranżację. Biel i kolor drewna łatwo dopasujesz do większości pomieszczeń. Z regałem KOMAD świetnie zagospodarujesz pustą ścianę w pokoju dziennym, młodzieżowym, gabinecie czy pracowni. REGAŁ NA KSIĄŻKI Szukasz regału, który pomieści kolekcję książek, a jednocześnie nie przytłoczy wnętrza? Regał KOMAD świetnie sprawdzi się jako forma domowej biblioteczki . Metalowa konstrukcja prezentuje się nowocześnie i lekko. WYKOŃCZENIE Stelaż wykończono białą farbą proszkową, a półki okleiną drewnopodobną.', '', 'regal-metalowy-z-3-polkami-komad', '', '', '', 'Regał metalowy z 3 półkami KOMAD', '', '', '', ''),
(365, 1, 1, 'Szeroka komoda LAGOS przyda się w każdym pokoju dziennym czy jadalni. Pomieści dokumenty, tekstylia domowe i inne akcesoria. Dużo bieli, ciepły kolor drewna, smukłość formy – te cechy sprawiają, że komoda prezentuje się bardzo elegancko. WNĘTRZE W 6 wnękach za drzwiami łatwo ułożysz potrzebne przedmioty. Szuflada pomieści niewielkie akcesoria. WYKOŃCZENIE Meble LAGOS są wykonane z płyt meblowych i wykończone laminatem. Fronty pokryto folią. BIAŁE MEBLE DO POKOJU Kolekcja LAGOS świetnie sprawdzi się w nowoczesnych czy skandynawskich wnętrzach, jak i tych z elementami stylu glamour. Dzięki zastosowaniu połysku na frontach meble nie przytłoczą pomieszczenia, a dodatkowo je rozświetlą. Połączenie bieli z kolorem drewna wprowadzi do mieszkania przytulny klimat .', '', 'komoda-lagos-3d1s', '', '', '', 'Komoda LAGOS 3D1S', '', '', '', ''),
(366, 1, 1, 'Komoda BILBAO 1D3S pomoże uporządkować ubrania i bieliznę w sypialni, tekstylia domowe w pokoju dziennym czy jadalni lub potrzebne akcesoria w przedpokoju. Geometryczne wykończenie frontów podkreśli nowoczesny design wnętrza. WNĘTRZE Za drzwiami znajdują się 2 wnęki. Maksymalne obciążenie półki wynosi 5 kg. 3 szuflady są wyposażone w prowadnice kulkowe. Na blacie możesz ułożyć stylowe dekoracje lub pamiątki, które wprowadzą ciepły i rodzinny klimat do wnętrza. Komodę wyposażono w zawiasy z cichym domykiem, więc unikniesz hałasu trzaskających drzwi. WYKOŃCZENIE Matowe wykończenie w połączeniu bieli z kolorem drewna, wysokie nóżki i czarne uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. NOWOCZESNE MEBLE DO SALONU Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty w kilku bryłach kolekcji nadają wnętrzu nietuzinkowego charakteru. Duża ilość brył BILBAO w różnych rozmiarach pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz oraz urządzić salon z jadalnią w spójnym stylu.', '', 'komoda-nowoczesna-z-szufladami-jednodrzwiowa-bilbao', '', '', '', 'Komoda nowoczesna z szufladami jednodrzwiowa BILBAO', '', '', '', ''),
(367, 1, 1, 'Szukasz minimalistycznej szafki RTV o długości 160 cm? Spodoba Ci się szafka RTV NOVENA. WNĘTRZE Półka wytrzyma obciążenie 5 kg. Za frontami szuflad kryją się podwójne wnętrza - dzięki temu możesz lepiej segregować swoje przedmioty. Szuflady mają cichy domyk - nie trzaskają. Blat szafki wyposażono w przepust kablowy. WYKOŃCZENIE Lubisz minimalistyczne aranżacje? Meble z kolekcji NOVENA zachwycą Cię swoją prostą konstrukcją. Białe fronty sprawiają, że przestrzeń wyda się jaśniejsza i większa. Czarne wstawki i dekory w kolorze drewna podkreślają nowoczesny charakter aranżacji. Meble wykończono laminatem.', '', 'szafka-pod-telewizor-nowoczesna-novena', '', '', '', 'Szafka pod telewizor nowoczesna NOVENA', '', '', '', ''),
(368, 1, 1, 'Kolekcja mebli MARCO to nowoczesna propozycja stawiająca na zdecydowane akcenty i odważną oryginalność aranżacyjną. Zdecydowana biel została przełamana czarnymi akcentami detali, a nowatorski dekor wymyka się sztampie stając się przełomem w aranżacji wnętrza. Kolekcja pięknie sprawdzi się we wnętrzach nowoczesnych i minimalistycznych, ale także stworzy świetną podstawę dla urządzenia wnętrza opartego na kontraście – świetnie wypadnie w zestawieniu z mocnymi barwami ścian lub obrazów, detali dekoracyjnych i tekstyliów domowych. Komoda MARCO doskonale uzupełnia salon lub sypialnię zapewniając sporo miejsca na przechowanie domowych akcesoriów, koców, serwisów obiadowych lub tekstyliów stołowych. Na pięknym, szerokim blacie można wyeksponować dekoracje i bibeloty, pamiątki, fotografie w ramkach lub ozdobny wazon z kwiatami stawiając ostatni akcent na wystroju wnętrza. WNĘTRZE Komoda zawiera 2 pojemne, zamykane wnęki , które pozwolą rozsądnie uporządkować potrzebne akcesoria i gadżety; Maksymalne obciążenie półki wynosi 5 kg ; 3 szuflady na prowadnicach rolkowych znaczącą zwiększają przestrzeń do przechowywania tekstyliów domowych, ubrań, bielizny i wielu gadżetów i akcesoriów . WYKOŃCZENIE Korpus mebla oraz półki są wykonane z połączenia płyty wiórowej o grubości 16 mm i drewna sosnowego o grubości 20 mm . Są wykończone matowym laminatem w klasycznej bieli przełamanej czarnymi wstawkami kolorystycznymi oraz wyjątkowo zdobnym dekorem; Fronty szafki są wykonane z płyty MDF o grubości 18 mm i pokryte białą folią PVC o wysokim połysku; W standardzie mebla jest oświetlenie LED o zimnej, białej barwie , która podkreśli elegancki charakter pomieszczenia. Punkty oświetleniowe pięknie podkreślają dekor na drzwiczkach komody. Klasa energetyczna oświetlenia to A++ ; Tradycyjne nóżki zostały zastąpione solidnym cokołem , który dodaje komodzie statecznego sznytu. Czarne uchwyty z tworzywa stanowią ukłon w stronę wzornictwa minimalistycznego pięknie podkreślając niebanalne kontrasty kolorystyczne.', '', 'komoda-marco-2d3s-z-oswietleniem', '', '', '', 'Komoda MARCO 2D3S z oświetleniem', '', '', '', ''),
(369, 1, 1, 'Brak porządku w przedpokoju i buty widoczne tuż po wejściu do pomieszczenia, w szybki sposób rozwiąże szafka na buty BOOTS . Prosta w konstrukcji i funkcjonalna pozwala na utrzymanie porządku. Dwudrzwiowa szafka podzielona na 6 równych części z możliwością regulacji wysokości półki to mebel, który jest potrzebny w każdym przedpokoju. Szafka ma wystarczającą pojemność dla całej rodziny. Kolorystyka szafki to dąb sonoma i biel, którą z łatwością dopasujemy ją do pozostałych mebli w mieszkaniu. WYKOŃCZENIE Mebel wykonano z płyt meblowych i pokryto folią.', '', 'szafka-na-buty-boots-bts321', '', '', '', 'Szafka na buty BOOTS BTS321', '', '', '', ''),
(370, 1, 1, 'Biała komoda TEMUZZA wpasuje się w jasne wnętrza o nowoczesnym charakterze. Kompaktowe wymiary komody sprawiają, że to idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Idealnie nada się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych, dokumentów. Uchwyty w srebrnym kolorze odznaczają się prostą, minimalistyczną stylistyką. WNĘTRZE Wnętrze komody dzieli się na 3 wnęki oraz 2 szuflady. Rozmiary wnęk można dopasować do własnych potrzeb, umieszczając półkę na pożądanej wysokości.', '', 'komoda-temuzza-2d2s', '', '', '', 'Komoda TEMUZZA 2D2S', '', '', '', ''),
(371, 1, 1, 'Komoda TEMUZZA to funkcjonalny mebel, który idealnie uzupełni aranżację domu lub biura. Prosty design oraz klasyczna, biała barwa sprawiają, że komoda wpasuje się w jasne wnętrza, stając się naturalnym elementem wyposażenia. Kompaktowe wymiary komody sprawiają, że to idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Idealnie nada się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych, dokumentów. Uchwyty w srebrnym kolorze odznaczają się prostą, minimalistyczną stylistyką. WNĘTRZE Wnętrze komody dzieli się na 2 wnęki oraz 2 szuflady. Rozmiary wnęk można dopasować do własnych potrzeb, umieszczając półkę na pożądanej wysokości.', '', 'komoda-temuzza-2d2s-niska', '', '', '', 'Komoda TEMUZZA 2D2S niska', '', '', '', ''),
(372, 1, 1, 'Szukasz pomysłu jak zagospodarować pustą ścianę? Dekoracje, rośliny, organizery ułóż w regale KABEA . Nowoczesny regał w kształcie drabiny to świetny sposób na przyciągającą wzrok aranżację. Czarno-biały regał łatwo dopasujesz do większości pomieszczeń – posłuży w pokoju dziennym, młodzieżowym, gabinecie czy pracowni. REGAŁ METALOWY NA KSIĄŻKI Czarna, metalowa konstrukcja prezentuje się nowocześnie i lekko. Regał świetnie sprawdzi się jako forma domowej biblioteczki . Białe półki z płyty meblowej to idealne miejsce na książki. WYKOŃCZENIE Metalowy stelaż wykończono farbą proszkową, a półki okleiną drewnopodobną.', '', 'regal-drabina-z-4-polkami-bialy-kabea', '', '', '', 'Regał drabina z 4 półkami biały KABEA', '', '', '', ''),
(373, 1, 1, 'Twoje imponujące 65 cali potrzebuje nowoczesnej podstawy? Biała szafka RTV z kolekcji NOVENA nada się do tego doskonale. Jej minimalistyczny wygląd nie odciągnie Twojej uwagi od ulubionego serialu. WNĘTRZE Swój sprzęt wstaw do wnęki otwartej, by mieć do niego bezpośredni dostęp. W bocznej szafce znajdują się 2 wnęki, w których zmieścisz kolekcję ulubionych gier. 2 podwójne i jedna pojedyncza szuflada zapewniają mnóstwo miejsca do przechowywania akcesoriów, płyt i gadżetów. Blat szafki wyposażono w przepust kablowy. WYKOŃCZENIE Lubisz minimalistyczne aranżacje? Meble z kolekcji NOVENA zachwycą Cię swoją prostą konstrukcją. Białe fronty sprawiają, że przestrzeń wyda się jaśniejsza i większa. Czarne wstawki i dekory w kolorze drewna podkreślają nowoczesny charakter aranżacji. Meble wykończono laminatem.', '', 'szafka-rtv-nowoczesna-novena', '', '', '', 'Szafka RTV nowoczesna NOVENA', '', '', '', ''),
(374, 1, 1, 'Zawsze wykonujesz makijaż w biegu? Wysokość szafki do przedpokoju RYLOTH sprawi, że niezbędne akcesoria będziesz mieć zawsze pod ręką - tuż przed wyjściem z mieszkania. Dokup lustro z tej samej kolekcji a już nigdy nie wyjdziesz do pracy bez wytuszowanych rzęs. WNĘTRZE W szerokiej szufladzie zmieścisz kolekcję swoich stylowych apaszek i dodatków . Zapewnij sobie codzienny, perfekcyjny wygląd. 2 wysokie , otwarte półki to idealna przestrzeń na flakonik perfum , którym skropisz się przed wyjściem z domu. 2 półki o udźwigu 5 kg , pozwolą Ci dobrać zawsze perfekcyjnie dobrane obuwie do reszty stylizacji. ESTETYKA I KOMFORT Szafka na buty RYLOTH - dzięki połączeniu prostej bryły oraz modnego zestawienia kolorystycznego - sprawdzi się bardzo dobrze w nowoczesnym mieszkaniu . Białe fronty oraz korpus szafki wykonane z płyty meblowej pokrytej folią podkreślone zostały listwami w kolorze dąb catania . Nawet w bardzo zatłoczonym korytarzu utrzymasz je łatwo w czystości. Drobne aluminiowe uchwyty nie przytłaczają wizualnie szafki, są jednocześnie wygodne w użytkowaniu – nie pozostawisz śladów palców na frontach. Białe , matowe fronty skrywają pojemne wnętrze.', '', 'wysoka-szafka-do-przedpokoju-z-szuflada-ryloth', '', '', '', 'Wysoka szafka do przedpokoju z szufladą RYLOTH', '', '', '', ''),
(375, 1, 1, 'Szafka RTV LAGOS zapewni miejsce na duży telewizor i pomieści sporo przedmiotów. Dużo bieli, ciepły kolor drewna, smukłość formy – te cechy sprawiają, że szafka prezentuje się bardzo elegancko. WNĘTRZE W 2 otwartych wnękach możesz ułożyć dekoder i konsolę. W 2 wnękach za drzwiami i szufladzie łatwo uporządkujesz drobne akcesoria, płyty czy gry. Każda z 2 wnęk ma wymiar 36,5 cm x 12 cm x 66 cm. WYKOŃCZENIE Meble LAGOS są wykonane z płyt meblowych i wykończone laminatem. Fronty pokryto folią. BIAŁE MEBLE DO POKOJU Kolekcja LAGOS świetnie sprawdzi się w nowoczesnych czy skandynawskich wnętrzach, jak i tych z elementami stylu glamour. Dzięki zastosowaniu połysku na frontach meble nie przytłoczą pomieszczenia, a dodatkowo je rozświetlą. Połączenie bieli z kolorem drewna wprowadzi do mieszkania przytulny klimat .', '', 'szafka-rtv-lagos-2d1s', '', '', '', 'Szafka RTV LAGOS 2D1S', '', '', '', ''),
(376, 1, 1, 'Komoda DIESEL zwraca uwagę prostotą i funkcjonalnością. Stanowi doskonałe dopełnienie dla nowoczesnego wnętrza, utrzymanego w jasnej tonacji kolorystycznej. Świetnie sprawdza się w kameralnej przestrzeni pokoju młodzieżowego i domowego gabinetu, jednak równie dobrze można ustawić go w salonie lub sypialni. To idealny mebel, by umieścić w nim ubrania, dokumenty oraz osobiste przednioty. Komoda DIESEL została wykonana z płyty meblowej wykończonej laminatem. Całości dopełniają okrągłe metalowe uchwyty, które pasują do kolorystyki. WNĘTRZE Cztery pojemne szuflady pozwalają na uporządkowanie rzeczy, a prowadnice kulkowe z pełnym wysuwem usprawnią obsługę mebla. WYKOŃCZENIE Połączenie ciepłej kolorystyki dębu madura z nieco ciemniejszymi elementami wybarwienia wellington tworzy pomysłowe zestawienie, które podkreśla walory estetyczne kolekcji DIESEL .', '', 'komoda-diesel-4s', '', '', '', 'Komoda DIESEL 4S', '', '', '', ''),
(377, 1, 1, 'Komoda STEP pomieści ubrania, bieliznę, jak i niezbędne akcesoria czy rzeczy do szkoły. Blat możesz wykorzystać jako miejsce na dekoracje, zabawki czy organizery. Połączenie koloru jasnego drewna z bielą oraz szarością imitującą beton urozmaica pokój i nadaje aranżacji lekkości. Komoda STEP sprawdzi się zarówno w pokoju dziewczynki, jak i chłopca. WNĘTRZE W 3 szufladach łatwo uporządkujesz potrzebne przedmioty. Otwarta wnęka to świetne miejsce na książki lub gry. WYKOŃCZENIE Meble z kolekcji STEP są wykonane z płyty meblowej i wykończone laminatem . Kolorystyka pozwala na wykorzystanie ich w nowoczesnych wnętrzach. Pasują zarówno do jasnych, jak i ciemnych kolorów ścian. Dwa rodzaje uchwytów urozmaicają wnętrze ciekawym designem. MEBLE MŁODZIEŻOWE STEP Kolekcję mebli STEP z powodzeniem możesz wykorzystać w pokoju dziecięcym , a za kilka lat posłużą jako meble młodzieżowe. Meble STEP dają dużo miejsca do przechowywania , więc z łatwością uporządkujesz wszystkie ubrania, zabawki i książki. Nowoczesne połączenie kolorów na frontach mebli pozwala stworzyć w pokoju optymistyczny i przytulny nastrój.', '', 'komoda-step', '', '', '', 'Komoda STEP', '', '', '', ''),
(378, 1, 1, 'Lubisz niestandardowe i nowoczesne rozwiązania we wnętrzach? Szeroka komoda 3D PATRIK to mebel, który odmieni przestrzeń salonu lub pokoju dziennego. Przechowasz w niej nie tylko tekstylia, dokumenty czy poskładane ubrania. Wyposażona w jedne, częściowo przeszklone drzwi pozwoli wyeksponować elegancką kolekcję kieliszków czy ulubione pamiątki. Trójwymiarowe fronty wprowadzą do wnętrza dynamiczny i wyrazisty charakter. Komoda w kolorze dąb artisan nada wnętrzu przytulny charakter i nie przytłoczy go. WNĘTRZE Za 3 drzwiami znajdziesz 7 wnęk, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. Brak uchwytów podkreśla minimalistyczny i nowoczesny charakter mebla. Blat możesz wykorzystać na wyeksponowanie stylowych dekoracji, zdjęć czy pamiątek. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się we współczesnych aranżacjach, w których zależy nam na stworzeniu ciekawej i nowoczesnej aranżacji.', '', 'komoda-nowoczesna-szeroka-patrik', '', '', '', 'Komoda nowoczesna szeroka PATRIK', '', '', '', ''),
(379, 1, 1, 'Komoda TEMUZZA to bardzo funkcjonalny mebel, który idealnie uzupełni aranżację domu. Bezpretensjonalny, prosty design oraz klasyczna, biała barwa wpasują się w jasne wnętrza stając się naturalnym elementem wyposażenia. Wnętrze komody dzieli się na dwie wnęki , których rozmiary można dopasować do własnych potrzeb umieszczając półkę na pożądanej wysokości. Kompaktowe wymiary komody sprawiają, że to idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów – idealnie nada się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych, dokumentów czy nawet przetworów kuchennych. Srebrne uchwyty odznaczają się prostą, minimalistyczną stylistyką. Korespondują z dyskretnymi, srebrnymi nóżkami komody subtelnie uspójniając design komody.', '', 'komoda-temuzza-2d-niska', '', '', '', 'Komoda TEMUZZA 2D niska', '', '', '', ''),
(380, 1, 1, 'Wasze buty wciąż leżą na środku przedpokoju? Wybierz szafkę na buty SIENNA i uporządkuj je raz na zawsze. Dzięki specjalnym drzwiom klapowym chowanie i wyciąganie butów będzie bardzo wygodne. Stosunkowo wysoka, ale i wąska szafka pozwoli przechowywać buty nawet w wąskim przedpokoju. Możesz wykorzystać jej blat, by trzymać na nim pojemnik z maseczkami, klucze czy torebkę. Szafka wyposażona jest w 3 drzwi klapowe z wygodnym - frezowanym uchwytem. WYKOŃCZENIE Szafka wykonana jest z płyt meblowych i wykończona folią. Białe, połyskujące fronty rozświetlą mały przedpokój. Połączenie koloru dębu piaskowego z bielą ociepli i optycznie powiększy wnętrze małego przedpokoju. Biała kolorystyka z połyskiem sprawdzi się szczególnie we wnętrzach nowoczesnych i minimalistycznych.', '', 'szafka-na-buty-sienna-3k', '', '', '', 'Szafka na buty SIENNA 3K', '', '', '', ''),
(381, 1, 1, 'Jeżeli cenisz sobie użyteczność i ponadczasowość komoda SIENNA będzie doskonałym wyborem. Szeroki blat będzie idealną ekspozycją na rodzinną kolekcję zdjęć lub stylowych dekoracji. Mebel możesz wkomponować w pomieszczenia o różnej kolorystyce, przez co nie podda się przemijającym trendom. WNĘTRZE Komodę wyposażono w 4 zamykane wnęki oraz 4 szuflady , dzięki czemu utrzymasz porządek w Twoich rzeczach. Taki układ szuflad i półek pozwoli posegregować przedmioty przechowywane w sypialni, biurze czy pokoju dziennym. WYKOŃCZENIE Komoda wykonana jest z płyt meblowych i wykończona folią. Białe, połyskujące fronty sprawią, że wnętrze wyda się większe. Biała kolorystyka z połyskiem sprawdzi się szczególnie we wnętrzach nowoczesnych i minimalistycznych. Komoda posiada frezowane uchwyty, a brak nóżek sprawi, że łatwej będzie Ci utrzymać czystość.', '', 'komoda-sienna-4s2d', '', '', '', 'Komoda SIENNA 4S2D', '', '', '', ''),
(382, 1, 1, 'Dwudrzwiowa komoda MAREY to połączenie interesującego koloru dębu szlachetnego oraz struktury imitującej fakturę drewna z popularną i uniwersalną bielą w połysku na frontowej części mebla. Masywne ramki otaczające mebel tworzą ciekawy wzór. Komoda jest wyposażona w cztery szuflady z systemem samodomykającym i drzwi z zawiasami z systemem cichego domyku. Komoda dzięki uniwersalnej budowie może być zastosowana nie tylko w przedpokoju, ale także w salonie czy jadalni. Duże uchwyty w srebrnym kolorze podkreślają kształt mebla. WNĘTRZE 4 szuflady i 4 zamknięte wnęki pozwalają na łatwe rozmieszczenie rzeczy. WYKOŃCZENIE Kolorystyka mebla, która opiera się na połączeniu ciemnego drewna i bieli tworzy przyjemny dla oka kontrast, który doskonale sprawdza się przy wielu aranżacjach. Całości dopełniają uchwyty w kolorze chrom. Komoda MAREY została wyposażona w zawiasy slide-on z hamulcem, który zapobiega szybkiemu zużyciu mebla w trakcie eksploatacji oraz prowadnice typu quadro.', '', 'komoda-marey-2d4s', '', '', '', 'Komoda MAREY 2D4S', '', '', '', ''),
(383, 1, 1, 'Komoda BRANDO zwraca uwagę kolorystyką oraz oszczędną, nowoczesną formą. Doskonale prezentuje się w przestrzeni salonu pokoju dziennego, sypialni oraz domowego gabinetu nadając wnętrzu chłodny, elegancki styl. Sprawdza się jako funkcjonalny mebel, w którym można w zależności od indywidualnych preferencji schować ubrania, elementy zastawy salonowej lub inne, przydatne drobiazgi wyposażenia domu. Jej blat można wykorzystać pod kątem ekspozycyjnym do ustawienia kwiatów lub zdjęć. Styl komody oraz całej kolekcji BRANDO idealnie pasuje do wnętrz jasnych a jej proste, oszczędne wzornictwo pozwala na dużą dowolność pod katem rozwiązań aranżacyjnych. WNĘTRZE Komoda BRANDO posiada 2 pojemne szuflady na prowadnicach kulkowych w górnej części mebla. Poniżej znajduje się szafka z półkami. Na szczególną uwagę zasługuje fakt, że drzwi zostały wyposażone w zawiasy z systemem cichego domyku. WYKOŃCZENIE Korpus oraz blaty mebla zostały wykonane z laminowanej płyty meblowej, natomiast fronty to MDF z wykończeniem w białym połysku . Modne zestawienie bieli oraz szarości betonu dodaje komodzie BRANDO nieco surowości złagodzonej poprzez linię podchwytów we frontowej części mebla.', '', 'komoda-brando-2d2s-b2', '', '', '', 'Komoda BRANDO 2D2S B2', '', '', '', ''),
(384, 1, 1, 'W wysokiej komodzie TERNI zorganizujesz poskładane ubrania, tekstylia domowe, jak i elementy dodatkowej zastawy stołowej. Niezależnie, w którym pokoju ją umieścisz, nie zajmie wiele przestrzeni, a zapewni dodatkowe miejsce do przechowywania. Delikatne frezowanie na frontach dodatkowo urozmaici wnętrze. WNĘTRZE Komoda jest wyposażona w 2 wnęki za drzwiami i 2 szuflady. Maksymalne obciążenie półki wynosi 10 kg . WYKOŃCZENIE Czarne, metalowe uchwyty tworzą ciekawy kontrast z kolorem mebla. Jasnoszare wykończenie komody TERNI nie przytłoczy wnętrza i wprowadzi do niego nowoczesny klimat. KOLEKCJA TERNI Kolekcja TERNI wyróżnia się dużą ilością brył, dzięki czemu możesz urządzić mieszkanie w spójnym stylu. Meble z kolekcji sprawdzą się w pokoju dziennym, młodzieżowym czy jednoosobowej sypialni.', '', 'komoda-terni-2d2s', '', '', '', 'Komoda TERNI 2D2S', '', '', '', ''),
(385, 1, 1, 'W pokoju Twojego nastoletniego dziecka zawsze dużo się dzieje, więc szukasz mebli do zadań specjalnych, które pomogą w organizacji przestrzeni? A może kolekcja mebli KUBO? Duża komoda z wnęką KUBO to mebel, na którym Twoje dziecko poustawia rzeczy, którymi chce się pochwalić. Wymiary wnęki: 43 x 35,5 x17,5. Za drzwiami schowa to, co chce ukryć, a w praktycznych szufladach poukłada na przykład ubrania. DWA KOLORY Ciepła kolorystyka boków i wnęk otwartych sprawia, że meble z kolekcji KUBO dodadzą przytulności pomieszczeniu. Białe, błyszczące fronty dodatkowo odbijają najwięcej promieni słonecznych, dlatego rozjaśnią i optycznie powiększą przestrzeń młodzieżowego pokoju. MEBLE DLA NASTOLATKA W pokoju nastolatka nie trudno o chaos, dlatego najlepiej sprawdzą się w nim meble ułatwiające przechowywanie i ukrywanie swoich małych skarbów. Meble z serii KUBO to kolekcja brył, gdzie możecie posegregować i schować zarówno podręczniki, jak i zabawki i kolekcję ulubionych przedmiotów.', '', 'duza-komoda-do-pokoju-mlodziezowego-kubo', '', '', '', 'Duża komoda do pokoju młodzieżowego KUBO', '', '', '', ''),
(386, 1, 1, 'Komoda YOOP z kolekcji młodzieżowej w pięknej kolorystyce dębu sonoma, przełamanej wstawkami w dekorze antracytu świetnie wpisze się w aranżację pokoju nastolatka. Uniwersalna kolorystyka sprawia, że pasuje niemal do każdego wnętrza. Ciepły odcień dębu rozjaśni pomieszczenie i sprawi, że będzie ono bardziej przytulne.', '', 'komoda-yoop-ypk-24', '', '', '', 'Komoda YOOP YPK-24', '', '', '', ''),
(387, 1, 1, 'Dekoder, konsola, gry i inne akcesoria pomieszczą się w szerokiej szafce RTV ARCTIC. Otwarte wnęki i i szafka z drzwiami klapowymi umożliwiają łatwe rozmieszczenie sprzętów. Biało-czarna szafka RTV świetnie wpisuje się w nowoczesne aranżacje wnętrz. Białe fronty wykończone na wysoki połysk sprawiają, że szafka nie przytłoczy przestrzeni wypoczynkowej, a dodatkowo ją rozświetli. WNĘTRZE Pod blatem znajduje się wnęka , w której możesz umieścić dekoder czy konsolę. W 2 wnękach za drzwiami przechowasz potrzebne akcesoria. Szklaną półkę możesz doposażyć w oświetlenie (za dopłatą), dzięki czemu kącik wypoczynkowy zaprezentuje się nowocześnie i elegancko . Pasujące oświetlenie: Z-1SQR-AL-TR-BC-WN WYKOŃCZENIE Szafka RTV jest wykonana z płyty meblowej i wykończona melaminą. Frezowania na froncie urozmaicają wnętrze i podkreślają nowoczesną aranżację mieszkania.', '', 'szafka-rtv-arctic-1k', '', '', '', 'Szafka RTV ARCTIC 1K', '', '', '', ''),
(388, 1, 1, 'Szeroka komoda BILBAO 2D3S pomoże uporządkować ubrania i bieliznę w sypialni, tekstylia domowe w pokoju dziennym czy jadalni lub potrzebne akcesoria w przestronnym przedpokoju. Geometryczne wykończenie frontów podkreśli nietuzinkowy design wnętrza. WNĘTRZE Za drzwiami znajdują się 4 wnęki. Maksymalne obciążenie półki wynosi 5 kg. 3 szuflady są wyposażone w prowadnice kulkowe. Na blacie możesz ułożyć stylowe dekoracje lub pamiątki, które wprowadzą rodzinny klimat do wnętrza. Komodę wyposażono w zawiasy z cichym domykiem, więc unikniesz hałasu trzaskających drzwi. WYKOŃCZENIE Matowe wykończenie w połączeniu bieli z kolorem drewna, wysokie nóżki i czarne uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. NOWOCZESNE MEBLE DO SALONU Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty w kilku bryłach kolekcji nadają wnętrzu nietuzinkowego charakteru. Duża ilość brył BILBAO w różnych rozmiarach pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz oraz urządzić salon z jadalnią w spójnym stylu.', '', 'komoda-szeroka-bilbao', '', '', '', 'Komoda szeroka BILBAO', '', '', '', ''),
(389, 1, 1, 'Komoda MORIS w kolorystyce dąb artisan jest idealną propozycją dla pokoju dziennego, w którym główną rolę odgrywa naturalność. Można zestawić z meblami w stylu nowoczesnym oraz skandynawskim. Dodatkowo na uwagę zasługuje subtelne zdobienie w środkowej części bryły podkreślone przez oświetlenie mebla. Kolorystyka dębu wzbogaca przestrzeń i wspaniale prezentuje się we wnętrzach lubiących światło. Proste, oszczędne wzornictwo brył kolekcji MORIS pozwala na dużą dowolność pod kątem indywidualnych rozwiązań przy wyborze wystroju wnętrza. WNĘTRZE Komoda MORIS posiada trzy szuflady oraz dwie szafki – idealne rozwiązanie pod kątem umieszczenia w nich ubrań, dokumentów lub przydatnych przedmiotów osobistych. WYKOŃCZENIE Komoda MORIS została wykonana z płyty meblowej, wykończonej laminatem. Posiada oświetlenie LED umieszczone przy ozdobnej części mebla pomiędzy blatem a szafką i szufladami. Uchwyty w czarnym kolorze w przyjemny sposób kontrastuje z jasnymi frontami i blatami.', '', 'komoda-moris-2d3s-z-oswietleniem', '', '', '', 'Komoda MORIS 2D3S z oświetleniem', '', '', '', ''),
(390, 1, 1, 'Jeżeli szukasz komody, która będzie pasować do Twojego loftowego pomieszania , wybierz komodę BOSCO . Laminat z wyraźnym rysunkiem drewna i czarnymi frontami nadają kolekcji surowy charakter. WNĘTRZE Komoda ma 3 pojemne szuflady i 2 wnęki za drzwiami. Maksymalne obciążenie półki wynosi 5 kg, więc będziesz mógł umieścić w niej dokumenty i inne przedmioty. WYKOŃCZENIE Front komody został wykonany z płyty meblowej wykończonej laminatem w kolorach: imitującym drewno dębowe oraz matowej czerni .', '', 'komoda-loftowa-bosco', '', '', '', 'Komoda loftowa BOSCO', '', '', '', ''),
(391, 1, 1, 'Potrzeba Ci więcej miejsca? Za poczwórnymi drzwiami wysokiej komody z serii MANN RIVER znajdziesz przestrzeń, której zawsze Ci brakowało. Na 8 półkach ułożysz talerze, miski, szklanki i kieliszki. W szufladzie schowasz obrusy, serwety albo sztućce. Jednym słowem, wszystko to, co może się przydać, kiedy odwiedzą Cię znajomi. Połączenie koloru jasnego drewna z elegancką czernią sprawia, że wysoka komoda MANN RIVER, to idealny mebel do przestronnych, nowoczesnych pomieszczeń. WNĘTRZE Na każdej z 8 półek pomieścisz rzeczy o wadze do 5 kg. W szufladzie schowasz lżejsze przedmioty. WYKOŃCZENIE Komodę wykonano z płyty meblowej i pokryto folią w kolorze Dębu Waterford. Front szuflady i fragmenty boków wykończono czarnym laminatem. Szufladę zamontowano na prowadnicach kulkowych. Uchwyty wykonano z aluminium w czarnym kolorze.', '', 'komoda-loftowa-mann-river-wysoka', '', '', '', 'Komoda loftowa MANN RIVER wysoka', '', '', '', ''),
(392, 1, 1, 'KOMODA PAUL Komoda PAUL to świetny pomysł na aranżację pokoju dziennego, salonu, a dzięki uniwersalnej budowie także innych pomieszczeń. Wszystko zależy od tego co chcesz w niej przechowywać. Ciekawa stylistyka została uzyskana dzięki ścięciom górnej krawędzi mebli, które wykonano z listew MDF. Białe fronty ujęte w ramę w kolorze dębu współgrają z nowoczesną formą brył. WYKOŃCZENIE Komodę wykonano z płyt meblowych pokrytych folią i wstawkami z płyt MDF.', '', 'komoda-paul', '', '', '', 'Komoda PAUL', '', '', '', ''),
(393, 1, 1, 'Lubisz kiedy wszystko jest na wysoki połysk? Komoda 3 drzwiowa biały połysk FLORO, to nowoczesny mebel, obok którego nie da się przejść obojętnie. Lśniące białe fronty, zachęcają do wstawienia jej do pomieszczeń urządzonych w industrialnym klimacie. Pojemne szafki i szuflady kuszą, żeby schować do nich to, co warto mieć pod ręką. Od kompletu zabytkowej porcelany, przez sztućce, aż po tekstylia. Masz inny pomysł? Świetnie! W końcu to Twoja komoda. WNĘTRZE Na każdej z 6 półek schowanych za potrójnymi drzwiami zmieścisz rzeczy, których waga nie przekracza 5 kg. 3 szuflady zlokalizowane w górnej części komody przydadzą się na mniejsze przedmioty. WYKONANIE Korpus komody 3 drzwiowej biały połysk FLORO, wykonano z 16 mm płyty meblowej. Korpus mebla pokryto laminatem w kolorze sosny norweskiej. Front został zrobiony z płyty MDF o grubości 16 mm. Materiał, którym pokryto front, to folia PVC o białym połysku. Uchwyty drzwi oraz szuflad zrobiono z tworzywa sztucznego. Szuflady zamontowano na prowadnicach bez hamulca. Mebel osadzono na nogach z tworzywa sztucznego.', '', 'komoda-3-drzwiowa-bialy-polysk-floro', '', '', '', 'Komoda 3 drzwiowa biały połysk FLORO', '', '', '', ''),
(394, 1, 1, 'Komoda DORIAN wchodzi w skład kolekcji mebli przeznaczonej dla salonu, pokoju dziennego lub jadalni. Doskonale prezentuje się jako mebel funkcjonalny oraz ekspozycyjny. Można na niej ustawić ozdoby dekoracyjne, kwiaty lub rodzinne pamiątki. Natomiast wewnątrz schować elementy zastawy, obrusy, dokumenty lub potrzebne na co dzień drobiazgi. Kolorystyka mebla w odcieniu dąb april została wzbogacona czarnymi wstawkami, ponadto zamiast nóżek w komodzie DORIAN zastosowano ozdobny cokół - również utrzymany w czarnym kolorze. Kontrastowe zestawienie sprawia, że kolekcja DORIAN może zostać ustawione zarówno w jasnym, jak i ciemniejszym wnętrzu, świetnie prezentuje się w towarzystwie szarości oraz w zestawieniu z meblami utrzymanymi w nowoczesnej stylistyce. WNĘTRZE Komoda DORIAN posiada 3 szuflady na prowadnicach kulkowych i zamykaną szafkę. Maksymalne obciążenie półek wynosi 5 kg . WYKOŃCZENIE Korpus, blat i półki komody DORIAN wykonane zostały z płyty meblowej i wykończone laminatem. Natomiast frontowa część z płyty MDF opatrzonej wysokiej jakości folią PVC. Całości dopełniają minimalistyczne uchwyty z tworzywa sztucznego. Komoda DORIAN została wyposażona w system podświetlenia ciepłym, białym światłem. Jego klasa energetyczna to A++ .', '', 'komoda-dorian-dn2-1d3s-z-oswietleniem', '', '', '', 'Komoda DORIAN DN2 1D3S z oświetleniem', '', '', '', ''),
(395, 1, 1, 'Biała komoda QUEBEC to mebel w najbardziej uniwersalnym kolorze, dzięki któremu łatwo dopasujesz ją do swojego wnętrza. Biel będzie niezastąpiona wszędzie tam, gdzie w pomieszczeniu jest niewiele światła, rozjaśniając optycznie pomieszczenie. Komoda znajdzie swoje zastosowanie w przedpokoju, salonie, jadalni czy sypialni. Proste uchwyty w srebrnym kolorze doskonale pasują do bryły mebla. WNĘTRZE Wnętrze dwudrzwiowej komody zostało wyposażone w 6 wnęk za drzwiami i 4 szuflady dla łatwiejszego rozmieszczenia rzeczy. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej pokrytej laminatem, front mebla jest wykonany z płyty MDF pokrytej folią PCV.', '', 'komoda-quebec-3', '', '', '', 'Komoda QUEBEC 3', '', '', '', ''),
(396, 1, 1, 'Regał MAURO to minimalistyczna bryła w białym kolorze. Sprawdzi się w małych wnętrzach lub może być podstawą większej kombinacji, kiedy zmienią się Twoje potrzeby. Regał możesz wykorzystać jako miejsce do uporządkowania dokumentów w domowym biurze lub jako półkę na książki i czasopisma w kąciku do czytania. Możesz ustawić na nim kwiaty lub stylowe dekoracje. Lekka i uniwersalna konstrukcja pozwala na wiele możliwości wykorzystania bryły. Wnęka ma wymiary 33x33 cm. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. Regał MAURO MXXR111 występuje w czterech wariantach kolorystycznych: czarnym, białym, szarym i dębowym.', '', 'regal-mauro-728x382-cm-bialy', '', '', '', 'Regał MAURO 72,8x38,2 cm biały', '', '', '', ''),
(397, 1, 1, 'Chcesz zapewnić sobie właściwy komfort podczas oglądania ulubionego serialu? Wybierz szafkę RTV BOSCO o szerokości ponad 160 cm , by umieścić na niej duży telewizor. WNĘTRZE W szafce zamontowano szeroką szufladę, w której przechowasz niewielkie akcesoria. Za zamkniętym frontem znajdują się 2 wnęki, w których możesz schować wszytko to, czego nie chcesz pokazywać. Do dolnej wnęki możesz dostać się używając drzwi klapowych. WYKOŃCZENIE Szafka RTV jest wykonana z płyty meblowej wykończonej melaminą. Połączenie czerni z kolorem drewna wprowadza do wnętrza nowoczesny i przytulny klimat.', '', 'loftowa-szafka-rtv-bosco', '', '', '', 'Loftowa szafka RTV BOSCO', '', '', '', ''),
(398, 1, 1, 'Szafka RTV z kolekcji TRASS to pomysł na ciekawą aranżację salonu, ciemniejsza kolorystyka będzie dobrze komponować się w jasnych pomieszczeniach. Szafka RTV pomieści sprzęt, dekoder lub drobne elementy typu płyty czy piloty, które możesz schować np w szufladzie. Cała kolekcja to system nowoczesnych mebli, prostych, a zarazem mających swój styl i charakter. WNĘTRZE Jednodrzwiowa szafka rtv z półką otwartą oraz jedną szufladą. Wymiary wnęki lewa/prawa: szerokość 49, cm, głębokość 42,5 cm, wysokość 10 cm (15 cm licząc z listwą) WYKOŃCZENIE Kolekcja charakteryzuje się oryginalnym kolorem dębu w połączeniu z czarnymi wstawkami. Obrzeża poziome i pionowe listwy z płyty MDF.', '', 'szafka-rtv-trass-trat121-n09', '', '', '', 'Szafka RTV TRASS TRAT121-N09', '', '', '', ''),
(399, 1, 1, 'Komoda PORTO 1D1S wkomponuje się w niewielką przestrzeń, tworząc praktyczny kąt do przechowywania. Głęboki odcień orzecha columbia wprowadza do wnętrza klimat elegancji i luksusu. Cechą charakterystyczną kolekcji jest wstawka z czarnego szkła lacobel , która nadaje meblowi oryginalny styl. Podfrezowane fronty zastępują tradycyjne uchwyty, co podnosi atrakcyjność kolekcji oraz usprawnia użytkowanie mebla. Bryły wchodzące w skład kolekcji umożliwiają gustowne umeblowanie pokoju dziennego w nowoczesnym stylu. Kolekcja dostępna jest wyłącznie w salonach Agata. WNĘTRZE Wnętrze składa się z szuflady oraz 2 wnęk w części zamkniętej. WYKOŃCZENIE Fronty wykonano z płyty MDF pokrytej folią PCV. Korpus mebla wykończono laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'komoda-porto-1d1s', '', '', '', 'Komoda PORTO 1D1S', '', '', '', ''),
(400, 1, 1, 'Komoda z nowoczesnej kolekcji mebli Kobe. To oryginalny system w ciepłym odcieniu dębu o dość ciekawych frontach. Duża komoda znajdzie swoje miejsce w pokoju dziennym, jadalni lub przedpokoju. Kobe to propozycja dla osób ceniących ciepłe i naturalne wnętrza, na pewno wniesie do aranżacji elegancję i niepowtarzalność. WNĘTRZE Komoda posiada 4 wnęki za drzwiami i 3 szuflady , w których łatwo uporządkujesz potrzebne przedmioty. WYKOŃCZENIE System Kobe to oryginalna, nowoczesna kolekcja, której fronty wykonane są z trwałego MDF. Doskonale imituje strukturę drewna dzięki czemu dodaje ciepłego klimatu we wnętrzu. Charakterystyczne są ciekawie wyfrezowane fronty oraz listwy ozdobne. Dodatkowo wszystkie bryły są bezuchwytowe.', '', 'komoda-kobe-2d3s', '', '', '', 'Komoda KOBE 2D3S', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(401, 1, 1, 'Wspólne oglądanie ulubionego serialu? Mecz drużyny, której od dawna kibicujecie? Szafka RTV z 2 szufladami ALEN z przyjemnością dotrzyma Wam towarzystwa podczas niejednego wspólnego wieczoru. Na jej blacie postawisz sporych rozmiarów telewizor . Na 2 otwartych półkach dekoder i konsolę . We wnękach schowanych za drzwiami po obu stronach szafki skryjesz; płyty , kolekcję starych filmów i gry . 2 szuflady to idealne miejsce na: ładowarki , piloty , baterie i zapasowe kable . Szafka RTV z 2 szufladami ALEN w kolorze sękatego , dębowego drewna dobrze prezentuje się w nowoczesnych, minimalistycznych wnętrzach . WNĘTRZE Półki znajdujące się pod blatem, utrzymają ciężar o wadze do 5 kg . W 2 wnękach za frontami schowasz większe i cięższe przedmioty. 2 szuflady pomieszczą rzeczy, które zawsze chciałbyś mieć pod ręką. WYKONANIE Szafkę RTV ALEN z 2 szufladami wykonano z płyty meblowej o grubości 16 mm . Mebel pokryto laminatem w kolorze sękatego dębu Bijoux – dzięki łatwiej utrzymasz powierzchnię szafki w czystości. Nogi oraz uchwyty zostały zrobione z tworzywa sztucznego w czarnym kolorze .', '', 'szafka-rtv-z-2-szufladami-alen-200-cm', '', '', '', 'Szafka RTV z 2 szufladami ALEN 200 cm', '', '', '', ''),
(402, 1, 1, 'Miłośnicy modernistycznych wnętrz zapieją z zachwytu, kiedy ujrzą komodę z kolekcji HAVANNA nawiązującej do nurtu dekoracji wnętrz z okresu lat 60 i 70 XX wieku. Minimalistyczna forma mebla uzupełniona została jedynie o proste, kontrastujące swą czernią z powierzchnią komody, uchwyty. Styl modernistyczny stawiał na piedestale przede wszystkim funkcjonalność i komoda HAVANNA spełnia ten warunek, tworząc przestrzeń, która pomieści naprawdę wiele, pomagając zachować porządek w mieszkaniu. WNĘTRZE Na wnętrze komody składają się trzy szafki, z których każda została wyposażona w pojedynczą półkę. Dodatkowo, nad środkową z szafek, znajduje się szuflada, która pomieści najdrobniejsze przedmioty. WYKOŃCZENIE Komoda została pokryta folią we wzorze postarzonego dębu, która ociepla nieco wizerunek surowej bryły mebla. Czarne, podłużne uchwyty urozmaicają pozbawiony elementów ozdobnych kształt.', '', 'komoda-havanna-3d1s', '', '', '', 'Komoda HAVANNA 3D1S', '', '', '', ''),
(403, 1, 1, 'Jeśli chcesz uporządkować obuwie w swoim niewielkim przedpokoju, przyda Ci się szafka na buty CANBERRA. Szafka ma głębokość 29,8 cm i szerokość 45 cm więc zajmuje mało miejsca. Szafkę w formie otwartego regału możesz także ustawić w swojej garderobie lub w zamykanym schowku. WNĘTRZE Szafka ma ponad 2 m wysokości i posiada aż 8 półek , na które można odłożyć obuwie. Każda półka jest ustawiona pod lekkim skosem, dzięki czemu szafka zajmuje tak mało miejsca. Każda półka zakończona jest wyższym brzegiem, który zapobiega zsunięciu się butów. WYKOŃCZENIE Szafka na buty została wykonany z płyty meblowej i wykończona folią w białym kolorze . Możesz zestawić ją z garderobą do przedpokoju CANBERRA.', '', 'szafka-wysoka-na-buty-canberra', '', '', '', 'Szafka wysoka na buty CANBERRA', '', '', '', ''),
(404, 1, 1, 'Komoda PRISCO świetnie prezentuje się w salonie oraz jadalni. Doskonale nadaje się nie tylko do przechowywania książek, dekoracji oraz osobistych drobiazgów, ale również eksponowania elementów dekoracyjnych. Nowoczesny design komody PRISCO cechują wyważone elementy dekoracyjne oraz kolorystyka, która łączy wybarwienie dąb craft złoty z czarnym kolorem. WNĘTRZE Komoda posiada 2 zamykane szafki Szuflada znajduje się w górnej części mebla W zamkniętym wnętrzu znajdują się 4 półki Maksymalny udźwig blatu komody wynosi 20 kg WYKOŃCZENIE Komoda została wykonana z płyty meblowej, wykończonej laminatem Frezowane fronty pełnią funkcję uchwytów. Są wygodne w użyciu i estetycznie wykonane Wnętrze można wykorzystać do trzymania książek, zastawy, dekoracji oraz osobistych drobiazgów', '', 'komoda-2-drzwiowa-z-szuflada-dab-craft-zloty-prisco', '', '', '', 'Komoda 2-drzwiowa z szufladą dąb craft złoty PRISCO', '', '', '', ''),
(405, 1, 1, 'Komoda TEMPRA 2 2D2S wyposażona jest w 2 drzwi oraz 2 szuflady . Dzięki takiemu rozkładowi jest idealnym meblem do przechowywania książek i drobnych gadżetów. WNĘTRZE W 3 wnękach możesz przechowywać przedmioty o wadze maksymalnej 5 kg 2 szuflady to idealne miejsce na drobiazgi WYKOŃCZENIE Została wykonana z płyty meblowej, pokrytej folią. Uchwyty zostały wykonane z tworzywa - są niewielkie i ładnie uzupełniają front mebla. Kolorystyka dąb artisan umożliwia zestawienie komody z meblami w stylu rustykalnym oraz industrialnym. Ładnie komponuje się również z meblami osadzonymi na czarnych profilach. MIEJSCE NA WSZYSTKO Kolekcja komód i regałów TEMPRA 2 sprawi, że w Twoim domu znajdzie się miejsce na wszystko. Przy jej pomocy możesz urządzić domową czytelnię, gabinet lub przedpokój. Dzięki tej kolekcji zachowasz porządek wśród ubrań, dokumentów, potrzebnych drobiazgów, a nawet ubrań.', '', 'komoda-tempra-2-niska-2d2s-dab-artisan', '', '', '', 'Komoda TEMPRA 2 niska 2D2S, dąb artisan', '', '', '', ''),
(406, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model średniej wielkości regału z trzema wnękami . Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Regał TEMPRA 2 został wykonany z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma.', '', 'regal-tempra-2-t2kr40-d30f', '', '', '', 'Regał TEMPRA 2 T2KR40-D30F', '', '', '', ''),
(407, 1, 1, 'Szafka RTV ROMA najlepiej sprawdza się jako element umeblowania pokoju dziennego. Wyróżnia się nowoczesnym designem. W idealnych proporcjach łączy w sobie funkcjonalność oraz walory ozdobne. Jest ustawnym, stabilnym meblem, który dobrze wygląda w połączeniu z telewizorem lub sprzętem grającym. Dzięki oryginalnej kolorystyce szafka RTV ROMA idealnie pasuje do wnętrz jasnych, wzbogaconych drewnianymi elementami dekoracyjnymi. Jej proste, oszczędne wzornictwo pozwala na dużą dowolność pod katem indywidualnych rozwiązań aranżacyjnych. Na szczególną uwagę zasługuje fakt, ze szafka została wyposażona w specjalne zawiasy, które sprawiają, że drzwi domykają się cicho i delikatnie. WNĘTRZE RTV ROMA to pojemna szafka w sam raz na kolekcje filmów, dokumenty, gazety lub przydatne przedmioty osobiste. Posiada również klasyczne dla tego typu mebla rozwiązanie, czyli funkcjonalną wnękę pod blatem o wymiarach 153x40x10 cm. WYKOŃCZENIE Elementy wykończeniowe szafki stanowi połączenie płyty meblowej MDF z laminatem w kolorze białym. Ponadto powierzchnia drzwi została specjalnie wyprofilowana tak, by móc szybko i sprawnie otwierać je i zamykać bez potrzeby korzystania z uchwytów. Jest to rozwiązanie, które również doskonale sprawdza się pod kątem dekoracyjnym.', '', 'szafka-rtv-roma-ro-12', '', '', '', 'Szafka RTV ROMA RO-12', '', '', '', ''),
(408, 1, 1, 'Potrzebujesz dodatkowego mebla do przechowywania, a pokój jest mały? Głęboka na 34 cm komoda OSLO jest idealna do niewielkich pomieszczeń. Sprawdzi się w wąskim przedpokoju, domowym biurze, pokoju dziennym czy młodzieżowym. Jasne fronty połączone z korpusem w kolorze drewna to ponadczasowa propozycja do wielu aranżacji. Dodatkowo takie wybarwienie nie przytłacza wnętrza. WNĘTRZE Za drzwiami znajdziesz 3 wnęki, w których łatwo uporządkujesz potrzebne przedmioty. 2 szuflady przydadzą się na drobne akcesoria. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się w nowoczesnych i skandynawskich aranżacjach.', '', 'komoda-oslo-2d2s', '', '', '', 'Komoda OSLO 2D2S', '', '', '', ''),
(409, 1, 1, 'Mała komoda BILBAO pomoże uporządkować niewielkie akcesoria w pokoju dziennym, jadalni czy przedpokoju. WNĘTRZE 3 szuflady są wyposażone w prowadnice kulkowe. Na blacie możesz ułożyć stylowe dekoracje lub pamiątki, które wprowadzą przytulny i rodzinny klimat do wnętrza. WYKOŃCZENIE Matowe wykończenie w połączeniu bieli z kolorem drewna, wysokie nóżki i czarne uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. NOWOCZESNE MEBLE DO SALONU Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty w kilku bryłach kolekcji nadają wnętrzu nietuzinkowego charakteru. Duża ilość brył BILBAO w różnych rozmiarach pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz oraz urządzić salon z jadalnią w spójnym stylu.', '', 'mala-komoda-z-3-szufladami-bilbao', '', '', '', 'Mała komoda z 3 szufladami BILBAO', '', '', '', ''),
(410, 1, 1, 'Komoda SNOW w białym kolorze idealnie wpisze się w każde wnętrze. Prosty kształt mebla został otoczony pogrubioną ramą, a fronty ozdobione poziomymi frezowaniami. Biel świetnie komponuje się ze wszystkimi kolorami, co daje nieskończone możliwości w tworzeniu własnych aranżacji. Srebrne uchwyty i nóżki idealnie komponują się z białą stylistyką mebla, podkreślając jego nowoczesny charakter. WNĘTRZE Komoda składa się z szuflady i półek, które pomogą rozmieścić rzeczy i wygodnie je uporządkować. WYKOŃCZENIE Szuflada wyposażona została w system cichego domykania, który zapobiega gwałtownym uderzeniom. PLIKI DO POBRANIA Instrukcja montażu: Pobierz &gt;&gt; Ulotka: Pobierz &gt;&gt;&gt;', '', 'komoda-snow-snwk22', '', '', '', 'Komoda SNOW SNWK22', '', '', '', ''),
(411, 1, 1, 'Szafka RTV z kolekcji nowoczesnych mebli Kobe. To oryginalny system w ciepłym odcieniu dębu o dość ciekawych frontach. Szafka RTV KOBE jest praktycznym segmentem, na którym postawisz telewizor, przechowasz sprzęt oraz drobiazgi typu piloty lub gry. Kobe to propozycja dla osób ceniących ciepłe i naturalne wnętrza. Wniesie do aranżacji elegancję i niepowtarzalność. WNĘTRZE Szafkę wyposażono w 4 wnęki za drzwiami i szufladę . Otwarta wnęka to świetne miejsce na dekoder. WYKOŃCZENIE System Kobe to oryginalna, nowoczesna kolekcja, której fronty wykonane są z trwałego MDF. Doskonale imituje strukturę drewna dzięki czemu dodaje ciepłego klimatu we wnętrzu. Charakterystyczne są ciekawie wyfrezowane fronty oraz listwy ozdobne. Dodatkowo wszystkie bryły są bezuchwytowe.', '', 'szafka-rtv-szeroka-kobe', '', '', '', 'Szafka RTV szeroka KOBE', '', '', '', ''),
(412, 1, 1, 'Komoda-domek to marzenie niejednego malucha. Pod uroczym daszkiem zmieszczą się lalki lub pluszaki. Komoda z daszkiem LOEN to świetna ekspozycja dla ulubionych zabawek lub książeczek. Dzięki wykończeniu w kolorze bieli oraz szarości łatwo dopasujesz komodę do większości aranżacji. Sprawdzi się zarówno w pokoju dziewczynki, jak i chłopca. WNĘTRZE Do dyspozycji masz 2 szuflady i 4 otwarte wnęki. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej i wykończona laminatem . Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości. BAJKOWE MEBLE DO POKOJU DZIECKA Meble LOEN do pokoju dziecka stworzą prawdziwie bajkową scenerię. Komoda i łóżeczko w kształcie domku , śliczne uchwyty przypominające chmurki pobudzają wyobraźnię i zachęcają do zabawy.', '', 'regal-domek-loen-2s', '', '', '', 'Regał domek LOEN 2S', '', '', '', ''),
(413, 1, 1, 'Szukasz nieoczywistej komody do pokoju swojego dziecka? Komoda z półkami z kolekcji mebli IMOLA to mebel, w którym Twoje dziecko będzie mogło schować nie tylko bibeloty i gry, ale również podręczniki i zeszyty szkolne. ZA DRZWIAMI Komoda ma 3 duże wnęki do przechowywania. Meble wprowadzą do pokoju młodego człowieka estetyczny wygląd, ale również ponadczasowość na ładnych kilka lat! 3 KOLORY Połączenie 3 kolorów to mieszanka koloru szarego przypominającego surowy beton , bieli oraz dębu. Meble wprowadzą do pokoju młodego człowieka estetyczny wygląd, ale również ponadczasowość na ładnych kilka lat! MEBLE DO ZADAŃ SPECJALNYCH W pokoju Twojego nastolatka zawsze dużo się dzieje, więc utrzymanie w nim porządku może być nie lada wyzwaniem. Jeśli szukasz mebli, które pomogą Ci uporządkować rzeczy dziecka, mamy dla Ciebie kolekcję do zadań specjalnych - IMOLA . Meble mają dużo wydzielonych wnęk do przechowywania pamiątek, którymi Twój nastolatek będzie chciał się pochwalić, a także półek za zamkniętymi drzwiami w sam raz do ukrywania skarbów.', '', 'komoda-z-polkami-do-pokoju-mlodziezowego-imola', '', '', '', 'Komoda z półkami do pokoju młodzieżowego IMOLA', '', '', '', ''),
(414, 1, 1, 'Szukasz dużej szafki pod TV i lubisz meble w kolorze drewna? Dzięki szafce RTV POLDARK posegregujesz płyty i bezpiecznie przechowasz sprzęt RTV. Wnęka otwarta, zamknięte szafki i szuflada pozwalają rozmieścić przedmioty w taki sposób, by bez problemu znaleźć to, co jest w danej chwili potrzebne. WNĘTRZE W 4 przestronnych wnękach szafki swobodnie pomieści się spora ilość akcesoriów i gadżetów, kolekcji filmów i gier. Maksymalne obciążenie półek wynosi 5 kg . Umieszczona pośrodku pod blatem otwarta wnęka to idealne miejsce na dekoder czy konsolę. Umieszczony z tyłu otwór pozwala ukryć nieestetycznie wyglądające kable. Wymiary otwartej wnęki to: 49/37/16 cm (szerokość/głębokość/wysokość) Szuflada na prowadnicach rolkowych przyda się na drobiazgi. WYKOŃCZENIE Korpus oraz półki są wykonane z płyty wiórowej o grubości 1,6 cm i wykończone laminatem . Fronty drzwiczek oraz szuflady są wykonane z połączenia płyty wiórowej i płyty MDF . Wykończenie frontów folią PVC w barwie dąb wotan podnosi jakość oraz trwałość mebla oraz nie sprawia żadnych trudności w utrzymaniu w czystości. DO JAKIEGO WNĘTRZA PASUJE SZAFKA RTV POLDARK? Szafka sprawdzi się we wnętrzach wypełnionych ciepłymi barwami, drewnem i metalem. Meble z kolekcji POLDARK wniosą do mieszkania przytulny klimat ponadczasowej estetyki prostoty i komfortu bezpieczeństwa.', '', 'szafka-rtv-poldark-2d1s', '', '', '', 'Szafka RTV POLDARK 2D1S', '', '', '', ''),
(415, 1, 1, 'Szafka na buty IRYS to niewielki mebel o prostej, minimalistycznej formie, która sprawia, że bryła pasuje do nowoczesnych wnętrz. Sprawdzi się szczególnie w niewielkich przedpokojach, gdzie zależy nam na utrzymaniu porządku. Połączenie bieli z barwą dębu sonoma stworzy w przedpokoju spokojną atmosferę, dzięki której wnętrze nie będzie przytłoczone. Możesz zestawić szafkę z pozostałymi meblami z kolekcji IRYS i stworzyć spójną stylistycznie aranżację przedpokoju. WNĘTRZE Szafka posiada cztery zamykane wnęki, dzięki którym z łatwością posegregujesz buty; Maksymalne obciążenie półek wynosi 5 kg. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej o grubości 1,6 cm i pokryta laminatem w ciekawym połączeniu barwy dębu sonoma oraz klasycznej bieli; Powierzchnię płyty laminowanej bardzo łatwo utrzymać w czystości – wystarczy użyć miękkiej, zwilżonej ściereczki; Srebrny uchwyt z tworzywa odznacza się prostą, minimalistyczną stylistyką i świetnie pasuje do nowoczesnego designu kolekcji IRYS.', '', 'szafka-na-buty-irys', '', '', '', 'Szafka na buty IRYS', '', '', '', ''),
(416, 1, 1, 'Jeśli zależy Ci na spójnej aranżacji salonu, która długo nie wyjdzie z mody, wybierz szafkę RTV kolekcji SIENNA. Na długim blacie zmieści się duży telewizor, dekoder, konsola a nawet dodatkowe dekoracje. Niska szafka w białym kolorze estetycznie wkomponuje się we wnętrze salonu, powiększy optycznie przestrzeń. WNĘTRZA W otwartej wnęce zmieszczą się niewielkie sprzęty elektroniczne. Szafki przydadzą się do uporządkowania kolekcji gier. W szufladzie wygodnie przechować drobne akcesoria. WYKOŃCZENIE Szafka wykonana jest z płyt meblowych i wykończona folią. Białe, połyskujące fronty powiększą optycznie pomieszczenie. Frezowane uchwyty sprawiają, że szafka prezentuje się minimalistycznie. Brak nóżek ułatwi Ci utrzymanie czystości.', '', 'szafka-rtv-sienna', '', '', '', 'Szafka RTV SIENNA', '', '', '', ''),
(417, 1, 1, 'Komoda MORIS w kolorystyce dąb artisan jest idealną propozycją dla pokoju dziennego, w którym główną rolę odgrywa naturalność. Można zestawić z meblami w stylu nowoczesnym oraz skandynawskim. Kolorystyka dębu wzbogaca przestrzeń i wspaniale prezentuje się we wnętrzach lubiących światło. Proste, oszczędne wzornictwo brył kolekcji MORIS pozwala na dużą dowolność pod kątem indywidualnych rozwiązań przy wyborze wystroju wnętrza. WNĘTRZE Komoda MORIS posiada trzy szuflady oraz otwieraną szafkę z półką – idealne rozwiązanie pod kątem umieszczenia w nich ubrań, dokumentów lub przydatnych przedmiotów osobistych. WYKOŃCZENIE Komoda MORIS posiada oświetlenie LED umieszczone przy ozdobnej części mebla pomiędzy blatem a szafką i szufladami. Uchwyty zostały wykończone czarnym kolorem , który w przyjemny sposób kontrastuje z jasnymi frontami.', '', 'komoda-moris-1d3s-z-oswietleniem', '', '', '', 'Komoda MORIS 1D3S z oświetleniem', '', '', '', ''),
(418, 1, 1, 'Szafka RTV MORIS w kolorystyce dąb artisan jest idealną propozycją dla pokoju dziennego, w którym główną rolę odgrywa naturalność. Można zestawić z meblami w stylu nowoczesnym oraz skandynawskim. Kolorystyka dębu wzbogaca przestrzeń i wspaniale prezentuje się we wnętrzach lubiących światło. Proste, oszczędne wzornictwo brył kolekcji MORIS pozwala na dużą dowolność pod kątem indywidualnych rozwiązań przy wyborze wystroju wnętrza. WNĘTRZE Szafka RTV MORIS posiada dwie szuflady oraz półki otwarte umieszczone w centralnej części mebla - w sam raz na kolekcje filmów, dokumenty, gazety lub przydatne przedmioty osobiste. Wymiary wnęki dolnej: szerokość 42,5 cm, głębokość 47 cm, wysokość 14,5 cm Wymiary wnęki górnej: szerokość 42,5 cm, głębokość 47 cm, wysokość 14 cm (28 cm licząc bez listwy) WYKOŃCZENIE Szafka RTV MORIS posiada również oświetlenie LED umieszczone przy ozdobnej części mebla pomiędzy blatem a szufladami. Uchwyty zostały wykończone czarnym kolorem , który w przyjemny sposób kontrastuje z jasnymi frontami.', '', 'szafka-rtv-moris-2s-150-z-oswietleniem', '', '', '', 'Szafka RTV MORIS 2S/150 z oświetleniem', '', '', '', ''),
(419, 1, 1, 'Szeroka komoda WHITEBLACK 2D3S przyda się w każdym pokoju dziennym czy jadalni. Pomieści dokumenty, tekstylia domowe i inne akcesoria. Biało-czarna kolorystyka mebla i dekoracyjna aplikacja na froncie to elementy, dzięki którym mebel prezentuje się elegancko. WNĘTRZE W 4 wnękach za drzwiami łatwo ułożysz potrzebne przedmioty. 3 szuflady pomieszczą niewielkie akcesoria. WYKOŃCZENIE Meble WHITEBLACK są wykonane z płyt meblowych i wykończone laminatem. Fronty pokryto folią. Metalowe, czarne uchwyty świetnie pasują do nowoczesnego designu kolekcji. BIAŁE MEBLE DO SALONU Kolekcja WHITEBLACK sprawdzi się we współczesnych wnętrzach, jak i tych z elementami stylu glamour. Wyposażona w szklaną, podświetloną aplikację na frontach podkreśli nowoczesny charakter aranżacji. Dzięki zastosowaniu połysku na frontach meble nie przytłoczą pomieszczenia, a dodatkowo je rozświetlą.', '', 'komoda-whiteblack-2d3s-z-podswietlanym-dekorem', '', '', '', 'Komoda WHITEBLACK 2D3S z podświetlanym dekorem', '', '', '', ''),
(420, 1, 1, 'Kolekcja mebli do sypialni VIENNA to świetne rozwiązanie do przestrzeni o przytulnym nastroju. Prosty design kolekcji przełamany łagodnym połączeniem bieli z barwą dębu wotan ociepli wnętrze i wprowadzi ciepłą, zaciszną atmosferę w sypialni. Komoda VIENNA to niezwykle praktyczny element wyposażenia sypialni lub garderoby. Proste wykończenie w wypełni przestrzeń sypialną wnosząc ciepłą, przytulną atmosferę współgrając z wieloma możliwościami aranżacyjnymi wnętrza. WNĘTRZE ● Dwie pojemne wnęki pomieszczą sporą ilość ubrań, koców, pościeli oraz odzieży sezonowej; ● Głębokość wnęki to 65 cm ; ● Trzy pojemne szuflady na prowadnicach rolkowych świetnie sprawdzą się jako dodatkowa przestrzeń do przechowywania bielizny i dodatków. WYKOŃCZENIE ● Korpus, fronty oraz półki komody VIENNA zostały wykonane z płyty wiórowej pokrytej laminatem , dzięki czemu łatwo utrzymać je w czystości; ● Proste uchwyty z metalu neutralnie dopełniają spokojny design mebla umożliwiając wygodne otwarcie drzwiczek oraz szuflad; ● Mebel jest umieszczony na dyskretnych nóżkach z tworzywa .', '', 'komoda-vienna-2d3s', '', '', '', 'Komoda VIENNA 2D3S', '', '', '', ''),
(421, 1, 1, 'Szafka RTV z kolekcji CHARTUM to doskonały wybór do Twojego centrum rozrywki. Fornir orzechowy i czarny - połyskujący blat tworzy niepowtarzalny efekt wizualny. Dzięki jego ciemnej barwie Twoje wnętrze zyska przytulny i elegancki charakter. WNĘTRZE Otwartą wnękę możesz przeznaczyć na konsolę lub dekoder - wymiar wnęki to: 45x70 cm W każdej z bocznych szafek znajdują się 2 wnęki. Szuflada pozwoli uporządkować akcesoria. WYKONANIE Mebel wykonany z płyty MDF pokryto fornirem orzechowym i zabezpieczono lakierem . Blat pokryto czarną - połyskującą, szklaną taflą - prezentuje się bardzo elegancko. Wykorzystanie forniru naturalnego zadowoli wszystkich wielbicieli drewna i jego naturalnego charakteru. Drzwi zamykają się lekko i nie trzaskają dzięki zawiasom z cichym domykiem.', '', 'szafka-rtv-orzechowa-z-czarnym-blatem-chartum', '', '', '', 'Szafka RTV orzechowa z czarnym blatem CHARTUM', '', '', '', ''),
(422, 1, 1, 'W komodzie GLOBO możesz przechowywać odzież i bieliznę, przybory szkolne lub zabawki. W jej symetrycznej formie i stonowanej kolorystyce kryje się prosty zamysł, by meble wypełniające pokój nastolatka pomagały okiełznać zazwyczaj panujący tam chaos. Jasna kolorystyka sprzyja wyciszeniu, a odbijające się od połyskujących frontów światło, rozjaśnia wnętrze. Osoby przebywające w takiej przestrzeni mają lepszy nastrój. Blask sprawia, że pokój nabiera eleganckiego charakteru. WNĘTRZE Podwójne drzwi ułatwiają korzystanie z szafki w węższych pomieszczeniach. Dwie szuflady przydadzą się do przechowywania drobniejszych przedmiotów. Na blacie komody można wyeksponować dekoracje lub umieścić kosmetyki i biżuterię. WYKOŃCZENIE na powierzchni mebla połączono wykończenie laminatem, imitującym strukturę jasnego drewna z połyskującą bielą. Lakierowane na wysoki połysk białe fronty sprawiają, że przestrzeń wydaje się większa. Tak wykończone meble są łatwe w czyszczeniu.', '', 'komoda-globo-2d2s', '', '', '', 'Komoda GLOBO 2D2S', '', '', '', ''),
(423, 1, 1, 'Niewielka komoda ELZZAN jest uzupełnieniem dla reprezentacyjnej części mieszkania. Wyposażona w zamykaną na pojedyncze drzwi szafkę oraz 3 szuflady doskonale podkreśla nowoczesny styl kameralnego wnętrza. Komoda ELZZAN wykonana została z płyty meblowej i wykończonej białą folią z połyskiem . WNĘTRZE Komoda posiada zamykaną szafkę (z półką) i 3 szuflady. Szuflady zostały zamontowane na prowadnicach kulkowych. Wnętrze komody można swobodnie wykorzystać do trzymania zastawy oraz obrusów lub ubrań lub osobistych drobiazgów. WYKOŃCZENIE Komoda została wykonana z płyty meblowej w kolorze uniwersalnej bieli oraz pokryta folią z połyskiem Uchwyty są z aluminium i pokryte czarnym, matowym kolorem - ładnie uzupełniają front mebla KOLEKCJA ELZZAN Meble, które wchodzą w skład kolekcji ELZZAN najlepiej prezentują się w jadalni, salonie lub pokoju dziennym. Pozwalają w kompletny sposób urządzić wnętrze, a ich design cechuje prostota, uniwersalność i funkcjonalność. Pojemne wnętrza pozwalają schować używane na co dzień drobiazgi lub wyeksponować dodatki dekoracyjne i sprzęt RTV. Ich atutem jest biała kolorystyka z połyskiem .', '', 'komoda-biala-z-polyskiem-elzzan', '', '', '', 'Komoda biała z połyskiem ELZZAN', '', '', '', ''),
(424, 1, 1, 'Sztuka modernizmu sięga początku XX wieku, lecz charakterystyczne dla niej wnętrzarskie rozwiązania są nadal jak najbardziej aktualne. Geometryczne bryły, proste kąty, minimalna ilość ozdób - cechy te występują również w nowoczesnym designie, wciąż zachwycają tych, którzy stawiają na przestrzeń i funkcjonalność. Surową formę mebla przełamuje nieco okleina imitująca dębowe drewno. Wnętrze urządzone w minimalistycznej stylistyce uzupełnij materiałami takimi jak szkło, metal czy naturalne drewno, a uzyskasz konsekwentną, ciekawą aranżację. Elegancja oparta na prostocie jest ponadczasowa, więc nie musisz martwić się, że za parę lat komodę będziesz mógł wyrzucić do lamusa. WNĘTRZE Szafka składa się z dwóch, ukrytych za drzwiczkami, wnęk- mniejszej i większej. Obie przedzielono półką, co pozwala optymalnie wykorzystać ich wnętrze. Pomiędzy szafkami znajdują się cztery szuflady, które ułatwią uporządkowanie drobnych rzeczy. WYKOŃCZENIE Komoda wykończona jest folią w dekorze postarzonego dębu z widocznymi słojami. Gładką powierzchnię mebla urozmaicają maksymalnie proste, czarne uchwyty, tworzące kontrast z odcieniem okleiny.', '', 'komoda-szeroka-z-szufladami-i-polkami-havanna', '', '', '', 'Komoda szeroka z szufladami i półkami HAVANNA', '', '', '', ''),
(425, 1, 1, 'KOMODA TES Komoda TES pozwoli uzyskać oryginalne oraz dobrze zaaranżowane wnętrze. Korpus i front w kolorze orzecha ociepli wnętrze. W połączeniu z ryflowaną wstawką na tle kontrastowego czarnego szkła prezentuje się bardzo nowocześnie. Proste linie podkreślają geometryczne kształty mebla. Tes nawiązuje do natury, oferując jednocześnie funkcjonalne rozwiązania, takie jak system push zastępujący tradycyjne uchwyty czy regulowane stopki. WNĘTRZE To uniwersalny mebel, który pomoże Ci przechować wszystkie niezbędne przedmioty i uporządkować przestrzeń. WYKOŃCZENIE Korpus mebla wykonany został z płyty laminowanej, łatwiejszej w utrzymaniu czystości, fronty mebla wykonane zostały z płyty MDF.', '', 'komoda-tes-ts2', '', '', '', 'Komoda TES TS2', '', '', '', ''),
(426, 1, 1, 'ELA 1 pozwoli zorganizować przestrzeń do przechowywania obuwia nawet w małym przedpokoju. Projektanci skupili się na funkcjonalności, tworząc szafkę, która dodatkowo służy jako siedzisko. Dzięki zastosowaniu praktycznych ślizgaczy, łatwiej jest przesuwać mebel. Szafka ułatwia utrzymywanie porządku. WNĘTRZE Specjalny układ drzwi umożliwia korzystanie z mebla zarówno od frontu, jak i z góry. Dwie wnęki pozwalają zorganizować przestrzeń wewnątrz szafki według własnych potrzeb. Dzięki zastosowaniu siłownika gazowego w górnych drzwiczkach, użytkowanie mebla jest wygodne i bezpieczne. W szafce można przechowywać obuwie codzienne, kapcie dla gości lub akcesoria do czyszczenia. WYKOŃCZENIE Szafkę wykończono laminatem, który ułatwia utrzymanie jej w czystości. Białe wybarwienie wpływa na optyczne powiększenie przestrzeni. Tapicerowane siedzisko w ciemnym kolorze, dodaje meblowi elegancji.', '', 'szafka-na-buty-ela-1', '', '', '', 'Szafka na buty ELA 1', '', '', '', ''),
(427, 1, 1, 'Szukasz mebla, który pomoże uporządkować rozgardiasz w pokoju nastolatka? Komoda BICYCLE zapewnia sporo miejsca do przechowywania, a front z nadrukiem roweru urozmaica wnętrze. Komoda BICYCLE stworzy w pokoju nastolatka stylowy kącik o sportowym charakterze. Sprawdzi się nawet w niewielkich pokojach młodzieżowych. WNĘTRZE Komoda jest wyposażona w 4 szuflady na prowadnicach kulkowych. Otworzysz je za pomocą metalowych uchwytów. Blat komody to świetne miejsce na dekoracje, pamiątki lub organizery. WYKOŃCZENIE Mebel jest wykonany z płyty meblowej i wykończony laminatem w jasnoszarym kolorze. Fronty są wykończone na wysoki połysk .', '', 'komoda-bicycle-4s', '', '', '', 'Komoda BICYCLE 4S', '', '', '', ''),
(428, 1, 1, 'SZAFKA RTV SAINT TROPEZ Szafka z kolekcji Saint Tropez, w której postawiono na funkcjonalność. Ta szafka łączy w sobie niemal wszystkie zalety jakie może posiadać nowoczesny mebel. Wykonana została w połączeniu ciepłego dekoru dąb sangallo z połyskującymi białymi frontami. To ciekawe zestawienie kolorów zostało podkreślone poprzez oświetlenie zamontowane na wieńcu szafki. Dekoracyjne frezowania zastąpiły tradycyjne uchwyty. WNĘTRZE Praktyczność tej szafki RTV osiągnięto dzięki dwóm otwartym półkom na sprzęt. Nie będzie problemu z pomieszczeniem nawet szerokich urządzeń. WYKOŃCZENIE Elementem przykuwającym wzrok są niestandardowe uchwyty, które stanowią piękny akcent i dopełniają całość. W szufladach zastosowano prowadnice kulkowe z samodociągiem. W cenie szafki zawarto oswietlenie LED.', '', 'szafka-rtv-saint-tropez-z-oswietleniem', '', '', '', 'Szafka RTV SAINT TROPEZ z oświetleniem', '', '', '', ''),
(429, 1, 1, 'Komoda SNOW w kolorze białym idealnie wpisze się w każde wnętrze. Prosty kształt został otoczony pogrubioną ramą, a fronty ozdobione poziomymi frezowaniami. Biel świetnie komponuje się ze wszystkimi kolorami, co daje nieskończone możliwości w tworzeniu własnych aranżacji. Srebrne uchwyty i nóżki idealnie komponują się z białą stylistyką mebla. WNĘTRZE Komoda z trzema szufladami to optymalne rozwiązanie, by zmieścić niezbędne rzeczy i wygodnie je uporządkować. WYKOŃCZENIE Szuflady wyposażone są w system cichego domykania, który zapobiega gwałtownym uderzeniom. PLIKI DO POBRANIA Instrukcja montażu: Pobierz &gt;&gt; Ulotka: Pobierz &gt;&gt;', '', 'komoda-biala-z-3-szufladami-snow', '', '', '', 'Komoda biała z 3 szufladami SNOW', '', '', '', ''),
(430, 1, 1, 'Szeroka komoda z szufladami VELLO to odzwierciedlenie wyobrażenia o perfekcyjnie zorganizowanej przestrzeni do przechowywania. Dzięki szerokim szufladom sprawi, że zachowanie porządku w Twojej sypialni stanie się banalnie proste. WNĘTRZE 4 półki na 4 pory roku pozwolą Ci na wprowadzenie sezonowości w twojej garderobie. Tworzą 6 wnęk , w których umieścisz zarówno ubrania na dany sezon, jak i dodatki, po które sięgniesz za jakiś czas. 4 szuflady to idealne miejsce na organizery – dzięki nim od razu skompletujesz idealny zestaw kolorystyczny, wyróżniający Twój codzienny styl. Będą również doskonałym miejscem na bieliznę, skarpetki, czy podkoszulki – tworząc uzupełnienie Twojej szafy kapsułowej . Wysokie drzwiczki umieszczone są na zawiasach – umożliwią łatwy dostęp do wnętrza komody VELLO. Szuflady kulkowe z pełnym wysuwem pozwolą Ci łatwo dostrzec ten dodatek, którego akurat szukasz. WYKOŃCZENIE Prosta forma komody oraz podcięte fronty sprawdzą się w nowoczesnych wnętrzach. Kolorystka w odcieniu dębu artisan pozwoli Ci na stworzenie przytulnego nastroju w salonie , przedpokoju lub pokoju młodzieżowym . Dzięki większej przestrzeni pomiędzy blatem a frontami, w wygodny sposób uchwycisz na podcięte drzwi komody VELLO. Korpus i drzwiczki z płyty meblowej pokrytej laminatem z łatwością wyczyścisz z kurzu. Laminat w kolorze dąb artisan posiada mocno zarysowane sęki. Możesz nadać wnętrzu bardziej industrialnego charakteru, jeśli postawisz na wyraziste akcesoria.', '', 'szeroka-komoda-z-szufladami-vello', '', '', '', 'Szeroka komoda z szufladami VELLO', '', '', '', ''),
(431, 1, 1, 'Duża komoda z szufladami VELLO to doskonały wybór „dla dwojga”. Dzięki niej Pan i Pani domu wprowadzi własne zasady uporządkowania przestrzeni we wspólnej sypialni . Po 2 szuflady dla niej, 2 dla niego – idealne połączenie. WNĘTRZE 4 półki o udźwigu 5 kg sprawdzą się, gdy zechcesz skryć we wnętrzu komody kolejny, piękny komplet bielizny. 4 szuflady o tej samej wysokości, pomieszczą zestawy skarpet na cały nadchodzący tydzień WYKOŃCZENIE Podcięte fronty sprawią, że komoda VELLO prezentować się będzie atrakcyjnie w małżeńskiej sypialni. Odnajdzie się także w nowoczesnym salonie. Brak standardowych uchwytów pozwoli na zachowanie minimalizmu we wnętrzach. Wykończenie korpusu i frontów w laminacie w odcieniu dębu artisan podkreśli urok pomieszczeniu i nada mu przytulnego charakteru. Szeroka przestrzeń pomiędzy frontami umożliwia wygodne otwarcie szuflad i drzwi komody. Komoda z szufladami VELLO posiada symetryczne podziały bryły, które „cieszą oko”. Korpus i fronty wykonanie są z płyty meblowej .', '', 'duza-komoda-z-szufladami-vello', '', '', '', 'Duża komoda z szufladami VELLO', '', '', '', ''),
(432, 1, 1, 'Konstrukcja komody MOOD sprawia, że łatwo uporządkujesz w niej wiele przedmiotów, a jednocześnie podkreśli ciekawą aranżację mieszkania. Komoda MOOD świetnie pasuje do nowoczesnego pokoju młodzieżowego, salonu czy sypialni. WNĘTRZE 2 otwarte wnęki to świetne miejsce na stylowe dekoracje, książki czy organizery. Wnęka za drzwiami i 2 szuflady przydadzą się na ukrycie akcesoriów, których nie chcesz eksponować. Szuflady zostały wyposażone w prowadnice kulkowe z pełnym wysuwem. WYKOŃCZENIE Matowe wykończenie , wysokie ukośne nóżki i białe uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. MEBLE DO POKOJU MŁODZIEŻOWEGO, SYPIALNI, SALONU Szukasz pomysłu na przytulne wnętrze w bieli, szarości i kolorze drewna? Kolekcja MOOD jest dla Ciebie! Meble MOOD pomogą Ci urządzić zarówno nowoczesny pokój młodzieżowy, pokój dzienny, czy sypialnię singla. Duża ilość brył MOOD pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz.', '', 'komoda-do-salonu-sypialni-mood-1d2s', '', '', '', 'Komoda do salonu, sypialni MOOD 1D2S', '', '', '', ''),
(433, 1, 1, 'Potrzebujesz małej szafki na buty do swojego przedpokoju ? Szafka na buty BILBAO to mebel o prostych kształtach z minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz . Jasna kolorystyka szafki wprowadza do pomieszczenia przytulny klimat. Kolor: dąb artisan jest popularny, co ułatwia zestawienie mebla z innymi. WNĘTRZE Masz do dyspozycji 1 wnękę, w której przechowasz obuwie lub akcesoria. Dzięki standardowym drzwiom łatwiej Ci będzie chować i wyciągać nawet duże przedmioty. WYKOŃCZENIE Mebel jest pokryty laminatem i folią, który łatwo utrzymasz w czystości. MEBLE Z GEOMETRYCZNYM WZOREM Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty nadają wnętrzu nietuzinkowy charakter. Duża ilość mebli z kolekcji BILBAO pozwoli zaaranżować przestrzeń zarówno w przedpokoju, jak i pokoju dziennego.', '', 'szafka-na-buty-do-przedpokoju-bilbao', '', '', '', 'Szafka na buty do przedpokoju BILBAO', '', '', '', ''),
(434, 1, 1, 'Chcesz stworzyć spójne wnętrze salonu, które sprawi, że poczujesz się przytulnie, jednocześnie nie rezygnując z nowoczesnego charakteru swojego domu? Wysoka komoda VELLO dzięki prostej bryle sprawdzi się zarówno w stylizowanym, industrialnym wnętrzu, jak i minimalistycznej , nowoczesnej aranżacji. WNĘTRZE I WYKOŃCZENIE Geometryczny kształt komody sprawi, że możesz ją wkomponować w przestrzeń salonu , sypialni lub przedpokoju . Dobrze sprawdzi się także w pokoju nastolatka . Korpus i fronty w kolorze dąb artisan w odcieniu złotego drewna nadadzą wnętrzu ciepła, przełamując chłodne odcienie szarości lub równoważąc chłód betonowej posadzki. Za 2 frontami z płyty meblowej pokrytymi laminatem , kryją się 2 półki o udźwigu 5 kg . Możesz na nich ułożyć cięższe segregatory, książki, kolekcję komiksów. Korpus wykonany z płyty meblowej wykończonej laminatem . Wysokość komody to 113,9 cm – pomoże Ci wyeksponować ciekawe dodatki, ozdobne ramki lub trofea z ostatniej egzotycznej podróży.', '', 'wysoka-komoda-do-salonu-vello', '', '', '', 'Wysoka komoda do salonu VELLO', '', '', '', ''),
(435, 1, 1, 'Komoda MODERN to idealne miejsce na dziewczęce bibeloty. Wraz z pozostałymi meblami z kolekcji wprowadza do wnętrza młodzieńczy urok i elegancki połysk . Przekształca pokój dziecka w stylowy zakątek o kobiecym charakterze . Biała kolorystyka sprawia, że wnętrze wydaje się większe. WNĘTRZE W 4 szufladach możesz przechowywać bieliznę, odzież lub rzeczy osobiste. WYKOŃCZENIE Komodę wykonano z płyty meblowej i MDF. Korpusy wykończono laminatem , który jest łatwy w czyszczeniu. Fronty pokryto specjalną folią PCV , która połyskując odbija światło, rozjaśnia wnętrze i powiększa je optycznie. Rysunkowy nadruk sprawia, że mebel prezentuje się dziewczęco i oryginalnie. Uchwyty wykonano z przeźroczystego tworzywa .', '', 'komoda-z-szufladami-do-pokoju-dzieciecego-modern', '', '', '', 'Komoda z szufladami do pokoju dziecięcego MODERN', '', '', '', ''),
(436, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 2 drzwi oraz 5 szuflad , w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz szuflady umiejscowione w centralnej części bryły. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-2d5s-t2kk45-d30f', '', '', '', 'Komoda TEMPRA 2 2D5S T2KK45-D30F', '', '', '', ''),
(437, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 3 drzwi oraz 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz szuflady. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-3d2s-t2kk10-d30f', '', '', '', 'Komoda TEMPRA 2 3D2S T2KK10-D30F', '', '', '', ''),
(438, 1, 1, 'Szafka RTV PORTO 2S pozwala stworzyć elegancki i praktyczny kącik telewizyjny. Głęboki odcień orzecha columbia wprowadza do wnętrza klimat elegancji i luksusu. Cechą charakterystyczną kolekcji jest wstawka z czarnego szkła lacobel , która nadaje meblowi oryginalny styl. Podfrezowane fronty zastępują tradycyjne uchwyty, co podnosi atrakcyjność kolekcji oraz usprawnia użytkowanie mebla. Bryły wchodzące w skład kolekcji umożliwiają gustowne umeblowanie pokoju dziennego w nowoczesnym stylu. Kolekcja dostępna jest wyłącznie w salonach Agata. WNĘTRZE W 2 praktycznych szufladach łatwiej jest zorganizować domową płytotekę i przechować akcesoria biurowe. Wnęka z podziałką to idealne miejsce na dekoder i konsolę. Rozmiar wnęki: 129,4 cm x 36,6 cm x 11,5 cm WYKOŃCZENIE Fronty wykonano z płyty MDF pokrytej folią PCV. Korpus mebla wykończono laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'szafka-rtv-porto', '', '', '', 'Szafka RTV PORTO', '', '', '', ''),
(439, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 2 drzwi , w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada zamykane szafki z półkami. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-2d-t2kk60-d30f', '', '', '', 'Komoda TEMPRA 2 2D T2KK60-D30F', '', '', '', ''),
(440, 1, 1, 'Komoda HEY z programu do pokoju młodzieżowego to połączenie dwóch nowoczesnych i popularnych kolorów. Dzięki temu łatwo je łączyć z innymi meblami lub dobrać odpowiednie dodatki. Komoda w wersji z 4 szufladami i półkami będzie doskonała na wszystkie drobiazgi lub ubrania. Uniwersalna konstrukcja komody pozwoli na zastosowanie jej nie tylko w pokoju młodzieżowym, ale w każdym innym pomieszczeniu. Solidne uchwyty imitujące kolor aluminium podkreślają nowoczesny charakter i przyciągają uwagę, pozwalają na swobodne otwieranie szuflad i drzwi. Front komody jak i blat został pozbawiony tradycyjnych prostych linii co tworzy ciekawą bryłę geometryczną. WNĘTRZE Komoda wyposażona jest w 4 szuflady, wysuwane za pomocą prowadnic kulkowych i półki. WYKOŃCZENIE Mebel jest wykonany z płyty meblowej pokrytej laminatem oraz płyty i listew MDF pokrytych folią cechującymi się trwałością i łatwością w utrzymaniu czystości.', '', 'komoda-hey-heyk231-c230', '', '', '', 'Komoda HEY HEYK231-C230', '', '', '', ''),
(441, 1, 1, 'Stylowa komoda OTIS to wielofunkcyjny mebel, który sprawdzi się w salonie, sypialni, przedpokoju czy jadalni. W zależności od pomieszczenia, pomieści zapasowe szkło, tekstylia stołowe i pościelowe, dokumenty lub ubrania. Komoda z kolekcji OTIS łączy w sobie popularne i lubiane barwy - ciepły odcień dębu oraz połyskującą biel. Dodajmy do tego czarne wstawki - uchwyty, nóżki oraz delikatną, okalającą przód ramkę a otrzymamy niezwykle interesujący element aranżacji wnętrza. Zastosowany w drzwiczkach oraz szufladach system cichego domyku przyczyni się do komfortowego korzystania z komody. WNĘTRZE Za drzwiczkami znajdują się łącznie 4 wnęki do przechowywania; Pośrodku komoda posiada 3 pojemne szuflady; Podzielenie komody na dużą ilość wnęk oraz szuflad sprzyja utrzymaniu porządku wewnątrz. WYKOŃCZENIE Fronty są wykonane z płyty akrylowej, co zapewnia ich trwałość, odporność oraz wysoki połysk ; Drzwiczki i szuflady są wyposażone w system cichego domyku, dzięki któremu nie trzaskają; Dzięki swojej charakterystycznej kompozycji, komoda OTIS sprawdzi się jako element umeblowania zarówno w stylu nowoczesnym, jak i industrialnym, loftowym a nawet retro.', '', 'komoda-otis-2d3s', '', '', '', 'Komoda OTIS 2D3S', '', '', '', ''),
(442, 1, 1, 'Biała komoda QUEBEC to mebel w najbardziej uniwersalnym kolorze, dzięki któremu łatwo dopasujesz ją na wielu arażancji. Biel będzie niezastąpiona wszędzie tam gdzie w pomieszczeniu jest niewiele światła, rozjaśniając optycznie pomieszczenie. \' Komoda znajdzie swoje zastosowanie w przedpokoju, salonie, jadalni lub sypialni. Proste uchwyty w srebrnym kolorze doskonale pasują do bryły mebla. WNĘTRZE Wnętrze dwudrzwiowej komody zostało wyposażone w 6 wnęk dla łatwiejszego rozmieszczenia rzeczy. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej pokrytej laminatem, front mebla jest wykonany z płyty MDF pokrytej folią PCV.', '', 'komoda-quebec-1', '', '', '', 'Komoda QUEBEC 1', '', '', '', ''),
(443, 1, 1, 'Prostopadłościenna, pozbawiona ozdób, bryła szafki HAVANNA to doskonała propozycja umeblowania do wnętrz współczesnych, podążających za aktualnymi trendami wzornictwa. Nie jest dziełem przypadku, że mebel spodoba również miłośnikom stylu vintage, gdyż projektanci mebli czerpią inspirację z modernizmu, kierunku w sztuce, który, choć powstał na początku ubiegłego wieku jest wciąż aktualny, ponieważ stawia przede wszystkim na nieprzesadnie zapełnioną przestrzeń oraz funkcjonalną stronę umeblowania. W dzisiejszych czasach, kiedy często jedno pomieszczenie pełni wiele ról w mieszkaniu, są to cechy bardzo istotne. WNĘTRZE Szafka podzielona jest na dwie części, przedzielone półkami. WYKOŃCZENIE Szafkę pokryto folią w dekorze postarzany dąb, z którym kontrastuje czerń prostych uchwytów. Dzięki temu niby nieznaczącemu akcentowi, mebel nabiera charakteru.', '', 'szafka-havanna-2d', '', '', '', 'Szafka HAVANNA 2D', '', '', '', ''),
(444, 1, 1, 'Chcesz odmienić wygląd swojego pokoju dziennego? Postaw na nowe meble! Wystarczy, że wybierzesz jeden, nowy mebel w wyrazistym stylu - szafkę RTV lub komodę, a odświeżysz przestrzeń w swoim salonie. Mamy dla Ciebie kolekcję SANTOS z frontami wykonanymi z litego drewna i przeszkleniami . Wygląd szafki RTV SANTOS łączy w sobie cechy stylu industrialnego oraz rustykalnego, dlatego przyciągnie wzrok Twoich gości. WNĘTRZE Na blacie szafki RTV SANTOS zmieści się telewizor lub dekoder czy konsola. 2 otwarte wnęki to idealne miejsce, by schować elektronikę. Dzięki otworowi w tylnej ściance szafki uporządkujesz wszystkie kable od swojego sprzętu elektronicznego. 2 szuflady przydadzą się do schowania płyt DVD lub kolekcji gier na konsolę. RUSTYKALNY CHARAKTER Meble z kolekcji SANTOS zachwycają prostą formą oraz masywnym wyglądem. Szafkę RTV Santos docenisz za fronty z litego drewna z naturalnym rysunkiem słojów. MEBLE DO SALONU Z kolekcją SANTOS możesz urządzić salon i jadalnię w spójnym stylu. Świetnie wpiszą zarówno w nowoczesne, jak i bardziej surowe wnętrza.', '', 'szafka-rtv-z-drewnianym-frontem-santos', '', '', '', 'Szafka RTV z drewnianym frontem SANTOS', '', '', '', ''),
(445, 1, 1, 'Szukasz kolekcji mebli do salonu , które będzie charakteryzowała prosta forma i klasyczna kolorystyka ? Nie jesteś zwolennikiem wyszukanego designu , a nawiązania do wzornictwa PRL sprawiają, że czujesz się jak bohater „Powrotu do przeszłości”? Postaw ma szafkę RTV z kolekcji mebli VELLO, która wraz z Twoim telewizorem stworzy dobraną parę. Zaproś ją do swojego nowoczesnego salonu . WYGLĄD Jeśli chcesz nadać wnętrzu więcej wyrazistości, postaw na blacie ciekawą ceramikę, zdobycze z podróży do ciekawych zakątków świata lub modernistyczne figurki. Podkreślą ciepły odcień szafki RTV , wykończonej w laminacie w kolorze dąb artisan . Dzięki dużej przestrzeni między blatem i frontami – nawet męska dłoń nie będzie mieć problemu z płynnym otwarciem podciętych frontów . Fronty wykonane z płyty meblowej pokrytej laminatem utrzymują zawiasy , dzięki nim płynnie otworzysz podcięty front szafki RTV. W szerokiej szufladzie możesz umieścić mnóstwo przekąsek, które będziesz mieć zawsze pod ręką podczas spotkania z przyjaciółmi. Swobodnie do nich sięgniesz dzięki prowadnicy kulkowej z pełnym wysuwem . Szafka RTV VELLO posiada również praktyczną wnękę na router lub odtwarzacz DVD.', '', 'szafka-pod-telewizor-rtv-z-szuflada-vello', '', '', '', 'Szafka pod telewizor RTV z szufladą VELLO', '', '', '', ''),
(446, 1, 1, 'Szafka RTV TERNI świetnie uzupełni nowoczesną aranżację pokoju dziennego. Zapewnia sporo miejsca do przechowywania, a delikatne frezowanie na frontach dodatkowo urozmaica wnętrze. WNĘTRZE 2 wnęki zamykane zapewnią miejsce na płyty, gry i inne akcesoria. 2 otwarte wnęki pomieszczą dekoder i konsolę, a dzięki otworom na tylnej ściance, łatwo zorganizujesz kable. WYKOŃCZENIE Czarne, metalowe uchwyty tworzą ciekawy kontrast z kolorem mebla. Jasnoszare wykończenie szafki RTV TERNI nie przytłoczy wnętrza, a wprowadzi do niego nowoczesny klimat. KOLEKCJA TERNI Kolekcja TERNI wyróżnia się dużą ilością brył, dzięki czemu możesz urządzić mieszkanie w spójnym stylu. Meble z kolekcji sprawdzą się w pokoju dziennym, młodzieżowym czy jednoosobowej sypialni.', '', 'szafka-rtv-terni-2d', '', '', '', 'Szafka RTV TERNI 2D', '', '', '', ''),
(447, 1, 1, 'Komoda BILBAO 2D pomoże uporządkować akcesoria w pokoju dziennym, sypialni, jadalni czy przedpokoju. Geometryczne wykończenie frontów podkreśli nietuzinkowy design wnętrza. WNĘTRZE Za drzwiami znajdują się 4 wnęki. Maksymalne obciążenie półki wynosi 5 kg. Na blacie możesz ułożyć stylowe dekoracje lub pamiątki, które wprowadzą ciepły i rodzinny klimat do wnętrza. Komodę wyposażono w zawiasy z cichym domykiem, więc unikniesz hałasu trzaskających drzwi. WYKOŃCZENIE Matowe wykończenie w połączeniu bieli z kolorem drewna, wysokie nóżki i czarne uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. NOWOCZESNE MEBLE DO SALONU Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty w kilku bryłach kolekcji nadają wnętrzu nietuzinkowego charakteru. Duża ilość brył BILBAO w różnych rozmiarach pozwoli dopasować meble zarówno do przestronnych, jak i tych niewielkich wnętrz oraz urządzić salon z jadalnią w spójnym stylu.', '', 'komoda-nowoczesna-dwudrzwiowa-bilbao', '', '', '', 'Komoda nowoczesna dwudrzwiowa BILBAO', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(448, 1, 1, 'SZAFKA RTV LOCARNO Szafka RTV z kolekcji Locarno to połączenie funkcjonalności z nowoczesnym designem. Jasna kolorystyka Dębu Nelson została przełamana ryflowanymi wstawkami w głębokim odcieniu szarości, które są znakiem rozpoznawczym całej kolekcji. Subtelnie zaokrąglone fronty dodają bryłom uroku a poziome srebrne uchwyty podkreślają nowoczesny charakter mebli. WNĘTRZE Szafka posiada półki w części zamkniętej oraz szufladę. WYKOŃCZENIE Górna i dolna część drzwi oraz ryflowana wstawka zostały wykonane z płyty MDF. Srebrne uchwyty świetnie prezentują się na tle dekoru dębowego tworząc przyjemny, nowoczesny akcent.', '', 'szafka-rtv-locarno-lcrt131', '', '', '', 'Szafka RTV LOCARNO LCRT131', '', '', '', ''),
(449, 1, 1, 'Mała komoda WHITEBLACK 1D3S przyda się w każdym pokoju dziennym czy jadalni. Pomieści dokumenty, tekstylia domowe lub inne akcesoria. Biało-czarna kolorystyka mebla i dekoracyjna aplikacja na froncie to elementy, dzięki którym mebel prezentuje się elegancko. WNĘTRZE W 2 wnękach za drzwiami ułożysz potrzebne przedmioty. 3 szuflady pomieszczą niewielkie akcesoria. WYKOŃCZENIE Meble WHITEBLACK są wykonane z płyt meblowych i wykończone laminatem. Fronty pokryto folią. Metalowe, czarne uchwyty świetnie pasują do nowoczesnego designu kolekcji. BIAŁE MEBLE DO SALONU Kolekcja WHITEBLACK sprawdzi się we współczesnych wnętrzach w stylu glamour. Wyposażona w szklaną, podświetloną aplikację na frontach podkreśli nowoczesny charakter aranżacji. Dzięki zastosowaniu połysku na frontach meble nie przytłoczą pomieszczenia, a dodatkowo je rozświetlą.', '', 'komoda-whiteblack-1d3s-z-podswietlonym-dekorem', '', '', '', 'Komoda WHITEBLACK 1D3S z podświetlonym dekorem', '', '', '', ''),
(450, 1, 1, 'Nowoczesne wzornictwo oraz ciekawe połączenie kolorystyczne komody MI PIACE sprawia, że mebel nie wychodzi z mody. Sprawdzi się zarówno we współczesnej sypialni, jak i stonowanym pokoju młodzieżowym. Połączenie białych frontów z korpusami w kolorze betonu tworzą ciekawe zestawienie, dające duże możliwości aranżacyjne. Podłużne uchwyty dopełniają całość oraz świetnie łączą się z prostym designem bryły. Komponenty użyte do wykonania płyty meblowej komody MI PIACE są ekologiczne - powstały w procesie recyclingu. WNĘTRZE Wewnątrz znajduję się trzy szuflady, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Linearne uchwyty podkreślają nowoczesny charakter bryły. Dodatkowym atutem jest wykończenie na wysoki połysk poliestrowym lakierem, który nakładany w procesie suszenia z zastosowaniem promieni UV zwiększa trwałość mebla.', '', 'komoda-z-szufladami-mi-piace', '', '', '', 'Komoda z szufladami MI PIACE', '', '', '', ''),
(451, 1, 1, 'Od dawna poszukujesz pojemnej komody w stylu skandynawskim , jednak ciągle nie możesz trafić na tę idealną? Biała komoda z szufladą PLISSEE o szerokości 187,1 cm to propozycja dla Ciebie! Minimalistyczny design, prosta bryła oraz drewniane nóżki sprawią, że przestrzeń Twojego salonu pozostanie jasna i przestronna, pomimo znaczącej pojemności komody PLISSEE. Komoda posiada także żłobienia na frontach, które nadają jej unikatowego charakteru . WNĘTRZE 8 półek pozwoli Ci na optymalne wykorzystanie przestrzeni na przechowywanie odzieży. 2 symetryczne szuflady to podział idealny, jeśli szukasz miejsca na akcesoria i dodatki swoje i męża. WYKOŃCZENIE Korpus komody wykończono laminatem w białym oraz dębowym kolorze . Fronty to połączenie płyty meblowej i płyty mdf , które pokryto laminatem oraz folią. Zawiasy z cichym domykiem pozwolą Ci delikatnie zamknąć szafkę, nie budząc przy tym drzemiącego na kanapie męża. Komodę wyróżniają pionowe pasy , dodające jej odrobiny nonszalancji. Postaw na niej unikatowe dodatki i dekoracje przywiezione z zagranicznych podróży i stwórz niepowtarzalny styl wnętrza Twojego salonu . Front mebla posiada charakterystyczne żłobienie przypominające plisę . Daje on ciekawy efekt 3D , który wyróżnia bryłę spośród innych.', '', 'komoda-z-szufladami-z-ryflowanym-frontem-plissee-1871-cm', '', '', '', 'Komoda z szufladami z ryflowanym frontem PLISSEE 187,1 cm', '', '', '', ''),
(452, 1, 1, 'Nowoczesna komoda z szufladami PLISSEE pozwoli Ci podkreślić urok nowoczesnego wnętrza . Jej charakterystyczne, żłobione fronty dają efekt 3D , który urozmaica aranżację i sprawia, że w Twoim salonie zagości współczesny design . Biel optycznie powiększy przestrzeń, a geometrycznie wykończone fronty pozwolą obserwować grę światła i cienia w pomieszczeniu,. WNĘTRZE 3 szuflady to nieodzowna pomoc w odpowiednim skompletowaniu garderoby. Odtąd wszystkie dodatki możesz posegregować i utrzymywać perfekcyjny porządek. Posiadasz kolekcję ciekawych książek – wyeksponuj je na 2 otwartych półkach . Większe elementy możesz ułożyć za frontami na półkach o udźwigu 5 kg . Zawiasy z cichym domykiem pozwolą Ci delikatnie zamknąć szafkę, nie budząc przy tym drzemiącego na kanapie męża. WYKOŃCZENIE Korpus komody wykończono laminatem w białym oraz dębowym kolorze . Fronty to połączenie płyty meblowej i płyty mdf , które pokryto laminatem oraz folią. Front mebla posiada charakterystyczne żłobienie przypominające plisę . Daje on ciekawy efekt 3D , który wyróżnia bryłę spośród innych.', '', 'komoda-wysoka-z-ryflowanym-frontem-i-szufladami-plissee', '', '', '', 'Komoda wysoka z ryflowanym frontem i szufladami PLISSEE', '', '', '', ''),
(453, 1, 1, 'Szafka RTV z kolekcji SANDY to nowoczesny mebel do zastosowania w salonie. Dzięki szerokim listwom wzdłuż boków oraz krótkim, nieregulowanym nóżkom meble z kolekcji SANDY sprawiają wrażenie solidnych i masywnych. Ciepły odcień dębu dodaje pomieszczeniu przytulności, którą dodatkowo wzmaga jeszcze oświetlenie LED o ciepłej, białej barwie. Brak widocznych uchwytów i delikatne żłobienia na froncie dodają szafce elegancji. Rozmiary szafki pozwalają na swobodne postawienie dowolnej wielkości telewizora lub różnych elementów dekoracyjnych. WNĘTRZE Wnętrze szafki składa się z dwóch otwartych wnęk o wymiarach 72,5x36,5x15 cm każda, idealnych do umieszczenia sprzętu RTV. Pod wnękami znajdują się dwie praktyczne szuflady, do schowania niezbędnych drobiazgów, aby były zawsze pod ręką. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej pokrytej laminatem, front mebla jest wykonany z płyty MDF pokrytej folią PVC.', '', 'szafka-rtv-sandy-2s-s1-z-oswietleniem', '', '', '', 'Szafka RTV SANDY 2S S1 z oświetleniem', '', '', '', ''),
(454, 1, 1, 'Komoda z nowoczesnej kolekcji mebli Kobe. To oryginalny system w ciepłym odcieniu dębu o dość ciekawych frontach. Mała komoda przyda się np. na bieliznę lub inne drobne przedmioty w jadalni, salonie czy sypialni. Kobe to propozycja dla osób ceniących ciepłe i naturalne wnętrza. Wniesie do aranżacji elegancję i niepowtarzalność. WNĘTRZE Komoda posiada 2 wnęki za drzwiami i 3 szuflady , w których łatwo pogrupujesz potrzebne przedmioty. WYKOŃCZENIE System Kobe to oryginalna, nowoczesna kolekcja, której fronty wykonane są z trwałego MDF. Doskonale imituje strukturę drewna dzięki czemu dodaje ciepłego klimatu we wnętrzu. Charakterystyczne są ciekawie wyfrezowane fronty oraz listwy ozdobne. Dodatkowo wszystkie bryły są bezuchwytowe.', '', 'komoda-kobe-1d3s', '', '', '', 'Komoda KOBE 1D3S', '', '', '', ''),
(455, 1, 1, 'Komoda TES pozwoli uzyskać oryginalne oraz dobrze zaaranżowane wnętrze. Korpus i front w kolorze orzecha ociepli wnętrze. W połączeniu z ryflowaną wstawką na tle kontrastowego czarnego szkła prezentuje się bardzo nowocześnie. Proste linie podkreślają geometryczne kształty mebla. Tes nawiązuje do natury, oferując jednocześnie funkcjonalne rozwiązania, takie jak system push open zastępujący tradycyjne uchwyty czy regulowane stopki, które pozwolą ci dopasować mebel do indywidualnych potrzeb. WNĘTRZE Wnętrze składa się z dwóch szuflad i półek w części zamkniętej. WYKOŃCZENIE Korpus mebla został pokryty laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość. Fronty zostały wykonane z płyty MDF pokrytej folią PCV.', '', 'komoda-tes-ts11', '', '', '', 'Komoda TES TS11', '', '', '', ''),
(456, 1, 1, 'Szafka RTV z kolekcji WITALIA to propozycja dla wielbicieli naturalnych materiałów we wnętrzach, do zastosowania w salonie czy sypialni. Mebel został wykonany w całości z litego drewna akacjowego - twardego i trwałego, z dużą odpornością na zarysowania. Dodatkowo drewno zostało poddane postarzającemu szczotkowaniu , co jeszcze bardziej podkreśla jego autentyczność. Ciemno-szara kolorystyka oraz metalowe uchwyty i nogi dodają mu industrialnego charakteru. Wykorzystanie naturalnych materiałów sprawia, że szafka będzie ponadczasowym elementem wyposażenia. Drewno wygląda zawsze szlachetnie, ociepla pomieszczenie i świetnie komponuje się z dodatkami wykonanymi z różnych materiałów, w różnych stylach. WNĘTRZE Szafka składa się z 1 wnęki przeznaczonej dla sprzętu RTV, praktycznej szuflady na niezbędne drobiazgi oraz zamykanej wnęki. Dla większej wygody użytkowania drzwiczki zostały wyposażone w zawiasy z cichym domykiem. WYKOŃCZENIE Całość mebla została wykonana z litego drewna akacjowego. Użyte metalowe uchwyty doskonale komponują się z całością. Drewno kojarzy się z klasyką, jednak oryginalne nogi mebla dodają mu nowoczesnego charakteru, z lekkim nawiązaniem do stylu retro.', '', 'szafka-rtv-drewniana-witalia', '', '', '', 'Szafka RTV drewniana WITALIA', '', '', '', ''),
(457, 1, 1, 'Bufet WITALIA to propozycja dla wielbicieli naturalnych materiałów we wnętrzach, do zastosowania w jadalni, przedpokoju lub salonie. Mebel został wykonany w całości z litego drewna akacjowego - twardego i trwałego, z dużą odpornością na zarysowania. Dodatkowo drewno zostało poddane postarzającemu szczotkowaniu, co jeszcze bardziej podkreśla jego autentyczność. Ciemno-szara kolorystyka oraz metalowe uchwyty i nogi dodają meblowi industrialnego charakteru. Wykorzystanie naturalnych materiałów sprawia, że bufet będzie ponadczasowym elementem wyposażenia. Drewno wygląda zawsze szlachetnie, ociepla pomieszczenie i świetnie komponuje się z dodatkami wykonanymi z różnych materiałów, w różnych stylach. WNĘTRZE Bufet składa się z 3 praktycznych szuflad oraz wnęk przedzielonych półkami. Dla większej wygody użytkowania drzwiczki zostały wyposażone w zawiasy z cichym domykiem. To idealny mebel do przechowywania dodatkowych sztućców, obrusów, serwetek czy innych akcesoriów przydatnych w jadalni lub salonie. WYKOŃCZENIE Całość mebla została wykonana z litego drewna akacjowego. Użyte metalowe uchwyty doskonale komponują się z całością. Drewno kojarzy się z klasyką, jednak oryginalne nogi mebla dodają mu nowoczesnego charakteru, z lekkim nawiązaniem do stylu retro.', '', 'bufet-witalia-d01', '', '', '', 'Bufet WITALIA D01', '', '', '', ''),
(458, 1, 1, 'Komoda TRENTINO jest meblem o uniwersalnym zastosowaniu. To idealne miejsce dla: książek, zastawy oraz wielu podręcznych drobiazgów. Wnęka we frontowej części tworzy przestrzeń ekspozycyjną, którą można przeznaczyć pod dodatki dekoracyjne. Jej budowa idealnie współgra z wnętrzem zaprojektowanym w nowoczesnym stylu. Korpus dobrze prezentuje się w zestawieniu z jasnymi, wypełnionymi światłem wnętrzami. Dzięki połączeniu białych frontów z czarnymi uchwytami oraz ciemną tonacją półek w centralnej części mebla TRENTINO idealnie pasuje do wnętrz, które łączą kontrastujące ze sobą elementy. WNĘTRZE Za potrójnymi drzwiami mieści się 7 wnęk.Możesz na nich stawiać przedmioty ważące maksymalnie 5 kg. Wnęka otwarta pozwoli wyeksponować ulubione dekoracje. Dodatkowa szuflada to odpowiednie miejsce na przechowywanie drobnych przedmiotów. WYKOŃCZENIE Komoda TRENTINO została wykonana z płyty meblowej. Na szczególną uwagę zasługują fronty z płyty MDF wykończone folią z efektem połysku.', '', 'komoda-trentino-2d1w1s', '', '', '', 'Komoda TRENTINO 2D1W1S', '', '', '', ''),
(459, 1, 1, 'Szukasz pomysłu jak zagospodarować pustą ścianę? Dekoracje, rośliny, organizery ułóż w regale KABEA . Nowoczesny regał w kształcie drabiny to świetny sposób na przyciągającą wzrok aranżację. Czarno-biały regał łatwo dopasujesz do większości pomieszczeń – posłuży w pokoju dziennym, młodzieżowym, gabinecie czy pracowni. REGAŁ METALOWY NA KSIĄŻKI Czarna, metalowa konstrukcja prezentuje się nowocześnie i lekko. Regał świetnie sprawdzi się jako forma domowej biblioteczki . Białe półki z płyty meblowej to idealne miejsce na książki. WYKOŃCZENIE Metalowy stelaż wykończono farbą proszkową, a półki okleiną drewnopodobną.', '', 'regal-drabina-z-3-polkami-bialy-kabea', '', '', '', 'Regał drabina z 3 półkami biały KABEA', '', '', '', ''),
(460, 1, 1, 'Jest czarna, elegancka i poleca się do mieszkań urządzonych w minimalistycznym stylu. Komoda 3 drzwiowa czarny mat MOLDE to nowoczesny mebel, w którym czarny front koresponduje z wyraźnie zarysowanymi słojami, pokrytego laminatem w kolorze dębu Wotan, blatu. Mebel najlepiej sprawdzi się w sypialni albo pokoju dziennym. Na każdej z półek schowanych w szafkach zmieścisz komplet porcelany albo codzienną zastawę stołową. szufladzie ułożysz wykrochmalone obrusy i serwety. WNĘTRZE W szufladzie możesz trzymać tekstylia. Każda z półek schowanych w szafkach, udźwignie rzeczy o wadze do 5 kg. WYKONANIE Komoda 3 drzwiowa z kolekcji MOLDE została wykonana z 16 mm płyty meblowej. Mebel pokryto laminatem w kolorze jasnego dębu Wotan. Front komody oklejono folią PVC, w kolorze czarnego matu. Uchwyty oraz nogi wykonano z tworzywa sztucznego.', '', 'komoda-3-drzwiowa-czarny-mat-molde', '', '', '', 'Komoda 3 drzwiowa czarny mat MOLDE', '', '', '', ''),
(461, 1, 1, 'Dekoder, konsola, gry i książki pomieszczą się w dużej szafce RTV ORENSE. Otwarte półki, regał i wnęka za drzwiami klapowymi umożliwiają łatwe rozmieszczenie przedmiotów. Szafka RTV z regałem to świetne uzupełnienie nowoczesnej aranżacji pokoju dziennego. WNĘTRZE Pod blatem znajduje się wnęka , w której możesz umieścić dekoder czy konsolę. Regał połączony z szafką to świetne miejsce na książki, płyty lub inne akcesoria. We wnęce za drzwiami schowasz przedmioty, których nie chcesz eksponować. Szafkę możesz doposażyć w oświetlenie (za dopłatą), dzięki czemu kącik wypoczynkowy zaprezentuje się nowocześnie i elegancko . Pasujące oświetlenie: Z-1SQR-AL-TR-BC-WN WYKOŃCZENIE Szafka RTV jest wykonana z płyty meblowej i wykończona melaminą. Połączenie czerni z kolorem drewna wprowadza do wnętrza nowoczesny i przytulny klimat .', '', 'szafka-rtv-orense-1k', '', '', '', 'Szafka RTV ORENSE 1K', '', '', '', ''),
(462, 1, 1, 'Lubisz grać, słuchać płyt albo oglądać seriale? Szafka RTV LISABON to idealny mebel do Twojego rodzinnego centrum rozrywki. Dzięki 3 wnękom otwartym możesz wyeksponować w niej 3 razy więcej sprzętu niż w zwykłej szafce. Dzięki połączeniu szarych frontów z blatem i bokami w kolorze jasnego drewna, szafkę RTV LISABON dopasujesz do większości nowoczesnych pomieszczeń. Od pokoju dziennego, po przestronny salon, a nawet pieczarę nastolatka. Sam zdecyduj, gdzie przyda się najbardziej. Do szafki RTV LISABON dopasujesz oświetlenie SQUARE 1-punktowe. Oświetlenie sprzedawane jest oddzielnie. WNĘTRZE Na blacie postawisz telewizor albo gramofon. Za pełnymi drzwiami znajdziesz drewnianą półkę, która pomieści rzeczy o wadze do 5 kg. W 3 szufladach schowasz; pilot, pady od konsoli, zapasowe baterie i gazetę z programem. Na 2 szklanych półkach o udźwigu do 3 kg, zmieści się dekoder TV i konsola do gier. WYKOŃCZENIE Szafkę wykonano z 16 mm płyty meblowej wykończonej melaminą w kolorze dębu artisan. Front szafki z 16 mm płyty MDF wykończono szarą folią PVC. Szklane półki wykonano z hartowanego szkła o grubości 6 mm. Szuflady osadzono na prowadnicach rolkowych. W szafce RTV LISABON zamontowano plastikowe uchwyty.', '', 'szafka-rtv-szara-lisabon', '', '', '', 'Szafka RTV szara LISABON', '', '', '', ''),
(463, 1, 1, 'Nieco mniejsza od swojej siostry z tej samej kolekcji, ale równie potrzebna i urocza. Szafka RTV z 1 szufladą ALEN to uniwersalny mebel, który najlepiej wygląda w nowoczesnych , stylowych przestrzeniach. Kolor sękatego dębowego drewna , pięknie komponuje się z minimalistycznymi wnętrzami w stonowanych odcieniach. Blat zachęca, żeby postawić na nim telewizor , a na półce poniżej niedawno kupioną najnowszą konsolę . W szafkach za drzwiami zmieścisz płyty, z kolei w szufladzie; kable, baterie ipady – rozwiązanie idealne dla kolekcjonera klasyki kina. WNĘTRZE Półka pod blatem to miejsce na rzeczy ważące do 5 kg . W szafkach po obu stronach mebla schowasz przedmioty o większym gabarycie – nie musisz patrzeć na pudełka z dokumentami stojące w widocznym miejscu. Szuflada to praktyczna przestrzeń na coś mniejszego, co chętnie ukryjesz przed ciekawskim wzrokiem. WYKONANIE Szafka RTV z 1 szufladą ALEN postała z 16 mm płyty meblowej . Mebel pokryto laminatem w kolorze dębu Bijoux, dzięki czemu nie musisz martwić się konserwacją, jak w przypadku tradycyjnych mebli dębowych. Nogi oraz uchwyty zostały wykonane z tworzywa sztucznego w czarnym kolorze .', '', 'szafka-rtv-z-szuflada-alen-150-cm', '', '', '', 'Szafka RTV z szufladą ALEN 150 cm', '', '', '', ''),
(464, 1, 1, 'To siedzisko do przedpokoju, które jednocześnie pełni funkcje szafki na obuwie - COMO zaprojektowano po to, byś mógł przymierzać buty w wygodnej - siedzącej pozycji. Znakiem rozpoznawczym mebli z kolekcji COMO jest minimalizm. Estetyka szafki bazuje na prostych bryłach oraz połączenia białej i szarej kolorystyki. Doskonale komponuje się z jasnymi wnętrzami. Wymiary poduszki tapicerowej: szer: 74 cm, wys: 5,4 cm, gł: 32 cm. WNĘTRZE 2 wnęki przydadzą się do przechowywania kapci dla gości lub butów. WYKOŃCZENIE Korpus oraz blat szafki na obuwie COMO zostały wykonane z płyty meblowej pokrytej laminatem oraz płyty MDF pokryta folią. Uwagę zwraca ozdobny front, który połyskuje i dzięki temu optycznie powiększa przestrzeń. Tapicerowana górna część mebla, na której możesz przysiąść, zakładając buty sprawia, że szafka prezentuje się elegancko.', '', 'szafka-na-buty-como-1k', '', '', '', 'Szafka na buty COMO 1K', '', '', '', ''),
(465, 1, 1, 'Dekoracje, rośliny, organizery ułóż w regale KOMAD . Nowoczesny regał to świetny sposób na przyciągającą wzrok aranżację. Biel i kolor drewna łatwo dopasujesz do większości pomieszczeń. Z regałem KOMAD świetnie zagospodarujesz pustą ścianę w pokoju dziennym, młodzieżowym, gabinecie czy pracowni. REGAŁ NA KSIĄŻKI Szukasz regału, który pomieści kolekcję książek, a jednocześnie nie przytłoczy wnętrza? Regał KOMAD świetnie sprawdzi się jako forma domowej biblioteczki . Metalowa konstrukcja prezentuje się nowocześnie i lekko. WYKOŃCZENIE Stelaż wykończono farbą proszkową, a półki okleiną drewnopodobną.', '', 'regal-metalowy-z-4-polkami-komad', '', '', '', 'Regał metalowy z 4 półkami KOMAD', '', '', '', ''),
(466, 1, 1, 'Komoda 2 drzwiowa FLORO to dodatkowa przestrzeń do przechowywania, swoim designem podkreślająca nowoczesny wygląd pomieszczenia . Na 2 półkach wewnątrz komody schowasz tekstylia albo zastawę stołową, którą oszczędzasz tylko na specjalne okazje. Na blacie postawisz wazon z bukietem świeżych kwiatów , ozdobny świecznik i zdjęcie z ważnego rodzinnego wydarzenia. Komoda FLORO to nowoczesny mebel , który wkomponuje się w sypialnię lub pokój dzienny , utrzymany w minimalistycznym klimacie . WNĘTRZE We wnętrzu komody 2 drzwiowej FLORO znajdziesz 2 półki , które tworzą 4 pojemne , symetryczne wnęki . WYKONANIE Korpus komody FLORO zrobiono z 16 mm płyty meblowej pokrytej laminatem – dzięki niemu nie musisz się już martwić o łatwe i szybkie utrzymanie czystości. Wystarczy, że zetrzesz kurz ściereczką od czasu do czasu. Laminat w odcieniu sosny norweskiej podkreśli chłodny charakter wnętrza, korpus kontrastuje z białym frontem , nadając bryle geometryczny wygląd . Front z mdf odznacza się również delikatnym połyskiem , ze względu na delikatne żłobienia pokryto go folią PVC. Półki wykonano z płyty meblowej , grubej na 16 mm w kolorze sosny norweskiej. Minimalistyczne , matowe , srebrne uchwyty nadają komodzie FLORO współczesnego wyglądu. Uchwyty i nóżki wykonano z tworzywa sztucznego .', '', 'komoda-minimalistyczna-2d-floro', '', '', '', 'Komoda minimalistyczna 2D FLORO', '', '', '', ''),
(467, 1, 1, 'Biała szafka RTV QUEBEC to mebel w najbardziej uniwersalnym kolorze, dzięki czemu łatwo dopasujesz ją do wielu aranżacji. Biel będzie niezastąpiona wszędzie tam gdzie w pomieszczeniu jest niewiele światła, rozjaśniając optycznie pomieszczenie. Szafka cechuje się szerokością 170 cm, dając możliwość ustawienia na niej nawet bardzo dużego telewizora. Proste uchwyty w srebrnym kolorze doskonale pasują do bryły mebla. WNĘTRZE Szafkę wyposażono w 2 wnęki za drzwiami i 2 szuflady. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej pokrytej laminatem, front mebla jest wykonany z płyty MDF pokrytej folią PCV.', '', 'szafka-rtv-biala-quebec', '', '', '', 'Szafka RTV biała QUEBEC', '', '', '', ''),
(468, 1, 1, 'Biała komoda z szufladami DUERO to uniwersalny mebel, w którym uporządkujesz różne akcesoria. Idealnie nada się do przechowywania poskładanych ubrań, bielizny czy kompletów pościeli. 5 szuflad wyposażono w prowadnice kulkowe. WYKOŃCZENIE Białą komodę z łatwością dopasujesz do większości aranżacji. Uchwyty w czarnym kolorze cechują się prostą, minimalistyczną stylistyką.', '', 'komoda-biala-z-5-szufladami-duero', '', '', '', 'Komoda biała z 5 szufladami DUERO', '', '', '', ''),
(469, 1, 1, 'Lubisz niestandardowe i nowoczesne rozwiązania we wnętrzach? Komoda 2D PATRIK to mebel, który odmieni przestrzeń salonu, przedpokoju czy sypialni. Trójwymiarowe fronty wprowadzą do wnętrza dynamiczny i wyrazisty charakter. Komoda w kolorze dąb artisan nada wnętrzu przytulny charakter i nie przytłoczy go. WNĘTRZE Za 2 drzwiami znajdziesz 6 wnęk, w których łatwo uporządkujesz potrzebne przedmioty. Maksymalne obciążenie półki wynosi 5 kg. Brak uchwytów podkreśla minimalistyczny i nowoczesny charakter mebla. Blat możesz wykorzystać na wyeksponowanie stylowych dekoracji, zdjęć czy pamiątek. WYKOŃCZENIE Komoda została wykonana z płyty meblowej i wykończona laminatem. Świetnie sprawdzi się we współczesnych aranżacjach, w których zależy nam na stworzeniu ciekawej i nowoczesnej aranżacji.', '', 'komoda-nowoczesna-dwudrzwiowa-patrik', '', '', '', 'Komoda nowoczesna dwudrzwiowa PATRIK', '', '', '', ''),
(470, 1, 1, 'Brakuje Ci miejsca? Nie dajesz już rady? Oto praktyczna komoda i jej 2 szuflady . Komoda z 2 szufladami FLORO to nowoczesny mebel, który dopasujesz do pomieszczeń urządzonych z modernistycznym zacięciem. Połyskująca biel frontów współgra z surowymi elementami wystroju, takimi jak; drewno, szkło, czy beton. Postaw ją w salonie albo sypialni i wykorzystaj dodatkowe miejsce. W 2 szufladach zmieszczą się dodatki i talerze, które mogą się przydać podczas niespodziewanej wizyty rodziców. Na 4 wnękach w szafce poniżej schowasz eleganckie kieliszki na specjalne okazje. WNĘTRZE Komoda FLORO posiada 2 szuflady na rzeczy, które lubisz mieć zawsze pod ręką. Na każdej z 2 półek zmieścisz przedmioty, których ciężar nie przekracza 5 kg – 4 wnęki to optymalne miejsce na przechowywanie. WYKONANIE Komodę FLORO wykończoną w białym połysku , wykonano z 16 mm płyty meblowej. Mebel został pokryty laminatem w kolorze norweskiej sosny , która ładnie kontrastuje z bielą frontów . Front komody zrobiono z 16 mm płyty MDF wykończonej białą , błyszczącą folią PVC – którą łatwo utrzymasz w czystości. Półki wewnątrz komody również pokryto laminatem. Minimalistyczne uchwyty oraz nogi komody wykonano tworzywa sztucznego .', '', 'komoda-z-2-szufladami-biala-floro', '', '', '', 'Komoda z 2 szufladami biała FLORO', '', '', '', ''),
(471, 1, 1, 'Szafka RTV TRENTINO to mebel funkcjonalny o nowoczesnej linii i jasnej kolorystyce. Można bez trudu dopasować ją pod kątem ustawienia telewizora lub sprzętu grającego. Wnęki i zamykane szafki po obu stronach czynią RTV TRENTINO meblem o uniwersalnym zastosowaniu. Pozwalają na umiejscowienie w przestrzeni szafki płyt, książek oraz podręcznych drobiazgów. Szafka RTV doskonale prezentuje się we wnętrzach przestronnego salonu lub pokoju dziennego. Dzięki połączeniu białych frontów z czarnym uchwytami oraz ciemną tonacją półek w centralnej części mebla idealnie pasuje do wnętrz, które łączą kontrastujące ze sobą elementy. Wizualnie cechuje się oszczędnym, wręcz minimalistycznym wzorem, który sprawia, że można bez trudu dopasować ją do już istniejącej aranżacji. WNĘTRZE RTV TRENTINO posiada 2 zamykane szafki. Szklane półki w części otwartej wykonano ze szkła hartowanego. Możesz na nich ustawić akcesoria o wadze 3 kg. WYKOŃCZENIE Szafka RTV TRENTINO została wykonana z płyty meblowej. Na szczególną uwagę zasługują fronty mebla z płyty MDF, wykończone folią z efektem połysku. Wymiar wnęki: 150,2 x 41,6 x 49,7', '', 'szafka-rtv-trentino-2d', '', '', '', 'Szafka RTV TRENTINO 2D', '', '', '', ''),
(472, 1, 1, 'Szukasz prostej szafki RTV w kontrastujących ze sobą kolorach? Dzięki szafce RTV BASIC 2 na małej przestrzeni stworzysz miejsce do przechowywania akcesoriów i sprzętu RTV. Mebel jest prosty i pozbawiony zdobień, dlatego bez trudu dopasujesz go do już istniejącej aranżacji w Twoim salonie. ZA ZAMKNIĘTYMI DRZWIAMI W szafce znajdziesz 1 zamykana półka , gdzie możesz schować sprzęt oraz okablowanie RTV lub kolekcję płyt DVD. PODŚWIETLENIE LED 1 szklana półka w centralnej części jest dodatkowo wyposażona w podświetlenie LED , więc możesz postawić tam wyjątkowy dodatek, albo ulubione zdjęcie. WYKOŃCZENIE Szafka jest wykonana z płyty meblowej wykończonej melaminą w białym i czarnym kolorze. Fronty są matowe. Nóżki mebla są z tworzywa sztucznego PCV.', '', 'szafka-rtv-z-oswietleniem-kontrastowa-basic-2', '', '', '', 'Szafka RTV z oświetleniem kontrastowa BASIC 2', '', '', '', ''),
(473, 1, 1, 'Pojemne szuflady i wnęki za drzwiami w komodzie KAYLAS pomieszczą potrzebne przedmioty w pokoju dziennym, sypialni czy jadalni. Komoda KAYLAS sprawdzi się jako dodatkowy mebel do uporządkowania ubrań, bielizny czy innych tekstyliów domowych. Meble do salonu KAYLAS sprawdzą się zarówno w przestronnych wnętrzach, jak i w niewielkich pokojach dziennych. Jasne fronty w połączeniu modnej szarości z kolorem drewna stworzą ciekawą i przytulną aranżację. WNĘTRZE Komoda posiada 4 szuflady i 4 wnęki ukryte za drzwiami. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Matowe wykończenie szarych frontów, dekor dąb canyon z wyraźnym rysunkiem drewna oraz czarne uchwyty idealnie pasują do mieszkania urządzonego w nowoczesnym stylu.', '', 'komoda-kaylas-2d4s', '', '', '', 'Komoda KAYLAS 2D4S', '', '', '', ''),
(474, 1, 1, 'Szafka RTV DALIA jest funkcjonalnym meblem w nowoczesnym stylu, który stanowi doskonałe dopełnienie wnętrza salonu lub pokoju dziennego. Posiada dwie pojemne szuflady umiejscowione po bokach mebla oraz wnękę, która została przedzielona półką. Szafka RTV DALIA jest ustawnym, stabilnym meblem, który dobrze wygląda w połączeniu z telewizorem lub sprzętem grającym. Z zewnątrz charakteryzuje się prostym, nowoczesnym wzorem. Kolor złotego dębu oraz łagodnie zaokrąglone krawędzie idealnie komponują się z wnętrzami jasnymi oraz utrzymanymi w ciepłej tonacji kolorystycznej, a ozdobne szerokie listwy boczne nadają konstrukcji mebla stabilności. WYKOŃCZENIE Szafkę RTV DALIA cechuje duża uniwersalność pod kątem doboru elementów dekoracyjnych. Na szczególną uwagę zasługuje front utrzymany w białym kolorze, który nadaje całości przyciągającego wzrok kontrastu, ponadto sprawia, że mebel prezentuje się bardzo estetycznie. Nóżki mebla wykonane są w takim samym kolorze, co korpus.', '', 'szafka-rtv-dalia-2s', '', '', '', 'Szafka RTV DALIA 2S', '', '', '', ''),
(475, 1, 1, 'Szafka REPLAY pomoże okiełznać rozgardiasz, panujący w dziecięcym pokoju. Możecie w niej przechowywać zabawki lub podręczniki i akcesoria szkolne. Wysokość szafki jest dostosowana do wzrostu dzieci, co ułatwia im samodzielne sprzątanie pokoju. Możesz dobrać taki kolor uchwytów, który najlepiej pasuje do charakteru wnętrza. Meble z kolekcji REPLAY zachwycają swoją funkcjonalnością, ale ich największym atutem jest możliwość dopasowania aranżacji do zmieniających się potrzeb dorastających dzieci. Poprzez zmianę uchwytów możesz tworzyć własne zestawienie kolorystyczne, odzwierciedlające osobowość lokatorów. Możesz dzielić przestrzeń na strefy, tworząc wnętrze dla rodzeństwa. WNĘTRZE 2 zamykane szafki zapewniają dużo miejsca na podręczniki lub prace plastyczne. Szuflada na drobiazgi przyda się do przechowywania pędzli, kredek i farb. WYKOŃCZENIE Białe wykończenie kolekcji REPLAY optycznie powiększa przestrzeń. Połyskujące fronty rozświetlają wnętrze, a dodatkowe drewniane uchwyty dodają im uroku. Laminat , jakim pokryto meble wystarczy od czasu do czasu przecierać miękką szmatką. *Cena mebla nie zawiera uchwytów widocznych na zdjęciach. Należy je dokupić osobno. Do wyboru sześć dostępnych kolorów: biały, pomarańczowy, zielony, różowy, turkusowy oraz grafitowy.', '', 'szafka-replay-rp-08-bez-uchwytow', '', '', '', 'Szafka REPLAY RP-08 (bez uchwytów)', '', '', '', ''),
(476, 1, 1, 'Komoda DALIA jest funkcjonalnym meblem w nowoczesnym stylu, który stanowi doskonałe dopełnienie wnętrza salonu lub pokoju dziennego. Jest wyposażona w trzy szuflady oraz dwie zamykane szafki. Świetnie nadaje się do trzymania ubrań, dokumentów lub przydatnych drobiazgów. Drzwi osadzone są na standardowych, puszkowych zawiasach. Z zewnątrz komoda DALIA charakteryzuje się prostym, nowoczesnym wzorem. Całość bardzo dobrze komponuje się z wnętrzami jasnymi oraz utrzymanymi w ciepłej tonacji kolorystycznej. WYKOŃCZENIE Komodę DALIA cechuje duża uniwersalność pod kątem doboru elementów dekoracyjnych. Łagodnie zaokrąglone krawędzie korpusu w kolorze złotego dębu w przyjemny sposób kontrastują z białym, lakierowanym frontem mebla. Ozdobne, szerokie listwy boczne nadają konstrukcji mebla stabilności. Nóżki mebla wykonane są w takim samym kolorze, co korpus.', '', 'komoda-dalia-2d3s', '', '', '', 'Komoda DALIA 2D3S', '', '', '', ''),
(477, 1, 1, 'SZAFKA RTV LIDO Szafka rtv z systemu mebli Lido to nowoczesna kolekcja, dzięki której zaaranżujesz salon lub jadalnie w pomysłowy sposób. Mnogość brył pozwoli zaaranżować wnętrze według osobistych preferencji . Umieścisz w niej sprzęt rtv oraz inne drobiazgi typu piloty czy prasę. Kontrastowe połączenie barw podkreśla charakter mebla. WNĘTRZE Szafka rtv posiada trzy szuflady oraz półkę otwartą na sprzęt rtv lub audio. WYKOŃCZENIE Kolekcję wyróżniają podfrezowane uchwyty, ryflowania na tylnych ściankach oraz charakterystyczne nóżki.', '', 'szafka-rtv-lido-li-9', '', '', '', 'Szafka rtv LIDO LI-9', '', '', '', ''),
(478, 1, 1, 'Częstuj swoich gości ulubionymi trunkami i sięgaj po słone przekąski, nie wychodząc z salonu. Pomoże Ci w tym bufet CHARTUM . Możesz w nim trzymać naczynia i kieliszki a także ulubione napoje. Może też pełnić funkcję stolika barowego. Wysoki na 80 cm , pozwoli Ci zagospodarować przestrzeń nad nim na dekoracje lub pamiątki. Częściowo przeszklone drzwi pozwolą Ci na wyeksponowanie ważnych dla Ciebie dodatków i wzmocnienie industrialnego charakteru. WNĘTRZE Za przeszklonymi drzwiami masz dużo miejsca - wnęki mają 41,5 cm głębokości i 91 cm szerokości. Półkę wykonano ze szkła hartowanego. 2 szuflady ukryte za pełnymi drzwiami możesz zagospodarować na przedmioty, które niekoniecznie chcesz mieć na widoku. WYKONANIE Mebel wykonany z płyty MDF został wykończony orzechowym fornirem i pokryty lakierem UV. Blat pokryto czarną - połyskującą, szklaną taflą - prezentuje się bardzo elegancko. Wykorzystanie forniru naturalnego zadowoli wszystkich wielbicieli drewna i jego naturalnego charakteru.', '', 'bufet-orzechowy-chartum', '', '', '', 'Bufet orzechowy CHARTUM', '', '', '', ''),
(479, 1, 1, 'Komoda TEMUZZA to funkcjonalny mebel, który idealnie uzupełni aranżację domu lub biura. Prosty design oraz klasyczna, biała barwa sprawiają, że komoda wpasuje się w jasne wnętrza, stając się naturalnym elementem wyposażenia. Kompaktowe wymiary komody sprawiają, że to idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Idealnie nada się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych, dokumentów. Uchwyty w srebrnym kolorze odznaczają się prostą, minimalistyczną stylistyką. WNĘTRZE Wnętrze komody dzieli się na 3 wnęki . Rozmiary wnęk można dopasować do własnych potrzeb, umieszczając półkę na pożądanej wysokości.', '', 'komoda-temuzza-2d', '', '', '', 'Komoda TEMUZZA 2D', '', '', '', ''),
(480, 1, 1, 'Komoda SNOW w kolorze białym idealnie wpisze się w każde wnętrze. Prosty kształt mebla został otoczony pogrubioną ramą, a fronty ozdobione poziomymi frezowaniami. Biel świetnie komponuje się ze wszystkimi kolorami, co daje nieskończone możliwości w tworzeniu własnych aranżacji. Srebrne uchwyty i nóżki idealnie komponują się z białą stylistyką mebla. WNĘTRZE Pojemna szeroka komoda z sześcioma szufladami to optymalne rozwiązanie, by zmieścić wszystkie niezbędne rzeczy i wygodnie je uporządkować. WYKOŃCZENIE szuflady wyposażono w system cichego domykania , który zapobiega gwałtownym uderzeniom; fronty komody wykonano z płyty MDF, korpus został wykonany z płyty laminowanej. PLIKI DO POBRANIA Instrukcja montażu: Pobierz &gt;&gt; Ulotka: Pobierz &gt;&gt;', '', 'komoda-biala-z-6-szufladami-szeroka-snow', '', '', '', 'Komoda biała z 6 szufladami szeroka SNOW', '', '', '', ''),
(481, 1, 1, 'Komoda SNOW w kolorze białym idealnie wpisze się w każde wnętrze. Prosty kształt mebla został otoczony pogrubioną ramą, a fronty ozdobione poziomymi frezowaniami. Biel świetnie komponuje się ze wszystkimi kolorami, co daje nieskończone możliwości w tworzeniu własnych aranżacji. Srebrne uchwyty i nóżki idealnie komponują się z białą stylistyką mebla. WNĘTRZE Pojemna komoda z dwojgiem drzwi i czterema szufladami to optymalne rozwiązanie, by zmieścić wszystkie niezbędne rzeczy i wygodnie je uporządkować. WYKOŃCZENIE Szuflady wyposażono w system cichego domykania, który zapobiega gwałtownym uderzeniom. PLIKI DO POBRANIA Instrukcja montażu: Pobierz &gt;&gt; Ulotka: Pobierz &gt;&gt;', '', 'komoda-biala-z-szufladami-i-polkami-snow', '', '', '', 'Komoda biała z szufladami i półkami SNOW', '', '', '', ''),
(482, 1, 1, 'Szukasz oryginalnej komody na kolekcję gier, książki, obrusy lub segregatory? Komoda BOHOL jest granatowa, posiada 6 wnęk i 3 szuflady i możesz postawić ją przy ścianie o długości 167 cm. Wyrazisty rysunek drewna wprowadzi do pokoju swojskość - tylko, że w nowoczesnym wydaniu. Zawiasy wyposażono w system cichego domyku, więc drzwi nie trzaskają. WNĘTRZE Dzięki 6 wnękom możesz posegregować swoje rzeczy, by zachować porządek na dłużej. 3 szuflady przydadzą się do przechowywania dokumentów lub drobiazgów. Na blacie możesz ustawić pamiątki rodzinne lub dekoracje. WYKOŃCZENIE Mebel wykończono dwoma rodzajami folii z rysunkiem drewna. Folia na blacie i półkach ma kolor drewna dębu riviera – sprawia, że we wnętrzu robi się przytulniej. Front i korpus pokrywa granatowa folia, imitująca malowane drewno. Uchwyty z tworzywa mają prostą formę DREWNO W BARWIE GRANATU Lubisz otaczać się rustykalnymi meblami, ale tym razem szukasz czegoś bardzo oryginalnego? Chcesz wprowadzić do salonu wyrazisty kolor? A co powiesz na meble wykończone w kolorze granatowego drewna? Kolekcja BOHOL to meble o masywnej konstrukcji, z wyraźnym rysunkiem drewna, prostymi uchwytami … i w granatowym odcieniu . Świetnie sprawdzą się w mieszkaniu urządzonym z motywami morskimi, w loftowym – surowym wnętrzu, wśród szarości i wśród kremów. Sprawią, że Twój salon będzie zarazem swojski i wytworny. Podoba Ci się taka koncepcja? Zamów całą kolekcję!', '', 'komoda-granatowa-z-3-szufladami-bohol', '', '', '', 'Komoda granatowa z 3 szufladami BOHOL', '', '', '', ''),
(483, 1, 1, 'Jeśli szukasz pojemnego mebla, który pomoże Ci zorganizować domowy rozgardiasz i odciążyć szafę ubraniową, to duża komoda ELARA jest dokładnie tym, czego potrzebujesz. Ma ponad 2 m długości, 4 wnęki i 4 szuflady na Twoje skarby. Komoda w salonie i sypialni Dobre rozplanowanie przestrzeni wewnątrz mebla sprawia, że umieścisz w niej: pościel, obrusy, bieliznę oraz inne ubrania, które nie wymagają wieszaków. Komoda w gabinecie Teczki, dokumenty, albumy oraz także inne przedmioty biurowe i osobiste również mogą znaleźć swoje miejsce w komodzie ELARA . WNĘTRZE Komoda posiada 3 szuflady w środkowej sekcji mebla Główna przestrzeń komody to 2 szafki podzielone półkami Maksymalne obciążenie półek to 5 kg WYKOŃCZENIE Komodę wykonano z płyt meblowych oraz MDF, pokrytych folią Korpus i fronty komody są w białym kolorze, natomiast blaty wykończono wybarwieniem imitującym drewno. Uchwyty są z tworzywa w czarnym kolorze.', '', 'komoda-duza-biala-elara', '', '', '', 'Komoda duża biała ELARA', '', '', '', ''),
(484, 1, 1, 'Szafka RTV ELZZAN posiada 3 zamykane szafki i 2 szuflady. Biały kolor z połyskiem estetycznie kontrastuje z czarnymi uchwytami i nóżkami mebla. Jest doskonałym wyborem do większości wnętrz. Łączy się z szarością i bielą, ale również jest doskonałym tłem dla żywych, intensywnych kolorów. RTV ELZZAN jest istotnym uzupełnieniem dla reprezentacyjnej części mieszkania. Wykonana w nowoczesnym stylu cechuje się funkcjonalnością oraz prostotą. WNĘTRZE RTV posiada 3 zamykane szafki i 2 szuflady umieszczone w centralnej części mebla. Szuflady zostały zamontowane na prowadnicach kulkowych . Wnętrze można swobodnie wykorzystać do trzymania zastawy oraz obrusów lub osobistych drobiazgów. WYKOŃCZENIE RTV została wykonana z płyty meblowej w kolorze uniwersalnej bieli oraz pokryta folią z połyskiem. Uchwyty są aluminiowe, pokryte czarnym, matowym kolorem - ładnie uzupełniają front mebla. KOLEKCJA ELZZAN Meble, które wchodzą w skład kolekcji ELZZAN najlepiej prezentują się w jadalni, salonie lub pokoju dziennym. Pozwalają w kompletny sposób urządzić wnętrze, a ich design cechuje prostota, uniwersalność i funkcjonalność. Pojemne wnętrza pozwalają schować używane na co dzień drobiazgi lub wyeksponować dodatki dekoracyjne i sprzęt RTV. Ich atutem jest biała kolorystyka z połyskiem .', '', 'szafka-rtv-z-2-szufladami-elzzan', '', '', '', 'Szafka RTV z 2 szufladami ELZZAN', '', '', '', ''),
(485, 1, 1, 'Dzięki zastosowaniu lameli na froncie, komoda SAVONA podkreśla nietuzinkowy charakter salonu, jadalni, pokoju dziennego czy przestronnego przedpokoju. Możesz umieścić w niej dodatkową zastawę stołową, dokumenty czy tekstylia domowe. Cofnięty w bryle cokół nadaje jej lekkości i jest ciekawą alternatywą dla klasycznych nóżek. Cokół jest podświetlony listwą LED. Dzięki temu prezentuje się elegancko i nowocześnie. WNĘTRZE W 3 szufladach przechowasz niewielkie akcesoria lub dokumenty. W 4 zamkniętych wnękach łatwo uporządkujesz potrzebne przedmioty. Blat komody to świetne miejsce na dekoracje lub pamiątki. Drzwi zostały wyposażone w system push to open. Wystarczy docisnąć ich front, a otworzą się błyskawicznie. WYKOŃCZENIE Komoda SAVONA jest wykonana z płyty meblowej i wykończona laminatem. Czarne fronty są wykończone na wysoki połysk . Połączenie czerni z kolorem dębu szlachetnego sprawia, że meble SAVONA sprawdzą się w klasycznych, nowoczesnych i eklektycznych wnętrzach. Kolekcja SAVONA do pokoju dziennego i jadalni Jeżeli szukasz mebli o oryginalnym i eleganckim designie, wybierz kolekcję SAVONA. Kolekcja SAVONA to połączenie klasyki z nutą nowoczesności. Wybarwienie dębu szlachetnego wnosi do wnętrza wytworny klimat, a nowoczesny dekor w formie lameli , czarne połyskujące fronty i oświetlenie sprawiają, że meble SAVONA prezentują się niezwykle elegancko. Z kolekcją SAVONA możesz urządzić pokój dzienny i jadalnię.', '', 'komoda-savona-z-listwa-led', '', '', '', 'Komoda SAVONA z listwą LED', '', '', '', ''),
(486, 1, 1, 'Szafka RTV SAVONA pozwala uporządkować strefę wypoczynkową, a dzięki lamelom na froncie stanowi nowoczesną podstawę dla sprzętu. Cofnięty w bryle cokół dodaje szafce lekkości i jest ciekawą alternatywą dla klasycznych nóżek. Cokół jest podświetlony listwą LED dzięki czemu prezentuje się nowocześnie i elegancko. WNĘTRZE W otwartej wnęce zmieści się dekoder czy konsola. 2 szafki i szuflada posłużą do uporządkowania akcesoriów. Drzwi zostały wyposażone w system push to open. Wystarczy docisnąć ich front, a otworzą się błyskawicznie. WYKOŃCZENIE Szafka RTV SAVONA jest wykonana z płyty meblowej i wykończona laminatem. Czarne fronty są wykończone na wysoki połysk . Połączenie czerni z kolorem dębu szlachetnego sprawia, że meble SAVONA sprawdzą się w klasycznych, nowoczesnych i eklektycznych wnętrzach. Kolekcja SAVONA do pokoju dziennego i jadalni Jeżeli szukasz mebli o nietuzinkowym i eleganckim designie, wybierz kolekcję SAVONA. Kolekcja SAVONA to połączenie klasyki z nutą nowoczesności. Wybarwienie dębu szlachetnego wnosi do wnętrza wytworny klimat, a nowoczesny dekor w formie lameli , czarne połyskujące fronty i oświetlenie sprawiają, że meble SAVONA prezentują się niezwykle elegancko. Z kolekcją SAVONA możesz urządzić pokój dzienny i jadalnię.', '', 'szafka-rtv-savona-z-listwa-led', '', '', '', 'Szafka RTV SAVONA z listwą LED', '', '', '', ''),
(487, 1, 1, 'Jeśli liczy się dla Ciebie komfort przechowywania, z pewnością dostrzeżesz komodę z szufladami ALEN. Komoda 2-drzwiowa ALEN to kompozycja pojemnych szuflad i praktycznych półek . 4 szuflady po środku i 4 wnęki schowane za pełnymi drzwiami to sporo dodatkowego miejsca, którego do tej pory Ci brakowało. Połączenie koloru sękatego dębu Bijoux z grafitowym wykończeniem sprawia, że komoda ALEN odnajdzie się w pomieszczeniach urządzonych minimalistycznie . WNĘTRZE 4 szuflady , do których włożysz; obrusy, prześcieradła i ręczniki. 2 półki o udźwigu do 5 kg , ukryte za symetrycznie osadzonymi drzwiami, sprawią, że zachowanie perfekcyjnego porządku będzie odtąd bardzo łatwe. WYKONANIE Komodę z szufladami ALEN wykonano z płyty meblowej o grubości 16 mm . Mebel pokryto laminatem w kolorze dębu Bijoux oraz w grafitowym odcieniu . Uchwyty szuflad i nogi zostały wytworzone z tworzywa sztucznego.', '', 'komoda-z-szufladami-dwudrzwiowa-alen', '', '', '', 'Komoda z szufladami dwudrzwiowa ALEN', '', '', '', ''),
(488, 1, 1, 'Potrzebny Ci nowy stolik kawowy? Stolik kawowy ciemny orzech ALGARD, to gustowny mebel, który świetnie prezentuje się w towarzystwie pozostałych mebli z tej serii. Połączenie koloru ciemnego drewna z matową szarością, zachęca do wstawienia stolika do nowoczesnego salonu, w którym przeważa styl industrialny. Postaw go przed wygodnym narożnikiem, zaproś gości na pogaduchy i zapomnijcie o całym świecie. Na blacie postaw poczęstunek. Na półce poniżej książkę, która właśnie czytasz. Do szuflad włóż pilot od telewizora, zapachowe świeczki, chusteczki i wszystko to, co warto mieć pod ręką. WNĘTRZE Półka pod blatem pomieści rzeczy o wadze do 5 kg. W szufladach schowasz przedmioty do 3 kg. WYKONANIE Konstrukcję stolika kawowego ALGARD wykonano z 16 mm płyty meblowej. Mebel okryto laminatem w kolorze orzecha Warmia oraz folią PVC w kolorze czarnego matu. Szuflady osadzono na prowadnicach z dolnym montażem, bez hamulca. Komodę osadzono na nogach z tworzywa sztucznego.', '', 'komoda-z-4-szufladami-algard', '', '', '', 'Komoda z 4 szufladami ALGARD', '', '', '', ''),
(489, 1, 1, 'Komoda Lionel to nowoczesny mebel wykonany z trwałych materiałów. Jasna kolorystyka sprawi, że pokój będzie wydawał się większy. Mebel wykonano w połączeniu dwóch kolorów - dębu truflowego i białego połysku. Cechą charakterystyczną całej kolekcji są frezowane uchwyty, które tworzą nowoczesną formę. Jest to kolekcja uniwersalna, mnogość dostępnych elementów pozwala wyposażyć pomieszczenia o rożnym przeznaczeniu i charakterze, od pokoju dziennego po sypialnię.', '', 'komoda-lionel-li2', '', '', '', 'Komoda LIONEL li2', '', '', '', ''),
(490, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. Komoda IRMA świetnie sprawdzi się zarówno w pokoju dziennym, jak i w jadalni. Od ciebie zależy gdzie najlepiej spełni swoją rolę. Jasna kolorystyka wpisze się w aktualne trendy umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadzi do wnętrza wyjątkowy klimat. W standardzie są dwa kolory wstawek - ciemne oraz białe. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WNĘTRZE Wnętrze składa się z szuflady oraz półek w części zamkniętej, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV. Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'komoda-irma-im4-z-oswietleniem', '', '', '', 'Komoda IRMA IM4 z oświetleniem', '', '', '', ''),
(491, 1, 1, 'Komoda trzydrzwiowa z serii Lionel jest idealnym rozwiązaniem dla osób ceniących sobie elegancję i oryginalność. Szczególnie dobrze będzie prezentowała się w salonie lub przedpokoju. Nowoczesna kolorystyka, w której połączono kolor dąb truflowy z frontami w białym połysku pasuje do większości pomieszczeń.', '', 'komoda-lionel-li3', '', '', '', 'Komoda LIONEL li3', '', '', '', ''),
(492, 1, 1, 'Szafka RTV DORIAN wchodzi w skład kolekcji mebli przeznaczonej dla salonu, pokoju dziennego lub jadalni. Szeroka i ustawna doskonale prezentuje się w centralnej części pomieszczenia jako mebel ekspozycyjny. Można na nim ustawić nie tylko sprzęt RTV, ale również ozdoby dekoracyjne, kwiaty lub rodzinne pamiątki. Kolorystyka mebla w odcieniu dąb april została wzbogacona czarnymi wstawkami, ponadto zamiast nóżek w szafce RTV DORIAN zastosowano ozdobny cokół - również utrzymany w czarnym kolorze. Kontrastowe zestawienie sprawia, że kolekcja DORIAN może zostać ustawione zarówno w jasnym, jak i ciemniejszym wnętrzu, świetnie prezentuje się w towarzystwie szarości oraz w zestawieniu z meblami utrzymanymi w nowoczesnej stylistyce. WNĘTRZE Szafka RTV DORIAN posiada otwartą wnękę, szufladę na prowadnicach kulkowych i przestrzeń zamkniętą na dwoje drzwi. Maksymalne obciążenie półek wynosi 5 kg. WYKOŃCZENIE Korpus, blat i półki RTV DORIAN wykonane zostały z płyty meblowej i wykończone laminatem. Natomiast frontowa część z płyty MDF opatrzonej wysokiej jakości folią PVC. Całości dopełniają minimalistyczne uchwyty z tworzywa sztucznego. Szafka RTV DORIAN została wyposażona w system podświetlenia ciepłym, białym światłem. Jego klasa energetyczna to A++ .', '', 'szafka-rtv-dorian-dn1-2d1s-z-oswietleniem', '', '', '', 'Szafka RTV DORIAN DN1 2D1S z oświetleniem', '', '', '', ''),
(493, 1, 1, 'Szukasz komody z szufladami , która sprawdzi się dobrze w sypialni dla dwojga? Komoda BOSTON oferuje Wam parzystą ilość szuflad i daje się zauważyć! Jeśli lubisz eksperymentować, możesz wydobyć industrialny charakter wnętrza wyszukanymi dodatkami. Komoda sprawdzi się także w sypialniach, urządzonych w męskim stylu. KOMODA DLA DWOJGA 6 symetrycznych szuflad w znaczący sposób ułatwi zachowanie perfekcyjnego porządku we wnętrzu komody BOSTON. Komoda spełni oczekiwania par - pozwala rozdzielić symetrycznie rzeczy 2 osób. WYKOŃCZENIE Mebel wykończono w ciemnobrązowym kolorze . Kolor dąb charleston podkreśli nowoczesny charakter Twojej stylowej sypialni . Niewielkie, eleganckie uchwyty i prowadnica rolkowa pozwolą otwierać szuflady płynnym ruchem. Fronty zostały wykonane z płyty meblowej pokrytej laminatem . Komoda BOSTON stanowi uzupełnienie unikatowej kolekcji mebli.', '', 'komoda-z-6-szufladami-boston', '', '', '', 'Komoda z 6 szufladami BOSTON', '', '', '', ''),
(494, 1, 1, 'W niewielkiej komodzie TERNI zorganizujesz poskładane ubrania, tekstylia domowe czy dokumenty. Niezależnie, w którym pokoju ją umieścisz, nie zajmie wiele przestrzeni, a zapewni dodatkowe miejsce do przechowywania. Delikatne frezowanie na frontach dodatkowo urozmaici wnętrze. WNĘTRZE Wnęka z półką i 3 szuflady pozwolą łatwo zorganizować potrzebne przedmioty. WYKOŃCZENIE Czarne, metalowe uchwyty tworzą ciekawy kontrast z kolorem mebla. Jasnoszare wykończenie komody TERNI nie przytłoczy wnętrza i wprowadzi do niego nowoczesny klimat. KOLEKCJA TERNI Kolekcja TERNI wyróżnia się dużą ilością brył, dzięki czemu możesz urządzić mieszkanie w spójnym stylu. Meble z kolekcji sprawdzą się w pokoju dziennym, młodzieżowym czy jednoosobowej sypialni.', '', 'komoda-terni-1d3s', '', '', '', 'Komoda TERNI 1D3S', '', '', '', ''),
(495, 1, 1, 'Komoda GRAZ 4S świetnie uzupełni aranżację domu lub biura. Prosty design oraz ciepły kolor drewna sprawiają, że komoda wpasuje się w jasne wnętrza, stając się naturalnym elementem wyposażenia. To idealny mebel uzupełniający w domu, w którym gromadzi się wiele akcesoriów. Przyda się do przechowywania zapasowej pościeli i ubrań, ale także butów, akcesoriów łazienkowych czy dokumentów. WNĘTRZE Do dyspozycji masz 4 szuflady , w których łatwo pogrupujesz potrzebne przedmioty. WYKOŃCZENIE Komodę wykończono laminatem, dzięki czemu łatwo jest go czyścić Uchwyty z tworzywa prezentują się nowocześnie', '', 'komoda-graz-4s', '', '', '', 'Komoda GRAZ 4S', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(496, 1, 1, 'Kolekcja mebli do salonu VENUTA to meble o wyjątkowej estetyce. ntrygująca prostota designu w połączeniu z elegancją ciemnej barwy w odcieniu dębu kawowego stanowią mocny, nowoczesny akcent aranżacyjny, dzięki któremu wnętrze salonu nabierze niezrównanie luksusowego charakteru. Komoda VENUTA jest wykonana z płyty MDF i wykończona lakierem ; Drzwiczki szafek otwierane są dyskretnym i bardzo wygodnym systemem push to open – wystarczy lekko przycisnąć drzwiczki dłonią, by je otworzyć; Zdecydowanie nieszablonowym rozwiązaniem estetycznym komody są wyróżniające się nogi ze stali polerowanej , dzięki którym komoda zyskuje nowoczesny rys eleganckiej geometrii i jednocześnie lekkiej smukłości;', '', 'komoda-venuta', '', '', '', 'Komoda VENUTA', '', '', '', ''),
(497, 1, 1, 'W szerokiej komodzie TERNI zorganizujesz poskładane ubrania, tekstylia domowe czy dokumenty. Zapewnia sporo miejsca do przechowywania, a delikatne frezowanie na frontach dodatkowo urozmaica wnętrze. WNĘTRZE 4 wnęki za drzwiami i 3 szuflady pozwolą łatwo zorganizować potrzebne przedmioty. Maksymalne obciążenie półki wynosi 10 kg. WYKOŃCZENIE Czarne, metalowe uchwyty tworzą ciekawy kontrast z kolorem mebla. Jasnoszare wykończenie komody TERNI nie przytłoczy wnętrza i wprowadzi do niego nowoczesny klimat. KOLEKCJA TERNI Kolekcja TERNI wyróżnia się dużą ilością brył, dzięki czemu możesz urządzić mieszkanie w spójnym stylu. Meble z kolekcji sprawdzą się w pokoju dziennym, młodzieżowym czy jednoosobowej sypialni.', '', 'komoda-terni-2d3s', '', '', '', 'Komoda TERNI 2D3S', '', '', '', ''),
(498, 1, 1, 'Szafka na buty Norton charakteryzuje się prostą minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz. Laminat w jasnym kolorze dębu sonoma, przypominający dekorem drewno, wprowadzi do pomieszczenia przytulny klimat. Kolor jest bardzo popularny, co ułatwia dopasowanie mebla z innymi. Brak tradycyjnych uchwytów sprawia, że mebel łatwiej wkomponować w dowolną aranżację. Posiada drzwi uchylne. Duża ilość brył dostępna w programie Norton czyni kolekcję bardzo atrakcyjną. WNĘTRZE W szafce przechowasz obuwie, szafka posiada jedne drzwi uchylne. WYKOŃCZENIE Mebel został pokryty laminatem, łatwym do utrzymania w czystości.', '', 'szafka-na-buty-norton-1k', '', '', '', 'Szafka na buty NORTON 1K', '', '', '', ''),
(499, 1, 1, 'Nowoczesna komoda o nietuzinkowym wyglądzie, która będzie atrakcyjnym akcentem, a jednocześnie zwiększy funkcjonalność wnętrza. Korpus komody wykonany został w ciepłym dekorze dąb sangallo, fronty w białym połysku. Zestawienie kolorów wyeksponowano dzięki punktowemu oświetleniu zamontowanemu na wieńcu mebla. Jej przeznaczeniem może być praktycznie każde pomieszczenie w domu – pokój dzienny, sypialnia, jadalnia czy przedpokój, w zależności od tego, co chcemy w niej przechowywać. WNĘTRZE Komoda posiada pięć szuflad i półki,, które pomogą ci w rozmieszczeniu rzeczy. WYKOŃCZENIE Dekoracyjnie frezowane fronty szafek pełnią rolę uchwytów. Szuflady zostały wyposażone w system samodomykający, co zwiększa funkcjonalność kolekcji.', '', 'komoda-saint-tropez-stzk231b-z-oswietleniem', '', '', '', 'Komoda SAINT TROPEZ STZK231B z oświetleniem', '', '', '', ''),
(500, 1, 1, 'Szafka RTV WHITEBLACK 1D nie tylko zapewni miejsce na telewizor i wszystkie akcesoria, ale będzie również prawdziwą ozdobą wnętrza. Biała kolorystyka mebla i dekoracyjna aplikacja na froncie to elementy, dzięki którym mebel prezentuje się elegancko. WNĘTRZE W 2 szerokich, otwartych wnękach możesz ułożyć dekoder i konsolę. We wnęce za drzwiami pomieszczą się drobne akcesoria, płyty czy gry. WYKOŃCZENIE Meble WHITEBLACK są wykonane z płyt meblowych i wykończone laminatem. Fronty pokryto folią. Metalowe, czarne uchwyty świetnie pasują do nowoczesnego designu kolekcji. BIAŁE MEBLE DO SALONU Kolekcja WHITEBLACK świetnie sprawdzi się we współczesnych wnętrzach, jak i tych z elementami stylu glamour. Wyposażona w szklaną, podświetloną aplikację na frontach podkreśli nowoczesny charakter aranżacji. Dzięki zastosowaniu połysku na frontach meble nie przytłoczą pomieszczenia, a a dodatkowo je rozświetlą.', '', 'szafka-rtv-whiteblack-1d-z-podswietlanym-dekorem', '', '', '', 'Szafka RTV WHITEBLACK 1D z podświetlanym dekorem', '', '', '', ''),
(501, 1, 1, 'Komoda z kolekcji młodzieżowej w pięknej kolorystyce dębu sonoma, przełamanej wstawkami w dekorze antracytu świetnie wpisze się w aranżacją pokoju nastolatka. Uniwersalna kolorystyka sprawia, że pasuje niemal do każdego wnętrza. Ciepły odcień dębu rozjaśni pomieszczenie i sprawi, że będzie ono bardziej przytulne.', '', 'komoda-yoop-ypk-23', '', '', '', 'Komoda YOOP YPK-23', '', '', '', ''),
(502, 1, 1, 'Regał wiszący NEYLLE to wysokofunkcjonalny mebel o nowoczesnym designie. Stabilna, wielopoziomowa forma daje Ci przestrzeń, w której poukładasz różnego rodzaju przedmioty, tworząc tym samym unikalny klimat w swoim pomieszczeniu. WYKOŃCZENIE Korpus i blat wykonane są z płyty meblowej i pokryte folią w ciemnym kolorze, imitującą strukturę drewna. 5 półek tworzy łącznie 10 wnęk, które wykorzystasz do ustawienia kolekcji książek, filmów lub ulubionych pamiątek. Regał wiszący wchodzi w skład kolekcji NEYLLE, która charakteryzuje się elegancją i wyrazistością. Możesz go zestawić z szafkami RTV i otrzymać oryginalny regał modułowy. Regał posiada otwory, które pozwolą Ci w stabilny sposób przymocować mebel do ściany.', '', 'nowoczesny-regal-wiszacy-neyle', '', '', '', 'Nowoczesny regał wiszący NEYLE', '', '', '', ''),
(503, 1, 1, 'KOMODA TIZIANO Nowoczesna komoda o nietuzinkowym wyglądzie, która będzie atrakcyjnym akcentem, a jednocześnie zwiększy funkcjonalność wnętrza. Korpus w kolorze dąb antyczny łączy się z frontami w beżowym połysku. Takie oryginalne wybarwienie świetnie komponuje się z innymi kolorami, więc możliwość tworzenia własnych aranżacji jest niemal nieograniczona. To mebel dla osób, które cenią funkcjonalność połączoną z ciekawym designem. Jej przeznaczeniem może być niemal każde pomieszczenie w domu. WNĘTRZE We wnętrzu znajdują się półki, w których bez problemu schowasz, co tylko zechcesz – od biżuterii po ubrania. WYKOŃCZENIE Fronty wykonano z płyty MDF. Charakterystycznym elementem kolekcji są niestandardowe uchwyty, które świetnie komponują się z całością. PLIKI DO POBRANIA Ulotka: Pobierz &gt;&gt;', '', 'komoda-tiziano-trzydzwiowa', '', '', '', 'Komoda TIZIANO trzydzwiowa', '', '', '', ''),
(504, 1, 1, 'Szukasz małej komody do salonu wypełnionego roślinami? Mamy dla Ciebie komodę z kolekcji POLYPODY z miejscem do przechowywania kwiatów. Komoda ma wbudowaną skrzynię na rośliny, do której należy dokupić wkład z materiału nieprzepuszczającego wodę. Mebel można doposażyć w oświetlenie. ZA ZAMKNIĘTYMI DRZWIAMI Skorzystasz z 4 zamykanych wnęk - idealnych do trzymania dokumentów oraz kolekcji płyt. Do przechowywania kabli i akcesoriów przyda się 1 szuflada. Skrzynkę umieszczoną w blacie możesz wykorzystać jako kwietnik. Dokup donicę z tworzywa, by przechowywać w niej rośliny w bezpieczny sposób. NIE TYLKO DO SALONU URBAN JUNGLE Z kolekcją mebli POLYPODY stworzysz zielony kącik sprzyjający koncentracji i wyciszeniu. Komoda z miejscem na rośliny idealnie wpasuje się w pokój wypełniony kwiatami, egzotycznymi roślinami i dekoracjami z motywem dżungli Metalowe nogi i imitacja drewna sprawiają, że meble sprawdzą się także w surowych - loftowych wnętrzach OZNACZONA ZŁOTYM MEDALEM Kolekcja mebli POLYPODY otrzymała Złoty Medal MTP na Targach Meble Polska 2022. Została stworzona z myślą o osobach, które chcą przebywać w otoczeniu zieleni również w swoich mieszkaniach. Meble z tej kolekcji pozwalają wyeksponować rośliny bez konieczności kupowania dodatkowych stojaków.', '', 'mala-komoda-z-miejscem-na-kwiaty-polypody', '', '', '', 'Mała komoda z miejscem na kwiaty POLYPODY', '', '', '', ''),
(505, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 2 drzwi oraz 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz szuflady. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-2d2s-t2kk20-d30f', '', '', '', 'Komoda TEMPRA 2 2D2S T2KK20-D30F', '', '', '', ''),
(506, 1, 1, 'Marzysz o przytulnej sypialni? Nic prostszego! Kolekcja mebli do sypialni MOONDUST to świetne rozwiązanie do przestrzeni o intymnym nastroju. Prosty design kolekcji przełamany łagodnym połączeniem bieli z imitacją plecionej tkaniny wprowadzi ciepłą i zaciszną atmosferę w sypialni. Kolekcję mebli MOONDUST możesz zestawić z naczyniami z gliny oraz materiałami o wyrazistym splocie. WNĘTRZE 4 pojemne szuflady sprawdzą się do przechowywania podręcznych przedmiotów oraz odzieży. WYKOŃCZENIE Korpus, fronty oraz półki szafki MOONDUST wykonano z płyty meblowej pokrytej folią, więc łatwo utrzymać je w czystości. Małe, okrągłe uchwyty neutralnie dopełniają spokojny design mebla, umożliwiając wygodne otwarcie szuflad.', '', 'komoda-do-sypialni-moondust', '', '', '', 'Komoda do sypialni MOONDUST', '', '', '', ''),
(507, 1, 1, 'RTV OPENER to mebel, który idealnie sprawdza się jako uzupełnienie dla kolekcji mebli w ciemnej oprawie kolorystycznej. Nowoczesna, oszczędna linia oraz wzbogacona czarnymi elementami kolorystyka dębu kolonialnego nadaje wnętrzu elegancji. Świetnie łączy się z meblami tapicerowanymi naturalną skórą. Pod względem funkcjonalnym bryła szafki OPENER ma charakter otwarty, można na niej ustawić oprócz sprzętu RTV także książki o różnym formacie, płyty winylowe i CD oraz wiele różnych drobiazgów przydatnych w codziennych zajęciach. WNĘTRZE Otwarta przestrzeń pod blatem wręcz zaprasza do eksperymentów aranżacyjnych. Pojedyncza szuflada jest idealnym schowkiem dla ulubionej książki, instrukcji obsługi sprzętu RTV oraz pilotów. Ciekawe rozwiązanie stanowią również cztery półki otwarte w centralnej części bryły. WYKOŃCZENIE Wysokie nóżki sprawiają, że wizualnie RTV OPENER wydaje się lżejsza. Szafka została wykonana z płyty meblowej wykończonej laminatem, środkowym elementom pokrytym folią, w postaci półek oraz pojedynczej szuflady zostało nadane ciepłe wybarwienie dębu kolonialnego.', '', 'szafka-rtv-loft-opener', '', '', '', 'Szafka RTV loft OPENER', '', '', '', ''),
(508, 1, 1, 'Nowoczesna komoda o nietuzinkowym wyglądzie, która będzie atrakcyjnym akcentem, a jednocześnie zwiększy funkcjonalność wnętrza. Korpus komody wykonany został w ciepłym dekorze dąb sangallo, lekko połyskujące fronty są białe. Eleganckie i stylowe zestawienie kolorów wyeksponowano dzięki punktowemu oświetleniu zamontowanemu na wieńcu mebla. Jej przeznaczeniem może być praktycznie każde pomieszczenie w domu – pokój dzienny, sypialnia, jadalnia czy przedpokój, w zależności od tego, co chcemy w niej przechowywać. WNĘTRZE Czterodrzwiowa komoda z szufladami i półkami, które pomogą ci w rozmieszczeniu rzeczy. Możesz przechowywać w niej wszystko – od ubrań po przybory kuchenne. WYKOŃCZENIE Dekoracyjnie frezowane fronty szafek pełnią rolę uchwytów. Szuflady zostały wyposażone w system samo-domykający, co zwiększa atrakcyjność kolekcji.', '', 'komoda-saint-tropez-stzk241b-z-oswietleniem', '', '', '', 'Komoda SAINT TROPEZ STZK241B z oświetleniem', '', '', '', ''),
(509, 1, 1, 'Szafka RTV MAREY to połączenie interesującego koloru dębu szlachetnego oraz struktury imitującej fakturę drewna z popularną i uniwersalną bielą w połysku na frontowej części mebla. Szafka w klasycznym układzie dwóch szuflad i z dwiema wnękami na sprzęt RTV to idealne rozwiązanie do pokoju dziennego czy sypialni. Masywne ramki otaczające mebel tworzą ciekawy wzór. Szafka jest wyposażona w dwie szuflady z systemem samodomykającym. Duże uchwyty w srebrnym kolorze podkreślają kształt mebla. WNĘTRZE Szafka składa się z półek otwartych i dwoje szuflad. WYKOŃCZENIE Kolorystyka mebla, która opiera się na połączeniu ciemnego drewna i bieli tworzy przyjemny dla oka kontrast, który doskonale sprawdza się przy wielu aranżacjach. Całości dopełniają uchwyty w kolorze chrom. Szafka RTV MAREY została również wyposażona w prowadnice quadro z hamulcem, które zapobiegają szybkiemu zużyciu mebla w trakcie eksploatacji. .', '', 'szafka-rtv-marey-2s', '', '', '', 'Szafka RTV MAREY 2S', '', '', '', ''),
(510, 1, 1, 'Kolekcja TULUZA w niebanalny sposób zaaranżuje salon przyciągającymi wzrok, oryginalnymi rozwiązaniami designerskimi. Spokojna biel w połączeniu z ciepłą barwą dąb artisan wniesie do przestrzeni przytulną atmosferę pomieszczenia, w którym można przyjemnie odpocząć i spędzić czas. Komoda TULUZA 2D to mebel znacząco ułatwiający przechowywanie w salonie, a także w sypialni. Pojemne wnęki szafek pomieszczą sporo akcesoriów umożliwiając zachowanie porządku, a oświetlenie ledowe podkreśla ciepłą elegancję mebla. WNĘTRZE ● W dwóch zamykanych szafkach znajdują się cztery pojemne wnęki ; ● Maksymalne obciążenie półki to 5 kg ; ● D wie otwarte półki idealnie nadają się do przechowywania podręcznych akcesoriów oraz przedmiotów codziennego użytku; ● Szeroki blat komody o wymiarach 43,2x103,5 cm świetnie sprawdzi się jako przestrzeń do eksponowania fotografii, dekoracyjnych bibelotów lub cennych pamiątek rodzinnych. WYKOŃCZENIE ● Korpus komody, blat oraz półki wykonane są z płyty meblowej i wykończone folią , dzięki czemu mebel jest wytrzymały i odporny na wilgoć; ● W standardzie jest oświetlenie na froncie komody pięknie podkreślające linię podziału w kolorze dębu artisan. Za dopłatą można doposażyć mebel w dwa punkty oświetlenia we wnętrzach półek otwartych ; ● Elegancję komody podkreślają chromowe, połyskujące uchwyty ; ● Dyskretne nóżki-ślizgacze z tworzywa sztucznego ułatwiają przesuwanie komody minimalizując ryzyko zarysowania podłogi. UWAGA na zdjęciach widoczne są oba oświetlenia, standardowe i opcjonalne, dodatkowo płatne', '', 'komoda-tuluza-2d-z-oswietleniem', '', '', '', 'Komoda TULUZA 2D z oświetleniem', '', '', '', ''),
(511, 1, 1, 'KOMODA LOCARNO Komoda z kolekcji Locarno to połączenie funkcjonalności z nowoczesnym designem. Jasna kolorystyka Dębu Nelson została przełamana ryflowanymi wstawkami w głębokim odcieniu szarości, które są znakiem rozpoznawczym całej kolekcji. Subtelnie zaokrąglone fronty dodają bryłom uroku a poziome srebrne uchwyty podkreślają nowoczesny charakter mebli. WNĘTRZE Wewnątrz znajdują się pojemne półki oraz cztery szuflady, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Górna i dolna część drzwi oraz ryflowana wstawka zostały wykonane z płyty MDF. Srebrne uchwyty świetnie prezentują się na tle dekoru dębowego tworząc przyjemny, nowoczesny akcent.', '', 'komoda-locarno-lcrk231', '', '', '', 'Komoda LOCARNO LCRK231', '', '', '', ''),
(512, 1, 1, 'Komoda HEY z programu do pokoju młodzieżowego to połączenie dwóch nowoczesnych i popularnych kolorów. Dzięki temu łatwo je łączyć z innymi meblami lub dobrać odpowiednie dodatki. Komoda w wersji z 4 szufladami będzie doskonała na wszystkie drobiazgi lub ubrania. Uniwersalna konstrukcja komody pozwoli na zastosowanie jej nie tylko w pokoju młodzieżowym, ale w każdym innym pomieszczeniu. Solidne uchwyty imitujące kolor aluminium podkreślają nowoczesny charakter i przyciągają uwagę, pozwalają na swobodne otwieranie szuflad. Front komody jak i blat został pozbawiony tradycyjnych prostych linii co tworzy ciekawą bryłę geometryczną. WNĘTRZE Komoda wyposażona jest w 4 pojemne szuflady, wysuwane za pomocą prowadnic kulkowych. WYKOŃCZENIE Mebel jest wykonany z płyty meblowej pokrytej laminatem oraz płyty i listew MDF pokrytych folią cechującymi się trwałością i łatwością w utrzymaniu czystości.', '', 'komoda-hey-heyk211-c230', '', '', '', 'Komoda HEY HEYK211-C230', '', '', '', ''),
(513, 1, 1, 'Szafka RTV SNOW w kolorze białym idealnie wpisze się w każde wnętrze. Prosta forma mebla została otoczona pogrubioną ramą, która nadaje mu geometryczną formę. Biel świetnie komponuje się ze wszystkimi kolorami, co daje nieskończone możliwości w tworzeniu własnych aranżacji. WNĘTRZE Szafka posiada dwie pojemne szuflady i otwarte półki na sprzęt. Wymiary wnęki: szerokość 75,5 cm, głębokość 49 cm, wysokość 28 cm/21,5 cm licząc z listwą. WYKONANIE Szuflady wyposażono w system cichego domykania. Srebrne uchwyty i nóżki idealnie komponują się z białą stylistyką mebla. PLIKI DO POBRANIA Instrukcja montażu: Pobierz &gt;&gt; Ulotka: Pobierz &gt;&gt;', '', 'szafka-rtv-biala-z-szufladami-snow', '', '', '', 'Szafka RTV biała z szufladami SNOW', '', '', '', ''),
(514, 1, 1, 'Szafka RTV ELZZAN posiada 2 zamykane szafki, 2 otwarte półki i szufladę . Biały kolor z połyskiem estetycznie kontrastuje z czarnymi uchwytami i nóżkami mebla. Łączy się z aranżacjami w szarości i bieli, ale również jest doskonałym tłem dla żywych, intensywnych kolorów. RTV ELZZAN to mebel w całości wykonany z płyty meblowej i wykończony białą folią z połyskiem jest doskonałym wyborem do większości wnętrz. WNĘTRZE RTV posiada 2 zamykane szafki, 2 otwarte półki i szufladę. Szuflada zostały zamontowane na prowadnicach kulkowych . Wnętrze można swobodnie wykorzystać do trzymania sprzętu RTV oraz osobistych drobiazgów. WYKOŃCZENIE RTV została wykonana z płyty meblowej w kolorze uniwersalnej bieli oraz pokryta folią z połyskiem . Uchwyty są z aluminium i pokryte czarnym, matowym kolorem - ładnie uzupełniają front mebla. KOLEKCJA ELZZAN Meble, które wchodzą w skład kolekcji ELZZAN najlepiej prezentują się w jadalni, salonie lub pokoju dziennym. Pozwalają w kompletny sposób urządzić wnętrze, a ich design cechuje prostota, uniwersalność i funkcjonalność. Pojemne wnętrza pozwalają schować używane na co dzień drobiazgi lub wyeksponować dodatki dekoracyjne i sprzęt RTV. Ich atutem jest biała kolorystyka z połyskiem .', '', 'szafka-rtv-z-polyskiem-biala-elzzan', '', '', '', 'Szafka RTV z połyskiem biała ELZZAN', '', '', '', ''),
(515, 1, 1, 'KOMODA TRASS TRAK221 Komoda z kolekcji mebli Trass to pomysł na ciekawą aranżację sypialni lub salonu, ciemniejsza kolorystyka będzie dobrze komponować się w jasnych pomieszczeniach. Dwudrzwiowa komoda z półkami w środku idealnie sprawdzi się na pościel, ręczniki itp. Cała kolekcja to system nowoczesnych mebli, prostych, a zarazem mających swój styl i charakter. WNĘTRZE Dwudrzwiowa komoda z półkami w środku. WYKOŃCZENIE Kolekcja charakteryzuje się oryginalnym kolorem dębu w połączeniu z czarnymi wstawkami. Obrzeża poziome i pionowe listwy z płyty MDF.', '', 'komoda-trass-trak221', '', '', '', 'Komoda TRASS TRAK221', '', '', '', ''),
(516, 1, 1, 'SZAFKA RTV TIZIANO Stylowa szafka RTV wykonana w dekorze dąb antyczny, idealnie odwzorowującym strukturę usłojenia drewna. Fronty zostały wykonane w beżowym połysku. Rolę uchwytów pełnią oryginalnie frezowane fronty. Szafka pochodzi z kolekcji nowoczesnych mebli Tiziano. Nad szufladami znajduje się miejsce na sprzęt audio-wideo. To doskonały wybór do pokoju dziennego. WYKOŃCZENIE Trzy szuflady i półki sprawdzą się doskonale do przechowywania sprzętu audio-wideo i dodatkowych akcesoriów. Wymiary wnęki otwartej to: szerokość 55,81 cm, głębokość 50,4 cm, wysokość 13,3 cm PLIKI DO POBRANIA Ulotka: Pobierz &gt;&gt;', '', 'szafka-rtv-tiziano', '', '', '', 'Szafka RTV TIZIANO', '', '', '', ''),
(517, 1, 1, 'Komoda HEY z programu do pokoju młodzieżowego to połączenie dwóch nowoczesnych i popularnych kolorów. Dzięki temu łatwo je łączyć z innymi meblami lub dobrać odpowiednie dodatki. Komoda w wersji z jedną szufladą i półką będzie doskonała na wszystkie drobiazgi lub ubrania. Konstrukcja komody pozwoli na zastosowanie jej nie tylko w pokoju młodzieżowym, ale w każdym innym pomieszczeniu. Solidne uchwyty imitujące kolor aluminium podkreślają nowoczesny charakter i przyciągają uwagę, pozwalają na swobodne otwieranie szuflad. Front komody jak i blat został pozbawiony tradycyjnych prostych linii co tworzy ciekawą bryłę geometryczną. WNĘTRZE Komoda wyposażona jest w szufladę, wysuwaną za pomocą prowadnicy kulkowej i półkę. WYKOŃCZENIE Mebel jest wykonany z płyty meblowej pokrytej laminatem oraz płyty i listew MDF pokrytych folią cechującymi się trwałością i łatwością w utrzymaniu czystości.', '', 'komoda-hey-heyk221-c230', '', '', '', 'Komoda HEY HEYK221-C230', '', '', '', ''),
(518, 1, 1, 'Regał MAURO to minimalistyczna bryła w ciepłym kolorze naturalnego drewna. Sprawdzi się w niewielkich wnętrzach lub może być podstawą większej kombinacji, kiedy zmienią się Twoje potrzeby. Regał możesz wykorzystać jako miejsce do uporządkowania dokumentów w domowym biurze lub jako półkę na książki i czasopisma w kąciku do czytania. Możesz ustawić na nim kwiaty lub stylowe dekoracje. Lekka i uniwersalna konstrukcja pozwala na wiele możliwości wykorzystania bryły. Wnęka ma wymiary: 33x33 cm. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. Regał MAURO MXXR221 występuje w czterech wariantach kolorystycznych: czarnym, białym, szarym i dębowym.', '', 'regal-mauro-727x728-cm-debowy', '', '', '', 'Regał MAURO 72,7x72,8 cm dębowy', '', '', '', ''),
(519, 1, 1, 'Komoda ELZZAN doskonale podkreśla nowoczesny styl w wystroju wnętrza. To mebel pojemny, funkcjonalny wyposażony w zamykaną na pojedyncze drzwi szafkę oraz 3 szuflady. W całości wykonany z płyty meblowej i wykończony białą folią z połyskiem jest uzupełnieniem dla reprezentacyjnej części mieszkania. WNĘTRZE Komoda posiada zamykaną szafkę (z półką) i 3 szuflady. Szuflady zostały zamontowane na prowadnicach kulkowych. Wnętrze komody można swobodnie wykorzystać do trzymania zastawy oraz obrusów lub ubrań lub osobistych drobiazgów. WYKOŃCZENIE Komoda została wykonana z płyty meblowej w kolorze uniwersalnej bieli oraz pokryta folią z połyskiem Uchwyty są z aluminium i pokryte czarnym, matowym kolorem - ładnie uzupełniają front mebla. KOLEKCJA ELZZAN Meble, które wchodzą w skład kolekcji ELZZAN najlepiej prezentują się w jadalni, salonie lub pokoju dziennym. Pozwalają w kompletny sposób urządzić wnętrze, a ich design cechuje prostota, uniwersalność i funkcjonalność. Pojemne wnętrza pozwalają schować używane na co dzień drobiazgi lub wyeksponować dodatki dekoracyjne i sprzęt RTV. Ich atutem jest biała kolorystyka z połyskiem .', '', 'komoda-z-3-szufladami-elzzan', '', '', '', 'Komoda z 3 szufladami ELZZAN', '', '', '', ''),
(520, 1, 1, 'SZAFKA RTV Stylowa szafka RTV wykonana w dekorze dąb antyczny, idealnie odwzorywującym strukturę usłojenia drewna. Fronty zostały wykonane w beżowym połysku. Rolę uchwytów pełnią oryginalnie wyfrezowane fronty. Szafka pochodzi z kolekcji nowoczesnych mebli Tiziano. Nad szufladami znajduje się miejsce na sprzęt audio-wideo. To doskonały wybór do pokoju dziennego. WYKOŃCZENIE Dwie szuflady i dwie półki sprawdzą się doskonale do przechowywania sprzętu audio-wideo i dodatkowych akcesoriów. PLIKI DO POBRANIA Ulotka: Pobierz &gt;&gt;', '', 'szafka-rtv-tiziano', '', '', '', 'Szafka RTV TIZIANO', '', '', '', ''),
(521, 1, 1, 'SZAFKA RTV SAINT TROPEZ Nowoczesna szafka RTV o nietuzinkowym wyglądzie, która będzie atrakcyjnym akcentem, a jednocześnie zwiększy funkcjonalność wnętrza. Korpus szafki wykonany został w ciepłym dekorze dąb sangallo, lekko połyskujące fronty są białe. Eleganckie i stylowe zestawienie kolorów wyeksponowano dzięki punktowemu oświetleniu zamontowanemu na wieńcu mebla. WNĘTRZE Trzydrzwiowa szafka z półkami, które pomogą w rozmieszczeniu rzeczy. Otwarta półka na sprzęt audio-wideo jest szeroka dzięki czemu zmieści się na niej nawet pokaźnych rozmiarów sprzęt. WYKOŃCZENIE Dekoracyjnie frezowane fronty szafek pełnią rolę uchwytów.', '', 'szafka-rtv-saint-tropez-z-oswietleniem', '', '', '', 'Szafka RTV SAINT TROPEZ z oświetleniem', '', '', '', ''),
(522, 1, 1, 'Szafka RTV HAVANNA to nieskomplikowany mebel o prostej bryle, nawiązujący stylistycznie do lat 60 czy 70 ubiegłego wieku, kiedy geometryczne kształty weszły na salony. Modernistyczne nawiązania odnaleźć można również we współczesnym designie, stąd szafka dobrze wkomponuje się zarówno we wnętrza nowoczesne, jak i w stylu vintage. Mebel będzie świetnie pełnił funkcję podstawy pod telewizor, uzupełniając umeblowanie pokoju wypoczynkowego. WNĘTRZE Za dwoma otwieranymi frontami znajdują się półki, na których umieścisz swoją kolekcję muzyczną czy filmową. Wnęka pośrodku szafki to doskonałe miejsce na dekoder czy kolorowe magazyny. WYKOŃCZENIE Szafkę RTV HAVANNA pokryto okleiną imitującą postarzone, dębowe drewno. Jedynymi elementami urozmaicającymi powierzchnię są proste, czarne uchwyty kontrastujące z pokryciem szafki. Wymiary wnęki - szerokość 52,5 cm, głębokość 40 cm, wysokość 13 cm (22,5 cm górna).', '', 'szafka-rtv-havanna-2d', '', '', '', 'Szafka RTV HAVANNA 2D', '', '', '', ''),
(523, 1, 1, 'Szafka SNOW w kolorze białym idealnie wpisze się w każde wnętrze. Prosty kształt mebla został otoczony pogrubioną ramą, a fronty ozdobione poziomymi frezowaniami. Biel świetnie komponuje się ze wszystkimi kolorami, co daje nieskończone możliwości w tworzeniu własnych aranżacji. Srebrne, metalowe uchwyty i nóżki idealnie komponują się z białą stylistyką mebla. WNĘTRZE Pojemna szafka została podzielona na 10 pakownych półek. To optymalne rozwiązanie, by zmieścić wszystkie niezbędne rzeczy i wygodnie je uporządkować. WYKONANIE krawędzie szafki są zaokrąglone i zabezpieczone obrzeżami ABS; fronty wykonano z płyty MDF, korpus z płyty laminowanej;', '', 'szafka-snow-snwk521', '', '', '', 'Szafka SNOW SNWK521', '', '', '', ''),
(524, 1, 1, 'Kolekcja TULUZA w niebanalny sposób zaaranżuje salon przyciągającymi wzrok, oryginalnymi rozwiązaniami designerskimi. Spokojna biel w połączeniu z ciepłą barwą dąb artisan wniesie do przestrzeni przytulną atmosferę pomieszczenia, w którym można przyjemnie odpocząć i spędzić czas. Szafka RTV TULUZA 2S to mebel, na którym telewizor oraz sprzęt elektroniczny prezentują się z elegancją i dobrze wpasowują w wyposażenie salonu. Pojemne wnęki świetnie nadają się do dyskretnego ustawienia dekoderów i mniejszych sprzętów, a pojemne szuflady zwiększą przestrzeń przechowywania dodatkowych akcesoriów. Oświetlenie ledowe podkreśla ciepłą elegancję mebla. Wymiary wnęki - szerokość 106,5 cm (55 cm prawej), głębokość 36 cm, wysokość 16 cm. WNĘTRZE ● Szeroki blat szafki o wymiarach 53,9x163,2 cm świetnie sprawdzi się jako przestrzeń do postawienia telewizora; ● Dwie otwarte półki szafki idealnie nadają się do przechowywania sprzętu RTV; ● Dwie szuflady zamontowane są na prowadnicach z hamulcem, co zapobiega głośnemu trzaskaniu podczas nieuważnego zamykania; WYKOŃCZENIE ● Korpus szafki oraz półki wykonane są z płyty meblowej i wykończone folią , dzięki czemu mebel jest wytrzymały i odporny na wilgoć; ● W standardzie jest oświetlenie na froncie szafki pięknie podkreślające linię podziału w kolorze dębu artisan. Za dopłatą można doposażyć mebel w dwa punkty oświetlenia w otwartych wnękach ; ● Elegancję szafki podkreślają chromowe, połyskujące uchwyty ; ● Dyskretne nóżki-ślizgacze z tworzywa sztucznego ułatwiają przesuwanie szafki minimalizując ryzyko zarysowania podłogi.', '', 'szafka-rtv-tuluza-2s-z-oswietleniem', '', '', '', 'Szafka RTV TULUZA 2S z oświetleniem', '', '', '', ''),
(525, 1, 1, 'Kolekcja TULUZA w niebanalny sposób zaaranżuje salon przyciągającymi wzrok, oryginalnymi rozwiązaniami designerskimi. Spokojna biel w połączeniu z ciepłą barwą dąb artisan wniesie do przestrzeni przytulną atmosferę pomieszczenia, w którym można przyjemnie odpocząć i spędzić czas. Komoda TULUZA 2D4S to mebel znacząco ułatwiający przechowywanie w salonie, a także w sypialni. Pojemne wnęki szafek pomieszczą sporo akcesoriów umożliwiając zachowanie porządku, a oświetlenie ledowe podkreśla ciepłą elegancję mebla. WNĘTRZE ● W dwóch zamykanych szafkach znajdują się cztery pojemne wnęki ; ● Maksymalne obciążenie półki to 5 kg ; ● Dwie otwarte półki komody idealnie nadają się do przechowywania podręcznych akcesoriów oraz przedmiotów codziennego użytku; ● Cztery szuflady zamontowane są na prowadnicach z hamulcem , co zapobiega głośnemu trzaskaniu podczas nieuważnego zamykania; ● Szeroki blat komody o wymiarach 43,2x163,2 cm świetnie sprawdzi się jako przestrzeń do eksponowania fotografii, dekoracyjnych bibelotów lub cennych pamiątek rodzinnych. WYKOŃCZENIE ● Korpus komody, blat oraz półki wykonane są z płyty meblowej i wykończone folią , dzięki czemu mebel jest wytrzymały i odporny na wilgoć; ● W standardzie jest oświetlenie na froncie komody pięknie podkreślające linię podziału w kolorze dębu artisan. Za dopłatą można doposażyć mebel w dwa punkty oświetlenia w otwartych wnękach ; ● Elegancję komody podkreślają chromowe, połyskujące uchwyty ; ● Dyskretne nóżki-ślizgacze z tworzywa sztucznego ułatwiają przesuwanie komody minimalizując ryzyko zarysowania podłogi.', '', 'komoda-tuluza-2d4s-z-oswietleniem', '', '', '', 'Komoda TULUZA 2D4S z oświetleniem', '', '', '', ''),
(526, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 3 drzwi oraz 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada zamykane szafki z półkami oraz szuflady. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-3d2s-t2kk40-d30f', '', '', '', 'Komoda TEMPRA 2 3D2S T2KK40-D30F', '', '', '', ''),
(527, 1, 1, 'Praktyczna i nowoczesna komoda z kolekcji Julietta doda wnętrzu oryginalnego charakteru. Białe fronty zostały ujęte wyrazistą ramą w kolorze dębu sonoma, która nadaje meblowi solidny wygląd. Ciekawym i nietypowym rozwiązaniem są otwarte półki, dzięki którym wyeksponujesz swoje ulubione dodatki. Srebrne uchwyty i nóżki dopełniają całość, tworząc spójny styl. WNĘTRZE Komoda posiada jedne drzwi, za którymi ukryte są półki oraz cztery szuflady i półki otwarte. INSTRUKCJA MONTAŻU Pobierz instrukcję montażu', '', 'komoda-julietta-crmk35l', '', '', '', 'Komoda JULIETTA CRMK35L', '', '', '', ''),
(528, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 2 drzwi, w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada zamykane szafki z półkami. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-2d-t2kk30-d30f', '', '', '', 'Komoda TEMPRA 2 2D T2KK30-D30F', '', '', '', ''),
(529, 1, 1, 'Aby stworzyć kącik telewizyjny w swoim salonie wybierz szafkę RTV POLYPODY. Wraz z pozostałymi meblami z kolekcji idealnie wpasuje się do wnętrz urządzonych w stylu urban jungle. KĄCIK FILMOWY W TWOIM SALONIE W szafce RTV POLYPODY zmieścisz najpotrzebniejsze przedmioty. Na blacie umieścisz telewizor oraz dekoracje. Za zamykanymi drzwiami - w 2 wnękach schowasz kolekcję ulubionych filmów lub akcesoria elektroniczne. NIE TYLKO DO SALONU URBAN JUNGLE Z meblami POLYPODY stworzysz zielony kącik sprzyjający koncentracji i wyciszeniu. Meble z miejscem na rośliny idealnie wpasują się w pokój wypełniony kwiatami, egzotycznymi roślinami i dekoracjami z motywem dżungli. OZNACZONA ZŁOTYM MEDALEM Kolekcja mebli POLYPODY otrzymała Złoty Medal MTP na Targach Meble Polska 2022. Została stworzona z myślą o osobach, które chcą przebywać w otoczeniu zieleni również w swoich mieszkaniach. Meble z tej kolekcji pozwalają wyeksponować rośliny bez konieczności kupowania dodatkowych stojaków.', '', 'szafka-rtv-z-polkami-polypody', '', '', '', 'Szafka RTV z półkami POLYPODY', '', '', '', ''),
(530, 1, 1, 'RTV OPENER to mebel, który idealnie sprawdza się jako uzupełnienie dla kolekcji mebli w ciemnej oprawie kolorystycznej. Nowoczesna, oszczędna linia oraz wzbogacona czarnymi elementami kolorystyka dębu kolonialnego nadaje wnętrzu elegancji. Świetnie łączy się z meblami tapicerowanymi naturalną skórą. Pod względem funkcjonalnym bryła szafki OPENER ma charakter otwarty, można na niej ustawić oprócz sprzętu RTV także książki o różnym formacie, płyty winylowe i CD oraz wiele różnych drobiazgów przydatnych w codziennych zajęciach. WNĘTRZE Otwarta przestrzeń pod blatem wręcz zaprasza do eksperymentów aranżacyjnych. Pojedyncza szuflada jest idealnym schowkiem dla ulubionej książki, instrukcji obsługi sprzętu RTV oraz pilotów. Ciekawe rozwiązanie stanowią również cztery półki otwarte w centralnej części bryły. WYKOŃCZENIE Wysokie nóżki sprawiają, że wizualnie RTV OPENER wydaje się lżejsza. Szafka została wykonana z płyty meblowej wykończonej laminatem, środkowym elementom pokrytym folią, w postaci półek oraz pojedynczej szuflady zostało nadane ciepłe wybarwienie dębu kolonialnego.', '', 'szafka-rtv-opener-opnt141-c990', '', '', '', 'Szafka RTV OPENER OPNT141-C990', '', '', '', ''),
(531, 1, 1, 'Dzięki komodzie SIENNA uporządkujesz rzeczy codziennego użytku. Będzie odpowiednia do domowego biura, sypialni czy przedpokoju. Pozwoli Ci posegregować ubrania, książki, segregatory z dokumentami i inne potrzebne drobiazgi. WNĘTRZE W 5 wnękach szafki pomieścisz część obuwia Twojej rodziny czy kapcie dla gości. 2 szuflady posłużą do przechowywania kluczy i innych drobiazgów, których używasz, gdy wychodzisz z mieszkania. Blat wykorzystasz do wyeksponowania ulubionych dekoracji, które nadadzą wnętrzu pożądanego charakteru. WYKOŃCZENIE Komoda wykonana jest z płyt meblowych i wykończona folią. Białe, połyskujące fronty powiększą optycznie przestrzeń. Brak nóżek sprawia, że łatwiej będzie Ci utrzymać czystość. Uwagę przyciągają frezowane uchwyty, które podkreślają minimalistyczny charakter mebla.', '', 'komoda-sienna-2s2d', '', '', '', 'Komoda SIENNA 2S2D', '', '', '', ''),
(532, 1, 1, 'Szafka RTV z kolekcji NEYLE to mebel, który sprawi, że Twój kącik telewizyjny będzie stanowił centralne miejsce salonu. Szafka posiada charakterystyczną nadstawkę z 2 otwartymi półkami, która wyróżnia ją na tle tradycyjnych szafek RTV. Szafkę NEYLE możesz wykorzystać jako bezpośrednią podstawę pod telewizor lub zdecydować się na rozwiącanie, w którym telewizor wisi nad szafką. Drugie rozwiązanie pozwoli Ci wygospodarować blat: postaw na nim świeczki, kwiaty lub inne dekoracje. WNĘTRZE 3 szuflady osadzone na łatwych w montażu prowadnicach kulkowych. Szufladę wyciągniesz płynnie nawet przy większym obciążeniu, dzięki czemu możesz do niej schować teczki z dokumentami lub książki, bez obawy o zniszczenie mechanizmu wysuwającego. Szafka posiada dwie otwarte półki, które możesz wykorzystać do postawienia konsoli lub dekodera. Zarówno w półkach, jak i szufladach znajdują się otwory na kable. Sam zdecyduj, czy Twój sprzęt elektroniczny będzie stał widoczny, czy wolisz go schować. WYKOŃCZENIE Korpus i blat wykonane są z płyty meblowej i pokryte folią w ciemnym kolorze, imitującą strukturę drewna. Wstęgi szuflad pokryte są czarną folią. W połączeniu z ciemnym kolorem drewna mebel prezentuje się gustownie i z klasą. Metalowe, proste uchwyty stanowią elegancki element ozdobny i służą wygodnemu otwarciu szuflady Szafka osadzona jest na ozdobnych, ażurowych nogach wykonanych z metalu. Metalowe elementy są cechą charakterystyczną kolekcji NEYLE i nadają meblom wyrazistości. Szafkę możesz zestawić z regałem wiszącym z kolekcji NEYLE i otrzymać oryginalny, wielopoziomowy regał modułowy.', '', 'szafka-rtv-z-szufladami-na-metalowych-nogach-neyle', '', '', '', 'Szafka RTV z szufladami na metalowych nogach NEYLE', '', '', '', ''),
(533, 1, 1, 'Regał MAURO to minimalistyczna bryła, która sprawdzi się w małych wnętrzach. Może być także podstawą większej kombinacji, kiedy zmienią się Twoje potrzeby. Regał sprawdzi się jako półka na książki i czasopisma w kąciku do czytania. Możesz ustawić na nim kwiaty lub stylowe dekoracje. Regał MAURO wykorzystasz również jako szafkę nocną w minimalistycznych wnętrzach. Wnęka ma wymiary 33x33 cm. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. Regał MAURO MXXR011 występuje w czterech wariantach kolorystycznych: czarnym, białym, szarym i dębowym.', '', 'regal-mauro-382x382-cm-bialy', '', '', '', 'Regał MAURO 38,2x38,2 cm biały', '', '', '', ''),
(534, 1, 1, 'Komoda ELZZAN podkreśla nowoczesny styl w wystroju wnętrza. To mebel pojemny, funkcjonalny, wyposażony w zamykaną na podwójne drzwi szafkę oraz 3 szuflady . W całości wykonany z płyty meblowej i wykończony białą folią z połyskiem jest doskonałym wyborem do jasnych, dobrze doświetlonych wnętrz. Komoda ELZZAN jest istotnym uzupełnieniem dla reprezentacyjnej części mieszkania. WNĘTRZE Komoda ma zamykaną szafkę (z półką) i 3 szuflady Szufladę zamontowano na prowadnicach kulkowych , które zapewniają płynne wysuwanie. Wnętrze komody można wykorzystać do trzymania zastawy oraz obrusów lub ubrań lub osobistych drobiazgów WYKOŃCZENIE Komodę wykonano z płyty meblowej i pokryta białą folią z połyskiem Uchwyty są z aluminium i pokryte czarnym, matowym kolorem - ładnie uzupełniają front mebla KOLEKCJA ELZZAN Meble, które wchodzą w skład kolekcji ELZZAN najlepiej prezentują się w jadalni, salonie lub pokoju dziennym. Pozwalają w kompletny sposób urządzić wnętrze, a ich design cechuje prostota, uniwersalność i funkcjonalność. Pojemne wnętrza pozwalają schować używane na co dzień drobiazgi lub wyeksponować dodatki dekoracyjne i sprzęt RTV. Ich atutem jest biała kolorystyka z połyskiem .', '', 'komoda-biala-z-szufladami-elzzan', '', '', '', 'Komoda biała z szufladami ELZZAN', '', '', '', ''),
(535, 1, 1, 'Komoda PRISCO świetnie prezentuje się w salonie oraz jadalni. Doskonale nadaje się nie tylko do przechowywania książek, dekoracji oraz osobistych drobiazgów, ale również eksponowania elementów dekoracyjnych. Nowoczesny design komody PRISCO cechują wyważone elementy dekoracyjne oraz kolorystyka, która łączy wybarwienie dąb craft złoty z czarnym kolorem. WNĘTRZE Komoda posiada 3 zamykane szafki Szuflada znajduje się w środkowej części mebla W zamkniętym wnętrzu znajdują się 6 wnęk Maksymalny udźwig blatu komody wynosi 20 kg WYKOŃCZENIE Komoda została wykonana z płyty meblowej, wykończonej laminatem Fronty mebla to MDF pokryty folią PVC Frezowane fronty pełnią funkcję uchwytów.', '', 'komoda-z-szuflada-prisco-1505-cm', '', '', '', 'Komoda z szufladą PRISCO 150,5 cm', '', '', '', ''),
(536, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 2 drzwi oraz 2 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada zamykane szafki (mniejszą i większą) z półkami oraz 2 szuflady. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-2d2s-t2kk50-d30f', '', '', '', 'Komoda TEMPRA 2 2D2S T2KK50-D30F', '', '', '', ''),
(537, 1, 1, 'Szukasz nowoczesnych mebli do swojego salonu? Szafka RTV LACO spodoba Ci się ze względu na swoje niebanalne połączenie kolorów. Barwa imitująca wybarwienie dębu oraz kolor czarny to obecnie jedno z najmodniejszych zestawień. A dzięki zastosowaniu efektu czarnej ramy froncie szafki, kącik wypoczynkowy nabiera nietuzinkowego charakteru. Kolor naturalnego drewna wizualnie ociepla przestrzeń i wprowadza przytulny klimat. WNĘTRZE W 2 otwartych wnękach zmieści się dekoder oraz konsola. Szafki wykorzystasz do uporządkowania urządzeń elektronicznych oraz innych innych akcesoriów. Maksymalne obciążenie półki wynosi 5 kg. WYKOŃCZENIE Szafka RTV LACO jest z płyty meblowej wykończonej laminatem, dlatego jest łatwa w czyszczeniu. Czarna ramka na przodzie jest wykończona w wysokim połysku, natomiast część w kolorze dębu ma matowe wykończenie, więc mebel będzie pasował do nowoczesnych oraz bardziej klasycznych wnętrz. KOLEKCJA LACO To propozycja dla osób pragnących stworzyć oryginalny charakter wnętrza. Meble LACO sprawdzą się w zarówno w nowoczesnych, jak i industrialnych mieszkaniach – wszędzie tam, gdzie chcemy wprowadzić nowatorski, strukturalny efekt. Obok tej kolekcji nie można przejść obojętnie!', '', 'szafka-rtv-do-salonu-laco', '', '', '', 'Szafka RTV do salonu LACO', '', '', '', ''),
(538, 1, 1, 'Jeśli szukasz pojemnej szafki pod telewizor i sprzęt stereo, szafka RTV 2 drzwiowa SALGADO spełni Twoje oczekiwania. Dzięki nowoczesnemu połączeniu koloru jasnego dębu z czernią, mebel dopasujesz do pomieszczeń utrzymanych w loftowym klimacie. Na otwartych półkach zmieścisz konsolę do gier i dekoder telewizji kablowej. W szafkach po obu stronach, pilot od telewizora, płyty albo retro kolekcję kaset magnetofonowych. Zestaw szafkę z pozostałymi meblami z kolekcji SALGADO i ciesz się wystrojem salonu z asymetrycznym motywem. WNĘTRZE Pojemne szafki za pełnymi drzwiami usytuowano po obu stronach mebla. Półki udźwigną rzeczy o wadze do 5 kg. WYKOŃCZENIE Mebel został zrobiony z 18 mm płyty meblowej. Szafkę pokryto laminatem czarnym i laminatem w kolorze jasnego dębowego drewna. W drzwiach zamontowano uchwyty z tworzywa. Nogi szafk i RTV SALGADO wykonano z tworzywa sztucznego.', '', 'szafka-pod-telewizor-salgado', '', '', '', 'Szafka pod telewizor SALGADO', '', '', '', ''),
(539, 1, 1, 'Komoda z kolekcji SANDY to nowoczesny mebel do zastosowania w salonie, przedpokoju lub sypialni. Dzięki szerokim listwom wzdłuż boków szafki oraz krótkim, nieregulowanym nóżkom meble z kolekcji SANDY sprawiają wrażenie solidnych i masywnych. Ciepły odcień dębu dodaje pomieszczeniu przytulności, którą dodatkowo wzmaga jeszcze oświetlenie LED o ciepłej, białej barwie. Brak widocznych uchwytów i delikatne żłobienia na froncie dodają meblom elegancji. WNĘTRZE Wnętrze komody kryje wnęki oraz dwie praktyczne szuflady na chowanie niezbędnych drobiazgów. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej pokrytej laminatem, natomiast fronty mebla z płyty MDF pokrytej folią PVC. Użyte materiały są łatwe do utrzymania w czystości - meble wystarczy przecierać wilgotną szmatką.', '', 'komoda-sandy-2d2s-s2-z-oswietleniem', '', '', '', 'Komoda SANDY 2D2S S2 z oświetleniem', '', '', '', ''),
(540, 1, 1, 'Komoda MADRYT to mebel w pięknym ciemnym kolorze BRONZE EXPRESSIVE OAK. Reprezentuje klasykę w nowoczesnym wydaniu. Kolekcja liczna w bryły pozwoli na wyposażenie jadalni, pokoju dziennego czy przedpokoju. Kolorystyka mebli MADRYT przypadnie do gustu miłośnikom ciemniejszych barw, które wprowadzą do pomieszczenia przyjemnej atmosfery zarówno w trakcie pracy, zabawy czy wypoczynku. Jest doskonała zwłaszcza do jasnych, mocno oświetlonych wnętrz. Wykończenie frontu z płyty MDF i wykorzystanie dużych uchwytów z naturalnego drewna pokrytego lakierem sprawiają, że mebel wygląda niezwykle ciekawie i jednocześnie zwiększa się jego trwałość. WNĘTRZE Komodę wyposażono w półki, dzielące wnętrze na 6 wnęk. Głębokie szuflady przydadzą się do przechowywania stosunkowo wysokich przedmiotów. Mniejsza szuflada górna przyda się na drobiazgi. Dzięki temu możemy ją stosować w każdym pomieszczeniu i sami decydować o jej przeznaczeniu. WYKOŃCZENIE Uchwyt z drewna i płyta MDF pokryta folią na froncie to mocny atut komody.', '', 'komoda-madryt-2d3s', '', '', '', 'Komoda MADRYT 2D3S', '', '', '', ''),
(541, 1, 1, 'Komoda MADRYT to mebel w pięknym ciemnym kolorze BRONZE EXPRESSIVE OAK. Reprezentuje klasykę w nowoczesnym wydaniu. Kolekcja liczna w bryły pozwoli na wyposażenie jadalni, pokoju dziennego czy przedpokoju. Kolorystyka mebli MADRYT przypadnie do gustu miłośnikom ciemniejszych barw, które wprowadzą do pomieszczenia przyjemnej atmosfery zarówno w trakcie pracy, zabawy czy wypoczynku. Jest doskonała zwłaszcza do jasnych, mocno oświetlonych wnętrz. Wykończenie frontu z płyty MDF i wykorzystanie dużych uchwytów z naturalnego drewna pokrytego lakierem sprawiają, że mebel wygląda niezwykle ciekawie i jednocześnie zwiększa się jego trwałość. WNĘTRZE Komodę wyposażono w półki zamykane i szuflady, dwie pojemniejsze i jedną mniejszą. Dzięki temu możemy ją stosować w każdym pomieszczeniu i sami decydować o jej przeznaczeniu. WYKOŃCZENIE Uchwyt z drewna i płyta MDF pokryta folią na froncie to mocny atut komody.', '', 'komoda-madryt-1d3s', '', '', '', 'Komoda MADRYT 1D3S', '', '', '', ''),
(542, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. Szafka RTV Irma świetnie sprawdzi się w pokoju dziennym. Jasna kolorystyka wpisze się w aktualne trendy umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadzi do wnętrza wyjątkowy klimat. Mnogość brył systemu pozwala na umeblowanie salonu i jadalni według własnych potrzeb i preferencji. W standardzie dwa kolory wstawek - ciemne oraz białe. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV. Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'szafka-rtv-irma-rtv-im1-z-oswietleniem-prawa', '', '', '', 'Szafka RTV IRMA RTV IM1 z oświetleniem prawa', '', '', '', ''),
(543, 1, 1, 'KOMODA TRASS TRAK231 Komoda z kolekcji mebli Trass to pomysł na ciekawą aranżację sypialni lub salonu, ciemniejsza kolorystyka będzie dobrze komponować się w jasnych pomieszczeniach. Dwudrzwiowa komoda z półkami w środku oraz czterema szufladami idealnie sprawdzi się na pościel, ręczniki jak i bieliznę . Cała kolekcja to system nowoczesnych mebli, prostych, a zarazem mających swój styl i charakter. WNĘTRZE Dwudrzwiowa komoda, półki w szafkach oraz cztery szuflady. WYKOŃCZENIE Kolekcja charakteryzuje się oryginalnym kolorem dębu w połączeniu z czarnymi wstawkami. Obrzeża poziome i pionowe listwy z płyty MDF.', '', 'komoda-trass-trak231', '', '', '', 'Komoda TRASS TRAK231', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(544, 1, 1, 'Kolekcja TEMPRA 2 to doskonałe dopełnienie dla nowoczesnych wnętrz salonu, gabinetu oraz pokoju młodzieżowego. Cechuje ją również duża funkcjonalność. Większość brył ma zamkniętą budowę, pełną półek, które umożliwiają dobrą organizację dla ubrań, dokumentów oraz potrzebnych drobiazgów - przez to doskonale nadają się do wnętrz kameralnych oraz przestrzeni związanej z pracą. Doskonałym przykładem wykorzystania tej przestrzeni jest model komody wyposażony w 4 szuflady , w całości wykonany z płyty meblowej i wykończony folią. Jasna kolorystyka w tonacji dębu sonoma wprowadza do pomieszczenia naturalny charakter oraz świetnie komponuje się ze skandynawskimi kompozycjami z zakresu wystroju wnętrza. Poszczególne bryły kolekcji TEMPRA 2 można zestawiać z wnętrzami w odcieniach bieli, szarości, a także uzupełnić o ozdoby i dodatki w bardziej intensywnej kolorystyce. WNĘTRZE i WYKOŃCZENIE Komoda TEMPRA 2 posiada szuflady rozmieszczone na całej długości mebla. Została wykonana z płyty meblowej, pokrytej folią. Całość jest utrzymana w jasnej tonacji kolorystycznej dąb sonoma . Uchwyty zostały wykonane z tworzywa. Są niewielkie i ładnie uzupełniają front mebla.', '', 'komoda-tempra-2-4s-t2kk212-d30f', '', '', '', 'Komoda TEMPRA 2 4S T2KK212-D30F', '', '', '', ''),
(545, 1, 1, 'Komoda z kolekcji NEYLE to pojemny mebel, o eleganckim, nowoczesnym wyglądzie. Komoda posiada charakterystyczną nadstawkę z półką, która otwiera bryłę i sprawia, że optycznie nabiera lekkości. Komoda NEYLE dobrze będzie prezentować się w pomieszczeniach, w których znajdują się rośliny zielone. Ciemny kolor drewna podkreśli walory domowej dżungli. WNĘTRZE 4 szuflady osadzone na łatwych w montażu prowadnicach kulkowych. Szufladę można wyciągnąć płynnie nawet przy większym obciążeniu, dzięki czemu możesz do niej schować teczki z dokumentami lub książki, bez obawy o zniszczenie mechanizmu wysuwającego. Komoda posiada 1 półkę otwartą, która wraz z blatem stanowi miejsce do ustawienia ulubionych dekoracji. 2 zamykane szafki, w których znajdują się 4 półki. Każda z półek posiada udźwig do 3 kg. Szafki pomogą Ci uporządkować kolekcję gier planszowych, puzzli lub filmów. Mogą też być miejscem, w którym poukładasz obrusy, pościel, czy inne tekstylia. WYKOŃCZENIE Korpus i blat wykonane są z płyty meblowej i pokryte folią w ciemnym kolorze, imitującą strukturę drewna. Wstęgi szuflad i dół szafek pokryte są czarną folią. Metalowe, proste uchwyty stanowią elegancki element ozdobny i służą wygodnemu otwarciu szuflad i szafek. Komoda osadzona jest na ozdobnych, ażurowych nogach wykonanych z metalu. Metalowe elementy to cecha charakterystyczna kolekcji NEYLE. W połączeniu z ciemnym kolorem drewna, meble nabierają wyrazistości.', '', 'komoda-na-metalowych-nogach-neyle', '', '', '', 'Komoda na metalowych nogach NEYLE', '', '', '', ''),
(546, 1, 1, 'Seria Lionel to nowoczesne meble wykonane z trwałych materiałów. Szafkę wykonano w połączeniu dwóch kolorów - dębu truflowego i białego połysku. Jasna kolorystyka sprawi, że pokój będzie wydawał się większy. Cechą charakterystyczną tej kolekcji są frezowane uchytwy, które tworzą nowczesny wygląd bryły. Jest to kolekcja uniwersalna, mnogość dostępnych elementów pozwala wyposażyć pomieszczenia o rożnym przeznaczeniu i charakterze.', '', 'szafka-rtv-lionel', '', '', '', 'Szafka RTV LIONEL', '', '', '', ''),
(547, 1, 1, 'Lubisz, gdy wokół panuje ład i porządek? Jasne barwy oraz minimalistyczny styl to otoczenie, w którym czujesz się najlepiej? Nie możesz przejść obojętnie wobec tego, co ma do zaoferowania komoda z szufladami z kolekcji MONTANA. Zwłaszcza, jeśli urządzasz wnętrze pokoju młodzieżowego . WNĘTRZE Za 2 frontami znajdziesz miejsce na ciepłe swetry , spodnie lub koszulki . Nie trać czasu na rozmyślanie, co dziś na siebie założyć. 4 szufladki pozwolą Ci uporządkować mniejsze części garderoby takie jak: bielizna , skarpetki lub elementy dekoracyjne Twojego wizerunku: apaszki , szaliki i biżuterię . Wszystko lepiej się układa, gdy jest na właściwym miejscu. WYKOŃCZENIE Korpus oraz fronty komody MONTANA wykonano z płyty meblowej o grubości 16 mm . Wykończenie nawiązujące do wyglądu bielonego drewna nada wnętrzu lekkości. Konstrukcję mebla pokryto laminatem w kolorze sosny andersen – podkreśl jej urok nietuzinkowymi dodatkami oraz elementami dekoracyjnymi. Design komody MONTANA możesz urozmaicić modernistycznymi elementami dekoracyjnymi – nadając wnętrzu nowoczesności .', '', 'komoda-z-szufladami-sosna-bielona-montana', '', '', '', 'Komoda z szufladami sosna bielona MONTANA', '', '', '', ''),
(548, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. Szafka RTV IRMA świetnie sprawdzi się w pokoju dziennym. Jasna kolorystyka wpisze się w aktualne trendy umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadzi do wnętrza wyjątkowy klimat. Mnogość brył systemu pozwala na umeblowanie salonu i jadalni według własnych potrzeb i preferencji. W standardzie dwa kolory wstawek - ciemne oraz białe. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WNĘTRZE Wnętrze składa się z półek w części zamkniętej oraz półek otwartych przeznaczonych na sprzęt RTV. Wymiary wnęki dolnej/górnej: szerokość 54 cm, głębokość 41 cm, wysokość 14 cm WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV. Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'szafka-rtv-irma-im2-z-oswietleniem', '', '', '', 'Szafka RTV IRMA IM2 z oświetleniem', '', '', '', ''),
(549, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. Komoda IRMA świetnie sprawdzi się zarówno w pokoju dziennym, jak i w jadalni. Od ciebie zależy gdzie najlepiej spełni swoją rolę. Jasna kolorystyka wpisze się w aktualne trendy umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadzi do wnętrza wyjątkowy klimat. W standardzie - dwa dekory - ciemny i biały. Użytkownik sam zdecyduje, który zamontować. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WNĘTRZE Wnętrze składa się z szuflady oraz półek w części zamkniętej, które pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV. Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'komoda-irma-im3-z-oswietleniem', '', '', '', 'Komoda IRMA IM3 z oświetleniem', '', '', '', ''),
(550, 1, 1, 'Kolekcja mebli MARCO to nowoczesna propozycja stawiająca na zdecydowane akcenty i odważną oryginalność aranżacyjną. Zdecydowana biel została przełamana czarnymi akcentami detali, a nowatorski dekor wymyka się sztampie stając się przełomem w aranżacji wnętrza. Kolekcja pięknie sprawdzi się we wnętrzach nowoczesnych i minimalistycznych, ale także stworzy świetną podstawę dla urządzenia wnętrza opartego na kontraście – świetnie wypadnie w zestawieniu z mocnymi barwami ścian lub obrazów, detali dekoracyjnych i tekstyliów domowych. Komoda MARCO doskonale uzupełnia salon lub sypialnię zapewniając sporo miejsca na przechowanie domowych akcesoriów, koców, serwisów obiadowych lub tekstyliów stołowych. Na pięknym, szerokim blacie można wyeksponować dekoracje i bibeloty, pamiątki, fotografie w ramkach lub ozdobny wazon z kwiatami stawiając ostatni akcent na wystroju wnętrza. WNĘTRZE Komoda zawiera 2 pojemne, zamykane wnęki , które pozwolą rozsądnie uporządkować potrzebne akcesoria i gadżety; Maksymalne obciążenie półki wynosi 5 kg ; 3 szuflady na prowadnicach rolkowych znacząco zwiększają przestrzeń do przechowywania tekstyliów domowych, ubrań, bielizny i wielu gadżetów i akcesoriów . WYKOŃCZENIE Korpus mebla oraz półki są wykonane z połączenia płyty wiórowej o grubości 16 mm i drewna sosnowego o grubości 20 mm . Są wykończone matowym laminatem w klasycznej bieli przełamanej czarnymi wstawkami kolorystycznymi oraz wyjątkowo zdobnym dekorem; Fronty szafki są wykonane z płyty MDF o grubości 18 mm i pokryte białą folią PVC o wysokim połysku ; W standardzie mebla jest oświetlenie LED o zimnej, białej barwie , która podkreśli elegancki charakter pomieszczenia. Punkty oświetleniowe pięknie podkreślają dekor na drzwiczkach komody. Klasa energetyczna oświetlenia to A++ ; Tradycyjne nóżki zostały zastąpione solidnym cokołem , który dodaje komodzie statecznego sznytu. Czarne uchwyty z tworzywa stanowią ukłon w stronę wzornictwa minimalistycznego pięknie podkreślając niebanalne kontrasty kolorystyczne.', '', 'komoda-marco-1d3s-z-oswietleniem', '', '', '', 'Komoda MARCO 1D3S z oświetleniem', '', '', '', ''),
(551, 1, 1, 'Szafka RTV z kolekcji nowoczesnych mebli Kobe. To oryginalny system w ciepłym odcieniu dębu o dość ciekawych frontach. Szafka RTV KOBE jest praktycznym segmentem, na którym postawisz telewizor, przechowasz sprzęt oraz drobiazgi typu piloty lub gry. Kobe to propozycja dla osób ceniących ciepłe i naturalne wnętrza. Wniesie do aranżacji elegancję i niepowtarzalność. WNĘTRZE Szafka RTV KOBE posiada 2 wnęki za drzwiami , szufladę oraz otwartą wnękę , która jest świetnym miejscem na dekoder lub konsolę. WYKOŃCZENIE System Kobe to oryginalna, nowoczesna kolekcja, której fronty wykonane są z trwałego MDF. Doskonale imituje strukturę drewna dzięki czemu dodaje ciepłego klimatu we wnętrzu. Charakterystyczne są ciekawie wyfrezowane fronty oraz listwy ozdobne. Dodatkowo wszystkie bryły są bezuchwytowe.', '', 'szafka-rtv-waska-kobe', '', '', '', 'Szafka RTV wąska KOBE', '', '', '', ''),
(552, 1, 1, 'Komoda dwudrzwiowa ROMA wyróżnia się nowoczesnym designem. W idealnych proporcjach łączy w sobie funkcjonalność oraz walory ozdobne. Najlepiej sprawdza się jako element umeblowania pokoju dziennego. Dzięki kolorystyce idealnie pasuje do wnętrz jasnych, wzbogaconych drewnianymi elementami dekoracyjnymi. Jej proste, oszczędne wzornictwo pozwala na dużą dowolność pod katem indywidualnych rozwiązań aranżacyjnych. Na szczególną uwagę zasługuje fakt, ze komoda ROMA została wyposażona w specjalne zawiasy, które sprawiają, że drzwi domykają się cicho i delikatnie. WNĘTRZE Komoda ROMA posiada dwie półki – idealne rozwiązanie pod kątem umieszczenia w nich ubrań, dokumentów lub przydatnych przedmiotów osobistych. WYKOŃCZENIE Komoda ROMA została wykonana z płyty meblowej MDF z laminatem w kolorze białym. Powierzchnia drzwi została specjalnie wyprofilowana tak, by móc szybko i sprawnie otwierać je i zamykać bez potrzeby korzystania z uchwytów. Jest to rozwiązanie, które również doskonale sprawdza się pod katem dekoracyjnym.', '', 'komoda-roma-ro-11', '', '', '', 'Komoda ROMA RO-11', '', '', '', ''),
(553, 1, 1, 'Szafka RTV TES pozwoli uzyskać oryginalne oraz dobrze zaaranżowane wnętrze. Korpus i front w kolorze orzecha ociepli wnętrze. W połączeniu z ryflowaną wstawką na tle kontrastowego czarnego szkła prezentuje się bardzo nowocześnie. Proste linie podkreślają geometryczne kształty mebla. Tes nawiązuje do natury, oferując jednocześnie funkcjonalne rozwiązania, takie jak system push zastępujący tradycyjne uchwyty czy regulowane stopki, które pozwolą ci dopasować mebel do indywidualnych potrzeb. WNĘTRZE Szafka pod telewizor umożliwi wyeksponowanie i przechowanie niezbędnych akcesoriów rtv. WYKOŃCZENIE Korpus mebla został pokryty laminetem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość. Fronty zostały wykonane z płyty MDF pokrytej folią PCV.', '', 'szafka-rtv-tes-ts10', '', '', '', 'Szafka RTV TES TS10', '', '', '', ''),
(554, 1, 1, 'Niska komoda SALVE przyda się nie tylko do schowania pantofli akcesoriów do czyszczenia obuwia. Możesz także na niej usiąść, by ułatwić sobie wkładanie butów. Komodę zestaw z pozostałymi meblami z serii SALVE i ciesz się spójną aranżacją swojego przedpokoju. WNĘTRZE Do dyspozycji masz 4 wnęki znajdujące się za podwójnymi drzwiami. SZAROŚĆ I POŁYSK Korpusy mebli SALVE pokrywa szary laminat z wyrazistym rysunkiem drewna. Prezentuje się nowocześnie i elegancko. Fronty wykończono folią z połyskiem . Dzięki temu odbijają światło i sprawiają, że wnętrze wydaje się większe. NOWOCZEŚNIE I SUBTELNIE Czy zdarza Ci się w pośpiechu szukać butów lub kluczy w przedpokoju? Masz już dość nerwowej atmosfery w trakcie wychodzenia z domu? Posegreguj swoje rzeczy w schowkach mebli SALVE i znajdź od razu to, czego potrzebujesz. Połączenie szarości i połyskującej bieli sprawia, że kolekcja mebli wprowadza do wnętrza klimat sprzyjający wyciszeniu. W takim wnętrzu łatwiej się uspokoisz, nawet jeśli bardzo będziesz się śpieszyć.', '', 'komoda-do-przedpokoju-z-lawka-salve', '', '', '', 'Komoda do przedpokoju z ławką SALVE', '', '', '', ''),
(555, 1, 1, 'Szafka RTV NECKER to mebel przeznaczony dla wnętrz pokoju dziennego oraz salonu. Wzbogaca wnętrze o elementy nowoczesnej stylizacji opartej na prostych, oszczędnych liniach oraz harmonii pomiędzy ciemną kolorystyką dębu lefkas i grandson , a czarnymi elementami, które dopełniają całości i dodają eleganckiego wykończenia. Wnętrze, wyposażone w szuflady oraz 2 wnęki pozwala na przechowywanie elementów zastawy oraz różnych drobiazgów. Blat mebla stanowi część ekspozycyjną. W zależności od upodobania można na nim sprzęt RTV lub umieścić kwiaty i dodatki dekoracyjne. Szafka RTV NECKER doskonale prezentuje się również w klasycznych wnętrzach, dając dużo swobody pod kątem doboru pozostałych mebli, oświetlenia oraz dodatków dekoracyjnych. WNĘTRZE RTV NECKER posiada 2 wnęki otwarte oraz 3 szuflady na prowadnicach rolkowych. To pojemna szafka w sam raz na kolekcje filmów, dokumenty, gazety lub przydatne przedmioty osobiste. Półki mebla mają możliwość obciążenia do 5 kg. WYKOŃCZENIE Korpus, blat i półki mebla został wykonane z płyty meblowej laminowanej, natomiast fronty, to płyta MDF wykończona folią PVC. Ciemną tonację mebla dopełniają uchwyty z tworzywa w czarnym kolorze.', '', 'szafka-rtv-necker-rtv-3s', '', '', '', 'Szafka RTV NECKER RTV 3S', '', '', '', ''),
(556, 1, 1, 'Jeśli szukasz zgrabnego mebla do salonu, szafka RTV z kolekcji SALGADO będzie dobrym wyborem. Szafka RTV jest rozwiązaniem do pomieszczeń utrzymanych w nowoczesnym, modernistycznym stylu. Połączenie koloru jasnego dębowego drewna z modną czernią sprawia, że szafkę RTV SALGADO dopasujesz także do przestrzeni minimalistycznych i loftowych . WNĘTRZE Na 2 otwartych , szerokich półkach zmieścisz dekoder, konsolę i pozostałe rzeczy o wadze do 5 kg . Większe przedmioty schowasz w pojemnej szafce za pełnymi drzwiami. WYKOŃCZENIE Szafkę RTV wykonano z płyty meblowej o grubości 18 mm . Mebel pokryto laminatem czarnym i w kolorze jasnego dębu Artisan – łatwo skomponujesz aranżację pomieszczenia opartą na jasnych odcieniach drewna. Drzwiczki, które posiadają ciekawy asymetryczny kształt , pozwolą Ci podkreślić nowoczesny charakter wnętrza . Minimalistyczny czarny uchwyt drzwi został zrobiony z tworzywa. Szafkę RTV SALGADO charakteryzuje geometryczny kształt, który podkreśla noga wykonana z płyty w kontrastowym, czarnym kolorze.', '', 'szafka-rtv-do-salonu-salgado', '', '', '', 'Szafka RTV do salonu SALGADO', '', '', '', ''),
(557, 1, 1, 'Szafka RTV z kolekcji MADRYT to mebel w pięknym ciemnym kolorze BRONZE EXPRESSIVE OAK. Reprezentuje klasykę w nowoczesnym wydaniu. Kolekcja liczna w bryły pozwoli na wyposażenie jadalni, pokoju dziennego czy przedpokoju. Kolorystyka mebli MADRYT przypadnie do gustu miłośnikom ciemniejszych barw, które wprowadzą do pomieszczenia przyjemnej atmosfery zarówno w trakcie pracy, zabawy czy wypoczynku. Jest doskonała zwłaszcza do jasnych, mocno oświetlonych wnętrz. Szafka RTV MADRYT to mebel dedykowany do pokoju dziennego lub sypialni. Większa niż standardowa wysokość szafki pozwoli na wygodne oglądanie telewizji. Wykończenie frontu z płyty MDF i wykorzystanie dużych uchwytów z naturalnego drewna pokrytego lakierem sprawiają, że mebel wygląda niezwykle ciekawie i jednocześnie zwiększa się jego trwałość. WNĘTRZE Szafkę wyposażono w dwie zamykane części przedzielone półkami, szufladę i otwartą wnękę doskonałą na sprzęt typu dekoder, magnetowid, itp. WYKOŃCZENIE Uchwyt z drewna i płyta MDF pokryta folią na froncie to mocny atut szafki.', '', 'szafka-rtv-madryt-2d1s', '', '', '', 'Szafka RTV MADRYT 2D1S', '', '', '', ''),
(558, 1, 1, 'KOMODA DENIS Komoda dwudrzwiowa Denis została wyposażona w mechanizmy, które podnoszą komfort użytkowania mebla. Kulkowe prowadnice, hamulce w drzwiach oraz regulowane stopki, które pozwolą Ci dopasować mebel do indywidualnych potrzeb oraz cieszyć się dobrze zaaranżowanym pokojem dziennym, to cechy wyróżniające komodę Denis. Nowoczesne materiały i konstrukcja z podfrezowanym frontem pełniącym rolę uchwytu sprawią, że Twoje wnętrze będzie wyglądało wspaniale. WNĘTRZE Komoda to uniwersalny mebel, w którym z powodzeniem przechowasz wszystkie te przedmioty, które chcesz mieć pod ręką. Mebel zmieści się również w niewielkim wnętrzu. WYKOŃCZENIE Charakterystyczne wykończenie w kolorze wiąz mat z wyrazistym wzorem nawiązującym do struktury drewna rozjaśni Twoje wnętrze.', '', 'komoda-denis-ds2', '', '', '', 'Komoda DENIS DS2', '', '', '', ''),
(559, 1, 1, 'Regał CUBE z drzwiami pomoże wprowadzić porządek wśród teczek, książek czy segregatorów. Drzwi zostały wyposażone w zamek , dzięki czemu możesz schować w regale ważne dokumenty. Został zaprojektowany z myślą o domowych biurach, w których zależy nam na odpowiedniej organizacji. Możesz zestawić go z biurkiem i regałami w innych rozmiarach z kolekcji CUBE do biura i stworzyć spójną aranżację miejsca pracy. WNĘTRZE 3 wnęki otwarte i 3 zamknięte zapewniają sporo miejsca do przechowywania. Maksymalne obciążenie półki wynosi 5 kg. WYKONANIE Korpus jest wykonany z płyty meblowej i wykończony laminatem , dzięki czemu łatwo utrzymasz czystość mebla. Uchwyt wykonany jest z metalu. Meble CUBE to dobry wybór do współczesnych aranżacji, pasują zarówno do jasnych, jak i ciemnych kolorów ścian i dodatków.', '', 'regal-z-szarymi-drzwiami-cube-1d', '', '', '', 'Regał z szarymi drzwiami CUBE 1D', '', '', '', ''),
(560, 1, 1, 'Kolekcja mebli MARCO to nowoczesna propozycja stawiająca na zdecydowane akcenty i odważną oryginalność aranżacyjną. Zdecydowana biel została przełamana czarnymi akcentami detali, a nowatorski dekor wymyka się sztampie stając się przełomem w aranżacji wnętrza. Kolekcja pięknie sprawdzi się we wnętrzach nowoczesnych i minimalistycznych , ale także stworzy świetną podstawę dla urządzenia wnętrza opartego na kontraście – świetnie wypadnie w zestawieniu z mocnymi barwami ścian lub obrazów, detali dekoracyjnych i tekstyliów domowych. Szafka RTV MARCO stworzy doskonałą bazę pod sprzęt i akcesoria domowego sprzętu elektronicznego. WNĘTRZE Szafka zawiera 2 pojemne, zamykane wnęki , które pozwolą rozsądnie uporządkować potrzebne akcesoria i gadżety; Maksymalne obciążenie półki wynosi 5 kg ; Pod blatem znajduje się otwarta wnęka , w której można umieścić dekodery i inne urządzenia elektroniczne. Z tyłu wnęki, na optymalnej wysokości jest umieszczony otwór, przez który można przełożyć kable, by podłączyć sprzęt do gniazdka; Wymiary otwartej wnęki: 73,5 x 37,5 x 15 cm ; Szuflada na prowadnicach kulkowych świetnie sprawdzi się jako dodatkowe miejsce do przechowywania – dzięki dużej pojemności można w niej trzymać nie tylko niezbędne kable i konsole, ale także koce, by były zawsze pod ręką podczas rodzinnego wieczorku filmowego. WYKOŃCZENIE Korpus mebla oraz półki są wykonane z połączenia płyty wiórowej o grubości 16 mm i drewna sosnowego o grubości 20 mm . Są wykończone matowym laminatem w klasycznej bieli przełamanej czarnymi wstawkami kolorystycznymi oraz wyjątkowo zdobnym dekorem; Fronty szafki są wykonane z płyty MDF o grubości 18 mm i pokryte białą folią PVC o wysokim połysku ; W standardzie mebla jest oświetlenie LED o zimnej, białej barwie , która podkreśli elegancki charakter pomieszczenia. Klasa energetyczna oświetlenia to A++ ; Tradycyjne nóżki zostały zastąpione solidnym cokołem , który dodaje szafce statecznego sznytu. Czarne uchwyty z tworzywa stanowią ukłon w stronę wzornictwa minimalistycznego pięknie podkreślając niebanalne kontrasty kolorystyczne.', '', 'szafka-rtv-marco-2d1s-z-oswietleniem', '', '', '', 'Szafka RTV MARCO 2D1S z oświetleniem', '', '', '', ''),
(561, 1, 1, 'Niski regał CUBE pomoże wprowadzić porządek wśród dokumentów, książek czy segregatorów. Został zaprojektowany z myślą o domowych biurach, w których zależy nam na odpowiedniej organizacji. Możesz zestawić go z biurkiem i regałami w innych rozmiarach z kolekcji CUBE do biura i stworzyć spójną aranżację miejsca pracy. WNĘTRZE W 3 wnękach ułożysz potrzebne przedmioty, które będą zawsze pod ręką. Maksymalne obciążenie półki wynosi 5 kg. WYKONANIE Korpus jest wykonany z płyty meblowej i wykończony laminatem , dzięki czemu łatwo utrzymasz czystość mebla. Meble w kolorze drewna to dobry wybór do współczesnych aranżacji, pasują zarówno do jasnych, jak i ciemnych kolorów ścian i dodatków. WYPOSAŻENIE DODATKOWE Możesz dokupić do regału fronty z kolekcji CUBE. Uporządkowane wnętrze, w którym dokumenty, teczki czy segregatory są ukryte za drzwiami, sprzyja skupieniu przy pracy lub nauce. Masz do wyboru szklane fronty , które optycznie powiększą przestrzeń, fronty w kolorze wiśnia havana (drewno jasne) lub jasnoszare .', '', 'regal-cube-niski', '', '', '', 'Regał CUBE niski', '', '', '', ''),
(562, 1, 1, 'Komoda NECKER to mebel przeznaczony dla wnętrz pokoju dziennego, salonu oraz jadalni. Wzbogaca wnętrze o elementy nowoczesnej stylizacji opartej na prostych, oszczędnych liniach oraz harmonii kolorystycznej pomiędzy ciemną kolorystyką dębu lefkas i grandson , a czarnymi elementami, które dopełniają całości i dodają eleganckiego wykończenia. Jej zamykane wnętrze, wyposażone w półki pozwala na przechowywanie elementów zastawy, książek, ubrań lub różnych drobiazgów. Komoda NECKER doskonale prezentuje się również w klasycznych wnętrzach, dając dużo swobody pod kątem doboru pozostałych mebli, oświetlenia oraz dodatków dekoracyjnych. WNĘTRZE Komoda NECKER posiada wnętrze wyposażone w zamykane wnęki - nieodzowne pod kątem uporządkowania umieszczonych w niej rzeczy. Półki mebla mają możliwość obciążenia do 5 kg. WYKOŃCZENIE Korpus, blat i półki mebla został wykonane z płyty meblowej laminowanej, natomiast fronty, to płyta MDF wykończona folią PVC. Ciemną tonacje mebla dopełniają uchwyty z tworzywa w czarnym kolorze.', '', 'komoda-necker-3d', '', '', '', 'Komoda NECKER 3D', '', '', '', ''),
(563, 1, 1, 'KOMODA DENIS Komoda trzydrzwiowa Denis została wyposażona w mechanizmy, które podnoszą komfort użytkowania mebla. Kulkowe prowadnice w szufladach, hamulce w drzwiach oraz regulowane stopki, które pozwolą Ci dopasować mebel do indywidualnych potrzeb oraz cieszyć się dobrze zaaranżowanym pokojem dziennym to cechy wyróżniające komodę Denis. Nowoczesne materiały i konstrukcja z podfrezowanym frontem pełniącym rolę uchwytu sprawią, że Twoje wnętrze będzie wyglądało wspaniale. WNETRZE Komoda to uniwersalny mebel, w którym z powodzeniem przechowasz wszystkie te przedmioty, które chcesz mieć pod ręką. Półki i szuflady pomogą w rozmieszczeniu rzeczy. WYKOŃCZENIE Charakterystyczne wykończenie w kolorze wiąz mat z wyrazistym wzorem nawiązującym do struktury drewna rozjaśni Twoje wnętrze.', '', 'komoda-denis-ds3', '', '', '', 'Komoda DENIS DS3', '', '', '', ''),
(564, 1, 1, 'Bufet NECKER to mebel przeznaczony dla wnętrz pokoju dziennego, salonu oraz jadalni. Wzbogaca wnętrze o elementy nowoczesnej stylizacji opartej na prostych, oszczędnych liniach oraz harmonii kolorystycznej pomiędzy ciemną kolorystyką dębu lefkas i grandson , a czarnymi elementami, które dopełniają całości i dodają eleganckiego wykończenia. Dwoje drzwi bufetu NECKER jest przeszklonych. Jej zamykane wnętrze, wyposażone w półki pozwala na przechowywanie elementów zastawy oraz różnych drobiazgów. Blat mebla może również stanowić część ekspozycyjną, można na nim umieścić kwiaty oraz dodatki dekoracyjne. Bufet NECKER doskonale prezentuje się również w klasycznych wnętrzach, dając dużo swobody pod kątem doboru pozostałych mebli, oświetlenia oraz dodatków dekoracyjnych. WNĘTRZE Bufet NECKER posiada wnętrze wyposażone w zamykane wnęki - nieodzowne pod kątem uporządkowania umieszczonych w niej rzeczy. Półki mebla mają możliwość obciążenia do 5 kg. WYKOŃCZENIE Korpus, blat i półki mebla został wykonane z płyty meblowej laminowanej, natomiast fronty, to płyta MDF wykończona folią PVC. Ciemną tonacje mebla dopełniają uchwyty z tworzywa w czarnym kolorze.', '', 'bufet-necker-3d', '', '', '', 'Bufet NECKER 3D', '', '', '', ''),
(565, 1, 1, 'Potrzebujesz regału o niestandardowych wymiarach? Regał KUBO ma wysokość 116 cm , więc bez problemu ustawisz go również w niższym pomieszczeniu, na przykład w pokoju ze skosami. Książki, płyty czy ulubione pamiątki ułóż w otwartych wnękach regału KUBO, a drobiazgi, których nie chcesz eksponować ukryj za drzwiami oraz w 2 szufladach. Wymiary wnęki:17,5 x 35,5 x 31 WNĘTRZE 2 otwarte oraz 4 zamknięte wnęki pomieszczą sporo przedmiotów. 2 szuflady zostały wyposażone w prowadnice kulkowe. WYKOŃCZENIE Połyskujące wykończenie , wysokie ukośne nóżki i uchwyty w kolorze imitującym jasne drewno idealnie pasują do mieszkania urządzonego w nowoczesnym stylu. MEBLE DLA NASTOLATKA W pokoju nastolatka niet rudno o chaos, dlatego najlepiej sprawdzą się w nim meble ułatwiające przechowywanie i ukrywanie swoich małych skarbów. Meble z serii KUBO to kolekcja brył, gdzie możecie posegregować i schować zarówno podręczniki, jak i zabawki i kolekcję ulubionych przedmiotów.', '', 'niski-regal-z-wnekami-kubo', '', '', '', 'Niski regał z wnękami KUBO', '', '', '', ''),
(566, 1, 1, 'Szafka RTV KALIKST ma aż 3 wnęki otwarte. Możesz w nich ustawić dekoder, konsolę i dowolny sprzęt, do których chcesz mieć bezpośredni dostęp. Mebel w białej barwie drewna wprowadzi do wnętrza przytulny, domowy nastrój. Ozdobnym elementem mebla są skrzyżowane listewki na drzwiach frontowych. WNĘTRZE Szafka posiada 2 zamykane wnęki, których uporządkujesz urządzenia elektroniczne, akcesoria, gry i inne dodatki. W otwartych wnękach możesz bezpiecznie umieścić dekoder lub konsolę. W tylnej części mebla został wycięty otwór, który umożliwi na dyskretne i estetyczne przełożenie kabli. Maksymalne obciążenie półki wynosi 5 kg . WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Uwagę zwracają ładnie wkomponowane w bryłę metalowe uchwyty z widocznym efektem postarzenia. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. KOLEKCJA KALIKST – SIELSKOŚĆ W NOWOCZESNYM WYDANIU Kolekcja KALIKST stanowi doskonałą bazę do stworzenia eklektycznej stylizacji. Kolekcja wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Tłem dla kolekcji KALIKST może być pełny głębi szmaragdowy kolor ścian lub ciepły odcień beżu. Mieszanie stylów jest dziś popularne, ponieważ daje dużo przestrzeni dla indywidualizmu. Duża ilość brył pozwoli Ci urządzić mieszkanie w spójnym stylu.', '', 'szafka-pod-telewizor-z-3-wnekami-na-sprzet-biala-kalikst', '', '', '', 'Szafka pod telewizor z 3 wnękami na sprzęt biała KALIKST', '', '', '', ''),
(567, 1, 1, 'Szukasz przeszklonej komody , która będzie pasować do Twojego minimalistycznego domu? Wykończenie komody VELLO w ciepłym odcieniu dębu artisan nada wnętrzu Twojego salonu przytulnego charakteru. Jednocześnie prosta w formie bryła komody oraz transparentny , szklany front sprawi, że odnajdzie się doskonale w nowoczesnej przestrzeni. WNĘTRZE Na 2 szklanych półkach za transparentnym, hartowanym frontem możesz ułożyć ozdobne pudełka, książki lub unikalne zestawy do parzenia Twojej ulubionej herbaty. Komoda VELLO posiada 4 półki z płyty meblowej o udźwigu 5 kg , na których umieścisz cięższe przedmioty. Możesz je również wykorzystać jako dodatkowe miejsce do przechowywania odzieży. Wysokość 92,9 cm pozwala na wyeksponowanie designerskich dodatków, pamiątek z wakacji, pięknych rodzinnych fotografii. WYKOŃCZENIE Korpus i półki wykonano z laminowanej płyty meblowej 16 mm , dzięki temu szybko zetrzesz kurz i pozbędziesz się drobnych zabrudzeń. Komoda VELLO posiada podcięte fronty , pozwalające na wygodne otwarcie drzwi – będące alternatywą dla klasycznych frezów. Wykończenie przeszklonej komody łączy w sobie nutę nowoczesności oraz ponadczasowy urok odcienia dębu artisan .', '', 'nowoczesna-przeszklona-komoda-vello', '', '', '', 'Nowoczesna przeszklona komoda VELLO', '', '', '', ''),
(568, 1, 1, 'Dzięki komodzie KALIKST uporządkujesz dodatki, które trzymasz w salonie lub w jadalni. Mebel sprawdzi się nie tylko jako miejsce do przechowywania. Pełni również funkcję dekoracyjną. Na blacie możesz ułożyć stylowe dekoracje lub ramki ze zdjęciami. Ozdobnym elementem mebla są skrzyżowane listewki na drzwiach frontowych. WNĘTRZE Komoda posiada 4 zamykane wnęki, w których uporządkujesz domowe tekstylia, czy zastawę stołową. Maksymalne obciążenie półki wynosi 5 kg . W środkowej części mebla umieszczono 3 szuflady, w których łatwo przechowasz drobne przedmioty. WYKOŃCZENIE Korpus mebla jest wykonany z płyty meblowej i wykończony folią. Uwagę zwracają ładnie wkomponowane w bryłę metalowe uchwyty z widocznym efektem postarzenia. Powierzchnię płyty foliowanej bardzo łatwo utrzymać w czystości. KOLEKCJA KALIKST – SIELSKOŚĆ W NOWOCZESNYM WYDANIU Kolekcja KALIKST stanowi doskonałą bazę do stworzenia eklektycznej stylizacji. Kolekcja wpisze się zarówno w nowoczesne wnętrza, jak i te bardziej sielskie. Tłem dla kolekcji KALIKST może być pełny głębi szmaragdowy kolor ścian lub ciepły odcień beżu. Mieszanie stylów jest dziś popularne, ponieważ daje dużo przestrzeni dla indywidualizmu. Duża ilość brył pozwoli Ci urządzić mieszkanie w spójnym stylu.', '', 'komoda-biala-z-szufladami-kalikst', '', '', '', 'Komoda biała z szufladami KALIKST', '', '', '', ''),
(569, 1, 1, 'Szafka RTV do salonu z kolekcji VELLO to propozycja dla osób ceniących prostą formę mebla oraz ciepły kolor drewna, dający we wnętrzu przytulny efekt. Jeśli szukasz rozwiązania, które nie przytłacza nadmiarem formy, szafka VELLO będzie strzałem w 10. Wygląd szerokiej szafki RTV VELLO nie będzie odstępował również Twojemu imponującemu telewizorowi. WYGLĄD Korpus i fronty w kolorze dąb artisan sprawi, że możesz nadać wnętrzu nowoczesnego , indywidualnego charakteru. Jeśli zechcesz stworzyć wnętrze w stylu bardziej industrialnym , wystarczy, że dobierzesz odpowiednie akcesoria. Szafka RTV VELLO wyglądać będzie efektownie jako solowy bohater Twojego stylowego salonu. Możesz skompletować także całą kolekcję mebli VELLO. Postaw na blacie czarne, stylizowane dodatki, by wydobyć jej unikalny charakter. Po obu stronach szafki RTV znajdują się wnęki , w których możesz umieścić swoją ulubioną kolekcję filmów. Szeroki blat pomieści router lub konsolę. Wnęka pod blatem to miejsce zarówno na pudełka z planszówkami, jak i pady – które wreszcie znajdą dla siebie odpowiednią lokalizację. WYKONANIE Szafka wykonana z płyty meblowej pokrytej laminatem sprawi, że w łatwy sposób utrzymasz blat oraz wnętrze szafki RTV w czystości. Laminat zdecydowanie ułatwia pozbycie się kurzu, nawet z niewidocznych zakamarków. Dzięki zawiasom fronty otwierają się w stabilny, płynny sposób. Nad frontami znajduje się większa przestrzeń, by męską dłonią z łatwością otworzyć wnętrze szafki RTV. Szeroka szuflada z pełnym wysuwem pozwoli Ci zgromadzić zapasy na wspólną rozrywkę przed telewizorem, którą spędzisz wraz z przyjaciółmi.', '', 'szeroka-szafka-rtv-pod-telewizor-vello', '', '', '', 'Szeroka szafka RTV pod telewizor VELLO', '', '', '', ''),
(570, 1, 1, 'Biała komoda z półkami w stylu skandynawskim PLISSEE sprawdzi się w nowoczesnym salonie. Jasny odcień wykończenia urozmaicony o pionowe paski wprowadzą do pomieszczenia nutę nonszalancji. Blat oraz spód szafki z nogami w dębowym kolorze podkreślają geometryczną bryłę mebla. WNĘTRZE 2 otwarte półki pozwolą Ci na odpowiednie wyeksponowanie swojej kolekcji unikatowych książek. Wewnątrz komody znajduje się 6 półek , na których możesz umieścić różne części garderoby . Większe elementy możesz ułożyć na półce o udźwigu 5 kg . Odtąd wszystkie dodatki możesz posegregować i utrzymywać perfekcyjny porządek. WYKOŃCZENIE Korpus komody wykończono laminatem w białym oraz dębowym kolorze . Charakterystyczną cechą komody PLISSEE są pionowe , delikatne paski zdobiące szerokie fronty. Fronty to połączenie płyty meblowej i płyty mdf , które pokryto laminatem oraz folią . Zawiasy z cichym domykiem pozwolą Ci delikatnie zamknąć szafkę, nie budząc przy tym drzemiącego na kanapie kota. Front mebla posiada charakterystyczne żłobienie przypominające plisę . Daje on ciekawy efekt 3D , który wyróżnia bryłę spośród innych.', '', 'komoda-wysoka-z-polkami-i-ryflowanym-frontem-plissee', '', '', '', 'Komoda wysoka z półkami i ryflowanym frontem PLISSEE', '', '', '', ''),
(571, 1, 1, 'Szafka RTV MODICO świetnie uzupełni nowoczesną aranżację pokoju dziennego. Z kolekcją MODICO możesz urządzić salon w spójnym stylu. Meble MODICO sprawią, że Twoje wnętrze będzie jasne i pełne ciepła. WNĘTRZE 4 szuflady pomieszczą potrzebne akcesoria w kąciku multimedialnym. Otwarta wnęka pod przeszkloną częścią blatu to świetne miejsce na dekoder. Możesz dodatkowo uwydatnić nowoczesny charakter meble, dokupując oświetlenie do szafki. WYKOŃCZENIE Meble MODICO wykonano z płyty meblowej i wykończono laminatem. Nowoczesny design i połączenie bieli z kolorem drewna wprowadza do pomieszczenia przytulny klimat.', '', 'szafka-rtv-modico-4s-mc-08', '', '', '', 'Szafka RTV MODICO 4S MC-08', '', '', '', ''),
(572, 1, 1, 'Komoda LACO podkreśla nowoczesny charakter pokoju dziennego. Możesz wykorzystać ją również w domowym biurze czy przestronnym przedpokoju. Dzięki zastosowaniu efektu czarnej ramki na froncie, wnętrze nabiera nietuzinkowego charakteru. Kolor naturalnego drewna wizualnie ociepla przestrzeń i wprowadza przytulny klimat. Takie połączenie kolorów - dąb charleston z czarną barwą - pasuje do nowoczesnego wnętrza , które nie unika kontrastów. WNĘTRZE Komoda posiada 4 zamykane wnęki, dzięki którym rozważnie uporządkujesz ubrania, dokumenty lub przydatne drobiazgi. Maksymalne obciążenie półki wynosi 5 kg . Blat możesz wykorzystać na wyeksponowanie pamiątek lub dekoracji. WYKOŃCZENIE Komoda LACO jest wykonana z płyty mebloweji wykończona laminatem. Czarna ramka na przodzie jest wykończona w wysokim połysku, natomiast część w kolorze dębu ma matowe wykończenie, więc mebel będzie pasował do nowoczesnych oraz bardziej klasycznych wnętrz. KOLEKCJA LACO To propozycja dla osób pragnących stworzyć oryginalny charakter wnętrza. Meble LACO sprawdzą się w zarówno w nowoczesnych, jak i industrialnych mieszkaniach – wszędzie tam, gdzie chcemy wprowadzić nowatorski, strukturalny efekt. Obok tej kolekcji nie można przejść obojętnie!', '', 'komoda-z-polkami-laco', '', '', '', 'Komoda z półkami LACO', '', '', '', ''),
(573, 1, 1, 'Szeroka komoda MODICO świetnie uzupełni nowoczesną aranżację mieszkania. Komoda pomoże zorganizować domowe tekstylia i dokumenty w pokoju dziennym, poskładane ubrania w sypialni lub elementy zastawy stołowej i akcesoria w jadalni. Z kolekcją MODICO możesz urządzić salon w spójnym stylu. Meble MODICO sprawią, że Twoje wnętrze będzie jasne i pełne ciepła. WNĘTRZE Szuflada pomieści niewielkie akcesoria. Otwarta wnęka pod przeszkloną częścią blatu to świetne miejsce na Twoje ulubione przedmioty. Możesz dodatkowo je uwydatnić, dokupując oświetlenie. We wnękach za drzwiami łatwo ułożysz potrzebne przedmioty. Blat możesz wykorzystać na wyeksponowanie stylowych dekoracji. WYKOŃCZENIE Meble MODICO wykonano z płyty meblowej i wykończono laminatem. Nowoczesny design i połączenie bieli z kolorem drewna wprowadza do pomieszczenia przytulny klimat.', '', 'komoda-modico-3d1s-mc-07', '', '', '', 'Komoda MODICO 3D1S MC-07', '', '', '', ''),
(574, 1, 1, 'Szafka RTV ROMA najlepiej sprawdza się jako element umeblowania pokoju dziennego. Wyróżnia się nowoczesnym designem. W idealnych proporcjach łączy w sobie funkcjonalność oraz walory ozdobne. Jest ustawnym, stabilnym meblem, który dobrze wygląda w połączeniu z telewizorem lub sprzętem grającym. Dzięki oryginalnej kolorystyce szafka RTV ROMA idealnie pasuje do wnętrz jasnych, wzbogaconych drewnianymi elementami dekoracyjnymi. Jej proste, oszczędne wzornictwo pozwala na dużą dowolność pod katem indywidualnych rozwiązań aranżacyjnych. Na szczególną uwagę zasługuje fakt, ze szafka została wyposażona w specjalne zawiasy, które sprawiają, że drzwi domykają się cicho i delikatnie. WNĘTRZE RTV ROMA to dwudrzwiowa, pojemna szafka w sam raz na kolekcje filmów, dokumenty, gazety lub przydatne przedmioty osobiste. Posiada również klasyczne dla tego typu mebla rozwiązanie, czyli funkcjonalną wnękę pod blatem o wymiarach 102x40x10. WYKOŃCZENIE Elementy wykończeniowe szafki stanowi połączenie płyty meblowej MDF z laminatem w kolorze białym. Ponadto powierzchnia drzwi została specjalnie wyprofilowana tak, by móc szybko i sprawnie otwierać je i zamykać bez potrzeby korzystania z uchwytów. Jest to rozwiązanie, które również doskonale sprawdza się pod kątem dekoracyjnym.', '', 'szafka-rtv-roma-ro-13', '', '', '', 'Szafka RTV ROMA RO-13', '', '', '', ''),
(575, 1, 1, 'Jasne barwy oraz minimalistyczny styl to otoczenie, w którym czujesz się najlepiej? Zwróć uwagę na atuty komody z 4 szufladami z kolekcji MONTANA utrzymanej w kolorystyce, która rozjaśni każde wnętrze. Komoda z szufladami to praktyczne rozwiązanie do pokoju młodzieżowego , która pomoże Ci zachować porządek. WNĘTRZE Dzięki 4 pojemnym szufladom nie będziesz mieć odtąd problemu z perfekcyjnym dopasowaniem garderoby. Wszystko lepiej się układa, gdy jest na właściwym miejscu. WYKOŃCZENIE Korpus oraz fronty komody MONTANA wykonano z płyty meblowej o grubości 16 mm . Wykończenie nawiązujące do wyglądu bielonego drewna nada wnętrzu lekkości. Konstrukcję mebla pokryto laminatem w kolorze sosny andersen – podkreśl jej urok nietuzinkowymi dodatkami oraz elementami dekoracyjnymi. Design komody MONTANA możesz urozmaicić modernistycznymi elementami dekoracyjnymi – nadając wnętrzu nowoczesności .', '', 'komoda-z-4-szufladami-sosna-bielona-montana', '', '', '', 'Komoda z 4 szufladami sosna bielona MONTANA', '', '', '', ''),
(576, 1, 1, 'Komoda ROMA wyróżnia się nowoczesnym designem. W idealnych proporcjach łączy w sobie funkcjonalność oraz walory ozdobne. Najlepiej sprawdza się jako dodatek do umeblowania pokoju dziennego. Dzięki jasnej kolorystyce idealnie pasuje do wnętrz jasnych, wzbogaconych drewnianymi elementami dekoracyjnymi. Jej proste, oszczędne wzornictwo pozwala na dużą dowolność pod katem indywidualnych rozwiązań aranżacyjnych. Na szczególną uwagę zasługuje fakt, ze komoda ROMA została wyposażona w specjalne zawiasy, które sprawiają, że drzwi domykają się cicho i delikatnie. WNĘTRZE Komoda ROMA posiada trzy szuflady oraz trzy półki – idealne rozwiązanie pod kątem umieszczenia w nich ubrań, dokumentów lub przydatnych przedmiotów osobistych. WYKOŃCZENIE Komoda ROMA została wykonana z płyty meblowej MDF z laminatem w kolorze białym. Powierzchnia drzwi została specjalnie wyprofilowana tak, by móc szybko i sprawnie otwierać je i zamykać bez potrzeby korzystania z uchwytów. Jest to rozwiązanie, które również doskonale sprawdza się pod katem dekoracyjnym.', '', 'komoda-roma-ro-9', '', '', '', 'Komoda ROMA RO-9', '', '', '', ''),
(577, 1, 1, 'Jeśli marzysz o nowocześnie zaaranżowanym wnętrzu, praktycznych rozwiązaniach oraz urzekającym wyglądzie – ta kolekcja dedykowana jest właśnie dla ciebie. S zafka RTV IRMA świetnie sprawdzi się w pokoju dziennym. Jasna kolorystyka wpisze się w aktualne trendy, umożliwiając szeroki wybór dodatków i kolorów ścian. Standardowe uchwyty zastąpiono w prezentowanej kolekcji systemem bezuchwytowym, który podnosi atrakcyjność mebli i cieszy się zainteresowaniem wśród naszych klientów. Oświetlenie zawarte w cenie (taśma LED w zagłębieniu pod blatem) wprowadza do wnętrza wyjątkowy klimat. Mnogość brył systemu pozwala na umeblowanie salonu i jadalni według własnych potrzeb i preferencji. W drzwiach zamontowano zawiasy z systemem cichego domyku, dzięki czemu drzwi nie hałasują podczas zamykania. WYKOŃCZENIE Fronty mebla wykonano z płyty MDF opłaszczowanej folią PCV . Korpus wykonano z płyty meblowej pokrytej laminatem, który jest łatwy w utrzymaniu czystości, cechuje go również trwałość.', '', 'szafka-rtv-irma-im1-z-oswietleniem-prawa', '', '', '', 'Szafka RTV IRMA IM1 z oświetleniem prawa', '', '', '', ''),
(578, 1, 1, 'Szeroka nowoczesna i uniwersalna komoda złożona z szuflad i półek, którą dopasujesz do każdego wnętrza. Połączenie orzecha z kolorem wenge będzie pasować do większości pomieszczeń.', '', 'komoda-naomi-na-3', '', '', '', 'Komoda NAOMI NA 3', '', '', '', ''),
(579, 1, 1, 'Duża komoda z 3 szufladami REMO to szeroki na 120 cm mebel. W 3 szufladach, 2 zamykanych wnękach i w otwartej półce pomieścisz swój niejeden skarb. Komoda REMO świetnie sprawdzi się w pokoju nastolatków. Połączenie koloru białego dębu, z białym matem i modną szarością sprawia, że mebel doskonale odnajdzie się w nowoczesnych przestrzeniach. WNĘTRZE W 3 pojemnych szufladach schowasz bieliznę i t-shirty. Na półce ułożysz rzeczy, które chcesz mieć widoczne. Za drzwiami znajdziesz szafkę z 3 półkami - poukładaj w niej złożone spodnie i swetry. WYKOŃCZENIE Komodę REMO wykonano z płyty meblowej pokrytej laminatem. Mebel laminowano w kolorze białego dębu wilton, białego matu i szarym.', '', 'komoda-duza-z-szufladami-remo', '', '', '', 'Komoda duża z szufladami REMO', '', '', '', ''),
(580, 1, 1, 'Urządzasz wnętrze pokoju młodzieżowego i pragniesz, by panował tam ład oraz porządek? Sprawdź co ma do zaoferowania komoda z z półkami z kolekcji MONTANA. Wraz z innymi elementami kolekcji pozwoli Ci stworzyć garderobę dopasowaną do oczekiwań wymagającej nastolatki . WNĘTRZE Za 3 symetrycznymi frontami znajdziesz miejsce na ciepłe swetry , spodnie lub koszulki . W komodzie znajdziesz 3 półki, które dzielą wnętrze na 6 wnęk. WYKOŃCZENIE Korpus oraz fronty komody MONTANA wykonano z płyty meblowej o grubości 16 mm . Wykończenie nawiązujące do wyglądu bielonego drewna nada wnętrzu lekkości. Konstrukcję mebla pokryto laminatem w kolorze sosny andersen – podkreśl jej urok nietuzinkowymi dodatkami oraz elementami dekoracyjnymi. Design komody MONTANA możesz urozmaicić modernistycznymi elementami dekoracyjnymi – nadając wnętrzu nowoczesności .', '', 'komoda-z-polkami-sosna-bielona-montana', '', '', '', 'Komoda z półkami sosna bielona MONTANA', '', '', '', ''),
(581, 1, 1, 'Lubisz zasypiać wśród tuzina miękkich poduszek, jednak ich przechowywanie przyprawia Cię o ból głowy? Trzymaj je pod ręką w skrzyn i DENVER. Skrzynia na poduszki i koce sprawi, że w mig zmienisz stylizację swojej sypialni. Stwórz niepowtarzalny nastrój w sypialni , bez ograniczeń w doborze designerskich dodatków. WNĘTRZE Skrzynia DENVER posiada przegrodę , która dzieli jej przestrzeń na 2 symetryczne części. Jeśli nie lubisz marznąć w nocy, możesz mieć odtąd dodatkowy koc lub pled w zasięgu swojej dłoni. WYKOŃCZENIE Skrzynia o minimalistycznym , prostym kształcie oraz głębokości 38,3 cm doskonale wkomponuje się w przestrzeń przed łóżkiem. Ozdobne żłobienia z przodu skrzyni podkreślą jej ciekawy design . Mebel stanowić będzie doskonałe uzupełnienie sypialni w nowoczesnym stylu . Dzięki wykończeniu w jasnym odcieniu przybrzeżnego dębu skrzynię DENVER możesz umieścić także we wnętrzu industrialnym . Aby utrzymanie czystości zajęło tylko chwilę, korpus wykonano z płyty meblowej pokrytej laminatem .', '', 'skrzynia-na-poduszki-denver', '', '', '', 'Skrzynia na poduszki DENVER', '', '', '', ''),
(582, 1, 1, 'W Twojej nowoczesnej strefie rozrywki jest sporo akcesoriów? Schowaj je do 2 szuflad szafki RTV SENALES. Wyposażona w 4 półki ukryte za drzwiami i 2 szuflady - pozwoli Ci przechować urządzenia elektroniczne i inne akcesoria, które warto mieć zawsze pod ręką. WNĘTRZE 4 półki pomieszczą urządzenia elektroniczne. 2 szuflady sprawdzą się jako miejsce na piloty czy drobne akcesoria. Maksymalne obciążenie półek wynosi 10 kg . Kolekcja SENALES Zachwyca wyrazistym rysunkiem dębowego drewna. Swój urok zawdzięcza warstwie forniru i matowego lakieru na frontach i korpusie. Kremowe fronty lekko połyskują - płytę meblową pokryto emalią i zabezpieczono lakierem. Takie wykończenie sprawia, że meble wprowadzają przytulny klimat do nowoczesnego wnętrza.', '', 'szafka-rtv-z-2-szufladami-senales', '', '', '', 'Szafka RTV z 2 szufladami SENALES', '', '', '', ''),
(583, 1, 1, 'Komoda NECKER to mebel przeznaczony dla wnętrz pokoju dziennego, salonu oraz jadalni. Wzbogaca wnętrze o elementy nowoczesnej stylizacji opartej na prostych, oszczędnych liniach oraz harmonii kolorystycznej pomiędzy ciemną kolorystyką dębu lefkas i grandson , a czarnymi elementami, które dopełniają całości i dodają eleganckiego wykończenia. Jej zamykane wnętrze, wyposażone w półki pozwala na przechowywanie elementów zastawy, książek, ubrań lub różnych drobiazgów. Komoda NECKER doskonale prezentuje się również w klasycznych wnętrzach, dając dużo swobody pod kątem doboru pozostałych mebli, oświetlenia oraz dodatków dekoracyjnych. WNĘTRZE Komoda NECKER posiada wnętrze wyposażone w zamykane półki - nieodzowne pod kątem uporządkowania umieszczonych w niej rzeczy. Półki mebla mają możliwość obciążenia do 5 kg. WYKOŃCZENIE Korpus, blat i półki mebla został wykonane z płyty meblowej laminowanej, natomiast fronty, to płyta MDF wykończona folią PVC. Ciemną tonacje mebla dopełniają uchwyty z tworzywa w czarnym kolorze.', '', 'komoda-necker-2d', '', '', '', 'Komoda NECKER 2D', '', '', '', ''),
(584, 1, 1, 'Regał CUBE z drzwiami przesuwnymi pomoże wprowadzić porządek wśród teczek, książek czy segregatorów. Drzwi zostały wyposażone w zamek , dzięki czemu możesz schować w regale ważne dokumenty. Został zaprojektowany z myślą o domowych biurach, w których zależy nam na odpowiedniej organizacji. Możesz zestawić go z biurkiem i regałami w innych rozmiarach z kolekcji CUBE do biura i stworzyć spójną aranżację miejsca pracy. WNĘTRZE 3 wnęki otwarte i 3 zamknięte zapewniają sporo miejsca do przechowywania. Maksymalne obciążenie półki wynosi 5 kg. WYKONANIE Korpus jest wykonany z płyty meblowej i wykończony laminatem , dzięki czemu łatwo utrzymasz czystość mebla. Uchwyt wykonany jest z metalu. Meble CUBE to dobry wybór do współczesnych aranżacji, pasują zarówno do jasnych, jak i ciemnych kolorów ścian i dodatków.', '', 'regal-cube-1d', '', '', '', 'Regał CUBE 1D', '', '', '', ''),
(585, 1, 1, 'Jeśli szukasz eleganckiej komody do niewielkiego salonu lub jadalni to G-TE spełni Twoje oczekiwania. Dzięki uniwersalnym wymiarom (92x39,5x88,5 cm) szafkę możesz postawić w dowolnym miejscu przy ścianie. Poustawiaj na niej ulubione ozdoby, kwiaty lub ramki ze zdjęciami, a zyskasz uroczy kącik dekoracyjny. WNĘTRZE W środku znajdziesz 2 wnęki, które wykorzystasz do przechowywania obrusów, ręczników lub innych tekstyliów. Półka ma udźwig do 5 kg, możesz więc poustawiać na niej również cięższe rzeczy, takie jak segregatory z dokumentami czy komplet naczyń. 1 szuflada osadzona jest na prowadnicach kulkowych, które bez problemu zamontujesz samodzielnie. KOLEKCJA G-TE Kolekcja G-TE to wybór dla osób lubiących odważne aranżacje o silnym akcencie. Połączenie boków w kolorze dębu z głęboką czernią frontów o wysokim połysku pięknie ze sobą współgra i sprawia, że meble doskonale sprawdzą się w nowoczesnych wnętrzach. Laminowane blaty z płyty meblowej imitują linię słojów drewna, dzięki czemu meble możesz zestawić z drewnianymi dodatkami. Wstęgi szuflad mają wyraźną w dotyku, falowaną strukturę, która uszlachetnia meble. Proste czarne uchwyty i nogi o ciekawym kształcie sprawiają, że bryły nabierają lekkości i wyrazistości.', '', 'komoda-z-czarnymi-frontami-g-te', '', '', '', 'Komoda z czarnymi frontami G-TE', '', '', '', ''),
(586, 1, 1, 'Komoda ROMA wyróżnia się nowoczesnym designem. W idealnych proporcjach łączy w sobie funkcjonalność oraz walory ozdobne. Najlepiej sprawdza się jako dodatek do umeblowania pokoju dziennego. Dzięki kolorystyce idealnie pasuje do wnętrz jasnych, wzbogaconych drewnianymi elementami dekoracyjnymi. Jej proste, oszczędne wzornictwo pozwala na dużą dowolność pod katem indywidualnych rozwiązań aranżacyjnych. Na szczególną uwagę zasługuje fakt, ze komoda ROMA została wyposażona w specjalne zawiasy, które sprawiają, że drzwi domykają się cicho i delikatnie. WNĘTRZE Komoda ROMA posiada trzy półki, na których bez trudu można umieścić ubrania lub przydatne bibeloty. WYKOŃCZENIE Komoda ROMA została wykonana z płyty meblowej MDF z laminatem w kolorze białym. Powierzchnia drzwi została specjalnie wyprofilowana tak, by móc szybko i sprawnie otwierać je i zamykać bez potrzeby korzystania z uchwytów. Jest to rozwiązanie, które doskonale sprawdza się pod katem dekoracyjnym.', '', 'komoda-roma-ro-10', '', '', '', 'Komoda ROMA RO-10', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(587, 1, 1, 'Szukasz mebla do pokoju nastolatka , ale większość średnio przypadła mu do gustu? Komoda z 3 szufladami REMO nie jest średnia, będzie natomiast dokładnie w sam raz. Ma wszystko to, czego akurat potrzebujesz. Półkę, szafkę i szuflady. Postaw ją w towarzystwie pozostałych, funkcjonalnych mebli z serii REMO i wykorzystaj jej powierzchnię w 100%. WNĘTRZE REMO posiada półkę na serię Twoich ulubionych książek w twardych okładkach. 3 szuflady na bieliznę albo mniejsze przedmioty, pomieszczą to, czego codziennie potrzebujesz. Możesz w nich umieścić także ręczniki lub podkoszulki . Za drzwiczkami znajdziesz wyższą wnękę na przedmioty o niestandardowym rozmiarze. WYKOŃCZENIE Komoda średnia z 3 szufladami została zrobiona z płyty meblowej o grubości 16 mm . Mebel pokryto laminatem w kolorze białego dębu Wilson , białego matu i antracytu . W szufladach i drzwiach, jako uchwyty zastosowano pionowe listwy . Kształt oraz geometria bryły sprawia, że będzie się ona dobrze komponować w minimalistycznych , nowoczesnych wnętrzach .', '', 'komoda-z-3-szufladami-remo', '', '', '', 'Komoda z 3 szufladami REMO', '', '', '', ''),
(588, 1, 1, 'Szafka RTV SENALES dodaje wnętrzu nowoczesnego stylu. Swój naturalny urok zawdzięcza warstwie forniru i matowego lakieru na frontach i korpusie Wyposażona w 4 półki ukryte za drzwiami, otwartą wnękę i szufladę , pozwoli Ci przechować w niej urządzenia elektroniczne i inne akcesoria, które warto mieć zawsze pod ręką. WNĘTRZE 4 półki o głębokości 40 cm pomieszczą urządzenia elektroniczne. W otwartej wnęce zmieści się dekoder lub konsola. Szuflada sprawdzi się jako miejsce na piloty czy drobne akcesoria. Maksymalne obciążenie półek wynosi 10 kg . KREMOWE FRONTY I FORNIR Kolekcja SENALES zachwyca wyrazistym rysunkiem dębowego drewna. Swój naturalny urok zawdzięcza fornirowemu wykończeniu i matowego lakieru na frontach i korpusie. Kremowe fronty lekko połyskują - płytę meblową pokryto emalią i zabezpieczono lakierem. Takie wykończenie sprawia, że meble wprowadzają przytulny klimat do nowoczesnego wnętrza.', '', 'szafka-rtv-nowoczesna-senales', '', '', '', 'Szafka RTV nowoczesna SENALES', '', '', '', ''),
(589, 1, 1, 'Szafka RTV G-TE jest elegancka, pojemna i ustawna. Blat o szerokości 158 cm pozwoli Ci postawić na niej telewizor o przekątnej ekranu do 50 cali. Jeśli zdecydujesz się powiesić telewizor nad szafką, jej blat wykorzystasz do postawienia konsoli, dekoracji lub kolekcji kwiatów. WNĘTRZE 2 szuflady osadzone na łatwych w montażu prowadnicach kulkowych. Schowaj tam kolekcję filmów, gier lub teczki z dokumentami i patrz, jak szuflada płynnie pracuje. 2 otwarte wnęki posłużą Ci do postawienia dekodera lub konsoli. 2 szafki pozwolą Ci uporządkować gry planszowe, puzzle lub albumy ze zdjęciami KOLEKCJA G-TE Kolekcja G-TE to wybór dla osób lubiących odważne aranżacje o silnym akcencie. Połączenie boków w kolorze dębu z głęboką czernią frontów o wysokim połysku wygląda bardzo estetycznie w nowoczesnych wnętrzach. Laminowane blaty z płyty meblowej imitują linię słojów drewna, dzięki czemu meble możesz zestawić z drewnianymi dodatkami. Wstęgi szuflad mają wyraźną w dotyku, falowaną strukturę, która nadaje meblom szlachetny wygląd. Proste czarne uchwyty i nogi o ciekawym kształcie sprawiają, że bryły nabierają lekkości i wyrazistości.', '', 'szafka-rtv-z-szufladami-g-te', '', '', '', 'Szafka RTV z szufladami G-TE', '', '', '', ''),
(590, 1, 1, 'Jeśli szukasz eleganckiej, pojemnej komody do salonu lub jadalni to komoda G-TE jest właśnie dla Ciebie. Blat w kolorze jasnego drewna pomoże Ci wyeksponować dekoracje lub kwiaty. Powieś nad nim lustro, a optycznie powiększysz pomieszczenie i zyskasz więcej światła. WNĘTRZE W środku znajdziesz 5 wnęk, które wykorzystasz do przechowywania obrusów, ręczników lub innych tekstyliów. Półka ma udźwig do 5 kg, możesz więc poustawiać na niej również cięższe rzeczy, takie jak segregatory z dokumentami, czy komplet zastawy. 2 szuflady osadzone są na prowadnicach kulkowych, które bez problemu zamontujesz samodzielnie. KOLEKCJA G-TE Kolekcja G-TE to wybór dla osób lubiących odważne aranżacje o silnym akcencie. Połączenie boków w kolorze dębu z głęboką czernią frontów o wysokim połysku pięknie ze sobą współgra i sprawia, że meble doskonale sprawdzą się w nowoczesnych wnętrzach. Laminowane blaty z płyty meblowej imitują linię słojów drewna, dzięki czemu meble możesz zestawić z drewnianymi dodatkami. Wstęgi szuflad mają wyraźną w dotyku, falowaną strukturę, która uszlachetnia meble. Proste czarne uchwyty i nogi o ciekawym kształcie sprawiają, że bryły nabierają lekkości i wyrazistości.', '', 'komoda-z-2-szufladami-g-te', '', '', '', 'Komoda z 2 szufladami G-TE', '', '', '', ''),
(591, 1, 1, 'Szukasz praktycznego, a zarazem stylowego mebla do Twojego wnętrza? Komoda SENALES ułatwia uporządkowanie wszystkich rzeczy, po które lubisz sięgać, przebywając w salonie i w jadalni. Ponadto prezentuje się niezwykle nowocześnie za sprawą przeszklenia na froncie, które możesz wykorzystać do wyeksponowania eleganckiego szkła. WNĘTRZE 5 półek komody pomieści zarówno odzież, jak i tekstylia domowe. Przeszklona półka sprawdzi się do wyeksponowania kieliszków. 4 szuflady przydadzą się do przechowywania drobnych akcesoriów. Maksymalne obciążenie półek wynosi 10 kg. Wysoka na 90 cm i szeroka na 152 cm, idealnie odnajdzie się w Twojej jadalni lub salonie. KREMOWE FRONTY I FORNIR Kolekcja SENALES zachwyca wyrazistym rysunkiem dębowego drewna. Swój naturalny urok zawdzięcza fornirowemu wykończeniu i matowemu lakierowi na frontach i korpusie. Kremowe fronty lekko połyskują - płytę meblową pokryto emalią i zabezpieczono lakierem. Takie wykończenie sprawia, że meble wprowadzają przytulny klimat do nowoczesnego wnętrza.', '', 'komoda-przeszklona-na-froncie-senales', '', '', '', 'Komoda przeszklona na froncie SENALES', '', '', '', ''),
(592, 1, 1, 'Twoje dziecko lubi grać na konsoli i okupuje kanapę w salonie, gdzie Ty chcesz w spokoju wypić kawę? Postaw sprzęt u niego w pokoju. Szafka RTV REMO stanowi doskonałą bazę pod telewizor, dekoder lub konsolę. WNĘTRZE Na blacie o szerokości 120 cm postawisz telewizor do 43 cali. Otwarte półki pomieszczą rzeczy do 5 kg - postaw tu konsolę lub dekoder. Szafka to doskonałe miejsce na książki i płyty. W szufladzie schowasz piloty oraz inne drobne rzeczy. WYKOŃCZENIE Szafkę RTV REMO wykonano z płyty meblowej. Mebel pokryto laminatami w kolorach białego dębu wilton, białego matu i antracytu. Uchwyty szafki i szuflady stanowią frezowane fronty.', '', 'szafka-rtv-remo', '', '', '', 'Szafka RTV REMO', '', '', '', ''),
(593, 1, 1, 'Półka wisząca REMO świetnie sprawdzi się w niewielkim pomieszczeniu. Zajmuje mało miejsca, a pozwoli poukładać Ci dodatkowe przedmioty, na które zabrakło miejsca w regale. Półka pochodzi z kolekcji REMO, ale możesz ją wykorzystać także jako samodzielny mebel. WNĘTRZE W długiej, szerszej części poustawiasz książki, ulubione gry, filmy lub ozdoby 2 wąskie półki posłużą Ci do odłożenia zeszytów lub cieńszych lektur. WYKOŃCZENIE Półkę z serii REMO wykonano z płyty meblowej. Powierzchnię mebla pokryto laminatami w kolorach: białego dębu wilton i szarym.', '', 'polka-wiszaca-z-wnekami-remo', '', '', '', 'Półka wisząca z wnękami REMO', '', '', '', ''),
(594, 1, 1, 'Albumy ze zdjęciami, obrusy, zastawa i dekoracje – pojemna komoda fornirowana SENALES ułatwia uporządkowanie wszystkich rzeczy, po które lubisz sięgać, przebywając w salonie i w jadalni. WNĘTRZE 6 półek komody pomieści zarówno odzież, jak i tekstylia domowe. 4 szuflady sprawdzą się do przechowywania drobnych akcesoriów. Maksymalne obciążenie półek wynosi 10 kg . Wysoka na 90 cm i szeroka na 152 cm , idealnie odnajdzie się w Twojej jadalni lub salonie. KREMOWE FRONTY I FORNIR Kolekcja SENALES zachwyca wyrazistym rysunkiem dębowego drewna. Swój naturalny urok zawdzięcza fornirowemu wykończeniu i matowego lakieru na frontach i korpusie. Kremowe fronty lekko połyskują - płytę meblową pokryto emalią i zabezpieczono lakierem. Takie wykończenie sprawia, że meble wprowadzają przytulny klimat do nowoczesnego wnętrza.', '', 'komoda-nowoczesna-senales', '', '', '', 'Komoda nowoczesna SENALES', '', '', '', ''),
(595, 1, 1, 'Cenisz sobie ład i porządek? Zależy Ci, aby mebel pełnił nie tylko swoje funkcjonalne zadanie, ale również był modnym dodatkiem do Twojego wnętrza? Komoda SENALES wyposażona jest w 12 półek ukrytych za drzwiami i 2 szuflady. Pozwoli Ci przechować zarówno elementy zastawy, jak i tekstylia domowe. Częściowo przeszklone drzwi wyeksponują elegancką kolekcję kieliszków czy ulubione pamiątki. Szeroka na 202.5 cm i wysoka na 90 cm umożliwia ustawienie na blacie efektownych dekoracji. WNĘTRZE 12 półek pomieści obrusy i dekoracje. 2 szuflady sprawdzą się do przechowywania drobnych akcesoriów. Maksymalne obciążenie półek wynosi 10 kg . Aby otworzyć drzwi należy docisnąć front - dzięki systemowi push to open otwieranie jest proste. KREMOWE FRONTY I FORNIR Kolekcja SENALES zachwyca wyrazistym rysunkiem dębowego drewna. Swój naturalny urok zawdzięcza fornirowemu wykończeniu i matowego lakieru na frontach i korpusie. Kremowe fronty lekko połyskują - płytę meblową pokryto emalią i zabezpieczono lakierem. Takie wykończenie sprawia, że meble wprowadzają przytulny klimat do nowoczesnego wnętrza.', '', 'komoda-nowoczesna-z-12-wnekami-senales', '', '', '', 'Komoda nowoczesna z 12 wnękami SENALES', '', '', '', ''),
(596, 1, 1, 'Komoda CAMBRIDGE to propozycja dla miłośników dobrego stylu i nietuzinkowych aranżacji. Doskonale przemyślana konstrukcja idealnie wypełni wnętrze przestronnej jadalni lub pokoju dziennego. WNĘTRZE W otwartych wnękach możesz ułożyć stylowe dekoracje. Małe wnęki są idealnym miejscem na butelki z winem. Akcesoria do jadalni, tekstylia domowe czy poskładane ubrania możesz przechować w 4 zamykanych wnękach . Do dyspozycji masz też szufladę , która pomieści drobne przedmioty. Maksymalne obciążenie półki wynosi 10 kg. KOLEKCJA CAMBRIDGE – do salonu i jadalni Marzysz o harmonii i spokoju w swoim wnętrzu? Postaw na wyjątkowe meble w ciemnozielonym kolorze, które połączone z blatem imitującym naturalne drewno wprowadzą do niego przytulny, a zarazem elegancki klimat. Z czym połączyć tę barwę? Pełna głębi zieleń chętnie połączy się z jasnymi kolorami – bielami, szarościami czy beżami. WYKOŃCZENIE Kolekcja CAMBRIDGE jest wykonana z płyty meblowej i wykończona laminatem.', '', 'komoda-zielona-cambridge-2d1s', '', '', '', 'Komoda zielona CAMBRIDGE 2D1S', '', '', '', ''),
(597, 1, 1, 'ELA 1 pozwoli zorganizować przestrzeń do przechowywania obuwia nawet w małym przedpokoju. Projektanci skupili się na funkcjonalności, tworząc szafkę, która dodatkowo służy jako siedzisko. Dzięki zastosowaniu praktycznych ślizgaczy, łatwiej jest przesuwać mebel. Szafka ułatwia utrzymywanie porządku. WNĘTRZE Specjalny układ drzwi umożliwia korzystanie z mebla zarówno od frontu, jak i z góry. Dwie wnęki pozwalają zorganizować przestrzeń wewnątrz szafki według własnych potrzeb. Dzięki zastosowaniu siłownika gazowego w górnych drzwiczkach, użytkowanie mebla jest wygodne i bezpieczne. W szafce można przechowywać obuwie codzienne, kapcie dla gości lub akcesoria do czyszczenia. WYKOŃCZENIE Szafkę wykończono laminatem, który ułatwia utrzymanie jej w czystości. Jasne wybarwienie, imitujące dąb w kolorze „sonoma” wpływa na optyczne powiększenie przestrzeni. Tapicerowane, białe siedzisko dodaje meblowi elegancji.', '', 'szafka-na-buty-ela-1', '', '', '', 'Szafka na buty ELA 1', '', '', '', ''),
(598, 1, 1, 'ELA 2 to szersza wersja praktycznego mebla, przeznaczonego do przechowywania butów. Pozwoli optymalnie zorganizować przestrzeń w przedpokoju. Projektanci skupili się na funkcjonalności, tworząc szafkę, która dodatkowo służy jako siedzisko dla dwóch osób. Dzięki zastosowaniu praktycznych ślizgaczy, łatwiej jest przesuwać mebel. WNĘTRZE Specjalny układ drzwi umożliwia korzystanie z mebla zarówno od frontu, jak i z góry. Dwie wnęki pozwalają zorganizować przestrzeń wewnątrz szafki według własnych potrzeb. Dzięki zastosowaniu siłownika gazowego w górnych drzwiczkach, użytkowanie mebla jest wygodne i bezpieczne. W szafce można przechowywać obuwie codzienne, kapcie dla gości lub akcesoria do czyszczenia. WYKOŃCZENIE Szafkę wykończono laminatem, który ułatwia utrzymanie jej w czystości. Białe wybarwienie płyty wpływa na optyczne powiększenie przestrzeni. Tapicerowane siedzisko w ciemnym kolorze, dodaje meblowi elegancji.', '', 'szafka-na-buty-ela-2', '', '', '', 'Szafka na buty ELA 2', '', '', '', ''),
(599, 1, 1, 'Komoda JOY jest pełna elegancji, ma 160 cm szerokości i bogate wnętrze - z jej pomocą przechowasz ulubione przedmioty. Wraz z pozostałymi meblami z kolekcji pozwoli Ci urządzić minimalistyczny salon z efektem połysku. 4 WNĘKI, 3 SZUFLADY Za drzwiami komody znajdują się 4 półki, na których poukładasz wszystko, co chcesz mieć pod ręką w salonie. 3 szuflady dają Ci dodatkową przestrzeń do przechowywania. Dzięki prowadnicom rolkowym schowasz w nich nawet cięższe rzeczy. MAT I POŁYSK Meble z kolekcji JOY pokryto białym laminatem, który na półkach, blatach i korpusach ma powierzchnię matową. Fronty wykończono w wysokim połysku. Lustrzana powierzchnia odbija światło i powiększa optycznie wnętrze. WYSOKIE NÓŻKI Komoda osadzona jest na czarnych metalowych nóżkach w kształcie płóz - wyglądają bardzo nowocześnie. Mają 10 cm wysokości - bez problemu sięgniesz pod mebel z pomocą odkurzacza. Nóżki posiadają tworzywowy ślizgacz, który zabezpiecza podłogę przed zarysowaniami. ZADZIORNY MINIMALIZM Lubisz otaczać się bielą, ale od mebli oczekujesz czegoś bardziej efektownego? Spodoba Ci zadziorny minimalizm kolekcji JOY. Fronty mebli JOY są jak lustrzana tafla – dodają wnętrzu elegancji. Czarne detale sprawiają, że meble stanowią wyrazisty element we wnętrzu. Pionowe uchwyty i metalowe płozy dodają im wizualnej smukłości – zgrabnie prezentują się nawet w niewielkich wnętrzach.', '', 'komoda-biala-z-polyskiem-na-metalowych-nogach-joy', '', '', '', 'Komoda biała z połyskiem na metalowych nogach JOY', '', '', '', ''),
(600, 1, 1, 'Stylowe , eleganckie, wysublimowane wnętrze ? To salon, w którym zagościła 3-drzwiowa komoda CHARLOTTE. Jeśli zechcesz, możesz umieścić ją w jasnym, pełnym złotych elementów salonie – czyniąc go jeszcze bardziej glamour . Chcąc uzyskać klasyczną aranżację wyrazistego pokoju dziennego – zdecyduj się zestawić komodę z innymi meblami z kolekcji CHARLOTTE. WNĘTRZE Za 3 drzwiami stylowej komody znajdziesz 3 półki , które tworzą 6 pojemnych wnęk na ubrania. Dzięki udźwigowi półek wykonanych z płyty meblowej , który wynosi do 8 kg , możesz w nich umieścić także cięższe przedmioty. Ciemny kolor laminatu sprawi, że wnętrze komody nie tylko łatwo utrzymać w czystości, nadaje on także głębi wnętrzu mebla. ELEGANCKI MINIMALIZM Komodę CHARLOTTE wykonano z połączenia płyty meblowej laminowanej w stonowanym , czarnym kolorze oraz pokrytej ciemnym , dębowym fornirem płyty. Płyta laminowana posiada grubość 18 mm , fornirowana 17 mm . Do wykończenia komody wykorzystano dębowy fornir barwiony na ciemny, brązowy odcień . Charakterystyczny , żłobiony front z płyty MDF kształtem przypomina modne , pionowe lamele został umieszczony w centralnej części mebla. Z przodu pokryty fornirem , w żłobieniach wykończony czarnym , eleganckim , kontrastującym lakierem sprawi, że Twój salon nabierze wyjątkowej klasy . Pozostałe 2 fronty pokryto czarnym lakierem , tworzącym efekt odbijającej światło tafli . Komodę CHARLOTTE wyróżnia czarny blat pokryty 6 mm szybą . Chcąc nie zakłócać minimalizmu modernistycznej bryły mebla – w drzwiach zastosowano otwarcie typu push-open . Całość stylowej komody CHARLOTTE unoszą minimalistyczne nóżki z płyty o grubości 34 mm .', '', 'komoda-do-salonu-z-lamelami-charlotte', '', '', '', 'Komoda do salonu z lamelami CHARLOTTE', '', '', '', ''),
(601, 1, 1, 'Niekwestionowana elegancja kolekcji mebli do salonu SANTORI wiąże nowoczesną prostotę designu z wysoką jakością wykonania. Jasny, ciepły odcień dębu bielonego zdobiony unikatowymi słojami podkreśla ponadczasową klasę, jaką prezentuje naturalne drewno. Komoda SANTORI urzeka funkcjonalną prostotą – doskonale uzupełnia aranżację salonu zapewniając sporo miejsca na przechowanie domowych akcesoriów, koców, serwisów obiadowych lub tekstyliów stołowych. Na pięknym, szerokim blacie można wyeksponować dekoracje i bibeloty, pamiątki, fotografie w ramkach lub ozdobny wazon z kwiatami stawiając ostatni akcent na wystroju wnętrza. WNĘTRZE Witryna zawiera 7 zamykanych wnęk , które pozwolą rozsądnie rozłożyć potrzebne akcesoria domowe; Maksymalne obciążenie półki wynosi 10 kg ; Dwie pojemne szuflady przydają się do przechowywania drobiazgów. WYKOŃCZENIE Korpus mebla jest wykonany z płyty wiórowej o grubości 15 mm i wykończony olejowaną okleiną z naturalnego drewna dębowego ; Półki komody z płyty wiórowej są wykończone folią ; Fronty komody są wykonane z olejowanego naturalnego drewna dębowego o grubości 20 mm . Do olejowania drewna użyto naturalnego oleju ; Wykończenia są utrzymane w barwie dębu Bianco – jasnym, ciepłym odcieniu, który wnosi do pomieszczenia przytulny, domowy klimat;', '', 'komoda-santori-3d2s-typ-01', '', '', '', 'Komoda SANTORI 3D2S TYP 01', '', '', '', ''),
(602, 1, 1, 'Niekwestionowana elegancja kolekcji mebli do salonu SANTORI wiąże nowoczesną prostotę designu z wysoką jakością wykonania. Jasny, ciepły odcień dębu bielonego zdobiony unikatowymi słojami podkreśla ponadczasową klasę, jaką prezentuje naturalne drewno. Szafka RTV SANTORI urzeka funkcjonalną prostotą – doskonale uzupełnia aranżację salonu i jadalni zapewniając sporo miejsca na przechowanie akcesoriów i gadżetów elektronicznych. Przestronny blat szafki świetnie nadaje się do umiejscowienia telewizora, ale także bibelotów dekoracyjnych i ozdób w przypadku, gdy telewizor zostaje zawieszony na ścianie. WNĘTRZE Szafka zawiera 6 zamykanych wnęk , które pozwolą rozsądnie rozłożyć potrzebne akcesoria i gadżety – cztery szersze są umieszczone po obu bokach szafki, a dwie węższe w sprytnie umiejscowionym środkowym panelu mebla; Maksymalne obciążenie półki wynosi 10 kg ; Umieszczone pod blatem dwie otwarte wnęki świetnie nadają się do przechowania sprzętu elektronicznego – dekodera telewizyjnego i konsoli oraz różnych typów odtwarzaczy, do których konieczny jest łatwy i szybki dostęp. WYKOŃCZENIE Korpus mebla jest wykonany z płyty wiórowej o grubości 15 mm i wykończony olejowaną okleiną z naturalnego drewna dębowego ; Półki szafki z płyty wiórowej są wykończone folią ; Fronty szafki są wykonane z olejowanego naturalnego drewna dębowego o grubości 20 mm . Do olejowania drewna użyto naturalnego oleju ; Wykończenia są utrzymane w barwie dębu Bianco – jasnym, ciepłym odcieniu, który wnosi do pomieszczenia przytulny, domowy klimat;', '', 'szafka-rtv-santori-3d-typ-31', '', '', '', 'Szafka RTV SANTORI 3D TYP 31', '', '', '', ''),
(603, 1, 1, 'Szafka RTV STEP wchodzi w skład kolekcji przeznaczonej do pokoju młodzieżowego. Wykorzystaj ją w kąciku multimedialnym i zapewnij bezpieczne miejsce na telewizor, konsolę i inne akcesoria. Połączenie koloru jasnego drewna z bielą oraz szarością imitującą beton urozmaica pokój i nadaje lekkości aranżacji. Szafka RTV STEP sprawdzi się zarówno w pokoju dziewczynki, jak i chłopca. WNĘTRZE Szafka posiada jedną zamkniętą i jedną otwartą wnękę. W dolnej części szafki znajduje się szuflada. WYKOŃCZENIE Meble z kolekcji STEP są wykonane z płyty meblowej i wykończone laminatem . Kolorystyka pozwala na wykorzystanie ich w nowoczesnych wnętrzach. Pasują zarówno do jasnych, jak i ciemnych kolorów ścian. Dwa rodzaje uchwytów urozmaicają wnętrze ciekawym designem. MEBLE MŁODZIEŻOWE STEP Kolekcję mebli STEP z powodzeniem możesz wykorzystać w pokoju dziecięcym , a za kilka lat posłuży jako meble młodzieżowe. Meble STEP dają dużo miejsca do przechowywania , więc z łatwością uporządkujesz wszystkie ubrania, zabawki i książki. Nowoczesne połączenie kolorów na frontach mebli pozwala stworzyć w pokoju optymistyczny i przytulny nastrój.', '', 'szafka-rtv-step-1d1s', '', '', '', 'Szafka RTV STEP 1D1S', '', '', '', ''),
(604, 1, 1, 'ELA 2 to szersza wersja praktycznego mebla, przeznaczonego do przechowywania butów. Pozwoli optymalnie zorganizować przestrzeń w przedpokoju. Projektanci skupili się na funkcjonalności, tworząc szafkę, która dodatkowo służy jako siedzisko dla dwóch osób. Dzięki zastosowaniu praktycznych ślizgaczy, łatwiej jest przesuwać mebel. WNĘTRZE Specjalny układ drzwi umożliwia korzystanie z mebla zarówno od frontu, jak i z góry. Dwie wnęki pozwalają zorganizować przestrzeń wewnątrz szafki według własnych potrzeb. Dzięki zastosowaniu siłownika gazowego w górnych drzwiczkach, użytkowanie mebla jest wygodne i bezpieczne. W szafce można przechowywać obuwie codzienne, kapcie dla gości lub akcesoria do czyszczenia. WYKOŃCZENIE Szafkę wykończono laminatem, który ułatwia utrzymanie jej w czystości. Jasne wybarwienie, imitujące dąb w kolorze „sonoma” wpływa na optyczne powiększenie przestrzeni. Tapicerowane, białe siedzisko dodaje meblowi elegancji.', '', 'szafka-na-buty-ela-2', '', '', '', 'Szafka na buty ELA 2', '', '', '', ''),
(605, 1, 1, 'Mała komoda BILBAO pomoże uporządkować drobiazgi w przedpokoju. Geometryczne wykończenie frontów kolekcji BILBAO podkreśli nietuzinkowy design wnętrza. WNĘTRZE Za drzwiami znajduje się 1 duża wnęka. Maksymalne obciążenie półki wynosi 5 kg . 2 szuflady są wyposażone w prowadnice kulkowe . Na blacie możesz ułożyć stylowe dekoracje lub ramki z ulubionymi zdjęciami domowników, które wprowadzą rodzinny klimat do wnętrza. Komodę wyposażono w zawiasy z cichym domykiem , więc unikniesz hałasu przy zamykaniu frontu. WYKOŃCZENIE Grafitowe fronty są wykończone w macie,dlatego nadają przytulności wnętrzu. Połączenie dwóch kolorów: grafitu i dębu artisan sprawia, że meble pasują do nowoczesnego mieszkania. MEBLE Z GEOMETRYCZNYM WZOREM Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty nadają wnętrzu nietuzinkowy charakter. Duża ilość mebli z kolekcji BILBAO pozwoli zaaranżować przestrzeń zarówno w przedpokoju, jak i pokoju dziennego.', '', 'komoda-z-szarym-frontem-bilbao', '', '', '', 'Komoda z szarym frontem BILBAO', '', '', '', ''),
(606, 1, 1, 'Niekwestionowana elegancja kolekcji mebli do salonu SANTORI wiąże nowoczesną prostotę designu z wysoką jakością wykonania. Jasny, ciepły odcień dębu bielonego zdobiony unikatowymi słojami podkreśla ponadczasową klasę, jaką prezentuje naturalne drewno. Szafka RTV SANTORI doskonale uzupełnia aranżację salonu, zapewniając sporo miejsca na przechowanie akcesoriów i gadżetów elektronicznych. Przestronny blat szafki świetnie nadaje się do umiejscowienia telewizora, ale także bibelotów dekoracyjnych i ozdób w przypadku, gdy telewizor zostaje zawieszony na ścianie. WNĘTRZE Szafka zawiera 4 zamykane wnęki, które pozwolą rozsądnie rozłożyć potrzebne akcesoria i gadżety. Maksymalne obciążenie półki wynosi 10 kg; Umieszczone pod blatem dwie otwarte wnęki świetnie nadają się do przechowania sprzętu elektronicznego – dekodera telewizyjnego i konsoli oraz różnych typów odtwarzaczy, do których konieczny jest łatwy i szybki dostęp. WYKOŃCZENIE Korpus mebla jest wykonany z płyty wiórowej o grubości 15 mm i wykończony olejowaną okleiną z naturalnego drewna dębowego. Półki szafki są wykończone folią. Wykończenia są utrzymane w barwie dębu Bianco – jasnym, ciepłym odcieniu, który wnosi do pomieszczenia przytulny, domowy klimat.', '', 'szafka-rtv-santori-2d2s', '', '', '', 'Szafka RTV SANTORI 2D2S', '', '', '', ''),
(607, 1, 1, 'Potrzebujesz małej szafki na buty do swojego przedpokoju ? Szafka na buty BILBAO to mebel o prostych kształtach z minimalistyczną formą, która sprawia, że mebel pasuje do nowoczesnych wnętrz . Jasna kolorystyka szafki wprowadza do pomieszczenia przytulny klimat. Kolor: dąb craft jest popularny, co ułatwia zestawienie mebla z innymi. WNĘTRZE Masz do dyspozycji 1 wnękę , w której przechowasz obuwie lub akcesoria. Dzięki standardowym drzwiom łatwiej Ci będzie chować i wyciągać nawet duże przedmioty. WYKOŃCZENIE Mebel jest pokryty laminatem, który łatwo utrzymasz w czystości. MEBLE Z GEOMETRYCZNYM WZOREM Szukasz mebli, które wyróżniają się ciekawym designem i pasują do współczesnych wnętrz? Kolekcja mebli BILBAO łączy w sobie elementy stylu skandynawskiego i nowoczesnego, a geometrycznie zdobione fronty nadają wnętrzu nietuzinkowy charakter. Duża ilość mebli z kolekcji BILBAO pozwoli zaaranżować przestrzeń zarówno w przedpokoju, jak i pokoju dziennego.', '', 'szafka-na-buty-z-szarym-frontem-bilbao', '', '', '', 'Szafka na buty z szarym frontem BILBAO', '', '', '', ''),
(608, 1, 1, '<p>Komoda SANTOS z frontami z litego drewna spodoba się wielbicielom naturalnych materiałów. Możesz wyeksponować w niej reprezentacyjne przedmioty, a w zamkniętych wnękach ukryć dokumenty lub tekstylia domowe. WNĘTRZE Do dyspozycji masz 2 przeszklone wnęki, 3 szuflady oraz 4 wnęki za pełnymi drzwiami . Możesz dokupić wewnętrzne oświetlenie do witryny, dzięki któremu sprawisz, że środek mebla będzie emanować ciepłem i przytulnym klimatem. NATURALNA FORMA I KOLOR Nie można wyobrazić sobie przytulnego wnętrza bez drewna. Komodę SANTOS docenisz za naturalny design – fronty z litego drewna, które podkreślają unikatowy wygląd mebla. MEBLE DO SALONU Z kolekcją FLORA możesz urządzić salon i jadalnię w spójnym stylu. Świetnie wpiszą zarówno w nowoczesne, jak i bardziej surowe wnętrza.</p>', '', 'komoda-z-drewnianym-frontem-santos', '', '', '', 'Komoda z drewnianym frontem SANTOS', '', '', '', ''),
(609, 1, 1, 'Komoda mała z 3 szufladami z serii REMO to świetne rozwiązanie do młodzieżowych pomieszczeń o niewielkim metrażu. WNĘTRZE 3 półki: książki, które obiecałeś sobie przeczytać? To na nie idealne miejsce. 2 szuflady: na bieliznę, ubrania albo rzeczy, o których wiesz tylko Ty. WYKOŃCZENIE Komodę wykonano z płyty meblowej. Mebel został pokryty laminatem w kolorze białego dębu wilton, szarym i białego matu.', '', 'komoda-mala-z-szufladami-remo', '', '', '', 'Komoda mała z szufladami REMO', '', '', '', ''),
(610, 1, 1, 'Szafka RTV VIRGINIA 1K1S to prosty i bardzo funkcjonalny mebel, który umożliwia przechowanie sprzętów elektronicznych i dodatkowych akcesoriów w estetyczny sposób wkomponowując je we wnętrze salonu. Kolekcja VIRGINIA wyróżnia się nowoczesnym designem, który wprowadza do pomieszczenia chłodny kolorystycznie klimat. Symetria konstrukcji udanie łączy się z uniwersalnością barwy i subtelnym wykończeniem. Meble z serii VIRGINIA umożliwiają funkcjonalne urządzenie domu z optymalnym wykorzystaniem przestrzeni wprowadzającym do aranżacji poczucie ładu i harmonii. WNĘTRZE Szafka zawiera dwie wnęki zamykane klapowo po obu stronach – idealne do przechowywania podręcznych gadżetów i akcesoriów. Szuflada na prowadnicach kulkowych przyda się jako dodatkowa przestrzeń służąca do uporządkowania drobnych dodatków. Wnęka pośrodku szafki świetnie nadaje się do przechowania dekodera lub konsoli. Wymiary wnęki: szerokość 43 cm, głębokość 50,5 cm, wysokość 17,5 cm . WYKOŃCZENIE Szafka jest wykonana z płyty meblowej o grubości 1,6 cm . Laminat pozytywnie wpływa na trwałość mebli, a dodatkowo ułatwia ich odkurzanie i mycie. Wizerunek białego drewna sosnowego dodaje aranżacji oryginalnego charakteru i jednocześnie rozjaśnia pomieszczenia. W połączeniu z metalowymi uchwytami stanowi bardzo uniwersalną propozycję do nowoczesnego salonu. Meble z serii VIRGINIA możesz zestawiać z szarościami, złamanymi odcieniami bieli, z beżem, brązem, granatem. Dobrze prezentują się także w pomieszczeniach o ciemnej kolorystyce.', '', 'szafka-rtv-virginia-2k1s', '', '', '', 'Szafka RTV VIRGINIA 2K1S', '', '', '', ''),
(611, 1, 1, 'Twoje sprzęty RTV potrzebują wyjątkowej oprawy? Szafka pod telewizor CRAMENA spełni nie tylko swoje funkcjonalne zadanie, ale również będzie stanowiła element dekoracji. Szeroka na 95 cm , nie zajmuje wiele miejsca w Twoim domowym centrum rozrywki. Wyposażona we wnękę i 2 szuflady o głębokości 44 cm , oferuje dodatkowe miejsce na dekoder oraz mniejsze akcesoria i gadżety, które chcesz mieć zawsze pod ręką. Szafka RTV CRAMENA , to doskonała propozycja dla koneserów antyków - stanowi element kolekcji, która wprowadzi do Twojego wnętrza odrobinę dworkowego stylu. WNĘTRZE 2 szuflady przydadzą się na drobiazki Wnęka otwarta jest z obu stron, dzięki czemu z łatwością przeciągniesz okablowanie. OZDOBA WNĘTRZA Wyposażona w ozdobny panel na dole mebla. Szafka została wzbogacona efektem ryflowania . Wprowadza przytulny klimat do Twoich wnętrz. WYKOŃCZENIE Wykonana z sosn y, pokryta szarym woskiem antykowanym, który nadaje jej postarzany wygląd. Metalowe uchwyty podkreślają jej surowy charakter. Szary odcień sprawia, że mebel staje się uniwersalny i ponadczasowy.', '', 'szafka-rtv-prowansalska-szara-cramena', '', '', '', 'Szafka RTV prowansalska szara CRAMENA', '', '', '', ''),
(612, 1, 1, 'Szukasz oryginalnej komody na dekoracje, obrusy lub gry? Komodę CRAMENĘ możesz postawić przy ścianie o długości 132 cm, a na jej blacie wyeksponować ważne dla Ciebie dekoracje. Mebel może pochwalić się nie tylko funkcjonalnością, ale również wyjątkowym wykonaniem w stylu prowansalskim . Kolekcja CRAMENA - to doskonała propozycja dla miłośników postarzanych mebli. WNĘTRZE ? W 6 zamykanych wnękach uporządkujesz swoje rzeczy 2 szuflady przydadzą się na dokumenty lub drobne akcesoria OZDOBA WNĘTRZA Wyposażona w ozdobny panel na dole mebla. Szafka została wzbogacona efektem ryflowania . Metalowe dodatki wzmacniają prowansalski styl. Wprowadza przytulny klimat do Twoich wnętrz. WYKOŃCZENIE Wykonana z sosny , pokryta szarym woskiem antykowanym, który nadał jej postarzany wygląd. Szary odcień sprawia, że mebel staje się uniwersalny i ponadczasowy.', '', 'komoda-3-drzwiowa-szara-cramena', '', '', '', 'Komoda 3-drzwiowa szara CRAMENA', '', '', '', ''),
(613, 1, 1, 'Obrusy, dekoracje, zastawa stołowa - komoda CRAMENA ułatwia uporządkowanie wszystkich rzeczy, po które często sięgasz, przebywając w salonie lub jadalni. Mebel może pochwalić się nie tylko funkcjonalnością, ale również wyjątkowym wykonaniem w stylu prowansalskim . Wyposażona w 2 półki ukryte za podwójnymi drzwiami oraz 2 wysuwane szuflady. Wysoka na 81 cm i szeroka na 91 cm , pozwala wyeksponować na niej ważne dla Ciebie pamiątki. To element kolekcji, która wprowadzi do wnętrza odrobinę dworkowego stylu. Przenieś się myślami do początku XX wieku ! Kolekcja CRAMENA - to doskonała propozycja dla koneserów antyków . WNĘTRZE 4 wnęki za zamkniętymi drzwiami pozwolą Ci uporządkować rzeczy. 2 szuflady przydadzą się na drobne przedmioty OZDOBNY WYGLĄD Wyposażona w ozdobny panel na dole mebla. Szafka została wzbogacona efektem ryflowania . Metalowe dodatki wzmacniają prowansalski styl. Wprowadza przytulny klimat do Twoich wnętrz. WYKOŃCZENIE Wykonana z sosny , pokryta szarym woskiem antykowanym, nadaje jej postarzany wygląd. Szary odcień sprawia, że mebel staje się uniwersalny i ponadczasowy.', '', 'komoda-prowansalska-szara-cramena', '', '', '', 'Komoda prowansalska szara CRAMENA', '', '', '', ''),
(614, 1, 1, '<p>Niewielka komoda ANTHONY to mebel praktyczny, który zadba o porządek w domowym zaciszu. Przeznaczona raczej do kameralnych wnętrz, bo dzięki zastosowaniu drzwi przesuwnych, idealnie wpisuje się w przestrzeń niewielkiego salonu, przedpokoju oraz jadalni. Jej kolorystyka łącząca biel sosny andersen i naturalny odcień dębu wotan rozjaśni wnętrze, a design stylizowany na meble w stylu prowansalskim podkreśli oryginalność wystroju wnętrza. WNĘTRZE Zamykane wnęki stanowią doskonałe miejsce do przechowywania rzeczy, których nie chcesz eksponować. Dostaniesz się do nich za pomocą drzwi przesuwnych. 2 szuflady pomogą zorganizować drobne przedmioty. Blat wykorzystaj jako miejsce na stylowe dodatki, które podkreślą charakter Twojego wnętrza. WYKOŃCZENIE Komoda jest wykonana z płyty meblowej i wykończona laminatem w kolorze sosny andersen i dąb wotan. Takie wykończenie wprowadza do wnętrza przytulny klimat. Uroku dodają ładnie wkomponowane w bryłę uchwyty. Meble do pokoju dziennego i jadalni Kolekcja mebli ANTHONY świetnie wypełni wnętrze mieszkania urządzonego w stylu prowansalskim. Jasna kolorystyka nadaje dużym bryłom lekkości, a intrygujący rysunek drewna wprowadza do aranżacji odrobinę surowego charakteru. Możesz zestawić je z dodatkami z wizerunkiem polnych kwiatów i elementami z jasnego drewna.</p>', '', 'komoda-prowansalska-z-drzwiami-przesuwnymi-anthony', '', '', '', 'Komoda prowansalska z drzwiami przesuwnymi ANTHONY', '', '', '', '');
